INSERT INTO `parf_goods` (`id`, `default_category_id`, `category_ids`, `parent_category`, `brand_id`, `name_1`, `name_2`, `name_in_cyrillic`, `vendor_code`, `vendor_code_id`, `description`, `price`, `existence`, `new`, `sex`, `flavors_group`, `top_note`, `heart_note`, `base_note`, `perfumer`, `collection`, `series`, `country`, `release`, `rating`, `number_of_votes`, `meta_title`, `meta_description`, `meta_keywords`, `rewrite`, `related`, `recommended`, `active`, `count_show`, `id_import`) VALUES
(1, 2, '2|1', 1, 0, '90/90-21 54R C-11 SPEEDY-CROC TT', NULL, '', '881167', 0, '<br>Mitas C11 – надежная мотоциклетная резина для любителей мотокросса. Изготовлена она европейским выдающимся брендом по трехмерной технологии. Благодаря этому все параметры идеально сбалансированы. Такая модель предназначается для установки на переднюю ось мототранспорта. Она сочетается с моделью C-10 для задней оси.<br/>\n<br>Для центральной части шины подобрана особая резиновая смесь. Она адаптирована для суровых мотокроссовых условий. Компаунд отличается эластичностью благодаря уникальным полимерам в составе. Шины демонстрирует феноменальную маневренность при пониженных температурах.<br/>\n<br>Speedy-Croc - рисунок протектора, обеспечивающий оптимальную производительность во всех режимах вождения.<br/>\n<br>Вес шины: 3,3 кг<br/>\n<br>Индекс нагрузки: 54<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '90-90-21-54r-c-11-speedy-croc-tt', NULL, NULL, 1, 0, 'c523bae9-325b-11e8-8192-ed790c9fa917'),
(2, 0, '', 0, 0, '110/70-12 47P TL MC16', NULL, '', '945202', 0, '<br>Шины Mitas MC16 - шины оригинального дизайна для скутеров.<br/>\n<br>Mitas MC16 обеспечивают прекрасные эксплуатационные и потребительские характеристики. Они отлично показывают себя практически на всех видах дорожного покрытия, даже на проселочных дорогах и по бездорожью. Курсовая устойчивость и высокая безопасность гарантируется рисунком протектора и резиновой смесью.<br/>\n<br>Вес шины: 2,6 кг<br/>\n<br>Индекс нагрузки: 47<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-70-12-47p-tl-mc16', NULL, NULL, 1, 0, '0ce5e1f8-325c-11e8-8192-ed790c9fa917'),
(3, 0, '', 0, 0, '4.00-8C 66L S-04 TT', NULL, '', '880968', 0, '<br>Вес шины: 2,3 кг<br/>\n<br>Индекс нагрузки: 66<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '4-00-8c-66l-s-04-tt', NULL, NULL, 1, 0, 'b1201be4-325b-11e8-8192-ed790c9fa917'),
(4, 4, '4|1', 1, 0, '120/80-18 62S TT MC24', NULL, '', '926990', 0, '<br>Mitas MC24  - диагональные покрышки двойного назначения с более выраженным рисунком протектора, чем у моделей MC30, E-08<br/>\n<br>INVADER MC24 - мотошины для мотоциклов двойного назначения и туристических эндуро, ориентированные на езду по асфальту и дорогам с твердым покрытием. Обеспечивают отличную управляемость на мокрой дороге и легком бездорожье в любую погоду.<br/>\n<br>Вес шины: 5,1 кг<br/>\n<br>Индекс нагрузки: 62<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-80-18-62s-tt-mc24', NULL, NULL, 1, 0, 'f8fee3d4-325b-11e8-8192-ed790c9fa917'),
(5, 4, '4|1', 1, 0, '110/80R19 TERRAFORCE-R 59V TL', NULL, '', '939386', 0, '<br>Радиальная шина двойного назначения с протектором, ориентированным в основном для города, предоставляет отличное сцепление как на сухом, так и мокром асфальте, а также на сухом грунте и гравии. Мотошина Terra Force-R представляет собой удачно улучшенную модель MC30 c фокусом на долговечность и стабильные показатели на протяжении всего срока службы. Оптимальное размещение блоков рисунка протектора, способствует отличному сцеплению с дорогой и прямолинейности езды.<br/>\n<br>Конструкция: Радиальная<br/>\n<br>Индекс нагрузки: 59<br/>\n<br>Вес шины: 5,1 кг<br/>\n<br>Страна производства: Словения<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-80r19-terraforce-r-59v-tl', NULL, NULL, 1, 0, 'ff45d4a5-325b-11e8-8192-ed790c9fa917'),
(6, 0, '', 0, 0, '19X7.00-8 B77 4PR TL', NULL, '', '915703', 0, '<br>Шины для квадроцикла Sava B77 - еще одна модель шин ATV, предназначенная для \"утилитарно-лесного\" использования.<br/>\n<br>Рисунок покрышек Sava B77 - направленная \"елочка\". Но дополнительные внутренние грани здесь используются неповсеместно.<br/>\n<br>Колеса Sava B77 имеют боковые грунтозацепы, уходящие на боковину покрышки. Это означат, что шина Sava B77 сконструирована также для работы на низких давлениях, когда боковина шин прогибается и вступает в контакт с опорной поверхностью дороги.<br/>\n<br>Шины ATV Sava B77 вполне органично могут быть применены на квадроциклах, используемых для поездок по полям и лесам.<br/>\n<br>Вес шины: 6,1 кг<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '19x7-00-8-b77-4pr-tl', NULL, NULL, 1, 0, 'ec3eec7c-325b-11e8-8192-ed790c9fa917'),
(7, 0, '', 0, 0, '100/80-16 50P TL MC32 WIN SCOOT', NULL, '', '925680', 0, '<br>Шины Mitas MC32 WIN SCOOT - идеальный выбор для тех, кто использует свой мотоцикл или скутер зимой и в межсезонье.<br/>\n<br>Эти шины обладают высокими эксплутационными характеристиками при низких температурах, на снегу, льду и мокрой дороге.<br/>\n<br>Вес шины: <br/>\n<br>Индекс нагрузки: 50<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '100-80-16-50p-tl-mc32-win-scoot', NULL, NULL, 1, 0, 'f27ec1b2-325b-11e8-8192-ed790c9fa917'),
(8, 0, '', 0, 0, '120/70-12 58P TL MC29 R.SPORTY 3+', NULL, '', '925766', 0, '<br>Шины Mitas - MC29 - cпортивные покрышки для скутеров.<br/>\n<br>Mitas MC29 обладают Крепким каркасом и боковинами для лучшей угловой стабильности, крупными плечевыми блоками для обеспечения сцепления и стабильности на экстремальных углах наклона, диагональными канавками для лучшего отвода воды.<br/> \n<br>Особенности протектора шин Sava MC29 способствуют низкой шумности при движении.<br/>\n<br>Вес шины: 3,2 кг<br/>\n<br>Индекс нагрузки: 58<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-70-12-58p-tl-mc29-r-sporty-3-', NULL, NULL, 1, 0, 'f27ec241-325b-11e8-8192-ed790c9fa917'),
(9, 2, '2|1', 1, 0, '100/100-18M/C 59M C-16 WIN FRIC TT', NULL, '', '881113', 0, '<br>Mitas C16 – модернизированная мотоциклетная покрышка от небезызвестного шинного гиганта из Европы. Она предназначается для маневренной езды по твердому дорожному полотну. Также вашему байку покорятся каменистые спуски и подъемы. Протектор имеет особенный узор. Он представляет собой совокупность массивных блоков, размещенных с определенными интервалами. Они были скрупулезно просчитаны в уникальной компьютерной программе для виртуального моделирования.<br/>\n<br>Резиновая смесь имеет особую прочность. Она дополнена новейшими полимерами, стойкими к абразивному и механическому стороннему воздействию.<br/>\n<br>Winter Friction - специальный вариант для использования в зимних условиях, подходит также для шипов.<br/>\n<br>Вес шины: 4,9 кг<br/>\n<br>Индекс нагрузки: 59<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '100-100-18m-c-59m-c-16-win-fric-tt', NULL, NULL, 1, 0, 'befe4d82-325b-11e8-8192-ed790c9fa917'),
(10, 0, '', 0, 0, '100/90-//110/90-17...TR6 HD BOX', NULL, '', '915219', 0, '<br>Камеры изготовлены из бутилкаучука и имеют следующие маркировки:<br/> \n<br><br/>\n<br>Mitas и SAVA<br/>\n<br><br/>\n<br>UHD - камера толщиной 4 мм для очень больших нагрузок<br/>\n<br>HD - камера толщиной 1,9-2,0 мм для больших нагрузок<br/>\n<br>Normal - камера толщиной 1,2-1,4 мм для не больших нагрузок, как правило устонавливаются на скутеры или малокубатурные мотоциклы<br/>\n<br>BOX - камера упакована в отдельную коробку<br/>\n<br>JS87, TR87, 90/90 - камера имеет изогнутый вентель<br/>\n<br>34G, TR6 - камера имеет прямой вентель<br/>\n<br><br/>\n<br>КАБАТ<br/>\n<br><br/>\n<br>HD - усиленные камеры для больших нагрузок<br/>\n<br>GP4(TR-4)(V1.09.1) - камера имеет прямой вентель<br/>\n<br>Все камеры марки КАБАТ не имеют упаковки<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '100-90---110-90-17---tr6-hd-box', NULL, NULL, 1, 0, 'd941f991-325b-11e8-8192-ed790c9fa917'),
(11, 2, '2|1', 1, 0, '110/90-19 62M XT-454 TT', NULL, '', '881183', 0, '<br>Mitas XT454 – европейская резина бескомпромиссного качества. Она демонстрирует великолепное сцепление с дорожным полотном любого качества. Это обеспечивается массивной короной протектора. Совокупность элементов центральной части покрышки разрабатывалась в компьютерной программе трехмерного компьютерного моделирования. Благодаря этому интервалы просчитаны до миллиметра. Боковые фигуры изготовлены из прочной резиновой смеси. Однако при этом они сохраняют отличную эластичность.<br/>\n<br>Super Soft - шина с более мягким каркасом и очень мягкой смесью для применения в экстремально тяжелых соревнованиях.<br/>\n<br>Вес шины: 5,7 кг<br/>\n<br>Индекс нагрузки: 62<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-90-19-62m-xt-454-tt', NULL, NULL, 1, 0, 'cbbe1db5-325b-11e8-8192-ed790c9fa917'),
(12, 3, '3|1', 1, 0, '2.75-18M/C 48P REINF H-03 TT', NULL, '', '881005', 0, '<br>Mitas H03 – высокотехнологичная европейская покрышка с бескомпромиссным качеством. Она станет лучшим вариантом для установки на обе оси мотоциклетного транспортного средства. Таким образом, вам будет обеспечена исключительная «цепкость» в любом скоростном режиме. Изумительный компаунд медленно изнашивается. Он почти не подвержен негативному механическому воздействию. С этими шинами вы стабильно проедете солидное количество километров! Мотошина отличается эталонной проходимостью.<br/>\n<br>Reinforced - увеличенный индекс грузоподъемности(нагрузки) шины по E.T.R.T.O.<br/>\n<br>Вес шины: 2,6 кг<br/>\n<br>Индекс нагрузки: 48<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '2-75-18m-c-48p-reinf-h-03-tt', NULL, NULL, 1, 0, 'b1201c3a-325b-11e8-8192-ed790c9fa917'),
(13, 3, '3|1', 1, 0, '95/70-17 F001 RACING SUPER SOFT TL', NULL, '', '915567', 0, '<br>Sava F001 - шины для мопедов и мотоциклов с высокой производительностью. Обновленная резиновая смесь улучшила ходовые параметры шины.<br/> \n<br>Super Soft - шина с мягким каркасом и очень мягкой смесью для применения в экстремально тяжелых соревнованиях.<br/>\n<br>Вес шины: 3,2 кг<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '95-70-17-f001-racing-super-soft-tl', NULL, NULL, 1, 0, 'df3e9b3f-325b-11e8-8192-ed790c9fa917'),
(14, 3, '3|1', 1, 0, '110/70-17 54H TL MC50', NULL, '', '940643', 0, '<br>\"Mitas MC50 - это высокоскоростные шины диагональной конструкции. Шины Mitas MC50 используются в профессиональных мотогонках, отличаются хорошим сцеплением с дорогой и длительным сроком службы. Данная моторезина рекомендуется для спорта, супермото, мотоциклов с низким и средним объемом двигателя. Конструкция шин Mitas MC50 позволяет использовать их не только на гоночных трассах, но и в повседневной жизни. Mitas MC50 - многофункциональная шина с отличной производительностью на сухом дорожном покрытии и в то же время с отличной управляемостью на мокром. Жесткость боковой стенки обеспечивает стабильность шины на гоночных трассах.<br/>\n<br>Конструкция: Диагональная<br/>\n<br>Индекс нагрузки: 57<br/>\n<br>Вес шины: 3,7 кг<br/>\n<br>Страна производства: Словения<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-70-17-54h-tl-mc50', NULL, NULL, 1, 0, '05e03bde-325c-11e8-8192-ed790c9fa917'),
(15, 4, '4|1', 1, 0, '90/90B21 M/C 54T E-10 DAKAR TL', NULL, '', '915624', 0, '<br>Mitas E10 - предназначены для всех типов дорог и умеренного бездорожья.<br/>\n<br>При разработке резиновой смеси использовалось огромное число новых компонентов, которые увеличили эксплуатационные качества шины Mitas E-10. Повысить износостойкие параметры помог кремний, за счет этого срок службы шину увеличился. Новая силика обеспечила резине повышенную эластичность, что положительно сказалось на сцеплении с влажным дорожным покрытием. Новая резиновая смесь позволила уменьшить сопротивление качению, что повысило устойчивость при движении на высоких скоростях.<br/>\n<br>Dakar - протектор с усиленным каркасом дляэкстремального вождения или гонок.<br/>\n<br>Вес шины: 4,7 кг<br/>\n<br>Индекс нагрузки: 54<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '90-90b21-m-c-54t-e-10-dakar-tl', NULL, NULL, 1, 0, 'e5518e8f-325b-11e8-8192-ed790c9fa917'),
(16, 0, '', 0, 0, '120/70-12 58P MC38 REINF. MAX TL', NULL, '', '950537', 0, '<br>Шины Mitas MC38 - Всесезонные покрышки для максискутера, подходящие как для сухой, так и влажной поверхности.<br/>\n<br>Современный рисунок протектора Mitas MC38 обеспечивает стабильность и комфорт на высоких скоростях и прекрасно отводит воду. Новый состав резины обеспечивает превосходное сцепление и длительный срок службы.<br/>\n<br>Вес шины: 3,2 кг<br/>\n<br>Индекс нагрузки: 58<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-70-12-58p-mc38-reinf--max-tl', NULL, NULL, 1, 0, '137b805c-325c-11e8-8192-ed790c9fa917'),
(17, 0, '', 0, 0, '60/100-14 TR4 BOX', NULL, '', '915216', 0, '<br>Камеры изготовлены из бутилкаучука и имеют следующие маркировки:<br/> \n<br><br/>\n<br>Mitas и SAVA<br/>\n<br><br/>\n<br>UHD - камера толщиной 4 мм для очень больших нагрузок<br/>\n<br>HD - камера толщиной 1,9-2,0 мм для больших нагрузок<br/>\n<br>Normal - камера толщиной 1,2-1,4 мм для не больших нагрузок, как правило устонавливаются на скутеры или малокубатурные мотоциклы<br/>\n<br>BOX - камера упакована в отдельную коробку<br/>\n<br>JS87, TR87, 90/90 - камера имеет изогнутый вентель<br/>\n<br>34G, TR6 - камера имеет прямой вентель<br/>\n<br><br/>\n<br>КАБАТ<br/>\n<br><br/>\n<br>HD - усиленные камеры для больших нагрузок<br/>\n<br>GP4(TR-4)(V1.09.1) - камера имеет прямой вентель<br/>\n<br>Все камеры марки КАБАТ не имеют упаковки<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '60-100-14-tr4-box', NULL, NULL, 1, 0, 'd941f989-325b-11e8-8192-ed790c9fa917'),
(18, 2, '2|1', 1, 0, '60/100-14 30M C-19 TT', NULL, '', '881103', 0, '<br>Mitas C-19 разработана для преимущественного использования по гравию, камням, горной местности.<br/>\n<br>Кроссовые шины Mitas C-19 одобрены для эксплуатации в соответствии с DOT EN, 80% по бездорожью, 20% на дорогах.<br/>\n<br>Вес шины: 1,5 кг<br/>\n<br>Индекс нагрузки: 30<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '60-100-14-30m-c-19-tt', NULL, NULL, 1, 0, 'befe4d1a-325b-11e8-8192-ed790c9fa917'),
(19, 2, '2|1', 1, 0, '120/90-18 65R C-20 TT', NULL, '', '881130', 0, '<br>Mitas C20 представляет собой уникальную разработку именитого шинного концерна. Покрышка отличается универсальностью. Протектор обладает улучшенным узором, который без проблем справляется даже с нестабильными дорожными полотнами.<br/> \n<br>Благодаря суперкрепкому компаунду в разы повышается срок эксплуатации такого изделия. Шина обладает высоким европейским качеством. Она надежно защищена от механических повреждений и абразивного воздействия магистралей.<br/> \n<br>Вес шины: 5,9 кг<br/>\n<br>Индекс нагрузки: 65 <br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-90-18-65r-c-20-tt', NULL, NULL, 1, 0, 'befe4e5e-325b-11e8-8192-ed790c9fa917'),
(20, 4, '4|1', 1, 0, '140/80-18 M/C 70R E-09 DAKAR TL', NULL, '', '938422', 0, '<br>Mitas E09 - подходит для пустынных и раллийных соревнований.<br/>\n<br>Протектор наделен эксклюзивным сочетанием элементов для совершенного сцепления на любой скорости. Благодаря прочной конструкции шины очень надежны, устойчивы к проколам.<br/>\n<br>Dakar - протектор с усиленным каркасом дляэкстремального вождения или гонок.<br/>\n<br>Вес шины: 8,7 кг<br/>\n<br>Индекс нагрузки: 70<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '140-80-18-m-c-70r-e-09-dakar-tl', NULL, NULL, 1, 0, 'ff45d430-325b-11e8-8192-ed790c9fa917'),
(21, 2, '2|1', 1, 0, '140/80-18M/C 70R EF-07 SUPER TT', NULL, '', '881087', 0, '<br>Mitas EF-07 разработана для преимущественного использования по гравию, камням, горной местности.<br/>\n<br>Обновленная резиновая смесь улучшила ходовые параметры шины. Большое содержание кремния повысило износостойкие качества протектора, в результате увеличился срок использования. Новая силика обеспечила повышенную эластичность, за счет этого улучшилось сцепление Mitas EF-07 на влажном дорожном покрытии. Сочетание обновленной резиновой смеси и оптимального подобранных протекторных блоков позволило увеличить пятно контакта с дорожной поверхностью.<br/>\n<br>Super-протектор из особой смеси для гонок Enduro.<br/>\n<br>Вес шины: 5,5 кг<br/>\n<br>Индекс нагрузки: 70<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '140-80-18m-c-70r-ef-07-super-tt', NULL, NULL, 1, 0, 'b831b6ac-325b-11e8-8192-ed790c9fa917'),
(22, 0, '', 0, 0, '130/90-10 61L TL MC29 SPORTY 3+', NULL, '', '925822', 0, '<br>Шины Mitas - MC29 - cпортивные покрышки для скутеров.<br/>\n<br>Mitas MC29 обладают Крепким каркасом и боковинами для лучшей угловой стабильности, крупными плечевыми блоками для обеспечения сцепления и стабильности на экстремальных углах наклона, диагональными канавками для лучшего отвода воды.<br/>  \n<br>Особенности протектора шин MC29 способствуют низкой шумности при движении.<br/>\n<br>Вес шины: 3,6 кг<br/>\n<br>Индекс нагрузки: 61<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '130-90-10-61l-tl-mc29-sporty-3-', NULL, NULL, 1, 0, 'f8fee316-325b-11e8-8192-ed790c9fa917'),
(23, 0, '', 0, 0, '3.50-10 51J TT B14', NULL, '', '945209', 0, '<br>Mitas B14 обеспечивают отличную скоростную езду, водоотведение, маневренность.<br/>\n<br>Оригинальный рисунок протектора гарантирует высокие сцепные, тяговые и тормозные характеристики.<br/>\n<br>Вес шины: 1,9 кг<br/>\n<br>Индекс нагрузки: 51<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '3-50-10-51j-tt-b14', NULL, NULL, 1, 0, '0ce5e246-325c-11e8-8192-ed790c9fa917'),
(24, 0, '', 0, 0, '3.25/3.50-19 HD-K GP-4 (V1.09.1) (TR-4)', NULL, '', '884783', 0, '<br>Камеры изготовлены из бутилкаучука и имеют следующие маркировки:<br/> \n<br><br/>\n<br>Mitas и SAVA<br/>\n<br><br/>\n<br>UHD - камера толщиной 4 мм для очень больших нагрузок<br/>\n<br>HD - камера толщиной 1,9-2,0 мм для больших нагрузок<br/>\n<br>Normal - камера толщиной 1,2-1,4 мм для не больших нагрузок, как правило устонавливаются на скутеры или малокубатурные мотоциклы<br/>\n<br>BOX - камера упакована в отдельную коробку<br/>\n<br>JS87, TR87, 90/90 - камера имеет изогнутый вентель<br/>\n<br>34G, TR6 - камера имеет прямой вентель<br/>\n<br><br/>\n<br>КАБАТ<br/>\n<br><br/>\n<br>HD - усиленные камеры для больших нагрузок<br/>\n<br>GP4(TR-4)(V1.09.1) - камера имеет прямой вентель<br/>\n<br>Все камеры марки КАБАТ не имеют упаковки<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '3-25-3-50-19-hd-k-gp-4--v1-09-1---tr-4-', NULL, NULL, 1, 0, 'd2e067cc-325b-11e8-8192-ed790c9fa917'),
(25, 0, '', 0, 0, '120/70-12 51L TL MC16', NULL, '', '945203', 0, '<br>Шины Mitas MC16 - шины оригинального дизайна для скутеров.<br/>\n<br>Mitas MC16 обеспечивают прекрасные эксплуатационные и потребительские характеристики. Они отлично показывают себя практически на всех видах дорожного покрытия, даже на проселочных дорогах и по бездорожью. Курсовая устойчивость и высокая безопасность гарантируется рисунком протектора и резиновой смесью.<br/>\n<br>Вес шины: 2,8 кг<br/>\n<br>Индекс нагрузки: 51<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-70-12-51l-tl-mc16', NULL, NULL, 1, 0, '0ce5e205-325c-11e8-8192-ed790c9fa917'),
(26, 0, '', 0, 0, '3.00/3.25...-17 TR6 SD17 BOX', NULL, '', '940635', 0, '<br>Камеры изготовлены из бутилкаучука и имеют следующие маркировки:<br/> \n<br><br/>\n<br>Mitas и SAVA<br/>\n<br><br/>\n<br>UHD - камера толщиной 4 мм для очень больших нагрузок<br/>\n<br>HD - камера толщиной 1,9-2,0 мм для больших нагрузок<br/>\n<br>Normal - камера толщиной 1,2-1,4 мм для не больших нагрузок, как правило устонавливаются на скутеры или малокубатурные мотоциклы<br/>\n<br>BOX - камера упакована в отдельную коробку<br/>\n<br>JS87, TR87, 90/90 - камера имеет изогнутый вентель<br/>\n<br>34G, TR6 - камера имеет прямой вентель<br/>\n<br><br/>\n<br>КАБАТ<br/>\n<br><br/>\n<br>HD - усиленные камеры для больших нагрузок<br/>\n<br>GP4(TR-4)(V1.09.1) - камера имеет прямой вентель<br/>\n<br>Все камеры марки КАБАТ не имеют упаковки<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '3-00-3-25----17-tr6-sd17-box', NULL, NULL, 1, 0, 'ff45d4e1-325b-11e8-8192-ed790c9fa917'),
(27, 4, '4|1', 1, 0, '120/90-17M/C 64T E-08 TL', NULL, '', '881045', 0, '<br>Mitas E-08 подходит для грунтовых дорог и сухой пересеченной местности.<br/>\n<br>Протектор наделен специфическим рисунком, разработанным командой инженеров по трехмерной технологии. Благодаря этому вся совокупность элементов размещена со скрупулезно просчитанными интервалами. Таким образом, центральная часть шины обладает феноменальным сцепление. Оно будет продемонстрировано на дорожном полотне любого качества.<br/>\n<br>Вес шины: 6,1 кг<br/>\n<br>Индекс нагрузки: 64<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-90-17m-c-64t-e-08-tl', NULL, NULL, 1, 0, 'b1201d09-325b-11e8-8192-ed790c9fa917'),
(28, 4, '4|1', 1, 0, '150/70-18 M/C 70T E-07 DAKAR TL', NULL, '', '915618', 0, '<br>Mitas E-07 специально создана для мотоциклов, которые эксплуатируются на любой дорожной поверхности. Отличительной особенностью этой модели является необычный протекторный рисунок, который обеспечивает повышенную устойчивость и уверенное управление на любой дорожной поверхности.<br/>\n<br>Вся поверхность шины покрыта необычными блоками, которые обеспечивают отличную устойчивость и управляемость. Оптимально подобранные расстояния между блоками предотвращают застревание камней в протекторе и повышают самоочищение. В плечевой зоне, блоки имеют другую форму, за счет этого достигается повышенная устойчивость при любых маневрах. Отличная курсовая устойчивость и быстрая обратная связь обеспечивается центральной частью протектора, где пересекаются блоки.<br/>\n<br>Dakar - протектор с усиленным каркасом для экстремального вождения или гонок.<br/>\n<br>Вес шины: 8,3 кг<br/>\n<br>Индекс нагрузки: 70<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '150-70-18-m-c-70t-e-07-dakar-tl', NULL, NULL, 1, 0, 'df3e9bb3-325b-11e8-8192-ed790c9fa917'),
(29, 0, '', 0, 0, '2.75-23 V1.09.1', NULL, '', '931288', 0, '<br>Камеры изготовлены из бутилкаучука и имеют следующие маркировки:<br/> \n<br><br/>\n<br>Mitas и SAVA<br/>\n<br><br/>\n<br>UHD - камера толщиной 4 мм для очень больших нагрузок<br/>\n<br>HD - камера толщиной 1,9-2,0 мм для больших нагрузок<br/>\n<br>Normal - камера толщиной 1,2-1,4 мм для не больших нагрузок, как правило устонавливаются на скутеры или малокубатурные мотоциклы<br/>\n<br>BOX - камера упакована в отдельную коробку<br/>\n<br>JS87, TR87, 90/90 - камера имеет изогнутый вентель<br/>\n<br>34G, TR6 - камера имеет прямой вентель<br/>\n<br><br/>\n<br>КАБАТ<br/>\n<br><br/>\n<br>HD - усиленные камеры для больших нагрузок<br/>\n<br>GP4(TR-4)(V1.09.1) - камера имеет прямой вентель<br/>\n<br>Все камеры марки КАБАТ не имеют упаковки<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '2-75-23-v1-09-1', NULL, NULL, 1, 0, 'ff45d3c3-325b-11e8-8192-ed790c9fa917'),
(30, 2, '2|1', 1, 0, '80/100-21 51R C-11 SPEEDY-CROC TT', NULL, '', '881158', 0, '<br>Mitas C11 – надежная мотоциклетная резина для любителей мотокросса. Изготовлена она европейским выдающимся брендом по трехмерной технологии. Благодаря этому все параметры идеально сбалансированы. Такая модель предназначается для установки на переднюю ось мототранспорта. Она сочетается с моделью C-10 для задней оси.<br/>\n<br>Для центральной части шины подобрана особая резиновая смесь. Она адаптирована для суровых мотокроссовых условий. Компаунд отличается эластичностью благодаря уникальным полимерам в составе. Шины демонстрирует феноменальную маневренность при пониженных температурах.<br/>\n<br>Speedy-Croc - рисунок протектора, обеспечивающий оптимальную производительность во всех режимах вождения.<br/>\n<br>Вес шины: 3,1 кг<br/>\n<br>Индекс нагрузки: 5,1 <br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '80-100-21-51r-c-11-speedy-croc-tt', NULL, NULL, 1, 0, 'c523ba80-325b-11e8-8192-ed790c9fa917'),
(31, 2, '2|1', 1, 0, '120/90-18 71R REIN.EF-07 SUP.LIGHT TT', NULL, '', '915645', 0, '<br>Mitas EF-07 разработана для преимущественного использования по гравию, камням, горной местности.<br/>\n<br>Обновленная резиновая смесь улучшила ходовые параметры шины. Большое содержание кремния повысило износостойкие качества протектора, в результате увеличился срок использования. Новая силика обеспечила повышенную эластичность, за счет этого улучшилось сцепление Mitas EF-07 на влажном дорожном покрытии. Сочетание обновленной резиновой смеси и оптимального подобранных протекторных блоков позволило увеличить пятно контакта с дорожной поверхностью.<br/>\n<br>Super Light - протектор из особой смеси и легким каркасом для Enduro Extreme.<br/>\n<br>Reinforced - увеличенный индекс грузоподъемности(нагрузки) шины по E.T.R.T.O.<br/>\n<br>Вес шины: 4,9 кг<br/>\n<br>Индекс нагрузки: 71<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-90-18-71r-rein-ef-07-sup-light-tt', NULL, NULL, 1, 0, 'e5518ed3-325b-11e8-8192-ed790c9fa917'),
(32, 4, '4|1', 1, 0, '3.00-21M/C 54S E-02 TT', NULL, '', '881076', 0, '<br>Универсальный фигурный рисунок протектора мотошин Mitas E-02 для передних и задних колес подходит для езды в режиме дорога/бездорожье.<br/>\n<br>Шина обладает великолепной маневренностью. Благодаря этому вы сможете с феноменальной стабильностью выходить из любого поворота.<br/>\n<br>Вес шины: 3,5 кг<br/>\n<br>Индекс нагрузки: 54<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '3-00-21m-c-54s-e-02-tt', NULL, NULL, 1, 0, 'b831b638-325b-11e8-8192-ed790c9fa917'),
(33, 0, '', 0, 0, '3.00/3.25-16 TR6 BOX', NULL, '', '915186', 0, '<br>Камеры изготовлены из бутилкаучука и имеют следующие маркировки:<br/> \n<br><br/>\n<br>Mitas и SAVA<br/>\n<br><br/>\n<br>UHD - камера толщиной 4 мм для очень больших нагрузок<br/>\n<br>HD - камера толщиной 1,9-2,0 мм для больших нагрузок<br/>\n<br>Normal - камера толщиной 1,2-1,4 мм для не больших нагрузок, как правило устонавливаются на скутеры или малокубатурные мотоциклы<br/>\n<br>BOX - камера упакована в отдельную коробку<br/>\n<br>JS87, TR87, 90/90 - камера имеет изогнутый вентель<br/>\n<br>34G, TR6 - камера имеет прямой вентель<br/>\n<br><br/>\n<br>КАБАТ<br/>\n<br><br/>\n<br>HD - усиленные камеры для больших нагрузок<br/>\n<br>GP4(TR-4)(V1.09.1) - камера имеет прямой вентель<br/>\n<br>Все камеры марки КАБАТ не имеют упаковки<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '3-00-3-25-16-tr6-box', NULL, NULL, 1, 0, 'd941f981-325b-11e8-8192-ed790c9fa917'),
(34, 2, '2|1', 1, 0, '110/100-18 M/C 64M XT-454 WIN FRIC TT', NULL, '', '881197', 0, '<br>Mitas XT454 – европейская резина бескомпромиссного качества. Она демонстрирует великолепное сцепление с дорожным полотном любого качества. Это обеспечивается массивной короной протектора. Совокупность элементов центральной части покрышки разрабатывалась в компьютерной программе трехмерного компьютерного моделирования. Благодаря этому интервалы просчитаны до миллиметра.<br/>\n<br>Боковые фигуры изготовлены из прочной резиновой смеси. Однако при этом они сохраняют отличную эластичность.<br/>\n<br>Winter Friction - специальный вариант для использования в зимних условиях, подходит также для шипов.<br/>\n<br>Вес шины: 5,5 кг<br/>\n<br>Индекс нагрузки: 64<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-100-18-m-c-64m-xt-454-win-fric-tt', NULL, NULL, 1, 0, 'cbbe1e18-325b-11e8-8192-ed790c9fa917'),
(35, 3, '3|1', 1, 0, '3.25-19M/C 54P H-01 TT', NULL, '', '881023', 0, '<br>Дорожная моторезина Mitas H-01 обладает ленточным рисунком протектора, который подходит для задних и передних колес мотоцикла.Данная моторезина предназначена для эксплуатации по качественной дороге.<br/>\n<br>Вес шины: 3,5 кг<br/>\n<br>Индекс нагрузки: 54<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '3-25-19m-c-54p-h-01-tt', NULL, NULL, 1, 0, 'b1201cbe-325b-11e8-8192-ed790c9fa917'),
(36, 2, '2|1', 1, 0, '120/80-19 63M C-20 TT', NULL, '', '925775', 0, '<br>Mitas C20 представляет собой уникальную разработку именитого шинного концерна. Покрышка отличается универсальностью. Протектор обладает улучшенным узором, который без проблем справляется даже с нестабильными дорожными полотнами.<br/> \n<br>Благодаря суперкрепкому компаунду в разы повышается срок эксплуатации такого изделия. Шина обладает высоким европейским качеством. Она надежно защищена от механических повреждений и абразивного воздействия магистралей.<br/> \n<br>Вес шины: 5,6 кг<br/>\n<br>Индекс нагрузки: 63<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-80-19-63m-c-20-tt', NULL, NULL, 1, 0, 'f27ec284-325b-11e8-8192-ed790c9fa917'),
(37, 4, '4|1', 1, 0, '150/70-17 M/C 69T E-07 TL', NULL, '', '889988', 0, '<br>Mitas E-07 специально создана для мотоциклов, которые эксплуатируются на любой дорожной поверхности. Отличительной особенностью этой модели является необычный протекторный рисунок, который обеспечивает повышенную устойчивость и уверенное управление на любой дорожной поверхности.<br/>\n<br>Вся поверхность шины покрыта необычными блоками, которые обеспечивают отличную устойчивость и управляемость. Оптимально подобранные расстояния между блоками предотвращают застревание камней в протекторе и повышают самоочищение. В плечевой зоне, блоки имеют другую форму, за счет этого достигается повышенная устойчивость при любых маневрах. Отличная курсовая устойчивость и быстрая обратная связь обеспечивается центральной частью протектора, где пересекаются блоки.<br/>\n<br>Вес шины: 7,3 кг<br/>\n<br>Индекс нагрузки: 69<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '150-70-17-m-c-69t-e-07-tl', NULL, NULL, 1, 0, 'd2e0689f-325b-11e8-8192-ed790c9fa917'),
(38, 0, '', 0, 0, '110/70-16 52P MC28 DIAMOND S TL', NULL, '', '950527', 0, '<br>Шины Mitas - MC28 - всесезонные шины, сделаны специально для максискутеров.<br/>\n<br>Mitas MC28 обладают отличной продольной и угловой стабильностью. <br/>\n<br>Долговечная резиновая смесь выдерживает скоростные и весовые нагрузки и отлично держит дорогу в любую погоду.<br/>\n<br>Вес шины: 3,3 кг<br/>\n<br>Индекс нагрузки: 52<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-70-16-52p-mc28-diamond-s-tl', NULL, NULL, 1, 0, '0ce5e320-325c-11e8-8192-ed790c9fa917'),
(39, 2, '2|1', 1, 0, '70/100-19 42M C-19 WINTER FRICTION TT', NULL, '', '915657', 0, '<br>Mitas C-19 разработана для преимущественного использования по гравию, камням, горной местности.<br/>\n<br>Кроссовые шины Mitas C-19 одобрены для эксплуатации в соответствии с DOT EN, 80% по бездорожью, 20% на дорогах.<br/>\n<br>Winter Friction - специальный вариант для использования в зимних условиях, подходит также для шипов.<br/>\n<br>Вес шины: 2,5 кг<br/>\n<br>Индекс нагрузки: 42<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '70-100-19-42m-c-19-winter-friction-tt', NULL, NULL, 1, 0, 'e5518f3a-325b-11e8-8192-ed790c9fa917'),
(40, 2, '2|1', 1, 0, '110/90-19 62M C-30 TERRACROSS ICE TT', NULL, '', '950573', 0, '<br>Mitas C30 представляет собой уникальную разработку именитого шинного концерна. Покрышка отличается универсальностью. Протектор обладает улучшенным узором, который без проблем справляется даже с нестабильными дорожными полотнами.\n\nДизайн протектора обеспечивает оптимальную производительность во всех режимах вождения.<br/>\n<br>Индекс нагрузки: 62<br/>\n<br>Вес шины: 5,9 кг<br/>\n<br>Страна производства: Словения<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-90-19-62m-c-30-terracross-ice-tt', NULL, NULL, 1, 0, '1a053309-325c-11e8-8192-ed790c9fa917'),
(41, 0, '', 0, 0, '120/70-14 55P TL MC28 DIAMOND S', NULL, '', '915440', 0, '<br>Шины Sava MC28 - всесезонные шины, сделаны специально для максискутеров.\nSava MC28 обладают отличной продольной и угловой стабильностью. \nДолговечная резиновая смесь выдерживает скоростные и весовые нагрузки и отлично держит дорогу в любую погоду.\n<br>Вес шины: 3,3 кг<br/>\n<br>Индекс нагрузки: 55<br/>\n<br>Страна производства: Словения<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-70-14-55p-tl-mc28-diamond-s', NULL, NULL, 1, 0, 'd941fa25-325b-11e8-8192-ed790c9fa917'),
(42, 2, '2|1', 1, 0, '100/100-18M/C 59M C-16 TT', NULL, '', '881112', 0, '<br>Mitas C16 – модернизированная мотоциклетная покрышка от небезызвестного шинного гиганта из Европы. Она предназначается для маневренной езды по твердому дорожному полотну. Также вашему байку покорятся каменистые спуски и подъемы. Протектор имеет особенный узор. Он представляет собой совокупность массивных блоков, размещенных с определенными интервалами. Они были скрупулезно просчитаны в уникальной компьютерной программе для виртуального моделирования.<br/>\n<br>Резиновая смесь имеет особую прочность. Она дополнена новейшими полимерами, стойкими к абразивному и механическому стороннему воздействию.<br/>\n<br>Вес шины: 4,6 кг<br/>\n<br>Индекс нагрузки: 59<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '100-100-18m-c-59m-c-16-tt', NULL, NULL, 1, 0, 'befe4d73-325b-11e8-8192-ed790c9fa917'),
(43, 0, '', 0, 0, '3.50-18 V1.09.1 HD', NULL, '', '940587', 0, '<br>Камеры изготовлены из бутилкаучука и имеют следующие маркировки:<br/> \n<br><br/>\n<br>Mitas и SAVA<br/>\n<br><br/>\n<br>UHD - камера толщиной 4 мм для очень больших нагрузок<br/>\n<br>HD - камера толщиной 1,9-2,0 мм для больших нагрузок<br/>\n<br>Normal - камера толщиной 1,2-1,4 мм для не больших нагрузок, как правило устонавливаются на скутеры или малокубатурные мотоциклы<br/>\n<br>BOX - камера упакована в отдельную коробку<br/>\n<br>JS87, TR87, 90/90 - камера имеет изогнутый вентель<br/>\n<br>34G, TR6 - камера имеет прямой вентель<br/>\n<br><br/>\n<br>КАБАТ<br/>\n<br><br/>\n<br>HD - усиленные камеры для больших нагрузок<br/>\n<br>GP4(TR-4)(V1.09.1) - камера имеет прямой вентель<br/>\n<br>Все камеры марки КАБАТ не имеют упаковки<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '3-50-18-v1-09-1-hd', NULL, NULL, 1, 0, 'ff45d4d9-325b-11e8-8192-ed790c9fa917'),
(44, 2, '2|1', 1, 0, '110/90-19M/C 62M C-24 TT', NULL, '', '920511', 0, '<br>Модель Mitas C-24 разработана для преимущественного использования по грязи и песку.<br/>\n<br>Прекрасные ходовые качества на песчаных и грязевых участках. Хорошая самоочищаемость протектора.<br/>\n<br>Вес шины: 5,8 кг<br/>\n<br>Индекс нагрузки: 62<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-90-19m-c-62m-c-24-tt', NULL, NULL, 1, 0, 'ec3eecad-325b-11e8-8192-ed790c9fa917'),
(45, 2, '2|1', 1, 0, '3.00-21 51M XT-444 WIN FRIC SPIKE TT', NULL, '', '881207', 0, '<br>Mitas XT444 – отличается повышенной проходимостью и минимальным процентом повреждений. Использование современного оборудования и лучших материалов позволило добиться прекрасных эксплуатационных характеристик.<br/>\n<br>Для предотвращения возможных повреждений и разрывов, которые часто происходят при движении по некачественному покрытию, был использован усиленный каркас. Новая технология намотки корда и корд повышенной прочности обеспечивают надежную защиту от повреждений и без проблем справляются с максимальными нагрузками. Также новый каркас имеет уменьшенный вес, что повысило скоростные и тормозные характеристики.<br/>\n<br>Winter Friction - специальный вариант для использования в зимних условиях, подходит также для шипов.<br/>\n<br>Spike - протектор с шипами Winterfriction.<br/>\n<br>Вес шины: 5,2 кг<br/>\n<br>Индекс нагрузки: 51<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '3-00-21-51m-xt-444-win-fric-spike-tt', NULL, NULL, 1, 0, 'cbbe1e65-325b-11e8-8192-ed790c9fa917'),
(46, 0, '', 0, 0, '2 1/4-18 42J TT B4 REINF. B Сава (белая боковина)', NULL, '', '915391', 0, '<br>Sava B4 - шины для мопедов.<br/>\n<br>Reinforced - увеличенный индекс грузоподъемности(нагрузки) шины по E.T.R.T.O..<br/>\n<br>Вес шины: 1,3 кг<br/>\n<br>Индекс нагрузки: 42<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '2-1-4-18-42j-tt-b4-reinf--b-sava--belaya-bokovina-', NULL, NULL, 1, 0, 'd941f9ff-325b-11e8-8192-ed790c9fa917'),
(47, 2, '2|1', 1, 0, '80/100-21 51M C-29 ICE TT', NULL, '', '943210', 0, '<br>Модель Mitas C-29 разработана для преимущественного использования по гравию, камням. Мотошины этой модели , маркированные красной полосой рекомендуется использовать на средних, средне-твердых грунтах.<br/>\n<br>Данная моторезина предназначена для установки на любую ось.овой дороге. Но и на дорогах с твердым покрытием покрышка надежно держит сцепление, препятствует вилянию и скольжению.<br/>\n<br>Вес шины: 6 кг<br/>\n<br>Индекс нагрузки: 51<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '80-100-21-51m-c-29-ice-tt', NULL, NULL, 1, 0, '05e03cfa-325c-11e8-8192-ed790c9fa917'),
(48, 4, '4|1', 1, 0, '100/90-19 M/C 57T E-09 DAKAR TL', NULL, '', '881064', 0, '<br>Mitas E09 - подходит для пустынных и раллийных соревнований.<br/>\n<br>Протектор наделен эксклюзивным сочетанием элементов для совершенного сцепления на любой скорости. Благодаря прочной конструкции шины очень надежны, устойчивы к проколам.<br/>\n<br>Dakar - протектор с усиленным каркасом дляэкстремального вождения или гонок.<br/>\n<br>Вес шины: 4,5 кг<br/>\n<br>Индекс нагрузки: 57<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '100-90-19-m-c-57t-e-09-dakar-tl', NULL, NULL, 1, 0, 'b831b5c7-325b-11e8-8192-ed790c9fa917'),
(49, 3, '3|1', 1, 0, '110/80-17 57H TL MC50', NULL, '', '938432', 0, '<br>Mitas MC50 - это высокоскоростные шины диагональной конструкции. Шины Mitas MC50 используются в профессиональных мотогонках, отличаются хорошим сцеплением с дорогой и длительным сроком службы. Данная моторезина рекомендуется для спорта, супермото, мотоциклов с низким и средним объемом двигателя. Конструкция шин Mitas MC50 позволяет использовать их не только на гоночных трассах, но и в повседневной жизни. Mitas MC50 - многофункциональная шина с отличной производительностью на сухом дорожном покрытии и в то же время с отличной управляемостью на мокром. Жесткость боковой стенки обеспечивает стабильность шины на гоночных трассах.<br/>\n<br>Конструкция: Диагональная<br/>\n<br>Индекс нагрузки: 57<br/>\n<br>Вес шины:  4,2 кг<br/>\n<br>Страна производства: Словения<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-80-17-57h-tl-mc50', NULL, NULL, 1, 0, '1a0532a2-325c-11e8-8192-ed790c9fa917'),
(50, 4, '4|1', 1, 0, '110/80B19 M/C 59T E-10 DAKAR TL', NULL, '', '885571', 0, '<br>Mitas E10 - предназначены для всех типов дорог и умеренного бездорожья.<br/>\n<br>При разработке резиновой смеси использовалось огромное число новых компонентов, которые увеличили эксплуатационные качества шины Mitas E-10. Повысить износостойкие параметры помог кремний, за счет этого срок службы шину увеличился. Новая силика обеспечила резине повышенную эластичность, что положительно сказалось на сцеплении с влажным дорожным покрытием. Новая резиновая смесь позволила уменьшить сопротивление качению, что повысило устойчивость при движении на высоких скоростях.<br/>\n<br>Dakar - протектор с усиленным каркасом дляэкстремального вождения или гонок.<br/>\n<br>Вес шины: 5,6 кг<br/>\n<br>Индекс нагрузки: 59<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-80b19-m-c-59t-e-10-dakar-tl', NULL, NULL, 1, 0, 'd2e06822-325b-11e8-8192-ed790c9fa917'),
(51, 2, '2|1', 1, 0, '100/90-19 57M C-20 TT', NULL, '', '881140', 0, '<br>Mitas C20 представляет собой уникальную разработку именитого шинного концерна. Покрышка отличается универсальностью. Протектор обладает улучшенным узором, который без проблем справляется даже с нестабильными дорожными полотнами.<br/> \n<br>Благодаря суперкрепкому компаунду в разы повышается срок эксплуатации такого изделия. Шина обладает высоким европейским качеством. Она надежно защищена от механических повреждений и абразивного воздействия магистралей.<br/> \n<br>Вес шины: 4,9 кг<br/>\n<br>Индекс нагрузки: 57<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '100-90-19-57m-c-20-tt', NULL, NULL, 1, 0, 'c523b9a5-325b-11e8-8192-ed790c9fa917'),
(52, 4, '4|1', 1, 0, '130/80-17 65H TL MC30 INVADER', NULL, '', '942312', 0, '<br>Mitas MC30  - предназначены для всех типов дорог и минимального бездорожья.<br/>\n<br>Invader MC30 - мотошины для мотоциклов двойного назначения и туристических эндуро, ориентированные на езду по асфальту и дорогам с твердым покрытием. Обеспечивают отличную управляемость на мокрой дороге и легком бездорожье в любую погоду.<br/>\n<br>Вес шины: 6,1 кг<br/>\n<br>Индекс нагрузки: 65<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '130-80-17-65h-tl-mc30-invader', NULL, NULL, 1, 0, '05e03c6f-325c-11e8-8192-ed790c9fa917'),
(53, 4, '4|1', 1, 0, '150/70-17 M/C 69R E-09 DAKAR TL', NULL, '', '924487', 0, '<br>Mitas E09 - подходит для пустынных и раллийных соревнований.<br/>\n<br>Протектор наделен эксклюзивным сочетанием элементов для совершенного сцепления на любой скорости. Благодаря прочной конструкции шины очень надежны, устойчивы к проколам.<br/>\n<br>Dakar - протектор с усиленным каркасом дляэкстремального вождения или гонок.<br/>\n<br>Вес шины: 7,6 кг<br/>\n<br>Индекс нагрузки: 69<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '150-70-17-m-c-69r-e-09-dakar-tl', NULL, NULL, 1, 0, 'ec3eedd7-325b-11e8-8192-ed790c9fa917'),
(54, 0, '', 0, 0, '120/70-12 58P TL MC25 REINF.', NULL, '', '943658', 0, '<br>Вес шины: 2,8 кг<br/>\n<br>Индекс нагрузки: 58<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-70-12-58p-tl-mc25-reinf-', NULL, NULL, 1, 0, '05e03d48-325c-11e8-8192-ed790c9fa917'),
(55, 2, '2|1', 1, 0, '110/90-19 62M C-28 TERRACROSS TT', NULL, '', '926996', 0, '<br>Mitas C28 представляет собой уникальную разработку именитого шинного концерна. Покрышка отличается универсальностью. Протектор обладает улучшенным узором, который без проблем справляется даже с нестабильными дорожными полотнами.<br/>\n<br>Дизайн протектора обеспечивает оптимальную производительность во всех режимах вождения.<br/>\n<br>Вес шины:6,1 кг<br/>\n<br>Индекс нагрузки: 62<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-90-19-62m-c-28-terracross-tt', NULL, NULL, 1, 0, 'ff45d34c-325b-11e8-8192-ed790c9fa917'),
(56, 3, '3|1', 1, 0, '3.25-18M/C 59P REINF H-06 TT', NULL, '', '881012', 0, '<br>Mitas H06 – великолепная всесезонная модель от европейского шинного гиганта. В абсолютно любую погоду вы сможете комфортно себя чувствовать за рулем своего транспортного средства. Такая универсальность делает шину данной модели превосходным вариантом для любителей долговременных путешествий. Покрышка рассчитана для установки на любую ось. Протектор имеет оригинальный узор, состоящий из прямых и криволинейных элементов. Reinforced - увеличенный индекс грузоподъемности(нагрузки) шины по E.T.R.T.O.<br/>\n<br>Вес шины: 3,5 кг<br/>\n<br>Индекс нагрузки: 59<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '3-25-18m-c-59p-reinf-h-06-tt', NULL, NULL, 1, 0, 'b1201c76-325b-11e8-8192-ed790c9fa917'),
(57, 2, '2|1', 1, 0, '120/90-18 65R C-18 TT', NULL, '', '881129', 0, '<br>Mitas C18 – идеальная разработка для задней оси мототранспорта. Это вариант С17 для задней оси. Протектор имеет универсальный узор, позволяющий покрышке демонстрировать изумительные «цепные» показатели в любых дорожных условиях! Покоряйте своему мотору даже сыпучие грунты!<br/>\n<br>Моторезина отличается адаптированной под повышенные нагрузки конструкцией. Внутри шины давление распределяется за доли секунды. Благодаря этому происходит медленное и равномерное изнашивание. В такой «обуви» вы сможете отлично ездить в дождливую погоду, поскольку протектор обладает феноменальными дренажными показателями.<br/> \n<br>Вес шины: 5,9 кг<br/>\n<br>Индекс нагрузки: 65<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-90-18-65r-c-18-tt', NULL, NULL, 1, 0, 'befe4e4f-325b-11e8-8192-ed790c9fa917'),
(58, 3, '3|1', 1, 0, '90/80-17 46P TL MC18', NULL, '', '922905', 0, '<br>Mitas MC18 - это высокоскоростные шины диагональной конструкции. Шины Mitas MC18 используются в профессиональных мотогонках, отличаются хорошим сцеплением с дорогой и длительным сроком службы. Данная моторезина рекомендуется для спорта, супермото, мотоциклов с низким и средним объемом двигателя. Конструкция шин Mitas MC18 позволяет использовать их не только на гоночных трассах, но и в повседневной жизни. Mitas MC18 - многофункциональная шина с отличной производительностью на сухом дорожном покрытии и в то же время с отличной управляемостью на мокром. Жесткость боковой стенки обеспечивает стабильность шины на гоночных трассах.<br/>\n<br>Конструкция: Диагональная<br/>\n<br>Индекс нагрузки: 46<br/>\n<br>Вес шины: 2,7 кг<br/>\n<br>Страна производства: Словения<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '90-80-17-46p-tl-mc18', NULL, NULL, 1, 0, 'ec3eed4e-325b-11e8-8192-ed790c9fa917'),
(59, 0, '', 0, 0, '140/100-17 TR6 BOX', NULL, '', '940639', 0, '<br>Камеры изготовлены из бутилкаучука и имеют следующие маркировки:<br/> \n<br><br/>\n<br>Mitas и SAVA<br/>\n<br><br/>\n<br>UHD - камера толщиной 4 мм для очень больших нагрузок<br/>\n<br>HD - камера толщиной 1,9-2,0 мм для больших нагрузок<br/>\n<br>Normal - камера толщиной 1,2-1,4 мм для не больших нагрузок, как правило устонавливаются на скутеры или малокубатурные мотоциклы<br/>\n<br>BOX - камера упакована в отдельную коробку<br/>\n<br>JS87, TR87, 90/90 - камера имеет изогнутый вентель<br/>\n<br>34G, TR6 - камера имеет прямой вентель<br/>\n<br><br/>\n<br>КАБАТ<br/>\n<br><br/>\n<br>HD - усиленные камеры для больших нагрузок<br/>\n<br>GP4(TR-4)(V1.09.1) - камера имеет прямой вентель<br/>\n<br>Все камеры марки КАБАТ не имеют упаковки<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '140-100-17-tr6-box', NULL, NULL, 1, 0, 'ff45d501-325b-11e8-8192-ed790c9fa917'),
(60, 0, '', 0, 0, '25X10.00-12 B77 4PR TL', NULL, '', '915700', 0, '<br>Шины для квадроцикла Sava B77 - еще одна модель шин ATV, предназначенная для \"утилитарно-лесного\" использования.<br/>\n<br>Рисунок покрышек Sava B77 - направленная \"елочка\". Но дополнительные внутренние грани здесь используются неповсеместно.<br/>\n<br>Колеса Sava B77 имеют боковые грунтозацепы, уходящие на боковину покрышки. Это означат, что шина Sava B77 сконструирована также для работы на низких давлениях, когда боковина шин прогибается и вступает в контакт с опорной поверхностью дороги.<br/>\n<br>Шины ATV Sava B77 вполне органично могут быть применены на квадроциклах, используемых для поездок по полям и лесам.<br/>\n<br>Вес шины: 10,6 кг<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '25x10-00-12-b77-4pr-tl', NULL, NULL, 1, 0, 'ec3eec70-325b-11e8-8192-ed790c9fa917');
