(61, 0, '', 0, 0, '90/80-16 52P TL/TT MC32 WIN SCOOT', NULL, '', '926209', 0, '<br>Шины Mitas MC32 WIN SCOOT - идеальный выбор для тех, кто использует свой мотоцикл или скутер зимой и в межсезонье.<br/>\n<br>Эти шины обладают высокими эксплутационными характеристиками при низких температурах, на снегу, льду и мокрой дороге.<br/>\n<br>Вес шины: 3,1 кг<br/>\n<br>Индекс нагрузки: 52<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '90-80-16-52p-tl-tt-mc32-win-scoot', NULL, NULL, 1, 0, 'f8fee3a0-325b-11e8-8192-ed790c9fa917'),
