(65, 4, '4|1', 1, 0, '140/80-17 M/C 69R E-09 TL', NULL, '', '922909', 0, '<br>Mitas E09 - подходит для пустынных и раллийных соревнований.<br/>\n<br>Протектор наделен эксклюзивным сочетанием элементов для совершенного сцепления на любой скорости. Благодаря прочной конструкции шины очень надежны, устойчивы к проколам.<br/>\n<br>Вес шины: 7,3 кг<br/>\n<br>Индекс нагрузки: 69<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '140-80-17-m-c-69r-e-09-tl', NULL, NULL, 1, 0, 'ec3eed81-325b-11e8-8192-ed790c9fa917'),
(66, 0, '', 0, 0, '140/70-16 65P TL MC28 DIAMOND S', NULL, '', '915471', 0, '<br>Шины Sava MC28 - всесезонные шины, сделаны специально для максискутеров.\nSava MC28 обладают отличной продольной и угловой стабильностью. \nДолговечная резиновая смесь выдерживает скоростные и весовые нагрузки и отлично держит дорогу в любую погоду.\n<br>Вес шины: 4,8 кг<br/>\n<br>Индекс нагрузки: 65<br/>\n<br>Страна производства: Словения<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '140-70-16-65p-tl-mc28-diamond-s', NULL, NULL, 1, 0, 'df3e9a5a-325b-11e8-8192-ed790c9fa917'),
(67, 4, '4|1', 1, 0, '3.00-21M/C 54S E-05 TT', NULL, '', '881075', 0, '<br>Mitas E-05 предназначен для легкого бездорожья.<br/>\n<br>На любой оси покрышка продемонстрирует феноменальные рабочие параметры. На магистралях хорошего и даже плохого качества вы будете почувствовать себя уверенно.<br/>\n<br>Вес шины: 3,2 кг<br/>\n<br>Индекс нагрузки: 54<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '3-00-21m-c-54s-e-05-tt', NULL, NULL, 1, 0, 'b831b62c-325b-11e8-8192-ed790c9fa917'),
(68, 0, '', 0, 0, '130/90-10 61L TL MC20 MONSUM', NULL, '', '925821', 0, '<br>Шины Mitas MC20 - всепогодные шины для скутеров. Отличная управляемость и долгий срок службы.<br/>\n<br>Эксклюзивная по составу резиновая смесь стойко справляется с абразивным воздействием асфальтного полотна.<br/>\n<br>Reinforced - увеличенный индекс грузоподъемности(нагрузки) шины по E.T.R.T.O.<br/>\n<br>Вес шины: 3,6 кг<br/>\n<br>Индекс нагрузки: 61<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '130-90-10-61l-tl-mc20-monsum', NULL, NULL, 1, 0, 'f8fee309-325b-11e8-8192-ed790c9fa917'),
(69, 4, '4|1', 1, 0, '140/80-17 M/C 69T E-07 DAKAR TL', NULL, '', '915619', 0, '<br>Mitas E-07 специально создана для мотоциклов, которые эксплуатируются на любой дорожной поверхности. Отличительной особенностью этой модели является необычный протекторный рисунок, который обеспечивает повышенную устойчивость и уверенное управление на любой дорожной поверхности.<br/>\n<br>Вся поверхность шины покрыта необычными блоками, которые обеспечивают отличную устойчивость и управляемость. Оптимально подобранные расстояния между блоками предотвращают застревание камней в протекторе и повышают самоочищение. В плечевой зоне, блоки имеют другую форму, за счет этого достигается повышенная устойчивость при любых маневрах. Отличная курсовая устойчивость и быстрая обратная связь обеспечивается центральной частью протектора, где пересекаются блоки.<br/>\n<br>Dakar - протектор с усиленным каркасом для экстремального вождения или гонок.<br/>\n<br>Вес шины: 7,8 кг<br/>\n<br>Индекс нагрузки: 69<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '140-80-17-m-c-69t-e-07-dakar-tl', NULL, NULL, 1, 0, 'e5518e5b-325b-11e8-8192-ed790c9fa917'),
(70, 4, '4|1', 1, 0, '90/90-21 54H TL MC30 INVADER', NULL, '', '947033', 0, '<br>Mitas MC30  - предназначены для всех типов дорог и минимального бездорожья.<br/>\n<br>Invader MC30 - мотошины для мотоциклов двойного назначения и туристических эндуро, ориентированные на езду по асфальту и дорогам с твердым покрытием. Обеспечивают отличную управляемость на мокрой дороге и легком бездорожье в любую погоду.<br/>\n<br>Вес шины: 4,6 кг<br/>\n<br>Индекс нагрузки: 54<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '90-90-21-54h-tl-mc30-invader', NULL, NULL, 1, 0, '0ce5e286-325c-11e8-8192-ed790c9fa917'),
(71, 0, '', 0, 0, '120/70-15 56S MC28 DIAMON. TL', NULL, '', '950524', 0, '<br>Шины Mitas - MC28 - всесезонные шины, сделаны специально для максискутеров.<br/>\n<br>Mitas MC28 обладают отличной продольной и угловой стабильностью. <br/>\n<br>Долговечная резиновая смесь выдерживает скоростные и весовые нагрузки и отлично держит дорогу в любую погоду.<br/>\n<br>Вес шины: 3,6 кг<br/>\n<br>Индекс нагрузки: 56<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-70-15-56s-mc28-diamon--tl', NULL, NULL, 1, 0, '0ce5e2f9-325c-11e8-8192-ed790c9fa917'),
(72, 4, '4|1', 1, 0, '130/80-17M/C 65T E-07 TL', NULL, '', '938421', 0, '<br>Mitas E-07 специально создана для мотоциклов, которые эксплуатируются на любой дорожной поверхности. Отличительной особенностью этой модели является необычный протекторный рисунок, <br>Mitas E-07 специально создана для мотоциклов, которые эксплуатируются на любой дорожной поверхности. Отличительной особенностью этой модели является необычный протекторный рисунок, который обеспечивает повышенную устойчивость и уверенное управление на любой дорожной поверхности.<br/>\n<br>Вся поверхность шины покрыта необычными блоками, которые обеспечивают отличную устойчивость и управляемость. Оптимально подобранные расстояния между блоками предотвращают застревание камней в протекторе и повышают самоочищение. В плечевой зоне, блоки имеют другую форму, за счет этого достигается повышенная устойчивость при любых маневрах. Отличная курсовая устойчивость и быстрая обратная связь обеспечивается центральной частью протектора, где пересекаются блоки.<br/>\n<br>Вес шины: 6,2 кг<br/>\n<br>Индекс нагрузки: 65<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '130-80-17m-c-65t-e-07-tl', NULL, NULL, 1, 0, 'ff45d423-325b-11e8-8192-ed790c9fa917'),
(73, 4, '4|1', 1, 0, '100/90-19 57S TL MC24', NULL, '', '915523', 0, '<br>Sava MC24  - диагональные покрышки двойного назначения с более выраженным рисунком протектора, чем у моделей MC30, E-08<br/>\n<br>MC24 - мотошины для мотоциклов двойного назначения и туристических эндуро, ориентированные на езду по асфальту и дорогам с твердым покрытием. Обеспечивают отличную управляемость на мокрой дороге и легком бездорожье в любую погоду.<br/>\n<br>Вес шины: 4,5 кг<br/>\n<br>Индекс нагрузки: 57<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '100-90-19-57s-tl-mc24', NULL, NULL, 1, 0, 'df3e9ad7-325b-11e8-8192-ed790c9fa917'),
(74, 0, '', 0, 0, '130/70-12 62P TL MC32 WIN SCOOT', NULL, '', '925804', 0, '<br>Шины Mitas MC32 WIN SCOOT - идеальный выбор для тех, кто использует свой мотоцикл или скутер зимой и в межсезонье.<br/>\n<br>Эти шины обладают высокими эксплутационными характеристиками при низких температурах, на снегу, льду и мокрой дороге.<br/>\n<br>Вес шины: 4 кг<br/>\n<br>Индекс нагрузки: 62<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '130-70-12-62p-tl-mc32-win-scoot', NULL, NULL, 1, 0, 'f27ec2ee-325b-11e8-8192-ed790c9fa917'),
(75, 0, '', 0, 0, '20X10.00-9 B70 4PR TL', NULL, '', '915687', 0, '<br>Шины для квадроцикла Sava B70 - модель шин ATV, предназначенная для спортивного использования.<br/>\n<br>Квадратное расположение шашечек протектора шин Sava B70 обеспечивает однозначность реакций, а большие канавки между шашками - устойчивость на грунтовом треке.<br/>\n<br>Вес шины: 4,6 кг<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '20x10-00-9-b70-4pr-tl', NULL, NULL, 1, 0, 'e5518fab-325b-11e8-8192-ed790c9fa917'),
(76, 2, '2|1', 1, 0, '120/90-19 64M XT-946 ICE SOFT TT', NULL, '', '881210', 0, '<br>Модель Mitas XT-946 разработана для преимущественного использования по камням, горной местности. Мотошины этой модели рекомендуется использовать на средне-мягких, средних грунтах и в холодную зимнюю погоду.<br/>\n<br>Ice Soft - специальный вариант для Motoskijoring. Шина не теряет свою гибкость даже при низких температурах.<br/>\n<br>Вес шины: 5,3 кг<br/>\n<br>Индекс нагрузки: 64<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-90-19-64m-xt-946-ice-soft-tt', NULL, NULL, 1, 0, 'cbbe1e8b-325b-11e8-8192-ed790c9fa917'),
(77, 0, '', 0, 0, '130/70-12 62P MC38 REINF.MAX S TL', NULL, '', '950536', 0, '<br>Шины Mitas MC38 - Всесезонные покрышки для максискутера, подходящие как для сухой, так и влажной поверхности.<br/>\n<br>Современный рисунок протектора Mitas MC38 обеспечивает стабильность и комфорт на высоких скоростях и прекрасно отводит воду. Новый состав резины обеспечивает превосходное сцепление и длительный срок службы.<br/>\n<br>Вес шины: 3,5 кг<br/>\n<br>Индекс нагрузки: 62<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '130-70-12-62p-mc38-reinf-max-s-tl', NULL, NULL, 1, 0, '137b804f-325c-11e8-8192-ed790c9fa917'),
(78, 4, '4|1', 1, 0, '100/90-19 M/C 57T E-07 DAKAR TL', NULL, '', '906767', 0, '<br>Mitas E-07 специально создана для мотоциклов, которые эксплуатируются на любой дорожной поверхности. Отличительной особенностью этой модели является необычный протекторный рисунок, который обеспечивает повышенную устойчивость и уверенное управление на любой дорожной поверхности.<br/>\n<br>Вся поверхность шины покрыта необычными блоками, которые обеспечивают отличную устойчивость и управляемость. Оптимально подобранные расстояния между блоками предотвращают застревание камней в протекторе и повышают самоочищение. В плечевой зоне, блоки имеют другую форму, за счет этого достигается повышенная устойчивость при любых маневрах. Отличная курсовая устойчивость и быстрая обратная связь обеспечивается центральной частью протектора, где пересекаются блоки.<br/>\n<br>Dakar - протектор с усиленным каркасом для экстремального вождения или гонок.<br/>\n<br>Вес шины: 5,3 кг<br/>\n<br>Индекс нагрузки: 57<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '100-90-19-m-c-57t-e-07-dakar-tl', NULL, NULL, 1, 0, 'd941f946-325b-11e8-8192-ed790c9fa917'),
(79, 0, '', 0, 0, '80/100-//90/90// 2.50/3.25 -21 TR6 HD BOX', NULL, '', '940642', 0, '<br>Камеры изготовлены из бутилкаучука и имеют следующие маркировки:<br/> \n<br><br/>\n<br>Mitas и SAVA<br/>\n<br><br/>\n<br>UHD - камера толщиной 4 мм для очень больших нагрузок<br/>\n<br>HD - камера толщиной 1,9-2,0 мм для больших нагрузок<br/>\n<br>Normal - камера толщиной 1,2-1,4 мм для не больших нагрузок, как правило устонавливаются на скутеры или малокубатурные мотоциклы<br/>\n<br>BOX - камера упакована в отдельную коробку<br/>\n<br>JS87, TR87, 90/90 - камера имеет изогнутый вентель<br/>\n<br>34G, TR6 - камера имеет прямой вентель<br/>\n<br><br/>\n<br>КАБАТ<br/>\n<br><br/>\n<br>HD - усиленные камеры для больших нагрузок<br/>\n<br>GP4(TR-4)(V1.09.1) - камера имеет прямой вентель<br/>\n<br>Все камеры марки КАБАТ не имеют упаковки<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '80-100---90-90---2-50-3-25--21-tr6-hd-box', NULL, NULL, 1, 0, '05e03bd6-325c-11e8-8192-ed790c9fa917'),
(80, 3, '3|1', 1, 0, '3.50-16M/C 64S REINF H-06 TT', NULL, '', '880999', 0, '<br>Mitas H06 – великолепная всесезонная модель от европейского шинного гиганта. В абсолютно любую погоду вы сможете комфортно себя чувствовать за рулем своего транспортного средства. Такая универсальность делает шину данной модели превосходным вариантом для любителей долговременных путешествий. Покрышка рассчитана для установки на любую ось. Протектор имеет оригинальный узор, состоящий из прямых и криволинейных элементов. Reinforced - увеличенный индекс грузоподъемности(нагрузки) шины по E.T.R.T.O.<br/>\n<br>Вес шины: 3,7 кг<br/>\n<br>Индекс нагрузки: 54<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '3-50-16m-c-64s-reinf-h-06-tt', NULL, NULL, 1, 0, 'b1201c2e-325b-11e8-8192-ed790c9fa917'),
(81, 2, '2|1', 1, 0, '80/100-12 50M C-20 TT', NULL, '', '881099', 0, '<br>Mitas C20 представляет собой уникальную разработку именитого шинного концерна. Покрышка отличается универсальностью. Протектор обладает улучшенным узором, который без проблем справляется даже с нестабильными дорожными полотнами.<br/> \n<br>Благодаря суперкрепкому компаунду в разы повышается срок эксплуатации такого изделия. Шина обладает высоким европейским качеством. Она надежно защищена от механических повреждений и абразивного воздействия магистралей.<br/> \n<br>Вес шины: 2,4 кг<br/>\n<br>Индекс нагрузки: 50<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '80-100-12-50m-c-20-tt', NULL, NULL, 1, 0, 'befe4d0b-325b-11e8-8192-ed790c9fa917'),
(82, 2, '2|1', 1, 0, '90/90-21 54R C-21 TT', NULL, '', '881166', 0, '<br>Mitas C21 создавались признанным шинником на основе высоких технологий, которые только начинают использоваться в отрасли. В результате шина может похвастаться эксклюзивным сочетанием ходовых параметров.<br/>\n<br>Компаунд был специально усовершенствован для этой модели. В него включены особые компоненты для непревзойденной прочности.<br/>\n<br>Вес шины: 4,1 кг<br/>\n<br>Индекс нагрузки: 54<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '90-90-21-54r-c-21-tt', NULL, NULL, 1, 0, 'c523bada-325b-11e8-8192-ed790c9fa917'),
(83, 0, '', 0, 0, '120/90-//130-140/80//100-110/100-18 BOX UHD 4MM TR6', NULL, '', '938302', 0, '<br>Камеры изготовлены из бутилкаучука и имеют следующие маркировки:<br/> \n<br><br/>\n<br>Mitas и SAVA<br/>\n<br><br/>\n<br>UHD - камера толщиной 4 мм для очень больших нагрузок<br/>\n<br>HD - камера толщиной 1,9-2,0 мм для больших нагрузок<br/>\n<br>Normal - камера толщиной 1,2-1,4 мм для не больших нагрузок, как правило устонавливаются на скутеры или малокубатурные мотоциклы<br/>\n<br>BOX - камера упакована в отдельную коробку<br/>\n<br>JS87, TR87, 90/90 - камера имеет изогнутый вентель<br/>\n<br>34G, TR6 - камера имеет прямой вентель<br/>\n<br><br/>\n<br>КАБАТ<br/>\n<br><br/>\n<br>HD - усиленные камеры для больших нагрузок<br/>\n<br>GP4(TR-4)(V1.09.1) - камера имеет прямой вентель<br/>\n<br>Все камеры марки КАБАТ не имеют упаковки<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-90---130-140-80--100-110-100-18-box-uhd-4mm-tr6', NULL, NULL, 1, 0, 'ff45d3fe-325b-11e8-8192-ed790c9fa917'),
(84, 2, '2|1', 1, 0, '120/90-18 M/C 65R C-18 SUPER LIGHT TT', NULL, '', '884387', 0, '<br>Mitas C18 – идеальная разработка для задней оси мототранспорта. Это вариант С17 для задней оси. Протектор имеет универсальный узор, позволяющий покрышке демонстрировать изумительные «цепные» показатели в любых дорожных условиях! Покоряйте своему мотору даже сыпучие грунты!<br/>\n<br>Моторезина отличается адаптированной под повышенные нагрузки конструкцией. Внутри шины давление распределяется за доли секунды. Благодаря этому происходит медленное и равномерное изнашивание. В такой «обуви» вы сможете отлично ездить в дождливую погоду, поскольку протектор обладает феноменальными дренажными показателями.<br/>\n<br>Super Light - протектор из особой смеси и легким каркасом для Enduro Extreme.<br/>\n<br>Вес шины: 5,5 кг<br/>\n<br>Индекс нагрузки: 65<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-90-18-m-c-65r-c-18-super-light-tt', NULL, NULL, 1, 0, 'cbbe1ed5-325b-11e8-8192-ed790c9fa917'),
(85, 2, '2|1', 1, 0, '2.50-12 37M C-19 TT', NULL, '', '881097', 0, '<br>Mitas C-19 разработана для преимущественного использования по гравию, камням, горной местности.<br/>\n<br>Кроссовые шины Mitas C-19 одобрены для эксплуатации в соответствии с DOT EN, 80% по бездорожью, 20% на дорогах.<br/>\n<br>Вес шины: 1,4 кг<br/>\n<br>Индекс нагрузки: 37<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '2-50-12-37m-c-19-tt', NULL, NULL, 1, 0, 'b831b70a-325b-11e8-8192-ed790c9fa917'),
(86, 0, '', 0, 0, '100/70-14 53L TL/TT MC32 WIN SCOOT', NULL, '', '925678', 0, '<br>Шины Mitas MC32 WIN SCOOT - идеальный выбор для тех, кто использует свой мотоцикл или скутер зимой и в межсезонье.<br/>\n<br>Эти шины обладают высокими эксплутационными характеристиками при низких температурах, на снегу, льду и мокрой дороге.<br/>\n<br>Вес шины: 2,5 кг<br/>\n<br>Индекс нагрузки: 53<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '100-70-14-53l-tl-tt-mc32-win-scoot', NULL, NULL, 1, 0, 'f27ec1a5-325b-11e8-8192-ed790c9fa917'),
(87, 3, '3|1', 1, 0, '160/60ZR17 69W TL SPORTFORCE+', NULL, '', '920516', 0, '<br>Мотоциклетная шина Mitas SportForce+ является одним из флагманов модельного ряда известного чешского производителя. Об этом можно судить по технологиям, использованным в ее конструкции. Многие из них ранее применялись исключительно в мотоспорте, что лишний раз подтверждает высокую производительность данной модели, предназначенной для спортбайков. Мотоциклетная шина Mitas SportForce+ является одним из флагманов модельного ряда известного чешского производителя. Об этом можно судить по технологиям, использованным в ее конструкции. Многие из них ранее применялись исключительно в мотоспорте, что лишний раз подтверждает высокую производительность данной модели, предназначенной для спортбайков.<br/>\n<br>Особенности:<br/>\n<br>Оптимизированный дизайн дренажных канавок.<br/>\n<br>Протекторный рисунок Mitas SportForce+ содержит большое количество дренажных канавок. Эти элементы отличаются формой и расположением, специально подобранными не только с целью обеспечить максимальную устойчивость к аквапланированию. Они имеют значительную протяженность, будучи расположенными под острым углом относительно направления. В сочетании со сложной многоугольной формой их боковых стенок это позволяет шине чрезвычайно эффективно сопротивляться перегреву, отводя значительную часть тепла в окружающее пространство. Те же конструктивные особенности позволяют дренажным канавкам превосходно справляться с отводом воды от пятна контакта, обеспечивая шине хорошую устойчивость в дождливую погоду.<br/>\n<br>Жесткий каркас.<br/>\n<br>Еще одним нововведением данной модели является технология SCT. За этой аббревиатурой (Strong Carcass Technology) скрывается конструкция каркаса, корд которого намотан таким образом, что в нем отсутствуют какие-либо стыки и швы. В результате шина прекрасно сохраняет свою первоначальную форму даже при самом сильном воздействии разнонаправленных сил ускорения, обеспечивая быстрые и точные реакции на действия байкера. Еще одним преимуществом данной технологии является улучшившаяся устойчивость к неравномерному износу.<br/>\n<br>Основные особенности мотошины Mitas SportForce+<br/>\n<br>— оптимизированное расположение и форма дренажных канавок обеспечивает не только высокую устойчивость к аквапланированию, но и снижает уровень нагрева при движении на высокой скорости;<br/>\n<br>— жесткий каркас улучшает управляемость и устойчивость при прохождении поворотов, придает реакциям шины быстроту и точность;<br/>\n<br>— стабильные сцепные свойства в любых условиях благодаря использованию при разработке технологий компьютерного моделирования.<br/>\n<br>Конструкция: Радиальная<br/>\n<br>Индекс нагрузки: 66<br/>\n<br>Вес шины: 5,5 кг<br/>\n<br>Страна производства: Словения<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '160-60zr17-69w-tl-sportforce-', NULL, NULL, 1, 0, 'ec3eecf4-325b-11e8-8192-ed790c9fa917'),
(88, 0, '', 0, 0, '140/60-13 63P TL MC29 R.SPORTY 3+', NULL, '', '924900', 0, '<br>Шины Mitas - MC29 - cпортивные покрышки для скутеров.<br/>\n<br>Mitas MC29 обладают Крепким каркасом и боковинами для лучшей угловой стабильности, крупными плечевыми блоками для обеспечения сцепления и стабильности на экстремальных углах наклона, диагональными канавками для лучшего отвода воды.<br/>  \n<br>Особенности протектора шин Sava MC29 способствуют низкой шумности при движении.<br/>\n<br>Вес шины: 3,7 кг<br/>\n<br>Индекс нагрузки: 63<br/>\n<br>Страна производства: Словения<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '140-60-13-63p-tl-mc29-r-sporty-3-', NULL, NULL, 1, 0, 'f27ec198-325b-11e8-8192-ed790c9fa917'),
(89, 0, '', 0, 0, '90/80-16 52M TL/TT MC26 REINF.', NULL, '', '942319', 0, '<br>Летние мотоциклетные шины Mitas MC26 обеспечивают прекрасные сцепно-тормозные качества, что является важным показателем при скоростной езде на мотоциклах и скутерах.<br/>\n<br>Протекторный рисунок и усовершенствованная резиновая композиция обеспечивает курсовую устойчивость и отличные показатели при вхождении в повороты.<br/>\n<br>Еще одним достоинством данной модели является долговечность.<br/>\n<br>Reinforced - увеличенный индекс грузоподъемности(нагрузки) шины по E.T.R.T.O.<br/>\n<br>Вес шины: 2,4 кг<br/>\n<br>Индекс нагрузки: 52<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '90-80-16-52m-tl-tt-mc26-reinf-', NULL, NULL, 1, 0, '05e03cb0-325c-11e8-8192-ed790c9fa917'),
(90, 0, '', 0, 0, '110/90-12 64P TL MC16', NULL, '', '925752', 0, '<br>Шины Mitas MC16 - шины оригинального дизайна для скутеров.<br/>\n<br>Mitas MC16 обеспечивают прекрасные эксплуатационные и потребительские характеристики. Они отлично показывают себя практически на всех видах дорожного покрытия, даже на проселочных дорогах и по бездорожью. Курсовая устойчивость и высокая безопасность гарантируется рисунком протектора и резиновой смесью.<br/>\n<br>Вес шины: 3,1 кг<br/>\n<br>Индекс нагрузки: 64<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-90-12-64p-tl-mc16', NULL, NULL, 1, 0, 'f27ec234-325b-11e8-8192-ed790c9fa917'),
(91, 2, '2|1', 1, 0, '110/90-19 62M C-10 SPEEDY-CROC TT', NULL, '', '881147', 0, '<br>Mitas C10 – великолепная разработка знаменитого европейского шинного гиганта. Неординарная конструкция покрышки позволяет продуктивно использовать ее в любых дорожных условиях! С такой «обувью» вы непременно станете «королем» твердого дорожного полотна, неустойчивого покрытия, сыпучих грунтов, пересеченной местности. Ваш мотокросс-байк сможет продемонстрировать с качественными европейскими покрышками весь свой потенциал!<br/> \n<br>Изделие разработано в трехмерной компьютерной программе для задних колес мотоциклетных транспортных средств.<br/>\n<br>Speedy-Croc - рисунок протектора, обеспечивающий оптимальную производительность во всех режимах вождения.<br/>\n<br>Вес шины: 4,9 кг<br/>\n<br>Индекс нагрузки: 62<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-90-19-62m-c-10-speedy-croc-tt', NULL, NULL, 1, 0, 'c523b9fd-325b-11e8-8192-ed790c9fa917'),
(92, 0, '', 0, 0, '130/70-16 61P TL MC38 MAX SCOOT', NULL, '', '915561', 0, '<br>Шины Sava MC38 - Всесезонные покрышки для максискутера, подходящие как для сухой, так и влажной поверхности.<br/>\n<br>Современный рисунок протектора Sava MC38 обеспечивает стабильность и комфорт на высоких скоростях и прекрасно отводит воду. Новый состав резины обеспечивает превосходное сцепление и длительный срок службы.<br/>\n<br>Вес шины: 4,8 кг<br/>\n<br>Индекс нагрузки: 61<br/>\n<br>Страна производства: Словения<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '130-70-16-61p-tl-mc38-max-scoot', NULL, NULL, 1, 0, 'df3e9b32-325b-11e8-8192-ed790c9fa917'),
