(94, 4, '4|1', 1, 0, '2.75-21M/C 45P E-09 TT', NULL, '', '881074', 0, '<br>Mitas E09 - подходит для пустынных и раллийных соревнований.<br/>\n<br>Протектор наделен эксклюзивным сочетанием элементов для совершенного сцепления на любой скорости. Благодаря прочной конструкции шины очень надежны, устойчивы к проколам.<br/>\n<br>Вес шины: 2,8 кг<br/>\n<br>Индекс нагрузки: 45<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '2-75-21m-c-45p-e-09-tt', NULL, NULL, 1, 0, 'b831b620-325b-11e8-8192-ed790c9fa917'),
(95, 0, '', 0, 0, '100/80-16 50P TL MC38 MAX SCOOT', NULL, '', '945208', 0, '<br>Шины Mitas MC38 - Всесезонные покрышки для максискутера, подходящие как для сухой, так и влажной поверхности.<br/>\n<br>Современный рисунок протектора Mitas MC38 обеспечивает стабильность и комфорт на высоких скоростях и прекрасно отводит воду. Новый состав резины обеспечивает превосходное сцепление и длительный срок службы.<br/>\n<br>Вес шины: 3,7 кг<br/>\n<br>Индекс нагрузки: 50<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '100-80-16-50p-tl-mc38-max-scoot', NULL, NULL, 1, 0, '0ce5e239-325c-11e8-8192-ed790c9fa917'),
(96, 4, '4|1', 1, 0, '150/70R17 TERRAFORCE-R 69V TL', NULL, '', '939384', 0, '<br>Радиальная шина двойного назначения с протектором, ориентированным в основном для города, предоставляет отличное сцепление как на сухом, так и мокром асфальте, а также на сухом грунте и гравии. Мотошина Terra Force-R представляет собой удачно улучшенную модель MC30 c фокусом на долговечность и стабильные показатели на протяжении всего срока службы. Оптимальное размещение блоков рисунка протектора, способствует отличному сцеплению с дорогой и прямолинейности езды.<br/>\n<br>Конструкция: Радиальная<br/>\n<br>Индекс нагрузки: 69<br/>\n<br>Вес шины: 6,4 кг<br/>\n<br>Страна производства: Словения<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '150-70r17-terraforce-r-69v-tl', NULL, NULL, 1, 0, 'ff45d498-325b-11e8-8192-ed790c9fa917'),
(97, 2, '2|1', 1, 0, '120/90-18 65R C-18 COUNTRY CROSS TT', NULL, '', '881128', 0, '<br>Mitas C18 – идеальная разработка для задней оси мототранспорта. Это вариант С17 для задней оси. Протектор имеет универсальный узор, позволяющий покрышке демонстрировать изумительные «цепные» показатели в любых дорожных условиях! Покоряйте своему мотору даже сыпучие грунты!<br/>\n<br>Моторезина отличается адаптированной под повышенные нагрузки конструкцией. Внутри шины давление распределяется за доли секунды. Благодаря этому происходит медленное и равномерное изнашивание. В такой «обуви» вы сможете отлично ездить в дождливую погоду, поскольку протектор обладает феноменальными дренажными показателями.<br/>\n<br>Country Cross - мотокросс шины из смеси для гоночных шин Enduro, подходят для гонок Cross Country.<br/>\n<br>Вес шины: 6,1 кг<br/>\n<br>Индекс нагрузки: 65<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-90-18-65r-c-18-country-cross-tt', NULL, NULL, 1, 0, 'befe4e40-325b-11e8-8192-ed790c9fa917'),
(98, 4, '4|1', 1, 0, '3.50-21 M/C 54M XT-644 ARMY TT', NULL, '', '881194', 0, '<br>XT-644 - универсальная покрышка для магистралей любого качества и нестабильного дорожного полотна за городом.<br/>\n<br>Шина демонстрирует изумительную устойчивость в любом скоростном режиме.<br/>\n<br>Вес шины: 5,9 кг<br/>\n<br>Индекс нагрузки: 54<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '3-50-21-m-c-54m-xt-644-army-tt', NULL, NULL, 1, 0, 'cbbe1e0c-325b-11e8-8192-ed790c9fa917'),
(99, 4, '4|1', 1, 0, '2.75-21M/C 45P E-08 TT', NULL, '', '881072', 0, '<br>Mitas E-08 подходит для грунтовых дорог и сухой пересеченной местности.<br/>\n<br>Протектор наделен специфическим рисунком, разработанным командой инженеров по трехмерной технологии. Благодаря этому вся совокупность элементов размещена со скрупулезно просчитанными интервалами. Таким образом, центральная часть шины обладает феноменальным сцепление. Оно будет продемонстрировано на дорожном полотне любого качества.<br/>\n<br>Вес шины: 2,9 кг<br/>\n<br>Индекс нагрузки: 45<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '2-75-21m-c-45p-e-08-tt', NULL, NULL, 1, 0, 'b831b614-325b-11e8-8192-ed790c9fa917'),
(100, 0, '', 0, 0, '11X7.10-5 SRH', NULL, '', '942324', 0, '<br>Покрышки для картинга SRH — очень жесткие прокатные покрышки.<br/>\n<br>Подходят для езды как под открытым небом, так и в закрытых помещениях, долгий срок службы при высоких температурах, подходят также для езды на прокатных картах.<br/>\n<br>Вес шины: 1,9 кг<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '11x7-10-5-srh', NULL, NULL, 1, 0, '05e03cf0-325c-11e8-8192-ed790c9fa917'),
(101, 3, '3|1', 1, 0, '3.00-19M/C 49P H-01 TT', NULL, '', '881020', 0, '<br>Дорожная моторезина Mitas H-01 обладает ленточным рисунком протектора, который подходит для задних и передних колес мотоцикла.Данная моторезина предназначена для эксплуатации по качественной дороге.<br/>\n<br>Вес шины: 3,2 кг<br/>\n<br>Индекс нагрузки: 49<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '3-00-19m-c-49p-h-01-tt', NULL, NULL, 1, 0, 'b1201cb2-325b-11e8-8192-ed790c9fa917'),
(102, 0, '', 0, 0, '140/60-13 63P MC28 REINF. TL', NULL, '', '950526', 0, '<br>Шины Mitas - MC28 - всесезонные шины, сделаны специально для максискутеров.<br/>\n<br>Mitas MC28 обладают отличной продольной и угловой стабильностью. <br/>\n<br>Долговечная резиновая смесь выдерживает скоростные и весовые нагрузки и отлично держит дорогу в любую погоду.<br/>\n<br>Вес шины: 3,7 кг<br/>\n<br>Индекс нагрузки: 63<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '140-60-13-63p-mc28-reinf--tl', NULL, NULL, 1, 0, '0ce5e313-325c-11e8-8192-ed790c9fa917'),
(103, 0, '', 0, 0, '90/100-16 TR6 HD BOX', NULL, '', '931136', 0, '<br>Камеры изготовлены из бутилкаучука и имеют следующие маркировки:<br/> \n<br><br/>\n<br>Mitas и SAVA<br/>\n<br><br/>\n<br>UHD - камера толщиной 4 мм для очень больших нагрузок<br/>\n<br>HD - камера толщиной 1,9-2,0 мм для больших нагрузок<br/>\n<br>Normal - камера толщиной 1,2-1,4 мм для не больших нагрузок, как правило устонавливаются на скутеры или малокубатурные мотоциклы<br/>\n<br>BOX - камера упакована в отдельную коробку<br/>\n<br>JS87, TR87, 90/90 - камера имеет изогнутый вентель<br/>\n<br>34G, TR6 - камера имеет прямой вентель<br/>\n<br><br/>\n<br>КАБАТ<br/>\n<br><br/>\n<br>HD - усиленные камеры для больших нагрузок<br/>\n<br>GP4(TR-4)(V1.09.1) - камера имеет прямой вентель<br/>\n<br>Все камеры марки КАБАТ не имеют упаковки<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '90-100-16-tr6-hd-box', NULL, NULL, 1, 0, 'ff45d3bb-325b-11e8-8192-ed790c9fa917'),
(104, 0, '', 0, 0, '11x6.00-5 SRH', NULL, '', '942140', 0, '<br>Покрышки для картинга SRH — очень жесткие прокатные покрышки.<br/>\n<br>Подходят для езды как под открытым небом, так и в закрытых помещениях, долгий срок службы при высоких температурах, подходят также для езды на прокатных картах.<br/>\n<br>Вес шины: 1,5 кг<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '11x6-00-5-srh', NULL, NULL, 1, 0, '05e03c3b-325c-11e8-8192-ed790c9fa917'),
(105, 0, '', 0, 0, '2.75/3.00-16 GP4', NULL, '', '950491', 0, '<br>Камеры изготовлены из бутилкаучука и имеют следующие маркировки:<br/> \n<br><br/>\n<br>Mitas и SAVA<br/>\n<br><br/>\n<br>UHD - камера толщиной 4 мм для очень больших нагрузок<br/>\n<br>HD - камера толщиной 1,9-2,0 мм для больших нагрузок<br/>\n<br>Normal - камера толщиной 1,2-1,4 мм для не больших нагрузок, как правило устонавливаются на скутеры или малокубатурные мотоциклы<br/>\n<br>BOX - камера упакована в отдельную коробку<br/>\n<br>JS87, TR87, 90/90 - камера имеет изогнутый вентель<br/>\n<br>34G, TR6 - камера имеет прямой вентель<br/>\n<br><br/>\n<br>КАБАТ<br/>\n<br><br/>\n<br>HD - усиленные камеры для больших нагрузок<br/>\n<br>GP4(TR-4)(V1.09.1) - камера имеет прямой вентель<br/>\n<br>Все камеры марки КАБАТ не имеют упаковки<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '2-75-3-00-16-gp4', NULL, NULL, 1, 0, '0ce5e2cb-325c-11e8-8192-ed790c9fa917'),
(106, 4, '4|1', 1, 0, '90/90-21M/C 54T E-07 DAKAR TT', NULL, '', '915623', 0, '<br>Mitas E-07 специально создана для мотоциклов, которые эксплуатируются на любой дорожной поверхности. Отличительной особенностью этой модели является необычный протекторный рисунок, который обеспечивает повышенную устойчивость и уверенное управление на любой дорожной поверхности.<br/>\n<br>Вся поверхность шины покрыта необычными блоками, которые обеспечивают отличную устойчивость и управляемость. Оптимально подобранные расстояния между блоками предотвращают застревание камней в протекторе и повышают самоочищение. В плечевой зоне, блоки имеют другую форму, за счет этого достигается повышенная устойчивость при любых маневрах. Отличная курсовая устойчивость и быстрая обратная связь обеспечивается центральной частью протектора, где пересекаются блоки.<br/>\n<br>Dakar - протектор с усиленным каркасом для экстремального вождения или гонок.<br/>\n<br>Вес шины: 4,3 кг<br/>\n<br>Индекс нагрузки: 54<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '90-90-21m-c-54t-e-07-dakar-tt', NULL, NULL, 1, 0, 'e5518e82-325b-11e8-8192-ed790c9fa917'),
(107, 4, '4|1', 1, 0, '100/90-19 57H TL MC30 INVADER', NULL, '', '915522', 0, '<br>Mitas MC30  - предназначены для всех типов дорог и минимального бездорожья.<br/>\n<br>Invader MC30 - мотошины для мотоциклов двойного назначения и туристических эндуро, ориентированные на езду по асфальту и дорогам с твердым покрытием. Обеспечивают отличную управляемость на мокрой дороге и легком бездорожье в любую погоду.<br/>\n<br>Вес шины: 4,5 кг<br/>\n<br>Индекс нагрузки: 57<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '100-90-19-57h-tl-mc30-invader', NULL, NULL, 1, 0, 'df3e9aca-325b-11e8-8192-ed790c9fa917'),
(108, 4, '4|1', 1, 0, '110/80-19 M/C 59T E-09 TL', NULL, '', '885570', 0, '<br>Mitas E09 - подходит для пустынных и раллийных соревнований.<br/>\n<br>Протектор наделен эксклюзивным сочетанием элементов для совершенного сцепления на любой скорости. Благодаря прочной конструкции шины очень надежны, устойчивы к проколам.<br/>\n<br>Вес шины: 4,5 кг<br/>\n<br>Индекс нагрузки: 59<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-80-19-m-c-59t-e-09-tl', NULL, NULL, 1, 0, 'd2e06815-325b-11e8-8192-ed790c9fa917'),
(109, 2, '2|1', 1, 0, '80/100-21 M/C 51M XT-434 W.F.SPIKE TT', NULL, '', '881206', 0, '<br>Mitas XT434 – отличается повышенной проходимостью и минимальным процентом повреждений. Использование современного оборудования и лучших материалов позволило добиться прекрасных эксплуатационных характеристик.<br/>\n<br>Одной из отличительных особенностей данной модели является протекторный рисунок. Он состоит из нескольких функциональных зон, обеспечивающих ей максимальную производительность в любых условиях. При этом их строение сильно разнится в силу тех задач, которым им приходится решать в процессе эксплуатации.<br/>\n<br>Winter Friction - специальный вариант для использования в зимних условиях, подходит также для шипов.<br/>\n<br>Spike - протектор с шипами Winterfriction.<br/>\n<br>Вес шины: 5,1 кг<br/>\n<br>Индекс нагрузки: 51<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '80-100-21-m-c-51m-xt-434-w-f-spike-tt', NULL, NULL, 1, 0, 'cbbe1e58-325b-11e8-8192-ed790c9fa917'),
(110, 4, '4|1', 1, 0, '150/70B18 M/C 70T E-10 DAKAR TL', NULL, '', '915617', 0, '<br>Mitas E10 - предназначены для всех типов дорог и умеренного бездорожья.<br/>\n<br>При разработке резиновой смеси использовалось огромное число новых компонентов, которые увеличили эксплуатационные качества шины Mitas E-10. Повысить износостойкие параметры помог кремний, за счет этого срок службы шину увеличился. Новая силика обеспечила резине повышенную эластичность, что положительно сказалось на сцеплении с влажным дорожным покрытием. Новая резиновая смесь позволила уменьшить сопротивление качению, что повысило устойчивость при движении на высоких скоростях.<br/>\n<br>Dakar - протектор с усиленным каркасом дляэкстремального вождения или гонок.<br/>\n<br>Вес шины: 8,1 кг<br/>\n<br>Индекс нагрузки: 70<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '150-70b18-m-c-70t-e-10-dakar-tl', NULL, NULL, 1, 0, 'df3e9ba6-325b-11e8-8192-ed790c9fa917'),
(111, 2, '2|1', 1, 0, '110/100-18 M/C 64M XT-454 TT', NULL, '', '881178', 0, '<br>Mitas XT454 – европейская резина бескомпромиссного качества. Она демонстрирует великолепное сцепление с дорожным полотном любого качества. Это обеспечивается массивной короной протектора. Совокупность элементов центральной части покрышки разрабатывалась в компьютерной программе трехмерного компьютерного моделирования. Благодаря этому интервалы просчитаны до миллиметра. Боковые фигуры изготовлены из прочной резиновой смеси. Однако при этом они сохраняют отличную эластичность.<br/>\n<br>Вес шины: 5,6 кг<br/>\n<br>Индекс нагрузки: 64<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-100-18-m-c-64m-xt-454-tt', NULL, NULL, 1, 0, 'cbbe1d79-325b-11e8-8192-ed790c9fa917'),
(112, 2, '2|1', 1, 0, '120/90-18 71R REINF EF-07 SUPER TT', NULL, '', '881086', 0, '<br>Mitas EF-07 разработана для преимущественного использования по гравию, камням, горной местности.<br/>\n<br>Обновленная резиновая смесь улучшила ходовые параметры шины. Большое содержание кремния повысило износостойкие качества протектора, в результате увеличился срок использования. Новая силика обеспечила повышенную эластичность, за счет этого улучшилось сцепление Mitas EF-07 на влажном дорожном покрытии. Сочетание обновленной резиновой смеси и оптимального подобранных протекторных блоков позволило увеличить пятно контакта с дорожной поверхностью.<br/>\n<br>Super-протектор из особой смеси для гонок Enduro.<br/>\n<br>Вес шины: 5,1 кг<br/>\n<br>Индекс нагрузки: 71<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-90-18-71r-reinf-ef-07-super-tt', NULL, NULL, 1, 0, 'b831b69f-325b-11e8-8192-ed790c9fa917'),
(113, 2, '2|1', 1, 0, '80/100-21 51R C-21 ТТ', NULL, '', '885901', 0, '<br>Mitas C21 создавались признанным шинником на основе высоких технологий, которые только начинают использоваться в отрасли. В результате шина может похвастаться эксклюзивным сочетанием ходовых параметров.<br/>\n<br>Компаунд был специально усовершенствован для этой модели. В него включены особые компоненты для непревзойденной прочности.<br/>\n<br>Вес шины: 3,5 кг<br/>\n<br>Индекс нагрузки: 51<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '80-100-21-51r-c-21-tt', NULL, NULL, 1, 0, 'd2e06890-325b-11e8-8192-ed790c9fa917'),
(114, 3, '3|1', 1, 0, '3.25-16M/C 55P REINF H-05 TT', NULL, '', '880998', 0, '<br>Mitas H05 представляет собой безукоризненные шоссейные шины. Они были разработаны известным концерном по уникальной трехмерной технологии. Особого внимания заслуживает протектор. Он имеет как прямые элементы, как и фигурные. Благодаря этому изделие демонстрирует феноменальные адгезионные способности! Доскональная конструкция мотопокрышки позволяется полностью «поглощать» любые неровности городских магистральных «джунглей». Резиновая смесь усовершенствована с использованием суперкрепких компонентов. Это делает компаунд стойким к абразивным и механическим воздействиям.<br/>\n<br>Reinforced - увеличенный индекс грузоподъемности(нагрузки) шины по E.T.R.T.O.<br/>\n<br>Данная моторезина наиболее подходит для классических и ретро-мотоциклов.<br/>\n<br>Вес шины: 3,1 кг<br/>\n<br>Индекс нагрузки: 55<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '3-25-16m-c-55p-reinf-h-05-tt', NULL, NULL, 1, 0, 'b1201c22-325b-11e8-8192-ed790c9fa917'),
(115, 2, '2|1', 1, 0, '100/90-19 57M C-18 TT', NULL, '', '881139', 0, '<br>Mitas C18 – идеальная разработка для задней оси мототранспорта. Это вариант С17 для задней оси. Протектор имеет универсальный узор, позволяющий покрышке демонстрировать изумительные «цепные» показатели в любых дорожных условиях! Покоряйте своему мотору даже сыпучие грунты!<br/>\n<br>Моторезина отличается адаптированной под повышенные нагрузки конструкцией. Внутри шины давление распределяется за доли секунды. Благодаря этому происходит медленное и равномерное изнашивание. В такой «обуви» вы сможете отлично ездить в дождливую погоду, поскольку протектор обладает феноменальными дренажными показателями.<br/> \n<br>Вес шины: 4,9 кг<br/>\n<br>Индекс нагрузки: 57<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '100-90-19-57m-c-18-tt', NULL, NULL, 1, 0, 'c523b996-325b-11e8-8192-ed790c9fa917'),
(116, 0, '', 0, 0, '120/90-19 (5.00-19) TR6 BOX T', NULL, '', '942305', 0, '<br>Камеры изготовлены из бутилкаучука и имеют следующие маркировки:<br/> \n<br><br/>\n<br>Mitas и SAVA<br/>\n<br><br/>\n<br>UHD - камера толщиной 4 мм для очень больших нагрузок<br/>\n<br>HD - камера толщиной 1,9-2,0 мм для больших нагрузок<br/>\n<br>Normal - камера толщиной 1,2-1,4 мм для не больших нагрузок, как правило устонавливаются на скутеры или малокубатурные мотоциклы<br/>\n<br>BOX - камера упакована в отдельную коробку<br/>\n<br>JS87, TR87, 90/90 - камера имеет изогнутый вентель<br/>\n<br>34G, TR6 - камера имеет прямой вентель<br/>\n<br><br/>\n<br>КАБАТ<br/>\n<br><br/>\n<br>HD - усиленные камеры для больших нагрузок<br/>\n<br>GP4(TR-4)(V1.09.1) - камера имеет прямой вентель<br/>\n<br>Все камеры марки КАБАТ не имеют упаковки<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-90-19--5-00-19--tr6-box-t', NULL, NULL, 1, 0, '05e03c67-325c-11e8-8192-ed790c9fa917'),
(117, 0, '', 0, 0, '120/70-15 56S MC38 MAX SCOOT TL', NULL, '', '950531', 0, '<br>Шины Mitas MC38 - Всесезонные покрышки для максискутера, подходящие как для сухой, так и влажной поверхности.<br/>\n<br>Современный рисунок протектора Mitas MC38 обеспечивает стабильность и комфорт на высоких скоростях и прекрасно отводит воду. Новый состав резины обеспечивает превосходное сцепление и длительный срок службы.<br/>\n<br>Вес шины: 3,7 кг<br/>\n<br>Индекс нагрузки: <56br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-70-15-56s-mc38-max-scoot-tl', NULL, NULL, 1, 0, '0ce5e354-325c-11e8-8192-ed790c9fa917');
