(118, 2, '2|1', 1, 0, '120/80-19 63M C-18 TT', NULL, '', '925774', 0, '<br>Mitas C18 – идеальная разработка для задней оси мототранспорта. Это вариант С17 для задней оси. Протектор имеет универсальный узор, позволяющий покрышке демонстрировать изумительные «цепные» показатели в любых дорожных условиях! Покоряйте своему мотору даже сыпучие грунты!<br/>\n<br>Моторезина отличается адаптированной под повышенные нагрузки конструкцией. Внутри шины давление распределяется за доли секунды. Благодаря этому происходит медленное и равномерное изнашивание. В такой «обуви» вы сможете отлично ездить в дождливую погоду, поскольку протектор обладает феноменальными дренажными показателями.<br/> \n<br>Вес шины: 5,6 кг<br/>\n<br>Индекс нагрузки: 63<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-80-19-63m-c-18-tt', NULL, NULL, 1, 0, 'f27ec275-325b-11e8-8192-ed790c9fa917'),
(119, 2, '2|1', 1, 0, '120/90-19 64M XT-946 TT', NULL, '', '881188', 0, '<br>Модель Mitas XT-946 разработана для преимущественного использования по камням, горной местности. Мотошины этой модели рекомендуется использовать на средне-мягких, средних грунтах.<br/>\n<br>Вес шины: 5,4 кг<br/>\n<br>Индекс нагрузки: 65<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-90-19-64m-xt-946-tt', NULL, NULL, 1, 0, 'cbbe1df1-325b-11e8-8192-ed790c9fa917'),
(120, 2, '2|1', 1, 0, '140/80-18 70M EF-07 SUPER SOFT EXT.TT', NULL, '', '920510', 0, '<br>Mitas EF-07 разработана для преимущественного использования по гравию, камням, горной местности.<br/>\n<br>Обновленная резиновая смесь улучшила ходовые параметры шины. Большое содержание кремния повысило износостойкие качества протектора, в результате увеличился срок использования. Новая силика обеспечила повышенную эластичность, за счет этого улучшилось сцепление Mitas EF-07 на влажном дорожном покрытии. Сочетание обновленной резиновой смеси и оптимального подобранных протекторных блоков позволило увеличить пятно контакта с дорожной поверхностью.<br/>\n<br>Super Soft - шина с мягким каркасом и очень мягкой смесью для применения в экстремально тяжелых соревнованиях.<br/>\n<br>Вес шины: 5,5 кг<br/>\n<br>Индекс нагрузки: 69<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '140-80-18-70m-ef-07-super-soft-ext-tt', NULL, NULL, 1, 0, 'ec3eeca0-325b-11e8-8192-ed790c9fa917'),
(121, 2, '2|1', 1, 0, '90/90-21 54R C-21 SUPER TT', NULL, '', '881165', 0, '<br>Mitas C21 создавались признанным шинником на основе высоких технологий, которые только начинают использоваться в отрасли. В результате шина может похвастаться эксклюзивным сочетанием ходовых параметров.<br/>\n<br>Компаунд был специально усовершенствован для этой модели. В него включены особые компоненты для непревзойденной прочности. Мотопокрышка великолепно справляется с торможением и препятствует заносам.<br/>\n<br>Super - протектор из особой смеси для гонок Enduro.<br/>\n<br>Вес шины: 3,7 кг<br/>\n<br>Индекс нагрузки: 54<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '90-90-21-54r-c-21-super-tt', NULL, NULL, 1, 0, 'c523bacb-325b-11e8-8192-ed790c9fa917'),
(122, 4, '4|1', 1, 0, '120/90-18 65R MC23 ROCKRIDER TT', NULL, '', '935192', 0, '<br>Асфальт: 40%<br/>\n<br>Бездорожье: 60%<br/>\n<br>Данная моторезина предназначена для установки на любую ось.<br/>\n<br>Вес шины: 5,2 кг<br/>\n<br>Индекс нагрузки: 65<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-90-18-65r-mc23-rockrider-tt', NULL, NULL, 1, 0, 'ff45d3f1-325b-11e8-8192-ed790c9fa917'),
(123, 2, '2|1', 1, 0, '2.75-21 45M ET-01 TL', NULL, '', '881071', 0, '<br>Mitas ET-01 разработана для преимущественного использования по гравию, камням, горной местности.<br/>\n<br>Универсальность изделия выражается в возможности установки на любую ось мотоцикла. Протектор получил нетрадиционный узор, который повысил «цепные» качества до максимального уровня.<br/>\n<br>Вес шины: 3,3 кг<br/>\n<br>Индекс нагрузки: 45<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '2-75-21-45m-et-01-tl', NULL, NULL, 1, 0, 'b831b608-325b-11e8-8192-ed790c9fa917'),
(124, 3, '3|1', 1, 0, '2.50-19M/C 41L H-02 TT', NULL, '', '881019', 0, '<br>Дорожная моторезина Mitas H-02 обладает универсальным рисунком протектора, который подходит для задних и передних колес мотоцикла. При установке сразу двух шин вам гарантированы феноменальные сцепные показатели на любых ландшафтах. Исключительные пропорции каркаса делают покрышку невероятно управляемой. Такая модель станет безукоризненным вариантом для тех, кто желает подобрать лучшую «обувь» для своего байка.<br/>\n<br>Данная моторезина наиболее подходит для классических и ретро-мотоциклов.<br/>\n<br>Вес шины: 1,9 кг<br/>\n<br>Индекс нагрузки: 41<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '2-50-19m-c-41l-h-02-tt', NULL, NULL, 1, 0, 'b1201ca6-325b-11e8-8192-ed790c9fa917'),
(125, 3, '3|1', 1, 0, '90/90-16 48P TL MC9', NULL, '', '915388', 0, '<br>Sava MC9  -  прекрасно подходят для эксплуатации на скутерах в условиях города, гарантируя маневренность и высокий уровень безопасности и курсовой устойчивости. Оригинальный протекторный рисунок летних мотоциклетных шин Sava MC9 от словенского производителя обеспечивает снижение тормозного пути, быстрый разгон, долговечность и устойчивость к порезам и истиранию.<br/>\n<br>Вес шины: 2,9 кг<br/>\n<br>Индекс нагрузки: 48<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '90-90-16-48p-tl-mc9', NULL, NULL, 1, 0, 'd941f9f1-325b-11e8-8192-ed790c9fa917'),
(126, 3, '3|1', 1, 0, '130/90-15 66R TL/TT MC7', NULL, '', '922904', 0, '<br>Mitas MC7 - это высокоскоростные шины диагональной конструкции. Шины Mitas MC7 используются в профессиональных мотогонках, отличаются хорошим сцеплением с дорогой и длительным сроком службы. Данная моторезина рекомендуется для спорта, супермото, мотоциклов с низким и средним объемом двигателя. Конструкция шин Mitas MC7 позволяет использовать их не только на гоночных трассах, но и в повседневной жизни. Mitas MC7 - многофункциональная шина с отличной производительностью на сухом дорожном покрытии и в то же время с отличной управляемостью на мокром. Жесткость боковой стенки обеспечивает стабильность шины на гоночных трассах.<br/>\n<br>Вес шины: 5,9 кг<br/>\n<br>Индекс нагрузки: 66<br/>\n<br>Страна производства: Словения<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '130-90-15-66r-tl-tt-mc7', NULL, NULL, 1, 0, 'ec3eed41-325b-11e8-8192-ed790c9fa917'),
(127, 0, '', 0, 0, '120/70-12 51P TL MC34', NULL, '', '915592', 0, '<br>Мотопокрышки Sava MC34 – это сочетание скорости и высокого уровня безопасности скутера.<br/>\n<br>Sava MC34 обеспечивают отличную курсовую устойчивость, обладают прекрасными сцепно-тяговыми качествами, защитой от аквапланирования.<br/>\n<br>Благодаря протекторному рисунку снижен тормозной путь и гарантируется быстрый разгон. <br/>\n\n<br>Вес шины: 3,6 кг<br/>\n<br>Индекс нагрузки: 51<br/>\n<br>Страна производства: Словения<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-70-12-51p-tl-mc34', NULL, NULL, 1, 0, 'df3e9b73-325b-11e8-8192-ed790c9fa917'),
(128, 4, '4|1', 1, 0, '120/90-17M/C 64R E-09 TL', NULL, '', '938306', 0, '<br>Mitas E09 - подходит для пустынных и раллийных соревнований.<br/>\n<br>Протектор наделен эксклюзивным сочетанием элементов для совершенного сцепления на любой скорости. Благодаря прочной конструкции шины очень надежны, устойчивы к проколам.<br/>\n<br>Вес шины: 5,3 кг<br/>\n<br>Индекс нагрузки: 64<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-90-17m-c-64r-e-09-tl', NULL, NULL, 1, 0, 'ff45d416-325b-11e8-8192-ed790c9fa917'),
(129, 0, '', 0, 0, '130/80-12 60J  TL MC19', NULL, '', '925812', 0, '<br>Sava MC19 - скутерная шина для захватывающей езды по внедорожью.<br/>\n<br>Конструкция шин гарантирует отличное сцепление, сопротивление пробою и острой поверхности.<br/>\n<br>Вес шины: 3,4 кг<br/>\n<br>Индекс нагрузки: 60<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '130-80-12-60j--tl-mc19', NULL, NULL, 1, 0, 'f8fee2bb-325b-11e8-8192-ed790c9fa917'),
(130, 0, '', 0, 0, '120/70-14 55L TL MC28 DIAMOND S', NULL, '', '944955', 0, '<br>Шины Mitas - MC28 - всесезонные шины, сделаны специально для максискутеров.<br/>\n<br>Mitas MC28 обладают отличной продольной и угловой стабильностью. <br/>\n<br>Долговечная резиновая смесь выдерживает скоростные и весовые нагрузки и отлично держит дорогу в любую погоду.<br/>\n<br>Вес шины: 3,3 кг<br/>\n<br>Индекс нагрузки: 55<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-70-14-55l-tl-mc28-diamond-s', NULL, NULL, 1, 0, '05e03d7c-325c-11e8-8192-ed790c9fa917'),
(131, 0, '', 0, 0, '130/70-12 62P TL MC29 R.SPORTY 3+', NULL, '', '925803', 0, '<br>Шины Mitas - MC29 - cпортивные покрышки для скутеров.<br/>\n<br>Mitas MC29 обладают Крепким каркасом и боковинами для лучшей угловой стабильности, крупными плечевыми блоками для обеспечения сцепления и стабильности на экстремальных углах наклона, диагональными канавками для лучшего отвода воды.<br/>  \n<br>Особенности протектора шин Sava MC29 способствуют низкой шумности при движении.<br/>\n<br>Вес шины: 3,9 кг<br/>\n<br>Индекс нагрузки: 63<br/>\n<br>Страна производства: Словения<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '130-70-12-62p-tl-mc29-r-sporty-3-', NULL, NULL, 1, 0, 'f27ec2e1-325b-11e8-8192-ed790c9fa917'),
(132, 0, '', 0, 0, '120/80-14 58S MC38 MAX SCOOT TL', NULL, '', '950534', 0, '<br>Шины Mitas MC38 - Всесезонные покрышки для максискутера, подходящие как для сухой, так и влажной поверхности.<br/>\n<br>Современный рисунок протектора Mitas MC38 обеспечивает стабильность и комфорт на высоких скоростях и прекрасно отводит воду. Новый состав резины обеспечивает превосходное сцепление и длительный срок службы.<br/>\n<br>Вес шины: 4 кг<br/>\n<br>Индекс нагрузки: 58<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-80-14-58s-mc38-max-scoot-tl', NULL, NULL, 1, 0, '137b8042-325c-11e8-8192-ed790c9fa917'),
(133, 2, '2|1', 1, 0, '90/90-21M/C 54R C-17 TT', NULL, '', '878047', 0, '<br>Модель Mitas C-17 разработана для преимущественного использования по камням, горной местности. Данная моторезина предназначена для установки на переднюю ось.<br/>\n<br>Кроссовая моторезина Mitas C-17 одобрена для эксплуатации в соответствии с DOT EN, 80% по бездорожью, 20% на дорогах.<br/>\n<br>Вес шины: 3,6 кг<br/>\n<br>Индекс нагрузки: 54<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '90-90-21m-c-54r-c-17-tt', NULL, NULL, 1, 0, 'b1201bc5-325b-11e8-8192-ed790c9fa917'),
(134, 0, '', 0, 0, '140/70-14 68P TL MC28 REINF.', NULL, '', '915439', 0, '<br>Шины Sava MC28 - всесезонные шины, сделаны специально для максискутеров.\nSava MC28 обладают отличной продольной и угловой стабильностью. \nДолговечная резиновая смесь выдерживает скоростные и весовые нагрузки и отлично держит дорогу в любую погоду.\n<br>Вес шины: 4,3 кг<br/>\n<br>Индекс нагрузки: 68<br/>\n<br>Страна производства: Словения<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '140-70-14-68p-tl-mc28-reinf-', NULL, NULL, 1, 0, 'd941fa18-325b-11e8-8192-ed790c9fa917'),
(135, 2, '2|1', 1, 0, '100/90-19M/C 57M C-16 WIN FRIC TT', NULL, '', '881138', 0, '<br>Mitas C16 – модернизированная мотоциклетная покрышка от небезызвестного шинного гиганта из Европы. Она предназначается для маневренной езды по твердому дорожному полотну. Также вашему байку покорятся каменистые спуски и подъемы. Протектор имеет особенный узор. Он представляет собой совокупность массивных блоков, размещенных с определенными интервалами. Они были скрупулезно просчитаны в уникальной компьютерной программе для виртуального моделирования.<br/>\n<br>Резиновая смесь имеет особую прочность. Она дополнена новейшими полимерами, стойкими к абразивному и механическому стороннему воздействию.<br/>\n<br>Winter Friction - специальный вариант для использования в зимних условиях, подходит также для шипов.<br/>\n<br>Вес шины: 4,8 кг<br/>\n<br>Индекс нагрузки: 57<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '100-90-19m-c-57m-c-16-win-fric-tt', NULL, NULL, 1, 0, 'c523b989-325b-11e8-8192-ed790c9fa917'),
(136, 4, '4|1', 1, 0, '90/90-21M/C 54R E-09 TL', NULL, '', '926215', 0, '<br>Mitas E09 - подходит для пустынных и раллийных соревнований.<br/>\n<br>Протектор наделен эксклюзивным сочетанием элементов для совершенного сцепления на любой скорости. Благодаря прочной конструкции шины очень надежны, устойчивы к проколам.<br/>\n<br>Вес шины: 3,8 кг<br/>\n<br>Индекс нагрузки: 54<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '90-90-21m-c-54r-e-09-tl', NULL, NULL, 1, 0, 'f8fee3c7-325b-11e8-8192-ed790c9fa917'),
(137, 2, '2|1', 1, 0, '2.50-12 37M C-19 WINTER FRICTION TT', NULL, '', '915644', 0, '<br>Mitas C-19 разработана для преимущественного использования по гравию, камням, горной местности.<br/>\n<br>Кроссовые шины Mitas C-19 одобрены для эксплуатации в соответствии с DOT EN, 80% по бездорожью, 20% на дорогах.<br/>\n<br>Winter Friction - специальный вариант для использования в зимних условиях, подходит также для шипов.<br/>\n<br>Вес шины: 1,5 кг<br/>\n<br>Индекс нагрузки: 37<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '2-50-12-37m-c-19-winter-friction-tt', NULL, NULL, 1, 0, 'e5518ec7-325b-11e8-8192-ed790c9fa917'),
(138, 4, '4|1', 1, 0, '4.10-18M/C 60P E-09 TT', NULL, '', '881062', 0, '<br>Mitas E09 - подходит для пустынных и раллийных соревнований.<br/>\n<br>Протектор наделен эксклюзивным сочетанием элементов для совершенного сцепления на любой скорости. Благодаря прочной конструкции шины очень надежны, устойчивы к проколам.<br/>\n<br>Вес шины: 4,6 кг<br/>\n<br>Индекс нагрузки: 60<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '4-10-18m-c-60p-e-09-tt', NULL, NULL, 1, 0, 'b831b5bb-325b-11e8-8192-ed790c9fa917'),
(139, 2, '2|1', 1, 0, '90/100-16 51M C-20 WINTER FRICTION TT', NULL, '', '915663', 0, '<br>Mitas C20 представляет собой уникальную разработку именитого шинного концерна. Покрышка отличается универсальностью. Протектор обладает улучшенным узором, который без проблем справляется даже с нестабильными дорожными полотнами.<br/>\n<br>Благодаря суперкрепкому компаунду в разы повышается срок эксплуатации такого изделия. Шина обладает высоким европейским качеством. Она надежно защищена от механических повреждений и абразивного воздействия магистралей.<br/>\n<br>Winter Friction - специальный вариант для использования в зимних условиях, подходит также для шипов.<br/>\n<br>Вес шины: 3,7 кг<br/>\n<br>Индекс нагрузки: 51<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '90-100-16-51m-c-20-winter-friction-tt', NULL, NULL, 1, 0, 'e5518f61-325b-11e8-8192-ed790c9fa917'),
(140, 3, '3|1', 1, 0, '3.25-18M/C 59P REINF H-04 TT', NULL, '', '881011', 0, '<br>Mitas H04 – эталонная разработка для прогулочного мотоциклетного транспортного средства. Использовать изделие от маститого европейского бренда можно для любой оси вашего мотора. Протектор обладает великолепным ходовым узором. Он был сконструирован в программе виртуального трехмерного моделирования. Это позволило наделить центральную часть шины эффективной желобковой системой, которая демонстрирует отличную «цепкость» в любых ландшафтных условиях.<br/>\n<br>Reinforced - увеличенный индекс грузоподъемности(нагрузки) шины по E.T.R.T.O.<br/>\n<br>Вес шины: 3,2 кг<br/>\n<br>Индекс нагрузки: 59<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '3-25-18m-c-59p-reinf-h-04-tt', NULL, NULL, 1, 0, 'b1201c6a-325b-11e8-8192-ed790c9fa917'),
(141, 2, '2|1', 1, 0, '120/100-18 M/C 68M XT-946 TT', NULL, '', '881182', 0, '<br>Модель Mitas XT-946 разработана для преимущественного использования по камням, горной местности. Мотошины этой модели рекомендуется использовать на средне-мягких, средних грунтах.<br/>\n<br>Вес шины: 5,2 кг<br/>\n<br>Индекс нагрузки: 68<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-100-18-m-c-68m-xt-946-tt', NULL, NULL, 1, 0, 'cbbe1da6-325b-11e8-8192-ed790c9fa917'),
(142, 0, '', 0, 0, '2.50/3.00-12 JS87 90/90 BOX', NULL, '', '915181', 0, '<br>Камеры изготовлены из бутилкаучука и имеют следующие маркировки:<br/> \n<br><br/>\n<br>Mitas и SAVA<br/>\n<br><br/>\n<br>UHD - камера толщиной 4 мм для очень больших нагрузок<br/>\n<br>HD - камера толщиной 1,9-2,0 мм для больших нагрузок<br/>\n<br>Normal - камера толщиной 1,2-1,4 мм для не больших нагрузок, как правило устонавливаются на скутеры или малокубатурные мотоциклы<br/>\n<br>BOX - камера упакована в отдельную коробку<br/>\n<br>JS87, TR87, 90/90 - камера имеет изогнутый вентель<br/>\n<br>34G, TR6 - камера имеет прямой вентель<br/>\n<br><br/>\n<br>КАБАТ<br/>\n<br><br/>\n<br>HD - усиленные камеры для больших нагрузок<br/>\n<br>GP4(TR-4)(V1.09.1) - камера имеет прямой вентель<br/>\n<br>Все камеры марки КАБАТ не имеют упаковки<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '2-50-3-00-12-js87-90-90-box', NULL, NULL, 1, 0, 'd941f97a-325b-11e8-8192-ed790c9fa917'),
(143, 2, '2|1', 1, 0, '130/80-17M/C 65N C-02 TT', NULL, '', '881111', 0, '<br>Mitas C02 – прекрасные покрышки европейского производства с широким набором характеристик. Предназначается для задней оси мотоциклетных транспортных средств. Модель Mitas C-02 разработана для преимущественного использования по гравию, камням.<br/>\n<br>Резиновая смесь дополнена стойкими к абразивному износу полимерами.<br/>\n<br>Reinforced - увеличенный индекс грузоподъемности(нагрузки) шины по E.T.R.T.O.<br/>\n<br>Вес шины: 5,5 кг<br/>\n<br>Индекс нагрузки: 65<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '130-80-17m-c-65n-c-02-tt', NULL, NULL, 1, 0, 'befe4d64-325b-11e8-8192-ed790c9fa917'),
(144, 0, '', 0, 0, '140/70-16 65P TL MC38 MAX SCOOT', NULL, '', '945589', 0, '<br>Шины Mitas MC38 - Всесезонные покрышки для максискутера, подходящие как для сухой, так и влажной поверхности.<br/>\n<br>Современный рисунок протектора Mitas MC38 обеспечивает стабильность и комфорт на высоких скоростях и прекрасно отводит воду. Новый состав резины обеспечивает превосходное сцепление и длительный срок службы.<br/>\n<br>Вес шины: 4,8 кг<br/>\n<br>Индекс нагрузки: 65<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '140-70-16-65p-tl-mc38-max-scoot', NULL, NULL, 1, 0, '0ce5e279-325c-11e8-8192-ed790c9fa917'),
(145, 0, '', 0, 0, '110/90-13 56P TL MC28 DIAMOND S', NULL, '', '943301', 0, '<br>Шины Mitas - MC28 - всесезонные шины, сделаны специально для максискутеров.<br/>\n<br>Mitas MC28 обладают отличной продольной и угловой стабильностью. <br/>\n<br>Долговечная резиновая смесь выдерживает скоростные и весовые нагрузки и отлично держит дорогу в любую погоду.<br/>\n<br>Вес шины: 3,6 кг<br/>\n<br>Индекс нагрузки: 56<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-90-13-56p-tl-mc28-diamond-s', NULL, NULL, 1, 0, '05e03d14-325c-11e8-8192-ed790c9fa917'),
(146, 2, '2|1', 1, 0, '120/90-18 65M XT-754 SUPER LIGHT TT', NULL, '', '926995', 0, '<br>Mitas XT754 – безукоризненный вариант для вашего эндуро. Известный шинный гигант из Европы скрупулезно подбирал набор рабочих параметров для такого изделия. В результате миру была представлена совершенная разработка. Она наделена маневренностью и устойчивостью. Вы будете превосходно чувствовать свой байк даже на экстремальном вираже.<br>\n<br>Шина имеет бескомпромиссное качество. Резиновая смесь усовершенствована. Ее состав дополнен суперпрочными синтетическими компонентами.<br>\n<br>Super Light - протектор из особой смеси и легким каркасом для Enduro Extreme.<br/>\n<br>Вес шины: 5,4 кг<br/>\n<br>Индекс нагрузки: 65<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-90-18-65m-xt-754-super-light-tt', NULL, NULL, 1, 0, 'f8fee41d-325b-11e8-8192-ed790c9fa917'),
(147, 2, '2|1', 1, 0, '2.50-12 37J C-11 TT', NULL, '', '881096', 0, '<br>Mitas C11 – надежная мотоциклетная резина для любителей мотокросса. Изготовлена она европейским выдающимся брендом по трехмерной технологии. Благодаря этому все параметры идеально сбалансированы. Такая модель предназначается для установки на переднюю ось мототранспорта. Она сочетается с моделью C-10 для задней оси.<br/>\n<br>Для центральной части шины подобрана особая резиновая смесь. Она адаптирована для суровых мотокроссовых условий. Компаунд отличается эластичностью благодаря уникальным полимерам в составе. Шины демонстрирует феноменальную маневренность при пониженных температурах.<br/>\n<br>Вес шины: 1,4 кг<br/>\n<br>Индекс нагрузки: 37<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '2-50-12-37j-c-11-tt', NULL, NULL, 1, 0, 'b831b6fc-325b-11e8-8192-ed790c9fa917'),
(148, 2, '2|1', 1, 0, '100/90-19 57M C-28 TERRACROSS TT', NULL, '', '926993', 0, '<br>Mitas C28 представляет собой уникальную разработку именитого шинного концерна. Покрышка отличается универсальностью. Протектор обладает улучшенным узором, который без проблем справляется даже с нестабильными дорожными полотнами.<br/>\n<br>Дизайн протектора обеспечивает оптимальную производительность во всех режимах вождения.<br/>\n<br>Вес шины: 5,3 кг<br/>\n<br>Индекс нагрузки: 57<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '100-90-19-57m-c-28-terracross-tt', NULL, NULL, 1, 0, 'f8fee3ff-325b-11e8-8192-ed790c9fa917'),
(149, 2, '2|1', 1, 0, '80/100-21M/C 51R C-17 TT', NULL, '', '881157', 0, '<br>Модель Mitas C-17 разработана для преимущественного использования по камням, горной местности. Данная моторезина предназначена для установки на переднюю ось.<br/>\n<br>Кроссовая моторезина Mitas C-17 одобрена для эксплуатации в соответствии с DOT EN, 80% по бездорожью, 20% на дорогах.<br/>\n<br>Вес шины: 3,5 кг<br/>\n<br>Индекс нагрузки: 51<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '80-100-21m-c-51r-c-17-tt', NULL, NULL, 1, 0, 'c523ba71-325b-11e8-8192-ed790c9fa917'),
(150, 0, '', 0, 0, '80/80-14 53L TL/TT MC32 WIN SCOOT', NULL, '', '915516', 0, '<br>Шины Mitas MC32 WIN SCOOT - идеальный выбор для тех, кто использует свой мотоцикл или скутер зимой и в межсезонье.<br/>\n<br>Эти шины обладают высокими эксплутационными характеристиками при низких температурах, на снегу, льду и мокрой дороге.<br/>\n<br>Вес шины: 1,9 кг<br/>\n<br>Индекс нагрузки: 53<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '80-80-14-53l-tl-tt-mc32-win-scoot', NULL, NULL, 1, 0, 'df3e9abe-325b-11e8-8192-ed790c9fa917'),
(151, 4, '4|1', 1, 0, '100/90-19 57H TL MC30 INVADER', NULL, '', '945200', 0, '<br>Mitas MC30  - предназначены для всех типов дорог и минимального бездорожья.<br/>\n<br>Invader MC30 - мотошины для мотоциклов двойного назначения и туристических эндуро, ориентированные на езду по асфальту и дорогам с твердым покрытием. Обеспечивают отличную управляемость на мокрой дороге и легком бездорожье в любую погоду.<br/>\n<br>Вес шины: 4,5 кг<br/>\n<br>Индекс нагрузки: 57<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '100-90-19-57h-tl-mc30-invader', NULL, NULL, 1, 0, '0ce5e1eb-325c-11e8-8192-ed790c9fa917'),
(152, 4, '4|1', 1, 0, '140/80-18 M/C 70T E-07 TL', NULL, '', '885569', 0, '<br>Mitas E-07 специально создана для мотоциклов, которые эксплуатируются на любой дорожной поверхности. Отличительной особенностью этой модели является необычный протекторный рисунок, который обеспечивает повышенную устойчивость и уверенное управление на любой дорожной поверхности.<br/>\n<br>Вся поверхность шины покрыта необычными блоками, которые обеспечивают отличную устойчивость и управляемость. Оптимально подобранные расстояния между блоками предотвращают застревание камней в протекторе и повышают самоочищение. В плечевой зоне, блоки имеют другую форму, за счет этого достигается повышенная устойчивость при любых маневрах. Отличная курсовая устойчивость и быстрая обратная связь обеспечивается центральной частью протектора, где пересекаются блоки.<br/>\n<br>Вес шины: 7,7 кг<br/>\n<br>Индекс нагрузки: 70<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '140-80-18-m-c-70t-e-07-tl', NULL, NULL, 1, 0, 'd2e06808-325b-11e8-8192-ed790c9fa917'),
(153, 0, '', 0, 0, '140/70-14 68S TL MC38 REINF. MAX', NULL, '', '945207', 0, '<br>Шины Mitas MC38 - Всесезонные покрышки для максискутера, подходящие как для сухой, так и влажной поверхности.<br/>\n<br>Современный рисунок протектора Mitas MC38 обеспечивает стабильность и комфорт на высоких скоростях и прекрасно отводит воду. Новый состав резины обеспечивает превосходное сцепление и длительный срок службы.<br/>\n<br>Вес шины: 4,3 кг<br/>\n<br>Индекс нагрузки: 68<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '140-70-14-68s-tl-mc38-reinf--max', NULL, NULL, 1, 0, '0ce5e22c-325c-11e8-8192-ed790c9fa917'),
(154, 3, '3|1', 1, 0, '120/65ZR17 56W TL SPORTFORCE+', NULL, '', '939435', 0, '<br>Мотоциклетная шина Mitas SportForce+ является одним из флагманов модельного ряда известного чешского производителя. Об этом можно судить по технологиям, использованным в ее конструкции. Многие из них ранее применялись исключительно в мотоспорте, что лишний раз подтверждает высокую производительность данной модели, предназначенной для спортбайков. Мотоциклетная шина Mitas SportForce+ является одним из флагманов модельного ряда известного чешского производителя. Об этом можно судить по технологиям, использованным в ее конструкции. Многие из них ранее применялись исключительно в мотоспорте, что лишний раз подтверждает высокую производительность данной модели, предназначенной для спортбайков.<br/>\n<br>Особенности:<br/>\n<br>Оптимизированный дизайн дренажных канавок.<br/>\n<br>Протекторный рисунок Mitas SportForce+ содержит большое количество дренажных канавок. Эти элементы отличаются формой и расположением, специально подобранными не только с целью обеспечить максимальную устойчивость к аквапланированию. Они имеют значительную протяженность, будучи расположенными под острым углом относительно направления. В сочетании со сложной многоугольной формой их боковых стенок это позволяет шине чрезвычайно эффективно сопротивляться перегреву, отводя значительную часть тепла в окружающее пространство. Те же конструктивные особенности позволяют дренажным канавкам превосходно справляться с отводом воды от пятна контакта, обеспечивая шине хорошую устойчивость в дождливую погоду.<br/>\n<br>Жесткий каркас.<br/>\n<br>Еще одним нововведением данной модели является технология SCT. За этой аббревиатурой (Strong Carcass Technology) скрывается конструкция каркаса, корд которого намотан таким образом, что в нем отсутствуют какие-либо стыки и швы. В результате шина прекрасно сохраняет свою первоначальную форму даже при самом сильном воздействии разнонаправленных сил ускорения, обеспечивая быстрые и точные реакции на действия байкера. Еще одним преимуществом данной технологии является улучшившаяся устойчивость к неравномерному износу.<br/>\n<br>Основные особенности мотошины Mitas SportForce+<br/>\n<br>— оптимизированное расположение и форма дренажных канавок обеспечивает не только высокую устойчивость к аквапланированию, но и снижает уровень нагрева при движении на высокой скорости;<br/>\n<br>— жесткий каркас улучшает управляемость и устойчивость при прохождении поворотов, придает реакциям шины быстроту и точность;<br/>\n<br>— стабильные сцепные свойства в любых условиях благодаря использованию при разработке технологий компьютерного моделирования.<br/>\n<br>Конструкция: Радиальная<br/>\n<br>Индекс нагрузки: 56<br/>\n<br>Вес шины: 4,3 кг<br/>\n<br>Страна производства: Словения<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-65zr17-56w-tl-sportforce-', NULL, NULL, 1, 0, 'ff45d4cc-325b-11e8-8192-ed790c9fa917'),
(155, 3, '3|1', 1, 0, '80/90-17 44R TL MC25 BOGART', NULL, '', '926192', 0, '<br>Mitas C25 представляет собой уникальную разработку именитого шинного концерна. Покрышка отличается универсальностью. Протектор обладает улучшенным узором и хорошим сцеплением с дорогой.  \n\nДизайн протектора обеспечивает оптимальную производительность во всех режимах вождения.<br/>\n<br>Индекс нагрузки: 44<br/>\n<br>Вес шины: 2,7 кг<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '80-90-17-44r-tl-mc25-bogart', NULL, NULL, 1, 0, '1a053288-325c-11e8-8192-ed790c9fa917'),
(156, 3, '3|1', 1, 0, '130/70-17 62H TL MC50', NULL, '', '942323', 0, '<br>\"Mitas MC50 - это высокоскоростные шины диагональной конструкции. Шины Mitas MC50 используются в профессиональных мотогонках, отличаются хорошим сцеплением с дорогой и длительным сроком службы. Данная моторезина рекомендуется для спорта, супермото, мотоциклов с низким и средним объемом двигателя. Конструкция шин Mitas MC50 позволяет использовать их не только на гоночных трассах, но и в повседневной жизни. Mitas MC50 - многофункциональная шина с отличной производительностью на сухом дорожном покрытии и в то же время с отличной управляемостью на мокром. Жесткость боковой стенки обеспечивает стабильность шины на гоночных трассах.<br/>\n<br>Конструкция: Диагональная<br/>\n<br>Индекс нагрузки: 62<br/>\n<br>Вес шины: 5,9 кг<br/>\n<br>Страна производства: Словения<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '130-70-17-62h-tl-mc50', NULL, NULL, 1, 0, '05e03ce3-325c-11e8-8192-ed790c9fa917'),
(157, 0, '', 0, 0, '140/60-14 64S MC38 REINF.MAX S TL', NULL, '', '950533', 0, '<br>Шины Mitas MC38 - Всесезонные покрышки для максискутера, подходящие как для сухой, так и влажной поверхности.<br/>\n<br>Современный рисунок протектора Mitas MC38 обеспечивает стабильность и комфорт на высоких скоростях и прекрасно отводит воду. Новый состав резины обеспечивает превосходное сцепление и длительный срок службы.<br/>\n<br>Вес шины: 3,6 кг<br/>\n<br>Индекс нагрузки: 64<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '140-60-14-64s-mc38-reinf-max-s-tl', NULL, NULL, 1, 0, '137b8035-325c-11e8-8192-ed790c9fa917'),
(158, 0, '', 0, 0, '150/80-10 65L TL MC17', NULL, '', '924898', 0, '<br>Mitas MC17 - скутерная шина для захватывающей езды по внедорожью.<br/>\n<br>MКонструкция шин гарантирует отличное сцепление, сопротивление пробою и острой поверхности.<br/>\n<br>Вес шины: 3,5 кг<br/>\n<br>Индекс нагрузки: 65<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '150-80-10-65l-tl-mc17', NULL, NULL, 1, 0, 'f27ec18b-325b-11e8-8192-ed790c9fa917'),
(159, 4, '4|1', 1, 0, '110/80-19 M/C 59T E-07 DAKAR TL', NULL, '', '906766', 0, '<br>Mitas E-07 специально создана для мотоциклов, которые эксплуатируются на любой дорожной поверхности. Отличительной особенностью этой модели является необычный протекторный рисунок, который обеспечивает повышенную устойчивость и уверенное управление на любой дорожной поверхности.<br/>\n<br>Вся поверхность шины покрыта необычными блоками, которые обеспечивают отличную устойчивость и управляемость. Оптимально подобранные расстояния между блоками предотвращают застревание камней в протекторе и повышают самоочищение. В плечевой зоне, блоки имеют другую форму, за счет этого достигается повышенная устойчивость при любых маневрах. Отличная курсовая устойчивость и быстрая обратная связь обеспечивается центральной частью протектора, где пересекаются блоки.<br/>\n<br>Dakar - протектор с усиленным каркасом для экстремального вождения или гонок.<br/>\n<br>Вес шины: 5,3 кг<br/>\n<br>Индекс нагрузки: 59<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-80-19-m-c-59t-e-07-dakar-tl', NULL, NULL, 1, 0, 'd941f939-325b-11e8-8192-ed790c9fa917'),
(160, 3, '3|1', 1, 0, '90/90-19 (3.00-19) 52T H-14 TT', NULL, '', '915614', 0, '<br>Mitas H14 – высокотехнологичная мотопокрышка европейского производства. Отличительной особенностью изделия является протектор. Он получил безукоризненный узор. По центру располагается желобок для блистательной устойчивости при езде по прямолинейной траектории. По обе стороны от него размещены фигурные элементы из прямых канавок, которые пересекаются под острыми углами. Адгезионные свойства мотопокрышки от почтенного бренда – выше любых похвал! Модель может похвастаться совершенным набором ходовых способностей.<br/>\n<br>Вес шины: 3,1 кг<br/>\n<br>Индекс нагрузки: 52<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '90-90-19--3-00-19--52t-h-14-tt', NULL, NULL, 1, 0, 'df3e9b99-325b-11e8-8192-ed790c9fa917'),
(161, 0, '', 0, 0, '90/100-14 (3.60/4.10-14) TR6 HD BOX', NULL, '', '931134', 0, '<br>Камеры изготовлены из бутилкаучука и имеют следующие маркировки:<br/> \n<br><br/>\n<br>Mitas и SAVA<br/>\n<br><br/>\n<br>UHD - камера толщиной 4 мм для очень больших нагрузок<br/>\n<br>HD - камера толщиной 1,9-2,0 мм для больших нагрузок<br/>\n<br>Normal - камера толщиной 1,2-1,4 мм для не больших нагрузок, как правило устонавливаются на скутеры или малокубатурные мотоциклы<br/>\n<br>BOX - камера упакована в отдельную коробку<br/>\n<br>JS87, TR87, 90/90 - камера имеет изогнутый вентель<br/>\n<br>34G, TR6 - камера имеет прямой вентель<br/>\n<br><br/>\n<br>КАБАТ<br/>\n<br><br/>\n<br>HD - усиленные камеры для больших нагрузок<br/>\n<br>GP4(TR-4)(V1.09.1) - камера имеет прямой вентель<br/>\n<br>Все камеры марки КАБАТ не имеют упаковки<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '90-100-14--3-60-4-10-14--tr6-hd-box', NULL, NULL, 1, 0, 'ff45d3b3-325b-11e8-8192-ed790c9fa917'),
(162, 3, '3|1', 1, 0, '80/90-16M/C 48P REINF H-07 TT', NULL, '', '880997', 0, '<br>Mitas H07 – исключительная мотоциклетная резина для высокоскоростных моторов. Протектор отличается безупречным рисунком. Дорожные байки продемонстрируют с такими покрышками беспримерную маневренность! Компаунд адаптирован под ухоженные дорожные полотна, поэтому вы можете не переживать о быстром износе. Устанавливайте универсальную модель от европейского шинного гиганта на любую ось своего мотоцикла. Ламели имеют оригинальное сочетание с прямолинейными отверстиями. Благодаря этому изделием демонстрируется высокая адгезия и эксклюзивные ходовые характеристики. Reinforced - увеличенный индекс грузоподъемности(нагрузки) шины по E.T.R.T.O.<br/>\n<br>Вес шины: 2,6 кг<br/>\n<br>Индекс нагрузки: 48<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '80-90-16m-c-48p-reinf-h-07-tt', NULL, NULL, 1, 0, 'b1201c15-325b-11e8-8192-ed790c9fa917'),
(163, 0, '', 0, 0, '3.00-10 42J MC12 B TL/TT', NULL, '', '940641', 0, '<br>Вес шины: <br/>\n<br>Индекс нагрузки: 42<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '3-00-10-42j-mc12-b-tl-tt', NULL, NULL, 1, 0, '05e03bca-325c-11e8-8192-ed790c9fa917'),
(164, 0, '', 0, 0, '2.50/2.75-19 TR6 BOX T', NULL, '', '942304', 0, '<br>Камеры изготовлены из бутилкаучука и имеют следующие маркировки:<br/> \n<br><br/>\n<br>Mitas и SAVA<br/>\n<br><br/>\n<br>UHD - камера толщиной 4 мм для очень больших нагрузок<br/>\n<br>HD - камера толщиной 1,9-2,0 мм для больших нагрузок<br/>\n<br>Normal - камера толщиной 1,2-1,4 мм для не больших нагрузок, как правило устонавливаются на скутеры или малокубатурные мотоциклы<br/>\n<br>BOX - камера упакована в отдельную коробку<br/>\n<br>JS87, TR87, 90/90 - камера имеет изогнутый вентель<br/>\n<br>34G, TR6 - камера имеет прямой вентель<br/>\n<br><br/>\n<br>КАБАТ<br/>\n<br><br/>\n<br>HD - усиленные камеры для больших нагрузок<br/>\n<br>GP4(TR-4)(V1.09.1) - камера имеет прямой вентель<br/>\n<br>Все камеры марки КАБАТ не имеют упаковки<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '2-50-2-75-19-tr6-box-t', NULL, NULL, 1, 0, '05e03c5f-325c-11e8-8192-ed790c9fa917'),
(165, 2, '2|1', 1, 0, '120/90-18 65M C-12 ICE SOFT TT', NULL, '', '881127', 0, '<br>Mitas C12 – мотоциклетная шина от признанного производителя из Европы. Протектор конструировался в программе виртуального трехмерного моделирования. Поэтому совокупность всех его элементов имеет идеальное расположения. Канавки наделены нетрадиционной глубиной и наклоном. Все это сделано для безукоризненного сцепления на любых дорожных полотнах.<br/>\n<br>Компаунд получил от команды специалистов маститого бренда оригинальный состав. Благодаря этому обеспечивается эго беспрецедентная износостойкость.<br/>\n<br>Ice Soft - специальный вариант для Motoskijoring. Шина не теряет свою гибкость даже при низких температурах.<br/>\n<br>Вес шины: 5,4 кг<br/>\n<br>Индекс нагрузки: 65<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-90-18-65m-c-12-ice-soft-tt', NULL, NULL, 1, 0, 'befe4e33-325b-11e8-8192-ed790c9fa917'),
(166, 2, '2|1', 1, 0, '70/100-17 40M C-19 WINTER FRICTION TT', NULL, '', '915655', 0, '<br>Mitas C-19 разработана для преимущественного использования по гравию, камням, горной местности.<br/>\n<br>Кроссовые шины Mitas C-19 одобрены для эксплуатации в соответствии с DOT EN, 80% по бездорожью, 20% на дорогах.<br/>\n<br>Winter Friction - специальный вариант для использования в зимних условиях, подходит также для шипов.<br/>\n<br>Вес шины: 2,3 кг<br/>\n<br>Индекс нагрузки: 40<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '70-100-17-40m-c-19-winter-friction-tt', NULL, NULL, 1, 0, 'e5518f2d-325b-11e8-8192-ed790c9fa917'),
(167, 2, '2|1', 1, 0, '110/100-18 64R C-18 TT', NULL, '', '881121', 0, '<br>Mitas C18 – идеальная разработка для задней оси мототранспорта. Это вариант С17 для задней оси. Протектор имеет универсальный узор, позволяющий покрышке демонстрировать изумительные «цепные» показатели в любых дорожных условиях! Покоряйте своему мотору даже сыпучие грунты!<br/>\n<br>Моторезина отличается адаптированной под повышенные нагрузки конструкцией. Внутри шины давление распределяется за доли секунды. Благодаря этому происходит медленное и равномерное изнашивание. В такой «обуви» вы сможете отлично ездить в дождливую погоду, поскольку протектор обладает феноменальными дренажными показателями.<br/> \n<br>Вес шины: 5,7 кг<br/>\n<br>Индекс нагрузки: 64<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-100-18-64r-c-18-tt', NULL, NULL, 1, 0, 'befe4df7-325b-11e8-8192-ed790c9fa917'),
(168, 4, '4|1', 1, 0, '140/80-17M/C 69H E-08 TL', NULL, '', '881085', 0, '<br>Mitas E-08 подходит для грунтовых дорог и сухой пересеченной местности.<br/>\n<br>Протектор наделен специфическим рисунком, разработанным командой инженеров по трехмерной технологии. Благодаря этому вся совокупность элементов размещена со скрупулезно просчитанными интервалами. Таким образом, центральная часть шины обладает феноменальным сцепление. Оно будет продемонстрировано на дорожном полотне любого качества.<br/>\n<br>Вес шины: 7 кг<br/>\n<br>Индекс нагрузки: 69<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '140-80-17m-c-69h-e-08-tl', NULL, NULL, 1, 0, 'b831b692-325b-11e8-8192-ed790c9fa917'),
(169, 3, '3|1', 1, 0, '100/80-17 52H TL MC50', NULL, '', '943304', 0, '<br>\"Mitas MC50 - это высокоскоростные шины диагональной конструкции. Шины Mitas MC50 используются в профессиональных мотогонках, отличаются хорошим сцеплением с дорогой и длительным сроком службы. Данная моторезина рекомендуется для спорта, супермото, мотоциклов с низким и средним объемом двигателя. Конструкция шин Mitas MC50 позволяет использовать их не только на гоночных трассах, но и в повседневной жизни. Mitas MC50 - многофункциональная шина с отличной производительностью на сухом дорожном покрытии и в то же время с отличной управляемостью на мокром. Жесткость боковой стенки обеспечивает стабильность шины на гоночных трассах.<br/>\n<br>Конструкция: Диагональная<br/>\n<br>Индекс нагрузки: 52<br/>\n<br>Вес шины: 3,7 кг<br/>\n<br>Страна производства: Словения<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '100-80-17-52h-tl-mc50', NULL, NULL, 1, 0, '05e03d3b-325c-11e8-8192-ed790c9fa917'),
(170, 0, '', 0, 0, '21X7.00-10 B70 4PR TL', NULL, '', '915686', 0, '<br>Шины для квадроцикла Sava B70 - модель шин ATV, предназначенная для спортивного использования.<br/>\n<br>Квадратное расположение шашечек протектора шин Sava B70 обеспечивает однозначность реакций, а большие канавки между шашками - устойчивость на грунтовом треке.<br/>\n<br>Вес шины: 4,9 кг<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '21x7-00-10-b70-4pr-tl', NULL, NULL, 1, 0, 'e5518f9f-325b-11e8-8192-ed790c9fa917'),
(171, 2, '2|1', 1, 0, '110/90-19M/C 62M C-20 TT', NULL, '', '881146', 0, '<br>Mitas C20 представляет собой уникальную разработку именитого шинного концерна. Покрышка отличается универсальностью. Протектор обладает улучшенным узором, который без проблем справляется даже с нестабильными дорожными полотнами.<br/> \n<br>Благодаря суперкрепкому компаунду в разы повышается срок эксплуатации такого изделия. Шина обладает высоким европейским качеством. Она надежно защищена от механических повреждений и абразивного воздействия магистралей.<br/> \n<br>Вес шины: 5,6 кг<br/>\n<br>Индекс нагрузки: 62<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-90-19m-c-62m-c-20-tt', NULL, NULL, 1, 0, 'c523b9ee-325b-11e8-8192-ed790c9fa917'),
(172, 2, '2|1', 1, 0, '110/90-19 62N C-22 TT', NULL, '', '915651', 0, '<br>Mitas C-22 предназначены для установки на мопеды, скутеры и лёгкие мотоциклы.<br/>\n<br>Чётко выраженный протектор позволяет уверенно себя чувствовать при движении по песчаной или грунтовой дороге. Но и на дорогах с твердым покрытием покрышка надежно держит сцепление, препятствует вилянию и скольжению.<br/>\n<br>Вес шины: 10,56 кг<br/>\n<br>Индекс нагрузки: 62<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-90-19-62n-c-22-tt', NULL, NULL, 1, 0, 'e5518efa-325b-11e8-8192-ed790c9fa917'),
(173, 4, '4|1', 1, 0, '140/80B17 M/C 69T E-10 TL', NULL, '', '885897', 0, '<br>Mitas E10 - предназначены для всех типов дорог и умеренного бездорожья.<br/>\n<br>При разработке резиновой смеси использовалось огромное число новых компонентов, которые увеличили эксплуатационные качества шины Mitas E-10. Повысить износостойкие параметры помог кремний, за счет этого срок службы шину увеличился. Новая силика обеспечила резине повышенную эластичность, что положительно сказалось на сцеплении с влажным дорожным покрытием. Новая резиновая смесь позволила уменьшить сопротивление качению, что повысило устойчивость при движении на высоких скоростях.<br/>\n<br>Вес шины: 7,3 кг<br/>\n<br>Индекс нагрузки: 69<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '140-80b17-m-c-69t-e-10-tl', NULL, NULL, 1, 0, 'd2e06876-325b-11e8-8192-ed790c9fa917'),
(174, 0, '', 0, 0, '4.00-10C 69J (4PR) TL/TT B-14', NULL, '', '915376', 0, '<br>Mitas B14 обеспечивают отличную скоростную езду, водоотведение, маневренность.<br/>\n<br>Оригинальный рисунок протектора гарантирует высокие сцепные, тяговые и тормозные характеристики.<br/>\n<br>Вес шины: <br/>\n<br>Индекс нагрузки: 69<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '4-00-10c-69j--4pr--tl-tt-b-14', NULL, NULL, 1, 0, 'd941f9e5-325b-11e8-8192-ed790c9fa917'),
(175, 3, '3|1', 1, 0, '4.00-18M/C 64S H-06 TT', NULL, '', '881017', 0, '<br>Mitas H06 – великолепная всесезонная модель от европейского шинного гиганта. В абсолютно любую погоду вы сможете комфортно себя чувствовать за рулем своего транспортного средства. Такая универсальность делает шину данной модели превосходным вариантом для любителей долговременных путешествий. Покрышка рассчитана для установки на любую ось. Протектор имеет оригинальный узор, состоящий из прямых и криволинейных элементов. Reinforced - увеличенный индекс грузоподъемности(нагрузки) шины по E.T.R.T.O.<br/>\n<br>Вес шины: 4,7 кг<br/>\n<br>Индекс нагрузки: 71<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '4-00-18m-c-64s-h-06-tt', NULL, NULL, 1, 0, 'b1201c9a-325b-11e8-8192-ed790c9fa917'),
(176, 0, '', 0, 0, '130/60-13 60P TL MC29 R.SPORTY 3+', NULL, '', '925800', 0, '<br>Шины Mitas - MC29 - cпортивные покрышки для скутеров.<br/>\n<br>Mitas MC29 обладают Крепким каркасом и боковинами для лучшей угловой стабильности, крупными плечевыми блоками для обеспечения сцепления и стабильности на экстремальных углах наклона, диагональными канавками для лучшего отвода воды.<br/>  \n<br>Особенности протектора шин Sava MC29 способствуют низкой шумности при движении.<br/>\n<br>Вес шины: 3,1 кг<br/>\n<br>Индекс нагрузки: 60<br/>\n<br>Страна производства: Словения<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '130-60-13-60p-tl-mc29-r-sporty-3-', NULL, NULL, 1, 0, 'f27ec2d4-325b-11e8-8192-ed790c9fa917'),
(177, 0, '', 0, 0, '140/70-14 68S TL MC38 REINF. MAX', NULL, '', '915559', 0, '<br>Шины Sava MC38 - Всесезонные покрышки для максискутера, подходящие как для сухой, так и влажной поверхности.<br/>\n<br>Современный рисунок протектора Sava MC38 обеспечивает стабильность и комфорт на высоких скоростях и прекрасно отводит воду. Новый состав резины обеспечивает превосходное сцепление и длительный срок службы.<br/>\n<br>Вес шины: 4,4 кг<br/>\n<br>Индекс нагрузки: 68<br/>\n<br>Страна производства: Словения<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '140-70-14-68s-tl-mc38-reinf--max', NULL, NULL, 1, 0, 'df3e9b25-325b-11e8-8192-ed790c9fa917'),
(178, 4, '4|1', 1, 0, '140/80B18 M/C 70T E-10 TL', NULL, '', '885899', 0, '<br>Mitas E10 - предназначены для всех типов дорог и умеренного бездорожья.<br/>\n<br>При разработке резиновой смеси использовалось огромное число новых компонентов, которые увеличили эксплуатационные качества шины Mitas E-10. Повысить износостойкие параметры помог кремний, за счет этого срок службы шину увеличился. Новая силика обеспечила резине повышенную эластичность, что положительно сказалось на сцеплении с влажным дорожным покрытием. Новая резиновая смесь позволила уменьшить сопротивление качению, что повысило устойчивость при движении на высоких скоростях.<br/>\n<br>Вес шины: 8,1 кг<br/>\n<br>Индекс нагрузки: 70<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '140-80b18-m-c-70t-e-10-tl', NULL, NULL, 1, 0, 'd2e06883-325b-11e8-8192-ed790c9fa917');
INSERT INTO `parf_goods` (`id`, `default_category_id`, `category_ids`, `parent_category`, `brand_id`, `name_1`, `name_2`, `name_in_cyrillic`, `vendor_code`, `vendor_code_id`, `description`, `price`, `existence`, `new`, `sex`, `flavors_group`, `top_note`, `heart_note`, `base_note`, `perfumer`, `collection`, `series`, `country`, `release`, `rating`, `number_of_votes`, `meta_title`, `meta_description`, `meta_keywords`, `rewrite`, `related`, `recommended`, `active`, `count_show`, `id_import`) VALUES
(179, 0, '', 0, 0, '120/80-16 60P MC38 MAX SCOOT TL', NULL, '', '950532', 0, '<br>Шины Mitas MC38 - Всесезонные покрышки для максискутера, подходящие как для сухой, так и влажной поверхности.<br/>\n<br>Современный рисунок протектора Mitas MC38 обеспечивает стабильность и комфорт на высоких скоростях и прекрасно отводит воду. Новый состав резины обеспечивает превосходное сцепление и длительный срок службы.<br/>\n<br>Вес шины: 4,7 кг<br/>\n<br>Индекс нагрузки: 60<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-80-16-60p-mc38-max-scoot-tl', NULL, NULL, 1, 0, '137b8028-325c-11e8-8192-ed790c9fa917'),
(180, 2, '2|1', 1, 0, '80/100-21 M/C 51R XT-994 WIN FRIC TT', NULL, '', '881201', 0, '<br>Основной сферой применения мотоциклетной шины Mitas XT-994 являются тяжелые и каменистые грунты, где она демонстрирует все свои сильные стороны, будучи установленной на переднее колесо мотоцикла категории мотокросс либо эндуро.<br/>\n<br>Данную модель выгодно отличает открытый дизайн протекторного рисунка, отличная курсовая устойчивость, очень продолжительный срок службы и великолепная надежность.<br/>\n<br>Также нельзя не отметить возможность эксплуатации на дорогах общего пользования. Об этом свидетельствует наличие сертификатов, удостоверяющих соответствие данной модели требованиям DOT и E75.<br/>\n<br>Winter Friction - специальный вариант для использования в зимних условиях, подходит также для шипов.<br/>\n<br>Вес шины: 4,5 кг<br/>\n<br>Индекс нагрузки: 51<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '80-100-21-m-c-51r-xt-994-win-fric-tt', NULL, NULL, 1, 0, 'cbbe1e4b-325b-11e8-8192-ed790c9fa917'),
(181, 4, '4|1', 1, 0, '140/80R17 TERRAFORCE-R 69V TL', NULL, '', '939383', 0, '<br>Радиальная шина двойного назначения с протектором, ориентированным в основном для города, предоставляет отличное сцепление как на сухом, так и мокром асфальте, а также на сухом грунте и гравии. Мотошина Terra Force-R представляет собой удачно улучшенную модель MC30 c фокусом на долговечность и стабильные показатели на протяжении всего срока службы. Оптимальное размещение блоков рисунка протектора, способствует отличному сцеплению с дорогой и прямолинейности езды.<br/>\n<br>Конструкция: Радиальная<br/>\n<br>Индекс нагрузки: 59<br/>\n<br>Вес шины: 6,4 кг<br/>\n<br>Страна производства: Словения<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '140-80r17-terraforce-r-69v-tl', NULL, NULL, 1, 0, 'ff45d48b-325b-11e8-8192-ed790c9fa917'),
(182, 2, '2|1', 1, 0, '110/100-18M/C 64M C-16 WIN FRIC TT', NULL, '', '881120', 0, '<br>Mitas C16 – модернизированная мотоциклетная покрышка от небезызвестного шинного гиганта из Европы. Она предназначается для маневренной езды по твердому дорожному полотну. Также вашему байку покорятся каменистые спуски и подъемы. Протектор имеет особенный узор. Он представляет собой совокупность массивных блоков, размещенных с определенными интервалами. Они были скрупулезно просчитаны в уникальной компьютерной программе для виртуального моделирования.<br/>\n<br>Резиновая смесь имеет особую прочность. Она дополнена новейшими полимерами, стойкими к абразивному и механическому стороннему воздействию.<br/>\n<br>Winter Friction - специальный вариант для использования в зимних условиях, подходит также для шипов.<br/>\n<br>Вес шины: 5,5 кг<br/>\n<br>Индекс нагрузки: 64<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-100-18m-c-64m-c-16-win-fric-tt', NULL, NULL, 1, 0, 'befe4dea-325b-11e8-8192-ed790c9fa917'),
(183, 3, '3|1', 1, 0, '130/70-17 62H TL MC50 R.SOFT', NULL, '', '944948', 0, '<br>Mitas MC50 - это высокоскоростные шины диагональной конструкции. Шины Mitas MC50 используются в профессиональных мотогонках, отличаются хорошим сцеплением с дорогой и длительным сроком службы. Данная моторезина рекомендуется для спорта, супермото, мотоциклов с низким и средним объемом двигателя. Конструкция шин Mitas MC50 позволяет использовать их не только на гоночных трассах, но и в повседневной жизни. Mitas MC50 - многофункциональная шина с отличной производительностью на сухом дорожном покрытии и в то же время с отличной управляемостью на мокром. Жесткость боковой стенки обеспечивает стабильность шины на гоночных трассах.<br/>\n<br>Racing Soft – для вождения в теплую погоду по умеренно гладкой поверхности<br/>\n<br>Конструкция: Диагональная<br/>\n<br>Индекс нагрузки: 62<br/>\n<br>Вес шины: 5,5 кг<br/>\n<br>Страна производства: Словения<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '130-70-17-62h-tl-mc50-r-soft', NULL, NULL, 1, 0, '1a0532d6-325c-11e8-8192-ed790c9fa917'),
(184, 2, '2|1', 1, 0, '120/90-18 65M C-10 TT COUNTRY CROSS', NULL, '', '884386', 0, '<br>Mitas C10 – великолепная разработка знаменитого европейского шинного гиганта. Неординарная конструкция покрышки позволяет продуктивно использовать ее в любых дорожных условиях! С такой «обувью» вы непременно станете «королем» твердого дорожного полотна, неустойчивого покрытия, сыпучих грунтов, пересеченной местности. Ваш мотокросс-байк сможет продемонстрировать с качественными европейскими покрышками весь свой потенциал!<br/>\n<br>Моторезина отличается адаптированной под повышенные нагрузки конструкцией. Внутри шины давление распределяется за доли секунды. Благодаря этому происходит медленное и равномерное изнашивание. В такой «обуви» вы сможете отлично ездить в дождливую погоду, поскольку протектор обладает феноменальными дренажными показателями.<br/>\n<br>Country Cross - мотокросс шины из смеси для гоночных шин Enduro, подходят для гонок Cross Country.<br/>\n<br>Вес шины: 5,2 кг<br/>\n<br>Индекс нагрузки: 65<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-90-18-65m-c-10-tt-country-cross', NULL, NULL, 1, 0, 'cbbe1ec8-325b-11e8-8192-ed790c9fa917'),
(185, 4, '4|1', 1, 0, '140/80B18 M/C 70T E-10 DAKAR TL', NULL, '', '885583', 0, '<br>Mitas E10 - предназначены для всех типов дорог и умеренного бездорожья.<br/>\n<br>При разработке резиновой смеси использовалось огромное число новых компонентов, которые увеличили эксплуатационные качества шины Mitas E-10. Повысить износостойкие параметры помог кремний, за счет этого срок службы шину увеличился. Новая силика обеспечила резине повышенную эластичность, что положительно сказалось на сцеплении с влажным дорожным покрытием. Новая резиновая смесь позволила уменьшить сопротивление качению, что повысило устойчивость при движении на высоких скоростях.<br/>\n<br>Dakar - протектор с усиленным каркасом дляэкстремального вождения или гонок.<br/>\n<br>Вес шины: 8,1 кг<br/>\n<br>Индекс нагрузки: 70<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '140-80b18-m-c-70t-e-10-dakar-tl', NULL, NULL, 1, 0, 'd2e06869-325b-11e8-8192-ed790c9fa917'),
(186, 0, '', 0, 0, '120/90-10 57L TL MC29 SPORTY 3+', NULL, '', '925777', 0, '<br>Шины Mitas - MC29 - cпортивные покрышки для скутеров.\n\nMitas MC29 обладают Крепким каркасом и боковинами для лучшей угловой стабильности, крупными плечевыми блоками для обеспечения сцепления и стабильности на экстремальных углах наклона, диагональными канавками для лучшего отвода воды.\n\nОсобенности протектора шин Sava MC29 способствуют низкой шумности при движении.<br/>\n<br>Индекс нагрузки: 57<br/>\n<br>Вес шины: 3,5 кг<br/>\n<br>Страна производства: Словения<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-90-10-57l-tl-mc29-sporty-3-', NULL, NULL, 1, 0, '137b8183-325c-11e8-8192-ed790c9fa917'),
(187, 3, '3|1', 1, 0, '3.00-19 M/C 57P H-02 TT', NULL, '', '920509', 0, '<br>Дорожная моторезина Mitas H-02 обладает универсальным рисунком протектора, который подходит для задних и передних колес мотоцикла. При установке сразу двух шин вам гарантированы феноменальные сцепные показатели на любых ландшафтах. Исключительные пропорции каркаса делают покрышку невероятно управляемой. Такая модель станет безукоризненным вариантом для тех, кто желает подобрать лучшую «обувь» для своего байка.<br/>\n<br>Данная моторезина наиболее подходит для классических и ретро-мотоциклов.<br/>\n<br>Вес шины: 3,5 кг<br/>\n<br>Индекс нагрузки: 57<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '3-00-19-m-c-57p-h-02-tt', NULL, NULL, 1, 0, 'ec3eec94-325b-11e8-8192-ed790c9fa917'),
(188, 3, '3|1', 1, 0, '120/70ZR17 58W TL SPORTFORCE+', NULL, '', '920514', 0, '<br>Мотоциклетная шина Mitas SportForce+ является одним из флагманов модельного ряда известного чешского производителя. Об этом можно судить по технологиям, использованным в ее конструкции. Многие из них ранее применялись исключительно в мотоспорте, что лишний раз подтверждает высокую производительность данной модели, предназначенной для спортбайков. Мотоциклетная шина Mitas SportForce+ является одним из флагманов модельного ряда известного чешского производителя. Об этом можно судить по технологиям, использованным в ее конструкции. Многие из них ранее применялись исключительно в мотоспорте, что лишний раз подтверждает высокую производительность данной модели, предназначенной для спортбайков.<br/>\n<br>Особенности:<br/>\n<br>Оптимизированный дизайн дренажных канавок.<br/>\n<br>Протекторный рисунок Mitas SportForce+ содержит большое количество дренажных канавок. Эти элементы отличаются формой и расположением, специально подобранными не только с целью обеспечить максимальную устойчивость к аквапланированию. Они имеют значительную протяженность, будучи расположенными под острым углом относительно направления. В сочетании со сложной многоугольной формой их боковых стенок это позволяет шине чрезвычайно эффективно сопротивляться перегреву, отводя значительную часть тепла в окружающее пространство. Те же конструктивные особенности позволяют дренажным канавкам превосходно справляться с отводом воды от пятна контакта, обеспечивая шине хорошую устойчивость в дождливую погоду.<br/>\n<br>Жесткий каркас.<br/>\n<br>Еще одним нововведением данной модели является технология SCT. За этой аббревиатурой (Strong Carcass Technology) скрывается конструкция каркаса, корд которого намотан таким образом, что в нем отсутствуют какие-либо стыки и швы. В результате шина прекрасно сохраняет свою первоначальную форму даже при самом сильном воздействии разнонаправленных сил ускорения, обеспечивая быстрые и точные реакции на действия байкера. Еще одним преимуществом данной технологии является улучшившаяся устойчивость к неравномерному износу.<br/>\n<br>Основные особенности мотошины Mitas SportForce+<br/>\n<br>— оптимизированное расположение и форма дренажных канавок обеспечивает не только высокую устойчивость к аквапланированию, но и снижает уровень нагрева при движении на высокой скорости;<br/>\n<br>— жесткий каркас улучшает управляемость и устойчивость при прохождении поворотов, придает реакциям шины быстроту и точность;<br/>\n<br>— стабильные сцепные свойства в любых условиях благодаря использованию при разработке технологий компьютерного моделирования.<br/>\n<br>Конструкция: Радиальная<br/>\n<br>Индекс нагрузки: 58<br/>\n<br>Вес шины: 4,6 кг<br/>\n<br>Страна производства: Словения<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-70zr17-58w-tl-sportforce-', NULL, NULL, 1, 0, 'ec3eecda-325b-11e8-8192-ed790c9fa917'),
(189, 0, '', 0, 0, '120/90-10 57L TL MC20 MONSUM', NULL, '', '922533', 0, '<br>Шины Sava MC20 - всепогодные шины для скутеров. Отличная управляемость и долгий срок службы.<br/>\n<br>Эксклюзивная по составу резиновая смесь стойко справляется с абразивным воздействием асфальтного полотна.<br/>\n<br>Вес шины: 3,4 кг<br/>\n<br>Индекс нагрузки: 57<br/>\n<br>Страна производства: Словения<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-90-10-57l-tl-mc20-monsum', NULL, NULL, 1, 0, 'ec3eed34-325b-11e8-8192-ed790c9fa917'),
(190, 3, '3|1', 1, 0, '2.75-16M/C 46P REINF H-06 TT', NULL, '', '880996', 0, '<br>Mitas H06 – великолепная всесезонная модель от европейского шинного гиганта. В абсолютно любую погоду вы сможете комфортно себя чувствовать за рулем своего транспортного средства. Такая универсальность делает шину данной модели превосходным вариантом для любителей долговременных путешествий. Покрышка рассчитана для установки на любую ось. Протектор имеет оригинальный узор, состоящий из прямых и криволинейных элементов. Reinforced - увеличенный индекс грузоподъемности(нагрузки) шины по E.T.R.T.O.<br/> \n<br>Вес шины: 2,3 кг<br/>\n<br>Индекс нагрузки: 46<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '2-75-16m-c-46p-reinf-h-06-tt', NULL, NULL, 1, 0, 'b1201c09-325b-11e8-8192-ed790c9fa917'),
(191, 0, '', 0, 0, '150/70-13 64S MC28 DIAMOND S TL', NULL, '', '950523', 0, '<br>Шины Mitas - MC28 - всесезонные шины, сделаны специально для максискутеров.<br/>\n<br>Mitas MC28 обладают отличной продольной и угловой стабильностью. <br/>\n<br>Долговечная резиновая смесь выдерживает скоростные и весовые нагрузки и отлично держит дорогу в любую погоду.<br/>\n<br>Вес шины: 4,8 кг<br/>\n<br>Индекс нагрузки: 64<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '150-70-13-64s-mc28-diamond-s-tl', NULL, NULL, 1, 0, '0ce5e2ec-325c-11e8-8192-ed790c9fa917'),
(192, 0, '', 0, 0, '110/70-11 45L TL MC20 MONSUM', NULL, '', '915464', 0, '<br>Шины Sava MC20 - всепогодные шины для скутеров. Отличная управляемость и долгий срок службы.<br/>\n<br>Эксклюзивная по составу резиновая смесь стойко справляется с абразивным воздействием асфальтного полотна.<br/>\n<br>Вес шины: 2,4 кг<br/>\n<br>Индекс нагрузки: 45<br/>\n<br>Страна производства: Словения<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-70-11-45l-tl-mc20-monsum', NULL, NULL, 1, 0, 'df3e9a4d-325b-11e8-8192-ed790c9fa917'),
(193, 0, '', 0, 0, '80/80-16 46M TL/TT MC26 REINF.', NULL, '', '942318', 0, '<br>Летние мотоциклетные шины Mitas MC26 обеспечивают прекрасные сцепно-тормозные качества, что является важным показателем при скоростной езде на мотоциклах и скутерах.<br/>\n<br>Протекторный рисунок и усовершенствованная резиновая композиция обеспечивает курсовую устойчивость и отличные показатели при вхождении в повороты.<br/>\n<br>Еще одним достоинством данной модели является долговечность.<br/>\n<br>Reinforced - увеличенный индекс грузоподъемности(нагрузки) шины по E.T.R.T.O.<br/>\n<br>Вес шины: 2,4 кг<br/>\n<br>Индекс нагрузки: 46<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '80-80-16-46m-tl-tt-mc26-reinf-', NULL, NULL, 1, 0, '05e03ca3-325c-11e8-8192-ed790c9fa917'),
(194, 4, '4|1', 1, 0, '4.10-18M/C 60P E-08 TT', NULL, '', '881060', 0, '<br>Mitas E-08 подходит для грунтовых дорог и сухой пересеченной местности.<br/>\n<br>Протектор наделен специфическим рисунком, разработанным командой инженеров по трехмерной технологии. Благодаря этому вся совокупность элементов размещена со скрупулезно просчитанными интервалами. Таким образом, центральная часть шины обладает феноменальным сцепление. Оно будет продемонстрировано на дорожном полотне любого качества.<br/>\n<br>Вес шины: 4,6 кг<br/>\n<br>Индекс нагрузки: 60<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '4-10-18m-c-60p-e-08-tt', NULL, NULL, 1, 0, 'b831b5af-325b-11e8-8192-ed790c9fa917'),
(195, 2, '2|1', 1, 0, '70/100-17 40M C-19 TT', NULL, '', '881110', 0, '<br>Mitas C-19 разработана для преимущественного использования по гравию, камням, горной местности.<br/>\n<br>Кроссовые шины Mitas C-19 одобрены для эксплуатации в соответствии с DOT EN, 80% по бездорожью, 20% на дорогах.<br/>\n<br>Вес шины: 2,2 кг<br/>\n<br>Индекс нагрузки: 40<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '70-100-17-40m-c-19-tt', NULL, NULL, 1, 0, 'befe4d55-325b-11e8-8192-ed790c9fa917'),
(196, 0, '', 0, 0, '120/70-15 56P MC28 TL', NULL, '', '950525', 0, '<br>Шины Mitas - MC28 - всесезонные шины, сделаны специально для максискутеров.<br/>\n<br>Mitas MC28 обладают отличной продольной и угловой стабильностью. <br/>\n<br>Долговечная резиновая смесь выдерживает скоростные и весовые нагрузки и отлично держит дорогу в любую погоду.<br/>\n<br>Вес шины: 3,6<br/>\n<br>Индекс нагрузки: 56<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-70-15-56p-mc28-tl', NULL, NULL, 1, 0, '0ce5e306-325c-11e8-8192-ed790c9fa917'),
(197, 0, '', 0, 0, '100/80-10 56J TL/TT MC6', NULL, '', '942322', 0, '<br>Mitas MC6 обеспечивают прекрасные сцепно-тормозные качества, что является важным показателем при скоростной езде на скутерах.<br/>\n<br>Протекторный рисунок и усовершенствованная резиновая композиция обеспечивает курсовую устойчивость и отличные показатели при вхождении в повороты.<br/>\n<br>Еще одним достоинством данной модели является долговечность.<br/>\n<br>Reinforced - увеличенный индекс грузоподъемности(нагрузки) шины по E.T.R.T.O.<br/>\n<br>Вес шины: 1,9 кг<br/>\n<br>Индекс нагрузки: 56<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '100-80-10-56j-tl-tt-mc6', NULL, NULL, 1, 0, '05e03cd6-325c-11e8-8192-ed790c9fa917'),
(198, 2, '2|1', 1, 0, '120/90-18 M/C 65P XT-754 TT', NULL, '', '881180', 0, '<br>Mitas XT754 – безукоризненный вариант для вашего эндуро. Известный шинный гигант из Европы скрупулезно подбирал набор рабочих параметров для такого изделия. В результате миру была представлена совершенная разработка. Она наделена маневренностью и устойчивостью. Вы будете превосходно чувствовать свой байк даже на экстремальном вираже.<br/>\n<br>Шина имеет бескомпромиссное качество. Резиновая смесь усовершенствована. Ее состав дополнен суперпрочными синтетическими компонентами.<br/>\n<br>Вес шины: 5,5 кг<br/>\n<br>Индекс нагрузки: 65<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-90-18-m-c-65p-xt-754-tt', NULL, NULL, 1, 0, 'cbbe1d97-325b-11e8-8192-ed790c9fa917'),
(199, 2, '2|1', 1, 0, '90/100-20 56R C-21 TT', NULL, '', '881154', 0, '<br>Mitas C21 создавались признанным шинником на основе высоких технологий, которые только начинают использоваться в отрасли. В результате шина может похвастаться эксклюзивным сочетанием ходовых параметров.<br/>\n<br>Компаунд был специально усовершенствован для этой модели. В него включены особые компоненты для непревзойденной прочности.<br/>\n<br>Вес шины: 3,6 кг<br/>\n<br>Индекс нагрузки: 51<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '90-100-20-56r-c-21-tt', NULL, NULL, 1, 0, 'c523ba62-325b-11e8-8192-ed790c9fa917'),
(200, 0, '', 0, 0, '11x7.10-5 SRB', NULL, '', '941641', 0, '<br>Средне-мягкие шины для соревнований.<br/>\n<br>Подходят для езды как под открытым небом, так и в закрытых помещениях, долгий срок службы при высоких температурах, подходят также для езды на прокатных картах.<br/>\n<br>Вес шины: 1,9 кг<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '11x7-10-5-srb', NULL, NULL, 1, 0, '05e03c31-325c-11e8-8192-ed790c9fa917'),
(201, 4, '4|1', 1, 0, '130/80-18M/C 72R REINF E-09 DAKAR TL', NULL, '', '925815', 0, '<br>Mitas E09 - подходит для пустынных и раллийных соревнований.<br/>\n<br>Протектор наделен эксклюзивным сочетанием элементов для совершенного сцепления на любой скорости. Благодаря прочной конструкции шины очень надежны, устойчивы к проколам.<br/>\n<br>Dakar - протектор с усиленным каркасом дляэкстремального вождения или гонок.<br/>\n<br>Вес шины: 6,5 кг<br/>\n<br>Индекс нагрузки: 72<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '130-80-18m-c-72r-reinf-e-09-dakar-tl', NULL, NULL, 1, 0, 'f8fee2e2-325b-11e8-8192-ed790c9fa917'),
(202, 0, '', 0, 0, '100/90-17-110/90-17 (3.00/3.50-17)TR6 HD', NULL, '', '947321', 0, '<br>Камеры изготовлены из бутилкаучука и имеют следующие маркировки:<br/> \n<br><br/>\n<br>Mitas и SAVA<br/>\n<br><br/>\n<br>UHD - камера толщиной 4 мм для очень больших нагрузок<br/>\n<br>HD - камера толщиной 1,9-2,0 мм для больших нагрузок<br/>\n<br>Normal - камера толщиной 1,2-1,4 мм для не больших нагрузок, как правило устонавливаются на скутеры или малокубатурные мотоциклы<br/>\n<br>BOX - камера упакована в отдельную коробку<br/>\n<br>JS87, TR87, 90/90 - камера имеет изогнутый вентель<br/>\n<br>34G, TR6 - камера имеет прямой вентель<br/>\n<br><br/>\n<br>КАБАТ<br/>\n<br><br/>\n<br>HD - усиленные камеры для больших нагрузок<br/>\n<br>GP4(TR-4)(V1.09.1) - камера имеет прямой вентель<br/>\n<br>Все камеры марки КАБАТ не имеют упаковки<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '100-90-17-110-90-17--3-00-3-50-17-tr6-hd', NULL, NULL, 1, 0, '0ce5e2c3-325c-11e8-8192-ed790c9fa917'),
(203, 4, '4|1', 1, 0, '4.50-18 M/C 62M XT-644 ARMY TT', NULL, '', '881193', 0, '<br>XT-644 - универсальная покрышка для магистралей любого качества и нестабильного дорожного полотна за городом.<br/>\n<br>Шина демонстрирует изумительную устойчивость в любом скоростном режиме.<br/>\n<br>Вес шины: 5,9 кг<br/>\n<br>Индекс нагрузки: 62<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '4-50-18-m-c-62m-xt-644-army-tt', NULL, NULL, 1, 0, 'cbbe1e00-325b-11e8-8192-ed790c9fa917'),
(204, 2, '2|1', 1, 0, '2.75-10 37M C-20 TT', NULL, '', '881095', 0, '<br>Mitas C20 представляет собой уникальную разработку именитого шинного концерна. Покрышка отличается универсальностью. Протектор обладает улучшенным узором, который без проблем справляется даже с нестабильными дорожными полотнами.<br/> \n<br>Благодаря суперкрепкому компаунду в разы повышается срок эксплуатации такого изделия. Шина обладает высоким европейским качеством. Она надежно защищена от механических повреждений и абразивного воздействия магистралей.<br/> \n<br>Вес шины: 1,5 кг<br/>\n<br>Индекс нагрузки: 37<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '2-75-10-37m-c-20-tt', NULL, NULL, 1, 0, 'b831b6ee-325b-11e8-8192-ed790c9fa917'),
(205, 0, '', 0, 0, '90/90-//80/100-21 BOX UHD 4MM TR6 T', NULL, '', '938304', 0, '<br>Камеры изготовлены из бутилкаучука и имеют следующие маркировки:<br/> \n<br><br/>\n<br>Mitas и SAVA<br/>\n<br><br/>\n<br>UHD - камера толщиной 4 мм для очень больших нагрузок<br/>\n<br>HD - камера толщиной 1,9-2,0 мм для больших нагрузок<br/>\n<br>Normal - камера толщиной 1,2-1,4 мм для не больших нагрузок, как правило устонавливаются на скутеры или малокубатурные мотоциклы<br/>\n<br>BOX - камера упакована в отдельную коробку<br/>\n<br>JS87, TR87, 90/90 - камера имеет изогнутый вентель<br/>\n<br>34G, TR6 - камера имеет прямой вентель<br/>\n<br><br/>\n<br>КАБАТ<br/>\n<br><br/>\n<br>HD - усиленные камеры для больших нагрузок<br/>\n<br>GP4(TR-4)(V1.09.1) - камера имеет прямой вентель<br/>\n<br>Все камеры марки КАБАТ не имеют упаковки<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '90-90---80-100-21-box-uhd-4mm-tr6-t', NULL, NULL, 1, 0, 'ff45d40e-325b-11e8-8192-ed790c9fa917'),
(206, 3, '3|1', 1, 0, '4.00-18 (110/90-18) 64T H-15 TT', NULL, '', '915613', 0, '<br>Mitas H15 – блистательная разработка именитого шинного гиганта из Европы. Она демонстрирует феноменальные рабочие параметры благодаря идеально сбалансированным параметрам конструкции. Необычный протектор в разы повышает сцепление с дорожным полотном. При этом не теряется стабильность движения даже на небывалых виражах. Вы будете проходить повороты, сохраняя при этом стабильный контакт с асфальтной поверхностью. Компаунд усовершенствован для суровых условий езды. Поэтому ему не страшно абразивное и механическое воздействие. Износ происходит беспрецедентно медленно.Mitas H15 – блистательная разработка именитого шинного гиганта из Европы. Она демонстрирует феноменальные рабочие параметры благодаря идеально сбалансированным параметрам конструкции. Необычный протектор в разы повышает сцепление с дорожным полотном. При этом не теряется стабильность движения даже на небывалых виражах. Вы будете проходить повороты, сохраняя при этом стабильный контакт с асфальтной поверхностью. Компаунд усовершенствован для суровых условий езды. Поэтому ему не страшно абразивное и механическое воздействие. Износ происходит беспрецедентно медленно.Mitas H15 – блистательная разработка именитого шинного гиганта из Европы. Она демонстрирует феноменальные рабочие параметры благодаря идеально сбалансированным параметрам конструкции. Необычный протектор в разы повышает сцепление с дорожным полотном. При этом не теряется стабильность движения даже на небывалых виражах. Вы будете проходить повороты, сохраняя при этом стабильный контакт с асфальтной поверхностью. Компаунд усовершенствован для суровых условий езды. Поэтому ему не страшно абразивное и механическое воздействие. Износ происходит беспрецедентно медленно.<br/>\n<br>Вес шины: 4 кг<br/>\n<br>Индекс нагрузки: 64<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '4-00-18--110-90-18--64t-h-15-tt', NULL, NULL, 1, 0, 'df3e9b8d-325b-11e8-8192-ed790c9fa917'),
(207, 2, '2|1', 1, 0, '110/90-19 62M C-18 SUPER LIGHT TT', NULL, '', '890000', 0, '<br>Mitas C18 – идеальная разработка для задней оси мототранспорта. Это вариант С17 для задней оси. Протектор имеет универсальный узор, позволяющий покрышке демонстрировать изумительные «цепные» показатели в любых дорожных условиях! Покоряйте своему мотору даже сыпучие грунты!<br/>\n<br>Моторезина отличается адаптированной под повышенные нагрузки конструкцией. Внутри шины давление распределяется за доли секунды. Благодаря этому происходит медленное и равномерное изнашивание. В такой «обуви» вы сможете отлично ездить в дождливую погоду, поскольку протектор обладает феноменальными дренажными показателями.<br/>\n<br>Super Light - протектор из особой смеси и легким каркасом для Enduro Extreme.<br/>\n<br>Вес шины: 5,2 кг<br/>\n<br>Индекс нагрузки: 62<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-90-19-62m-c-18-super-light-tt', NULL, NULL, 1, 0, 'd2e068fe-325b-11e8-8192-ed790c9fa917'),
(208, 0, '', 0, 0, '25X8.00-12 B77 4PR TL', NULL, '', '915698', 0, '<br>Шины для квадроцикла Sava B77 - еще одна модель шин ATV, предназначенная для \"утилитарно-лесного\" использования.<br/>\n<br>Рисунок покрышек Sava B77 - направленная \"елочка\". Но дополнительные внутренние грани здесь используются неповсеместно.<br/>\n<br>Колеса Sava B77 имеют боковые грунтозацепы, уходящие на боковину покрышки. Это означат, что шина Sava B77 сконструирована также для работы на низких давлениях, когда боковина шин прогибается и вступает в контакт с опорной поверхностью дороги.<br/>\n<br>Шины ATV Sava B77 вполне органично могут быть применены на квадроциклах, используемых для поездок по полям и лесам.<br/>\n<br>Вес шины: 5,9 кг<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '25x8-00-12-b77-4pr-tl', NULL, NULL, 1, 0, 'e5518fcf-325b-11e8-8192-ed790c9fa917'),
(209, 4, '4|1', 1, 0, '130/80-17 65H TL MC30 INVADER', NULL, '', '915141', 0, '<br>Mitas MC30  - предназначены для всех типов дорог и минимального бездорожья.<br/>\n<br>Invader MC30 - мотошины для мотоциклов двойного назначения и туристических эндуро, ориентированные на езду по асфальту и дорогам с твердым покрытием. Обеспечивают отличную управляемость на мокрой дороге и легком бездорожье в любую погоду.<br/>\n<br>Вес шины: 6,1 кг<br/>\n<br>Индекс нагрузки: 65<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '130-80-17-65h-tl-mc30-invader', NULL, NULL, 1, 0, 'd941f96d-325b-11e8-8192-ed790c9fa917'),
(210, 0, '', 0, 0, '110/90-//100/90-19 TR6  HD BOX T', NULL, '', '938437', 0, '<br>Камеры изготовлены из бутилкаучука и имеют следующие маркировки:<br/> \n<br><br/>\n<br>Mitas и SAVA<br/>\n<br><br/>\n<br>UHD - камера толщиной 4 мм для очень больших нагрузок<br/>\n<br>HD - камера толщиной 1,9-2,0 мм для больших нагрузок<br/>\n<br>Normal - камера толщиной 1,2-1,4 мм для не больших нагрузок, как правило устонавливаются на скутеры или малокубатурные мотоциклы<br/>\n<br>BOX - камера упакована в отдельную коробку<br/>\n<br>JS87, TR87, 90/90 - камера имеет изогнутый вентель<br/>\n<br>34G, TR6 - камера имеет прямой вентель<br/>\n<br><br/>\n<br>КАБАТ<br/>\n<br><br/>\n<br>HD - усиленные камеры для больших нагрузок<br/>\n<br>GP4(TR-4)(V1.09.1) - камера имеет прямой вентель<br/>\n<br>Все камеры марки КАБАТ не имеют упаковки<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-90---100-90-19-tr6--hd-box-t', NULL, NULL, 1, 0, 'ff45d47b-325b-11e8-8192-ed790c9fa917'),
(211, 0, '', 0, 0, '120/80-12 55J TL MC19', NULL, '', '925769', 0, '<br>Sava MC19 - скутерная шина для захватывающей езды по внедорожью.<br/>\n<br>Конструкция шин гарантирует отличное сцепление, сопротивление пробою и острой поверхности.<br/>\n<br>Вес шины: 3,3 кг<br/>\n<br>Индекс нагрузки: 55<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-80-12-55j-tl-mc19', NULL, NULL, 1, 0, 'f27ec25b-325b-11e8-8192-ed790c9fa917'),
(212, 0, '', 0, 0, '70/100-17 (2.25/2.50-17) TR6 BOX T', NULL, '', '938438', 0, '<br>Камеры изготовлены из бутилкаучука и имеют следующие маркировки:<br/> \n<br><br/>\n<br>Mitas и SAVA<br/>\n<br><br/>\n<br>UHD - камера толщиной 4 мм для очень больших нагрузок<br/>\n<br>HD - камера толщиной 1,9-2,0 мм для больших нагрузок<br/>\n<br>Normal - камера толщиной 1,2-1,4 мм для не больших нагрузок, как правило устонавливаются на скутеры или малокубатурные мотоциклы<br/>\n<br>BOX - камера упакована в отдельную коробку<br/>\n<br>JS87, TR87, 90/90 - камера имеет изогнутый вентель<br/>\n<br>34G, TR6 - камера имеет прямой вентель<br/>\n<br><br/>\n<br>КАБАТ<br/>\n<br><br/>\n<br>HD - усиленные камеры для больших нагрузок<br/>\n<br>GP4(TR-4)(V1.09.1) - камера имеет прямой вентель<br/>\n<br>Все камеры марки КАБАТ не имеют упаковки<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '70-100-17--2-25-2-50-17--tr6-box-t', NULL, NULL, 1, 0, 'ff45d483-325b-11e8-8192-ed790c9fa917'),
(213, 2, '2|1', 1, 0, '2.50-10 37J C-12 TT', NULL, '', '881092', 0, '<br>Mitas C12 – мотоциклетная шина от признанного производителя из Европы. Протектор конструировался в программе виртуального трехмерного моделирования. Поэтому совокупность всех его элементов имеет идеальное расположения. Канавки наделены нетрадиционной глубиной и наклоном. Все это сделано для безукоризненного сцепления на любых дорожных полотнах.<br/>\n<br>Компаунд получил от команды специалистов маститого бренда оригинальный состав. Благодаря этому обеспечивается эго беспрецедентная износостойкость.<br/>\n<br>Вес шины: 1,5 кг<br/>\n<br>Индекс нагрузки: 37<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '2-50-10-37j-c-12-tt', NULL, NULL, 1, 0, 'b831b6e0-325b-11e8-8192-ed790c9fa917'),
(214, 2, '2|1', 1, 0, '110/100-18M/C 64M C-16 TT', NULL, '', '881119', 0, '<br>Mitas C16 – модернизированная мотоциклетная покрышка от небезызвестного шинного гиганта из Европы. Она предназначается для маневренной езды по твердому дорожному полотну. Также вашему байку покорятся каменистые спуски и подъемы. Протектор имеет особенный узор. Он представляет собой совокупность массивных блоков, размещенных с определенными интервалами. Они были скрупулезно просчитаны в уникальной компьютерной программе для виртуального моделирования.<br/>\n<br>Резиновая смесь имеет особую прочность. Она дополнена новейшими полимерами, стойкими к абразивному и механическому стороннему воздействию.<br/>\n<br>Вес шины: 5,2 кг<br/>\n<br>Индекс нагрузки: 64<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-100-18m-c-64m-c-16-tt', NULL, NULL, 1, 0, 'befe4ddb-325b-11e8-8192-ed790c9fa917'),
(215, 2, '2|1', 1, 0, '110/90-19 M/C 62M XT-454 W.F.SPIKE TT', NULL, '', '861807', 0, '<br>Mitas XT454 – европейская резина бескомпромиссного качества. Она демонстрирует великолепное сцепление с дорожным полотном любого качества. Это обеспечивается массивной короной протектора. Совокупность элементов центральной части покрышки разрабатывалась в компьютерной программе трехмерного компьютерного моделирования. Благодаря этому интервалы просчитаны до миллиметра.<br/>\n<br>Боковые фигуры изготовлены из прочной резиновой смеси. Однако при этом они сохраняют отличную эластичность.<br/>\n<br>Winter Friction - специальный вариант для использования в зимних условиях, подходит также для шипов.<br/>\n<br>Spike - протектор с шипами Winterfriction.<br/>\n<br>Вес шины: 8,1 кг<br/>\n<br>Индекс нагрузки: 62<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-90-19-m-c-62m-xt-454-w-f-spike-tt', NULL, NULL, 1, 0, 'b1201bae-325b-11e8-8192-ed790c9fa917'),
(216, 2, '2|1', 1, 0, '90/100-14 49M C-20 WINTER FRICTION TT', NULL, '', '915662', 0, '<br>Mitas C20 представляет собой уникальную разработку именитого шинного концерна. Покрышка отличается универсальностью. Протектор обладает улучшенным узором, который без проблем справляется даже с нестабильными дорожными полотнами.<br/>\n<br>Благодаря суперкрепкому компаунду в разы повышается срок эксплуатации такого изделия. Шина обладает высоким европейским качеством. Она надежно защищена от механических повреждений и абразивного воздействия магистралей.<br/>\n<br>Winter Friction - специальный вариант для использования в зимних условиях, подходит также для шипов.<br/>\n<br>Вес шины: 3,2 кг<br/>\n<br>Индекс нагрузки: 49<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '90-100-14-49m-c-20-winter-friction-tt', NULL, NULL, 1, 0, 'e5518f54-325b-11e8-8192-ed790c9fa917'),
(217, 3, '3|1', 1, 0, '120/90-18 65H TL MC50', NULL, '', '925783', 0, '<br>\"Mitas MC50 - это высокоскоростные шины диагональной конструкции. Шины Mitas MC50 используются в профессиональных мотогонках, отличаются хорошим сцеплением с дорогой и длительным сроком службы. Данная моторезина рекомендуется для спорта, супермото, мотоциклов с низким и средним объемом двигателя. Конструкция шин Mitas MC50 позволяет использовать их не только на гоночных трассах, но и в повседневной жизни. Mitas MC50 - многофункциональная шина с отличной производительностью на сухом дорожном покрытии и в то же время с отличной управляемостью на мокром. Жесткость боковой стенки обеспечивает стабильность шины на гоночных трассах.<br/>\n<br>Конструкция: Диагональная<br/>\n<br>Индекс нагрузки: 65<br/>\n<br>Вес шины: 5,5 кг<br/>\n<br>Страна производства: Словения<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-90-18-65h-tl-mc50', NULL, NULL, 1, 0, 'f27ec2c7-325b-11e8-8192-ed790c9fa917'),
(218, 0, '', 0, 0, '120/90-//130/80-18 HD TR6 BOX', NULL, '', '940640', 0, '<br>Камеры изготовлены из бутилкаучука и имеют следующие маркировки:<br/> \n<br><br/>\n<br>Mitas и SAVA<br/>\n<br><br/>\n<br>UHD - камера толщиной 4 мм для очень больших нагрузок<br/>\n<br>HD - камера толщиной 1,9-2,0 мм для больших нагрузок<br/>\n<br>Normal - камера толщиной 1,2-1,4 мм для не больших нагрузок, как правило устонавливаются на скутеры или малокубатурные мотоциклы<br/>\n<br>BOX - камера упакована в отдельную коробку<br/>\n<br>JS87, TR87, 90/90 - камера имеет изогнутый вентель<br/>\n<br>34G, TR6 - камера имеет прямой вентель<br/>\n<br><br/>\n<br>КАБАТ<br/>\n<br><br/>\n<br>HD - усиленные камеры для больших нагрузок<br/>\n<br>GP4(TR-4)(V1.09.1) - камера имеет прямой вентель<br/>\n<br>Все камеры марки КАБАТ не имеют упаковки<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-90---130-80-18-hd-tr6-box', NULL, NULL, 1, 0, '05e03bc2-325c-11e8-8192-ed790c9fa917'),
(219, 2, '2|1', 1, 0, '2.75-23 48P SW-02 TT', NULL, '', '881176', 0, '<br>Mitas SW-02 рекомендована для классических и длинных кольцевых гонок с отличным сцеплением в поворотах.<br/>\n<br>Данная моторезина предназначена для установки на переднюю ось.<br/>\n<br>Вес шины: 2,6 кг<br/>\n<br>Индекс нагрузки: 48<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '2-75-23-48p-sw-02-tt', NULL, NULL, 1, 0, 'cbbe1d6d-325b-11e8-8192-ed790c9fa917'),
(220, 0, '', 0, 0, '120/90-10 57L TL MC32 WIN SCOOT', NULL, '', '915506', 0, '<br>Шины Mitas MC32 WIN SCOOT - идеальный выбор для тех, кто использует свой мотоцикл или скутер зимой и в межсезонье.<br/>\n<br>Эти шины обладают высокими эксплутационными характеристиками при низких температурах, на снегу, льду и мокрой дороге.<br/>\n<br>Вес шины: 3,9 кг<br/>\n<br>Индекс нагрузки: 57<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-90-10-57l-tl-mc32-win-scoot', NULL, NULL, 1, 0, 'df3e9ab1-325b-11e8-8192-ed790c9fa917'),
(221, 0, '', 0, 0, '120/90-10 56J TL MC17 V2', NULL, '', '915434', 0, '<br>Mitas MC17 - скутерная шина для захватывающей езды по внедорожью.<br/>\n<br>MКонструкция шин гарантирует отличное сцепление, сопротивление пробою и острой поверхности.<br/>\n<br>Вес шины: 3,5 кг<br/>\n<br>Индекс нагрузки: 56<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-90-10-56j-tl-mc17-v2', NULL, NULL, 1, 0, 'd941fa0b-325b-11e8-8192-ed790c9fa917'),
(222, 4, '4|1', 1, 0, '150/70-17M/C 69H E-08 TL', NULL, '', '881084', 0, '<br>Mitas E-08 подходит для грунтовых дорог и сухой пересеченной местности.<br/>\n<br>Протектор наделен специфическим рисунком, разработанным командой инженеров по трехмерной технологии. Благодаря этому вся совокупность элементов размещена со скрупулезно просчитанными интервалами. Таким образом, центральная часть шины обладает феноменальным сцепление. Оно будет продемонстрировано на дорожном полотне любого качества.<br/>\n<br>Вес шины: 7,1 кг<br/>\n<br>Индекс нагрузки: 69<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '150-70-17m-c-69h-e-08-tl', NULL, NULL, 1, 0, 'b831b685-325b-11e8-8192-ed790c9fa917'),
(223, 4, '4|1', 1, 0, '110/80-19 M/C 59R E-09 TL', NULL, '', '925751', 0, '<br>Mitas E09 - подходит для пустынных и раллийных соревнований.<br/>\n<br>Протектор наделен эксклюзивным сочетанием элементов для совершенного сцепления на любой скорости. Благодаря прочной конструкции шины очень надежны, устойчивы к проколам.<br/>\n<br>Вес шины: 4,4 кг<br/>\n<br>Индекс нагрузки: 59<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-80-19-m-c-59r-e-09-tl', NULL, NULL, 1, 0, 'f27ec227-325b-11e8-8192-ed790c9fa917'),
(224, 2, '2|1', 1, 0, '90/90-21M/C 54R C-19 SUPER TT', NULL, '', '881164', 0, '<br>Mitas C-19 разработана для преимущественного использования по гравию, камням, горной местности. Кроссовые шины Mitas C-19 одобрены для эксплуатации в соответствии с DOT EN, 80% по бездорожью, 20% на дорогах.<br/>\n<br>Super - протектор из особой смеси для гонок Enduro.<br/>\n<br>Вес шины: 3,6 кг<br/>\n<br>Индекс нагрузки: 54<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '90-90-21m-c-54r-c-19-super-tt', NULL, NULL, 1, 0, 'c523babc-325b-11e8-8192-ed790c9fa917'),
(225, 3, '3|1', 1, 0, '3.50-18M/C 62P REINF H-06 TT', NULL, '', '881015', 0, '<br>Mitas H06 – великолепная всесезонная модель от европейского шинного гиганта. В абсолютно любую погоду вы сможете комфортно себя чувствовать за рулем своего транспортного средства. Такая универсальность делает шину данной модели превосходным вариантом для любителей долговременных путешествий. Покрышка рассчитана для установки на любую ось. Протектор имеет оригинальный узор, состоящий из прямых и криволинейных элементов. Reinforced - увеличенный индекс грузоподъемности(нагрузки) шины по E.T.R.T.O.<br/>\n<br>Вес шины: 3,9 кг<br/>\n<br>Индекс нагрузки: 62<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '3-50-18m-c-62p-reinf-h-06-tt', NULL, NULL, 1, 0, 'b1201c8e-325b-11e8-8192-ed790c9fa917'),
(226, 0, '', 0, 0, '10X4.50-5 SRB', NULL, '', '915684', 0, '<br>Средне-мягкие шины для соревнований.<br/>\n<br>Подходят для езды как под открытым небом, так и в закрытых помещениях, долгий срок службы при высоких температурах, подходят также для езды на прокатных картах.<br/>\n<br>Вес шины: 1,4 кг<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '10x4-50-5-srb', NULL, NULL, 1, 0, 'e5518f93-325b-11e8-8192-ed790c9fa917'),
(227, 4, '4|1', 1, 0, '150/70-18 M/C 70R E-09 DAKAR TL', NULL, '', '924489', 0, '<br>Mitas E09 - подходит для пустынных и раллийных соревнований.<br/>\n<br>Протектор наделен эксклюзивным сочетанием элементов для совершенного сцепления на любой скорости. Благодаря прочной конструкции шины очень надежны, устойчивы к проколам.<br/>\n<br>Dakar - протектор с усиленным каркасом дляэкстремального вождения или гонок.<br/>\n<br>Вес шины: 8,5 кг<br/>\n<br>Индекс нагрузки: 70<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '150-70-18-m-c-70r-e-09-dakar-tl', NULL, NULL, 1, 0, 'f27ec17e-325b-11e8-8192-ed790c9fa917'),
(228, 0, '', 0, 0, '100/70-14 53L TL/TT MC26 REINF.', NULL, '', '944953', 0, '<br>Летние мотоциклетные шины Mitas MC26 обеспечивают прекрасные сцепно-тормозные качества, что является важным показателем при скоростной езде на мотоциклах и скутерах.<br/>\n<br>Протекторный рисунок и усовершенствованная резиновая композиция обеспечивает курсовую устойчивость и отличные показатели при вхождении в повороты.<br/>\n<br>Еще одним достоинством данной модели является долговечность.<br/>\n<br>Reinforced - увеличенный индекс грузоподъемности(нагрузки) шины по E.T.R.T.O.<br/>\n<br>Вес шины: 2,5 кг<br/>\n<br>Индекс нагрузки: 53<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '100-70-14-53l-tl-tt-mc26-reinf-', NULL, NULL, 1, 0, '05e03d6f-325c-11e8-8192-ed790c9fa917'),
(229, 0, '', 0, 0, '130/90-10 70M S-11 WINTER FRICTION TL', NULL, '', '915368', 0, '<br>Mitas S-11 – шины для скутера, использующегося на бездорожье или зимой.<br/>\n<br>Модель разработана для преимущественной эксплуатации на бездорожье, но предполагает и использование на асфальте. Покрышки Mitas S-11 пригодны для использования в зимних условиях и шипования.<br/>\n<br>Winter Friction - специальный вариант для использования в зимних условиях, подходит также для шипов.<br/>\n<br>Вес шины: <br/>\n<br>Индекс нагрузки: 70<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '130-90-10-70m-s-11-winter-friction-tl', NULL, NULL, 1, 0, 'd941f9d8-325b-11e8-8192-ed790c9fa917'),
(230, 2, '2|1', 1, 0, '100/90-19M/C 57M C-16 TT', NULL, '', '881137', 0, '<br>Mitas C16 – модернизированная мотоциклетная покрышка от небезызвестного шинного гиганта из Европы. Она предназначается для маневренной езды по твердому дорожному полотну. Также вашему байку покорятся каменистые спуски и подъемы. Протектор имеет особенный узор. Он представляет собой совокупность массивных блоков, размещенных с определенными интервалами. Они были скрупулезно просчитаны в уникальной компьютерной программе для виртуального моделирования.<br/>\n<br>Резиновая смесь имеет особую прочность. Она дополнена новейшими полимерами, стойкими к абразивному и механическому стороннему воздействию.<br/>\n<br>Вес шины: 4,5 кг<br/>\n<br>Индекс нагрузки: 57<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '100-90-19m-c-57m-c-16-tt', NULL, NULL, 1, 0, 'c523b97a-325b-11e8-8192-ed790c9fa917'),
(231, 3, '3|1', 1, 0, '190/55ZR17 75W TL SPORTFORCE+', NULL, '', '939434', 0, '<br>Мотоциклетная шина Mitas SportForce+ является одним из флагманов модельного ряда известного чешского производителя. Об этом можно судить по технологиям, использованным в ее конструкции. Многие из них ранее применялись исключительно в мотоспорте, что лишний раз подтверждает высокую производительность данной модели, предназначенной для спортбайков. Мотоциклетная шина Mitas SportForce+ является одним из флагманов модельного ряда известного чешского производителя. Об этом можно судить по технологиям, использованным в ее конструкции. Многие из них ранее применялись исключительно в мотоспорте, что лишний раз подтверждает высокую производительность данной модели, предназначенной для спортбайков.<br/>\n<br>Особенности:<br/>\n<br>Оптимизированный дизайн дренажных канавок.<br/>\n<br>Протекторный рисунок Mitas SportForce+ содержит большое количество дренажных канавок. Эти элементы отличаются формой и расположением, специально подобранными не только с целью обеспечить максимальную устойчивость к аквапланированию. Они имеют значительную протяженность, будучи расположенными под острым углом относительно направления. В сочетании со сложной многоугольной формой их боковых стенок это позволяет шине чрезвычайно эффективно сопротивляться перегреву, отводя значительную часть тепла в окружающее пространство. Те же конструктивные особенности позволяют дренажным канавкам превосходно справляться с отводом воды от пятна контакта, обеспечивая шине хорошую устойчивость в дождливую погоду.<br/>\n<br>Жесткий каркас.<br/>\n<br>Еще одним нововведением данной модели является технология SCT. За этой аббревиатурой (Strong Carcass Technology) скрывается конструкция каркаса, корд которого намотан таким образом, что в нем отсутствуют какие-либо стыки и швы. В результате шина прекрасно сохраняет свою первоначальную форму даже при самом сильном воздействии разнонаправленных сил ускорения, обеспечивая быстрые и точные реакции на действия байкера. Еще одним преимуществом данной технологии является улучшившаяся устойчивость к неравномерному износу.<br/>\n<br>Основные особенности мотошины Mitas SportForce+<br/>\n<br>— оптимизированное расположение и форма дренажных канавок обеспечивает не только высокую устойчивость к аквапланированию, но и снижает уровень нагрева при движении на высокой скорости;<br/>\n<br>— жесткий каркас улучшает управляемость и устойчивость при прохождении поворотов, придает реакциям шины быстроту и точность;<br/>\n<br>— стабильные сцепные свойства в любых условиях благодаря использованию при разработке технологий компьютерного моделирования.<br/>\n<br>Конструкция: Радиальная<br/>\n<br>Индекс нагрузки: 75<br/>\n<br>Вес шины: 6,9 кг<br/>\n<br>Страна производства: Словения<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '190-55zr17-75w-tl-sportforce-', NULL, NULL, 1, 0, 'ff45d4bf-325b-11e8-8192-ed790c9fa917'),
(232, 3, '3|1', 1, 0, '3.25-18M/C 59P REINF H-03 TT', NULL, '', '881010', 0, '<br>Mitas H03 – высокотехнологичная европейская покрышка с бескомпромиссным качеством. Она станет лучшим вариантом для установки на обе оси мотоциклетного транспортного средства. Таким образом, вам будет обеспечена исключительная «цепкость» в любом скоростном режиме. Изумительный компаунд медленно изнашивается. Он почти не подвержен негативному механическому воздействию. С этими шинами вы стабильно проедете солидное количество километров! Мотошина отличается эталонной проходимостью.<br/>\n<br>Reinforced - увеличенный индекс грузоподъемности(нагрузки) шины по E.T.R.T.O.<br/>\n<br>Вес шины: 3,8 кг<br/>\n<br>Индекс нагрузки: 59<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '3-25-18m-c-59p-reinf-h-03-tt', NULL, NULL, 1, 0, 'b1201c5e-325b-11e8-8192-ed790c9fa917'),
(233, 4, '4|1', 1, 0, '150/70-18 M/C 70R E-09 TL', NULL, '', '925840', 0, '<br>Mitas E09 - подходит для пустынных и раллийных соревнований.<br/>\n<br>Протектор наделен эксклюзивным сочетанием элементов для совершенного сцепления на любой скорости. Благодаря прочной конструкции шины очень надежны, устойчивы к проколам.<br/>\n<br>Вес шины: 8,2 кг<br/>\n<br>Индекс нагрузки: 70<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '150-70-18-m-c-70r-e-09-tl', NULL, NULL, 1, 0, 'f8fee33d-325b-11e8-8192-ed790c9fa917');
