(234, 0, '', 0, 0, '60/100-14 (2.25/2.50-14) TR6 HD BOX', NULL, '', '938435', 0, '<br>Камеры изготовлены из бутилкаучука и имеют следующие маркировки:<br/> \n<br><br/>\n<br>Mitas и SAVA<br/>\n<br><br/>\n<br>UHD - камера толщиной 4 мм для очень больших нагрузок<br/>\n<br>HD - камера толщиной 1,9-2,0 мм для больших нагрузок<br/>\n<br>Normal - камера толщиной 1,2-1,4 мм для не больших нагрузок, как правило устонавливаются на скутеры или малокубатурные мотоциклы<br/>\n<br>BOX - камера упакована в отдельную коробку<br/>\n<br>JS87, TR87, 90/90 - камера имеет изогнутый вентель<br/>\n<br>34G, TR6 - камера имеет прямой вентель<br/>\n<br><br/>\n<br>КАБАТ<br/>\n<br><br/>\n<br>HD - усиленные камеры для больших нагрузок<br/>\n<br>GP4(TR-4)(V1.09.1) - камера имеет прямой вентель<br/>\n<br>Все камеры марки КАБАТ не имеют упаковки<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '60-100-14--2-25-2-50-14--tr6-hd-box', NULL, NULL, 1, 0, 'ff45d473-325b-11e8-8192-ed790c9fa917'),
(235, 0, '', 0, 0, '120/80-//130/70...-19 BOX UHD 4MM TR6 T', NULL, '', '938303', 0, '<br>Камеры изготовлены из бутилкаучука и имеют следующие маркировки:<br/> \n<br><br/>\n<br>Mitas и SAVA<br/>\n<br><br/>\n<br>UHD - камера толщиной 4 мм для очень больших нагрузок<br/>\n<br>HD - камера толщиной 1,9-2,0 мм для больших нагрузок<br/>\n<br>Normal - камера толщиной 1,2-1,4 мм для не больших нагрузок, как правило устонавливаются на скутеры или малокубатурные мотоциклы<br/>\n<br>BOX - камера упакована в отдельную коробку<br/>\n<br>JS87, TR87, 90/90 - камера имеет изогнутый вентель<br/>\n<br>34G, TR6 - камера имеет прямой вентель<br/>\n<br><br/>\n<br>КАБАТ<br/>\n<br><br/>\n<br>HD - усиленные камеры для больших нагрузок<br/>\n<br>GP4(TR-4)(V1.09.1) - камера имеет прямой вентель<br/>\n<br>Все камеры марки КАБАТ не имеют упаковки<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-80---130-70----19-box-uhd-4mm-tr6-t', NULL, NULL, 1, 0, 'ff45d406-325b-11e8-8192-ed790c9fa917'),
(236, 4, '4|1', 1, 0, '140/80-17M/C 69T E-07 TL', NULL, '', '884385', 0, '<br>Mitas E-07 специально создана для мотоциклов, которые эксплуатируются на любой дорожной поверхности. Отличительной особенностью этой модели является необычный протекторный рисунок, который обеспечивает повышенную устойчивость и уверенное управление на любой дорожной поверхности.<br/>\n<br>Вся поверхность шины покрыта необычными блоками, которые обеспечивают отличную устойчивость и управляемость. Оптимально подобранные расстояния между блоками предотвращают застревание камней в протекторе и повышают самоочищение. В плечевой зоне, блоки имеют другую форму, за счет этого достигается повышенная устойчивость при любых маневрах. Отличная курсовая устойчивость и быстрая обратная связь обеспечивается центральной частью протектора, где пересекаются блоки.<br/>\n<br>Индекс нагрузки: 69<br/>\n<br>Вес шины: 7,3 кг <br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '140-80-17m-c-69t-e-07-tl', NULL, NULL, 1, 0, 'cbbe1ebb-325b-11e8-8192-ed790c9fa917'),
(237, 2, '2|1', 1, 0, '110/90-19M/C 62M C-18 TT', NULL, '', '881145', 0, '<br>Mitas C18 – идеальная разработка для задней оси мототранспорта. Это вариант С17 для задней оси. Протектор имеет универсальный узор, позволяющий покрышке демонстрировать изумительные «цепные» показатели в любых дорожных условиях! Покоряйте своему мотору даже сыпучие грунты!<br/>\n<br>Моторезина отличается адаптированной под повышенные нагрузки конструкцией. Внутри шины давление распределяется за доли секунды. Благодаря этому происходит медленное и равномерное изнашивание. В такой «обуви» вы сможете отлично ездить в дождливую погоду, поскольку протектор обладает феноменальными дренажными показателями.<br/> \n<br>Вес шины: 5,6 кг<br/>\n<br>Индекс нагрузки: 62<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-90-19m-c-62m-c-18-tt', NULL, NULL, 1, 0, 'c523b9df-325b-11e8-8192-ed790c9fa917'),
(238, 0, '', 0, 0, '100/80-17 52R MC32 W.SCOOT M+S TL', NULL, '', '940645', 0, '<br>Шины Mitas MC32 WIN SCOOT - идеальный выбор для тех, кто использует свой мотоцикл или скутер зимой и в межсезонье.<br/>\n<br>Эти шины обладают высокими эксплутационными характеристиками при низких температурах, на снегу, льду и мокрой дороге.<br/>\n<br>M + S - шины для грязи и снега, используются также круглогодично. Устанавливая шину на мотоцикл, достигающий большую скорость, необходимо учитывать допустимую максимальную скорость шины.<br/>\n<br>Вес шины: 4,1 кг<br/>\n<br>Индекс нагрузки: 52<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '100-80-17-52r-mc32-w-scoot-m-s-tl', NULL, NULL, 1, 0, '05e03bf3-325c-11e8-8192-ed790c9fa917'),
(239, 2, '2|1', 1, 0, '110/100-18M/C 71N REINF C-02 TT', NULL, '', '881118', 0, '<br>Mitas C02 – прекрасные покрышки европейского производства с широким набором характеристик. Предназначается для задней оси мотоциклетных транспортных средств. Модель Mitas C-02 разработана для преимущественного использования по гравию, камням.<br/>\n<br>Резиновая смесь дополнена стойкими к абразивному износу полимерами.<br/>\n<br>Reinforced - увеличенный индекс грузоподъемности(нагрузки) шины по E.T.R.T.O.<br/>\n<br>Вес шины: 5,7 кг<br/>\n<br>Индекс нагрузки: 71<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-100-18m-c-71n-reinf-c-02-tt', NULL, NULL, 1, 0, 'befe4dcc-325b-11e8-8192-ed790c9fa917'),
(240, 2, '2|1', 1, 0, '90/90-21 M/C 54R C-19 TT SUPER LIGHT', NULL, '', '885575', 0, '<br>Mitas C19 – идеальная разработка для задней оси Модель Mitas C-19 разработана для преимущественного использования по гравию, камням, горной местности.<br/>\n<br>Кроссовые шины Mitas C-19 одобрены для эксплуатации в соответствии с DOT EN, 80% по бездорожью, 20% на дорогах.<br/>\n<br>Super Light - протектор из особой смеси и легким каркасом для Enduro Extreme.<br/>\n<br>Вес шины: 3,6 кг<br/>\n<br>Индекс нагрузки: 54<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '90-90-21-m-c-54r-c-19-tt-super-light', NULL, NULL, 1, 0, 'd2e0685a-325b-11e8-8192-ed790c9fa917'),
(241, 0, '', 0, 0, '100/90-12 49P TL MC20 MONSUM', NULL, '', '915586', 0, '<br>Шины Sava MC20 - всепогодные шины для скутеров. Отличная управляемость и долгий срок службы.<br/>\n<br>Эксклюзивная по составу резиновая смесь стойко справляется с абразивным воздействием асфальтного полотна.<br/>\n<br>Вес шины: 2,9 кг<br/>\n<br>Индекс нагрузки: 49<br/>\n<br>Страна производства: Словения<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '100-90-12-49p-tl-mc20-monsum', NULL, NULL, 1, 0, 'df3e9b66-325b-11e8-8192-ed790c9fa917'),
(242, 3, '3|1', 1, 0, '3.25-18  52P MC7 TL/TT', NULL, '', '924332', 0, '<br>Mitas MC7 - это высокоскоростные шины диагональной конструкции. Шины Mitas MC7 используются в профессиональных мотогонках, отличаются хорошим сцеплением с дорогой и длительным сроком службы. Данная моторезина рекомендуется для спорта, супермото, мотоциклов с низким и средним объемом двигателя. Конструкция шин Mitas MC7 позволяет использовать их не только на гоночных трассах, но и в повседневной жизни. Mitas MC7 - многофункциональная шина с отличной производительностью на сухом дорожном покрытии и в то же время с отличной управляемостью на мокром. Жесткость боковой стенки обеспечивает стабильность шины на гоночных трассах.<br/>\n<br>Вес шины: 4 кг<br/>\n<br>Индекс нагрузки: 52<br/>\n<br>Страна производства: Словения<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '3-25-18--52p-mc7-tl-tt', NULL, NULL, 1, 0, 'ec3eedb2-325b-11e8-8192-ed790c9fa917'),
(243, 4, '4|1', 1, 0, '130/80-17M/C 65T E-08 TL', NULL, '', '881040', 0, '<br>Mitas E-08 подходит для грунтовых дорог и сухой пересеченной местности.<br/>\n<br>Протектор наделен специфическим рисунком, разработанным командой инженеров по трехмерной технологии. Благодаря этому вся совокупность элементов размещена со скрупулезно просчитанными интервалами. Таким образом, центральная часть шины обладает феноменальным сцепление. Оно будет продемонстрировано на дорожном полотне любого качества.<br/>\n<br>Вес шины: 6,7 кг<br/>\n<br>Индекс нагрузки: 65<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '130-80-17m-c-65t-e-08-tl', NULL, NULL, 1, 0, 'b1201cfc-325b-11e8-8192-ed790c9fa917'),
(244, 4, '4|1', 1, 0, '90/90-21M/C 54R E-09 DAKAR TL', NULL, '', '926214', 0, '<br>Mitas E09 - подходит для пустынных и раллийных соревнований.<br/>\n<br>Протектор наделен эксклюзивным сочетанием элементов для совершенного сцепления на любой скорости. Благодаря прочной конструкции шины очень надежны, устойчивы к проколам.<br/>\n<br>Dakar - протектор с усиленным каркасом дляэкстремального вождения или гонок.<br/>\n<br>Вес шины: 3,8 кг<br/>\n<br>Индекс нагрузки: 54<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '90-90-21m-c-54r-e-09-dakar-tl', NULL, NULL, 1, 0, 'f8fee3ba-325b-11e8-8192-ed790c9fa917'),
(245, 4, '4|1', 1, 0, '100/90-19 M/C 57R E-09 TL', NULL, '', '925732', 0, '<br>Mitas E09 - подходит для пустынных и раллийных соревнований.<br/>\n<br>Протектор наделен эксклюзивным сочетанием элементов для совершенного сцепления на любой скорости. Благодаря прочной конструкции шины очень надежны, устойчивы к проколам.<br/>\n<br>Вес шины: 4,5 кг<br/>\n<br>Индекс нагрузки: 57<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '100-90-19-m-c-57r-e-09-tl', NULL, NULL, 1, 0, 'f27ec1e6-325b-11e8-8192-ed790c9fa917'),
(246, 2, '2|1', 1, 0, '80/100-12 50M C-20 WINTER FRICTION TT', NULL, '', '926187', 0, '<br>Mitas C20 представляет собой уникальную разработку именитого шинного концерна. Покрышка отличается универсальностью. Протектор обладает улучшенным узором, который без проблем справляется даже с нестабильными дорожными полотнами.<br/>\n<br>Благодаря суперкрепкому компаунду в разы повышается срок эксплуатации такого изделия. Шина обладает высоким европейским качеством. Она надежно защищена от механических повреждений и абразивного воздействия магистралей.<br/>\n<br>Winter Friction - специальный вариант для использования в зимних условиях, подходит также для шипов.<br/>\n<br>Вес шины: 2,3 кг<br/>\n<br>Индекс нагрузки: 50<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '80-100-12-50m-c-20-winter-friction-tt', NULL, NULL, 1, 0, 'f8fee393-325b-11e8-8192-ed790c9fa917'),
(247, 4, '4|1', 1, 0, '140/80-18 70R MC23 ROCKRIDER TT', NULL, '', '935191', 0, '<br>Асфальт: 40%<br/>\n<br>Бездорожье: 60%<br/>\n<br>Данная моторезина предназначена для установки на любую ось.<br/>\n<br>Вес шины: 6 кг<br/>\n<br>Индекс нагрузки: 70<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '140-80-18-70r-mc23-rockrider-tt', NULL, NULL, 1, 0, 'ff45d3e4-325b-11e8-8192-ed790c9fa917'),
(248, 2, '2|1', 1, 0, '110/100-18 64R C-18 SUPER LIGHT TT', NULL, '', '889997', 0, '<br>Mitas C18 – идеальная разработка для задней оси мототранспорта. Это вариант С17 для задней оси. Протектор имеет универсальный узор, позволяющий покрышке демонстрировать изумительные «цепные» показатели в любых дорожных условиях! Покоряйте своему мотору даже сыпучие грунты!<br/>\n<br>Моторезина отличается адаптированной под повышенные нагрузки конструкцией. Внутри шины давление распределяется за доли секунды. Благодаря этому происходит медленное и равномерное изнашивание. В такой «обуви» вы сможете отлично ездить в дождливую погоду, поскольку протектор обладает феноменальными дренажными показателями.<br/>\n<br>Super Light - протектор из особой смеси и легким каркасом для Enduro Extreme.<br/>\n<br>Вес шины: 5,3 кг<br/>\n<br>Индекс нагрузки: 64<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-100-18-64r-c-18-super-light-tt', NULL, NULL, 1, 0, 'd2e068ef-325b-11e8-8192-ed790c9fa917'),
(249, 2, '2|1', 1, 0, '120/90-18 65M C-12 TT', NULL, '', '881126', 0, '<br>Mitas C12 – мотоциклетная шина от признанного производителя из Европы. Протектор конструировался в программе виртуального трехмерного моделирования. Поэтому совокупность всех его элементов имеет идеальное расположения. Канавки наделены нетрадиционной глубиной и наклоном. Все это сделано для безукоризненного сцепления на любых дорожных полотнах.<br/>\n<br>Компаунд получил от команды специалистов маститого бренда оригинальный состав. Благодаря этому обеспечивается эго беспрецедентная износостойкость.<br/>\n<br>Вес шины: 5,4 кг<br/>\n<br>Индекс нагрузки: 65 <br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-90-18-65m-c-12-tt', NULL, NULL, 1, 0, 'befe4e24-325b-11e8-8192-ed790c9fa917'),
(250, 0, '', 0, 0, '18X9.50-8 B77 4PR TL', NULL, '', '915704', 0, '<br>Шины для квадроцикла Sava B77 - еще одна модель шин ATV, предназначенная для \"утилитарно-лесного\" использования.<br/>\n<br>Рисунок покрышек Sava B77 - направленная \"елочка\". Но дополнительные внутренние грани здесь используются неповсеместно.<br/>\n<br>Колеса Sava B77 имеют боковые грунтозацепы, уходящие на боковину покрышки. Это означат, что шина Sava B77 сконструирована также для работы на низких давлениях, когда боковина шин прогибается и вступает в контакт с опорной поверхностью дороги.<br/>\n<br>Шины ATV Sava B77 вполне органично могут быть применены на квадроциклах, используемых для поездок по полям и лесам.<br/>\n<br>Вес шины: 5,9 кг<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '18x9-50-8-b77-4pr-tl', NULL, NULL, 1, 0, 'ec3eec88-325b-11e8-8192-ed790c9fa917'),
(251, 3, '3|1', 1, 0, '3.50-18M/C 62P REINF H-03 TT', NULL, '', '881014', 0, '<br>Mitas H03 – высокотехнологичная европейская покрышка с бескомпромиссным качеством. Она станет лучшим вариантом для установки на обе оси мотоциклетного транспортного средства. Таким образом, вам будет обеспечена исключительная «цепкость» в любом скоростном режиме. Изумительный компаунд медленно изнашивается. Он почти не подвержен негативному механическому воздействию. С этими шинами вы стабильно проедете солидное количество километров! Мотошина отличается эталонной проходимостью.<br/>\n<br>Reinforced - увеличенный индекс грузоподъемности(нагрузки) шины по E.T.R.T.O.<br/>\n<br>Вес шины: 3,9 кг<br/>\n<br>Индекс нагрузки: 62<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '3-50-18m-c-62p-reinf-h-03-tt', NULL, NULL, 1, 0, 'b1201c82-325b-11e8-8192-ed790c9fa917'),
(252, 0, '', 0, 0, '2.00/2.25-19 TR4 BOX T', NULL, '', '942303', 0, '<br>Камеры изготовлены из бутилкаучука и имеют следующие маркировки:<br/> \n<br><br/>\n<br>Mitas и SAVA<br/>\n<br><br/>\n<br>UHD - камера толщиной 4 мм для очень больших нагрузок<br/>\n<br>HD - камера толщиной 1,9-2,0 мм для больших нагрузок<br/>\n<br>Normal - камера толщиной 1,2-1,4 мм для не больших нагрузок, как правило устонавливаются на скутеры или малокубатурные мотоциклы<br/>\n<br>BOX - камера упакована в отдельную коробку<br/>\n<br>JS87, TR87, 90/90 - камера имеет изогнутый вентель<br/>\n<br>34G, TR6 - камера имеет прямой вентель<br/>\n<br><br/>\n<br>КАБАТ<br/>\n<br><br/>\n<br>HD - усиленные камеры для больших нагрузок<br/>\n<br>GP4(TR-4)(V1.09.1) - камера имеет прямой вентель<br/>\n<br>Все камеры марки КАБАТ не имеют упаковки<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '2-00-2-25-19-tr4-box-t', NULL, NULL, 1, 0, '05e03c57-325c-11e8-8192-ed790c9fa917'),
(253, 2, '2|1', 1, 0, '110/100-18 M/C 64P XT-754 TT', NULL, '', '881179', 0, '<br>Mitas XT754 – безукоризненный вариант для вашего эндуро. Известный шинный гигант из Европы скрупулезно подбирал набор рабочих параметров для такого изделия. В результате миру была представлена совершенная разработка. Она наделена маневренностью и устойчивостью. Вы будете превосходно чувствовать свой байк даже на экстремальном вираже.<br/>\n<br>Шина имеет бескомпромиссное качество. Резиновая смесь усовершенствована. Ее состав дополнен суперпрочными синтетическими компонентами.<br/>\n<br>Вес шины: 5,0 кг<br/>\n<br>Индекс нагрузки: 64<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-100-18-m-c-64p-xt-754-tt', NULL, NULL, 1, 0, 'cbbe1d88-325b-11e8-8192-ed790c9fa917'),
(254, 4, '4|1', 1, 0, '120/80-18M/C 62S E-07 TL', NULL, '', '943298', 0, '<br>Mitas E-07 специально создана для мотоциклов, которые <br>Mitas E-07 специально создана для мотоциклов, которые эксплуатируются на любой дорожной поверхности. Отличительной особенностью этой модели является необычный протекторный рисунок, который обеспечивает повышенную устойчивость и уверенное управление на любой дорожной поверхности.<br/>\n<br>Вся поверхность шины покрыта необычными блоками, которые обеспечивают отличную устойчивость и управляемость. Оптимально подобранные расстояния между блоками предотвращают застревание камней в протекторе и повышают самоочищение. В плечевой зоне, блоки имеют другую форму, за счет этого достигается повышенная устойчивость при любых маневрах. Отличная курсовая устойчивость и быстрая обратная связь обеспечивается центральной частью протектора, где пересекаются блоки.<br/>\n<br>Вес шины: 7,7 кг<br/>\n<br>Индекс нагрузки: 62<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-80-18m-c-62s-e-07-tl', NULL, NULL, 1, 0, '05e03d07-325c-11e8-8192-ed790c9fa917'),
(255, 2, '2|1', 1, 0, '100/100-19 62M XT-946 TT', NULL, '', '881186', 0, '<br>Модель Mitas XT-946 разработана для преимущественного использования по камням, горной местности. Мотошины этой модели рекомендуется использовать на средне-мягких, средних грунтах.<br/>\n<br>Вес шины: 4,8 кг<br/>\n<br>Индекс нагрузки: 62<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '100-100-19-62m-xt-946-tt', NULL, NULL, 1, 0, 'cbbe1de2-325b-11e8-8192-ed790c9fa917'),
(256, 2, '2|1', 1, 0, '4.00-18 64M ET-01 TL', NULL, '', '881059', 0, '<br>Mitas ET-01 разработана для преимущественного использования по гравию, камням, горной местности.<br/>\n<br>Универсальность изделия выражается в возможности установки на любую ось мотоцикла. Протектор получил нетрадиционный узор, который повысил «цепные» качества до максимального уровня.<br/>\n<br>Вес шины: 5,5 кг<br/>\n<br>Индекс нагрузки: 64<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '4-00-18-64m-et-01-tl', NULL, NULL, 1, 0, 'b831b5a3-325b-11e8-8192-ed790c9fa917'),
(257, 0, '', 0, 0, '110/80-12 61L TL MC16', NULL, '', '945588', 0, '<br>Шины Mitas MC16 - шины оригинального дизайна для скутеров.<br/>\n<br>Mitas MC16 обеспечивают прекрасные эксплуатационные и потребительские характеристики. Они отлично показывают себя практически на всех видах дорожного покрытия, даже на проселочных дорогах и по бездорожью. Курсовая устойчивость и высокая безопасность гарантируется рисунком протектора и резиновой смесью.<br/>\n<br>Вес шины: 2,8<br/>\n<br>Индекс нагрузки: 61<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-80-12-61l-tl-mc16', NULL, NULL, 1, 0, '0ce5e26c-325c-11e8-8192-ed790c9fa917'),
(258, 0, '', 0, 0, '100/70-14 53L TL/TT MC26 REINF.', NULL, '', '915456', 0, '<br>Летние мотоциклетные шины Mitas MC26 обеспечивают прекрасные сцепно-тормозные качества, что является важным показателем при скоростной езде на мотоциклах и скутерах.<br/>\n<br>Протекторный рисунок и усовершенствованная резиновая композиция обеспечивает курсовую устойчивость и отличные показатели при вхождении в повороты.<br/>\n<br>Еще одним достоинством данной модели является долговечность.<br/>\n<br>Reinforced - увеличенный индекс грузоподъемности(нагрузки) шины по E.T.R.T.O.<br/>\n<br>Вес шины: 2,5 кг<br/>\n<br>Индекс нагрузки: 53<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '100-70-14-53l-tl-tt-mc26-reinf-', NULL, NULL, 1, 0, 'df3e9a40-325b-11e8-8192-ed790c9fa917'),
(259, 4, '4|1', 1, 0, '90/90-21 M/C 54T E-08 TT', NULL, '', '881068', 0, '<br>Mitas E-08 подходит для грунтовых дорог и сухой пересеченной местности.<br/>\n<br>Протектор наделен специфическим рисунком, разработанным командой инженеров по трехмерной технологии. Благодаря этому вся совокупность элементов размещена со скрупулезно просчитанными интервалами. Таким образом, центральная часть шины обладает феноменальным сцепление. Оно будет продемонстрировано на дорожном полотне любого качества.<br/>\n<br>Вес шины: 3,3 кг<br/>\n<br>Индекс нагрузки: 54<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '90-90-21-m-c-54t-e-08-tt', NULL, NULL, 1, 0, 'b831b5fb-325b-11e8-8192-ed790c9fa917'),
(260, 2, '2|1', 1, 0, '3.00-21 51M XT-444 WIN FRIC TT', NULL, '', '881200', 0, '<br>Mitas XT444 – отличается повышенной проходимостью и минимальным процентом повреждений. Использование современного оборудования и лучших материалов позволило добиться прекрасных эксплуатационных характеристик.<br/>\n<br>Для предотвращения возможных повреждений и разрывов, которые часто происходят при движении по некачественному покрытию, был использован усиленный каркас. Новая технология намотки корда и корд повышенной прочности обеспечивают надежную защиту от повреждений и без проблем справляются с максимальными нагрузками. Также новый каркас имеет уменьшенный вес, что повысило скоростные и тормозные характеристики.<br/>\n<br>Winter Friction - специальный вариант для использования в зимних условиях, подходит также для шипов.<br/>\n<br>Вес шины: 4,5 кг<br/>\n<br>Индекс нагрузки: 51<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '3-00-21-51m-xt-444-win-fric-tt', NULL, NULL, 1, 0, 'cbbe1e3f-325b-11e8-8192-ed790c9fa917'),
(261, 0, '', 0, 0, '100/90-10 61J TL/TT MC6 REINF', NULL, '', '922531', 0, '<br>Mitas MC6 обеспечивают прекрасные сцепно-тормозные качества, что является важным показателем при скоростной езде на скутерах.<br/>\n<br>Протекторный рисунок и усовершенствованная резиновая композиция обеспечивает курсовую устойчивость и отличные показатели при вхождении в повороты.<br/>\n<br>Еще одним достоинством данной модели является долговечность.<br/>\n<br>Reinforced - увеличенный индекс грузоподъемности(нагрузки) шины по E.T.R.T.O.<br/>\n<br>Вес шины: 2,3 кг<br/>\n<br>Индекс нагрузки: 61<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '100-90-10-61j-tl-tt-mc6-reinf', NULL, NULL, 1, 0, 'ec3eed1b-325b-11e8-8192-ed790c9fa917'),
(262, 2, '2|1', 1, 0, '90/90-21M/C 54R EF-06 SUPER TT', NULL, '', '881090', 0, '<br>Mitas EF-06 разработана для преимущественного использования по грязи и песку, гравию.<br/>\n<br>Уникальной узор протектора наделил мотошину непревзойденной адгезией.<br/>\n<br>Super-протектор из особой смеси для гонок Enduro.<br/>\n<br>Вес шины: кг<br/>\n<br>Индекс нагрузки: 54<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '90-90-21m-c-54r-ef-06-super-tt', NULL, NULL, 1, 0, 'b831b6d3-325b-11e8-8192-ed790c9fa917'),
(263, 2, '2|1', 1, 0, '80/100-21 51M C-31 TERRACROSS TT', NULL, '', '926992', 0, '<br>Mitas C31 представляет собой уникальную разработку именитого шинного концерна. Покрышка отличается универсальностью. Протектор обладает улучшенным узором, который без проблем справляется даже с нестабильными дорожными полотнами.<br/>\n<br>Дизайн протектора обеспечивает оптимальную производительность во всех режимах вождения.<br/>\n<br>Вес шины: 3,7 кг<br/>\n<br>Индекс нагрузки: 51<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '80-100-21-51m-c-31-terracross-tt', NULL, NULL, 1, 0, 'f8fee3f0-325b-11e8-8192-ed790c9fa917'),
(264, 0, '', 0, 0, '100/80-16 50P TL MC32 WIN SCOOT', NULL, '', '915554', 0, '<br>Шины Mitas MC32 WIN SCOOT - идеальный выбор для тех, кто использует свой мотоцикл или скутер зимой и в межсезонье.<br/>\n<br>Эти шины обладают высокими эксплутационными характеристиками при низких температурах, на снегу, льду и мокрой дороге.<br/>\n<br>Вес шины: 4 кг<br/>\n<br>Индекс нагрузки: 50<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '100-80-16-50p-tl-mc32-win-scoot', NULL, NULL, 1, 0, 'df3e9b18-325b-11e8-8192-ed790c9fa917'),
(265, 4, '4|1', 1, 0, '120/90-17M/C 64S E-07 TL', NULL, '', '925782', 0, '<br>Mitas E-07 специально создана для мотоциклов, которые эксплуатируются на любой дорожной поверхности. Отличительной особенностью этой модели является необычный протекторный рисунок, который обеспечивает повышенную устойчивость и уверенное управление на любой дорожной поверхности.<br/>\n<br>Вся поверхность шины покрыта необычными блоками, которые обеспечивают отличную устойчивость и управляемость. Оптимально подобранные расстояния между блоками предотвращают застревание камней в протекторе и повышают самоочищение. В плечевой зоне, блоки имеют другую форму, за счет этого достигается повышенная устойчивость при любых маневрах. Отличная курсовая устойчивость и быстрая обратная связь обеспечивается центральной частью протектора, где пересекаются блоки.<br/>\n<br>Вес шины: 6,2 кг<br/>\n<br>Индекс нагрузки: 64<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-90-17m-c-64s-e-07-tl', NULL, NULL, 1, 0, 'f27ec2ba-325b-11e8-8192-ed790c9fa917'),
(266, 0, '', 0, 0, '130/60-13 53J TL MC16', NULL, '', '945205', 0, '<br>Шины Mitas MC16 - шины оригинального дизайна для скутеров.<br/>\n<br>Mitas MC16 обеспечивают прекрасные эксплуатационные и потребительские характеристики. Они отлично показывают себя практически на всех видах дорожного покрытия, даже на проселочных дорогах и по бездорожью. Курсовая устойчивость и высокая безопасность гарантируется рисунком протектора и резиновой смесью.<br/>\n<br>Вес шины: 3,1 кг<br/>\n<br>Индекс нагрузки: 53<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '130-60-13-53j-tl-mc16', NULL, NULL, 1, 0, '0ce5e21f-325c-11e8-8192-ed790c9fa917'),
(267, 0, '', 0, 0, '3.00-10 42J TL/TT MC12', NULL, '', '942321', 0, '<br>Вес шины: 2 кг<br/>\n<br>Индекс нагрузки: 42<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '3-00-10-42j-tl-tt-mc12', NULL, NULL, 1, 0, '05e03cca-325c-11e8-8192-ed790c9fa917'),
(268, 4, '4|1', 1, 0, '140/80-18 M/C 70R E-09 TL', NULL, '', '928519', 0, '<br>Mitas E09 - подходит для пустынных и раллийных соревнований.<br/>\n<br>Протектор наделен эксклюзивным сочетанием элементов для совершенного сцепления на любой скорости. Благодаря прочной конструкции шины очень надежны, устойчивы к проколам.<br/>\n<br>Вес шины: 8,1 кг<br/>\n<br>Индекс нагрузки: 70<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '140-80-18-m-c-70r-e-09-tl', NULL, NULL, 1, 0, 'ff45d3a6-325b-11e8-8192-ed790c9fa917'),
(269, 2, '2|1', 1, 0, '110/90-18 61M C-12 TT', NULL, '', '881117', 0, '<br>Mitas C12 – мотоциклетная шина от признанного производителя из Европы. Протектор конструировался в программе виртуального трехмерного моделирования. Поэтому совокупность всех его элементов имеет идеальное расположения. Канавки наделены нетрадиционной глубиной и наклоном. Все это сделано для безукоризненного сцепления на любых дорожных полотнах.<br/>\n<br>Компаунд получил от команды специалистов маститого бренда оригинальный состав. Благодаря этому обеспечивается эго беспрецедентная износостойкость.<br/>\n<br>Вес шины: 4,9 кг<br/>\n<br>Индекс нагрузки: 71<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-90-18-61m-c-12-tt', NULL, NULL, 1, 0, 'befe4dbd-325b-11e8-8192-ed790c9fa917'),
(270, 2, '2|1', 1, 0, '100/90-19 57M C-12 TT', NULL, '', '881136', 0, '<br>Mitas C12 – мотоциклетная шина от признанного производителя из Европы. Протектор конструировался в программе виртуального трехмерного моделирования. Поэтому совокупность всех его элементов имеет идеальное расположения. Канавки наделены нетрадиционной глубиной и наклоном. Все это сделано для безукоризненного сцепления на любых дорожных полотнах.<br/>\n<br>Компаунд получил от команды специалистов маститого бренда оригинальный состав. Благодаря этому обеспечивается эго беспрецедентная износостойкость.<br/>\n<br>Вес шины: 4,5 кг<br/>\n<br>Индекс нагрузки: 57<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '100-90-19-57m-c-12-tt', NULL, NULL, 1, 0, 'c523b96b-325b-11e8-8192-ed790c9fa917'),
(271, 4, '4|1', 1, 0, '110/80-19 M/C 59T E-07 TL', NULL, '', '906765', 0, '<br>Mitas E-07 специально создана для мотоциклов, которые эксплуатируются на любой дорожной поверхности. Отличительной особенностью этой модели является необычный протекторный рисунок, который обеспечивает повышенную устойчивость и уверенное управление <br>Mitas E-07 специально создана для мотоциклов, которые эксплуатируются на любой дорожной поверхности. Отличительной особенностью этой модели является необычный протекторный рисунок, который обеспечивает повышенную устойчивость и уверенное управление на любой дорожной поверхности.<br/>\n<br>Вся поверхность шины покрыта необычными блоками, которые обеспечивают отличную устойчивость и управляемость. Оптимально подобранные расстояния между блоками предотвращают застревание камней в протекторе и повышают самоочищение. В плечевой зоне, блоки имеют другую форму, за счет этого достигается повышенная устойчивость при любых маневрах. Отличная курсовая устойчивость и быстрая обратная связь обеспечивается центральной частью протектора, где пересекаются блоки.<br/>\n<br>Вес шины: 4,5 кг<br/>\n<br>Индекс нагрузки: 59<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-80-19-m-c-59t-e-07-tl', NULL, NULL, 1, 0, 'd941f92c-325b-11e8-8192-ed790c9fa917'),
(272, 4, '4|1', 1, 0, '2.75-16 46P REINF E-06 TT', NULL, '', '881036', 0, '<br>Фигурный протектор кроссового характера мотоциклетной шины Mitas E-06 для использования главным образом на бездорожье.<br/>\n<br>Резиновая смесь получила неординарный состав. Совокупность суперкрепких полимеров наделила мотопокрышку уникальной прочностью. Она стойко справляется даже с отрицательными механическими воздействиями.<br/>\n<br>Reinforced - увеличенный индекс грузоподъемности(нагрузки) шины по E.T.R.T.O.\n<br>Вес шины: 2,3 кг<br/>\n<br>Индекс нагрузки: 46<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '2-75-16-46p-reinf-e-06-tt', NULL, NULL, 1, 0, 'b1201cf0-325b-11e8-8192-ed790c9fa917'),
(273, 2, '2|1', 1, 0, '110/90-19 62L C-22 ICE TT', NULL, '', '915650', 0, '<br>Mitas C-22 предназначены для установки на мопеды, скутеры и лёгкие мотоциклы.<br/>\n<br>Чётко выраженный протектор позволяет уверенно себя чувствовать при движении по песчаной или грунтовой дороге. Но и на дорогах с твердым покрытием покрышка надежно держит сцепление, препятствует вилянию и скольжению.<br/>\n<br>Вес шины: 10,5 кг<br/>\n<br>Индекс нагрузки: 64<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-90-19-62l-c-22-ice-tt', NULL, NULL, 1, 0, 'e5518eed-325b-11e8-8192-ed790c9fa917'),
(274, 0, '', 0, 0, '130/70-17 62R TL MC32 WIN SCOOT', NULL, '', '925811', 0, '<br>Шины Mitas MC32 WIN SCOOT - идеальный выбор для тех, кто использует свой мотоцикл или скутер зимой и в межсезонье.<br/>\n<br>Эти шины обладают высокими эксплутационными характеристиками при низких температурах, на снегу, льду и мокрой дороге.<br/>\n<br>Вес шины: 5,4 кг<br/>\n<br>Индекс нагрузки: 62<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '130-70-17-62r-tl-mc32-win-scoot', NULL, NULL, 1, 0, 'f8fee2ae-325b-11e8-8192-ed790c9fa917'),
(275, 0, '', 0, 0, '110/70-12 47P TL MC34', NULL, '', '915611', 0, '<br>Мотопокрышки Sava MC34 – это сочетание скорости и высокого уровня безопасности скутера.<br/>\n<br>Sava MC34 обеспечивают отличную курсовую устойчивость, обладают прекрасными сцепно-тяговыми качествами, защитой от аквапланирования.<br/>\n<br>Благодаря протекторному рисунку снижен тормозной путь и гарантируется быстрый разгон. <br/>\n\n<br>Вес шины: 2,6 кг<br/>\n<br>Индекс нагрузки: 53<br/>\n<br>Страна производства: Словения<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-70-12-47p-tl-mc34', NULL, NULL, 1, 0, 'df3e9b80-325b-11e8-8192-ed790c9fa917'),
(276, 0, '', 0, 0, '2.75/3.00-18 V1.09.1', NULL, '', '952202', 0, '<br>Камеры изготовлены из бутилкаучука и имеют следующие маркировки:<br/> \n<br><br/>\n<br>Mitas и SAVA<br/>\n<br><br/>\n<br>UHD - камера толщиной 4 мм для очень больших нагрузок<br/>\n<br>HD - камера толщиной 1,9-2,0 мм для больших нагрузок<br/>\n<br>Normal - камера толщиной 1,2-1,4 мм для не больших нагрузок, как правило устонавливаются на скутеры или малокубатурные мотоциклы<br/>\n<br>BOX - камера упакована в отдельную коробку<br/>\n<br>JS87, TR87, 90/90 - камера имеет изогнутый вентель<br/>\n<br>34G, TR6 - камера имеет прямой вентель<br/>\n<br><br/>\n<br>КАБАТ<br/>\n<br><br/>\n<br>HD - усиленные камеры для больших нагрузок<br/>\n<br>GP4(TR-4)(V1.09.1) - камера имеет прямой вентель<br/>\n<br>Все камеры марки КАБАТ не имеют упаковки<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '2-75-3-00-18-v1-09-1', NULL, NULL, 1, 0, '137b8090-325c-11e8-8192-ed790c9fa917'),
(277, 0, '', 0, 0, '80/80-14 53L TL/TT MC26 REINF.', NULL, '', '943303', 0, '<br>Летние мотоциклетные шины Mitas MC26 обеспечивают прекрасные сцепно-тормозные качества, что является важным показателем при скоростной езде на мотоциклах и скутерах.<br/>\n<br>Протекторный рисунок и усовершенствованная резиновая композиция обеспечивает курсовую устойчивость и отличные показатели при вхождении в повороты.<br/>\n<br>Еще одним достоинством данной модели является долговечность.<br/>\n<br>Reinforced - увеличенный индекс грузоподъемности(нагрузки) шины по E.T.R.T.O.<br/>\n<br>Вес шины: 1,8 кг<br/>\n<br>Индекс нагрузки: 53<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '80-80-14-53l-tl-tt-mc26-reinf-', NULL, NULL, 1, 0, '05e03d2e-325c-11e8-8192-ed790c9fa917'),
(278, 4, '4|1', 1, 0, '80/90-21 48P TT MC23', NULL, '', '942316', 0, '<br>Асфальт: 40%<br/>\n<br>Бездорожье: 60%<br/>\n<br>Данная моторезина предназначена для установки на любую ось.<br/>\n<br>Вес шины: 3 кг<br/>\n<br>Индекс нагрузки: 48<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '80-90-21-48p-tt-mc23', NULL, NULL, 1, 0, '05e03c96-325c-11e8-8192-ed790c9fa917'),
(279, 2, '2|1', 1, 0, '90/90-21M/C 54R C-19 TT', NULL, '', '881163', 0, '<br>Mitas C-19 разработана для преимущественного использования по гравию, камням, горной местности.<br/>\n<br>Кроссовые шины Mitas C-19 одобрены для эксплуатации в соответствии с DOT EN, 80% по бездорожью, 20% на дорогах.<br/>\n<br>Вес шины: 3,9 кг<br/>\n<br>Индекс нагрузки: 54<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '90-90-21m-c-54r-c-19-tt', NULL, NULL, 1, 0, 'c523baad-325b-11e8-8192-ed790c9fa917'),
(280, 2, '2|1', 1, 0, '120/90-19 66N C-10 SPEEDY-CROC TT', NULL, '', '881153', 0, '<br>Mitas C10 – великолепная разработка знаменитого европейского шинного гиганта. Неординарная конструкция покрышки позволяет продуктивно использовать ее в любых дорожных условиях! С такой «обувью» вы непременно станете «королем» твердого дорожного полотна, неустойчивого покрытия, сыпучих грунтов, пересеченной местности. Ваш мотокросс-байк сможет продемонстрировать с качественными европейскими покрышками весь свой потенциал!<br/> \n<br>Изделие разработано в трехмерной компьютерной программе для задних колес мотоциклетных транспортных средств.<br/>\n<br>Speedy-Croc - рисунок протектора, обеспечивающий оптимальную производительность во всех режимах вождения.<br/>\n<br>Вес шины: 5,3 кг<br/>\n<br>Индекс нагрузки: 66<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-90-19-66n-c-10-speedy-croc-tt', NULL, NULL, 1, 0, 'c523ba53-325b-11e8-8192-ed790c9fa917'),
(281, 0, '', 0, 0, '10X4.50-5 SRB', NULL, '', '941640', 0, '<br>Средне-мягкие шины для соревнований.<br/>\n<br>Подходят для езды как под открытым небом, так и в закрытых помещениях, долгий срок службы при высоких температурах, подходят также для езды на прокатных картах.<br/>\n<br>Вес шины: 1,4 кг<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '10x4-50-5-srb', NULL, NULL, 1, 0, '05e03c27-325c-11e8-8192-ed790c9fa917'),
(282, 0, '', 0, 0, '130/90-10 61L TL MC32 WIN SCOOT', NULL, '', '915505', 0, '<br>Шины Mitas MC32 WIN SCOOT - идеальный выбор для тех, кто использует свой мотоцикл или скутер зимой и в межсезонье.<br/>\n<br>Эти шины обладают высокими эксплутационными характеристиками при низких температурах, на снегу, льду и мокрой дороге.<br/>\n<br>Вес шины: 4 кг<br/>\n<br>Индекс нагрузки: 61<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '130-90-10-61l-tl-mc32-win-scoot', NULL, NULL, 1, 0, 'df3e9aa5-325b-11e8-8192-ed790c9fa917'),
(283, 0, '', 0, 0, '120/70-12 51S MC28 TL', NULL, '', '950530', 0, '<br>Шины Mitas - MC28 - всесезонные шины, сделаны специально для максискутеров.<br/>\n<br>Mitas MC28 обладают отличной продольной и угловой стабильностью. <br/>\n<br>Долговечная резиновая смесь выдерживает скоростные и весовые нагрузки и отлично держит дорогу в любую погоду.<br/>\n<br>Вес шины: 3 кг<br/>\n<br>Индекс нагрузки: 51<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-70-12-51s-mc28-tl', NULL, NULL, 1, 0, '0ce5e347-325c-11e8-8192-ed790c9fa917'),
(284, 0, '', 0, 0, '90/90-10 50J TL/TT MC13', NULL, '', '938431', 0, '<br>Вес шины: 2,3 кг<br/>\n<br>Индекс нагрузки: 52<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '90-90-10-50j-tl-tt-mc13', NULL, NULL, 1, 0, 'ff45d466-325b-11e8-8192-ed790c9fa917'),
(285, 4, '4|1', 1, 0, '130/80-18M/C 72T REINF E-08 TL', NULL, '', '881055', 0, '<br>Mitas E-08 подходит для грунтовых дорог и сухой пересеченной местности.<br/>\n<br>Протектор наделен специфическим рисунком, разработанным командой инженеров по трехмерной технологии. Благодаря этому вся совокупность элементов размещена со скрупулезно просчитанными интервалами. Таким образом, центральная часть шины обладает феноменальным сцепление. Оно будет продемонстрировано на дорожном полотне любого качества.<br/>\n<br>Вес шины: 6,2 кг<br/>\n<br>Индекс нагрузки: 72<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '130-80-18m-c-72t-reinf-e-08-tl', NULL, NULL, 1, 0, 'b831b596-325b-11e8-8192-ed790c9fa917'),
(286, 4, '4|1', 1, 0, '140/80-18 M/C 70T E-07 DAKAR TL', NULL, '', '915621', 0, '<br>Mitas E-07 специально создана для мотоциклов, которые эксплуатируются на любой дорожной поверхности. Отличительной особенностью этой модели является необычный протекторный рисунок, который обеспечивает повышенную устойчивость и уверенное управление на любой дорожной поверхности.<br/>\n<br>Вся поверхность шины покрыта необычными блоками, которые обеспечивают отличную устойчивость и управляемость. Оптимально подобранные расстояния между блоками предотвращают застревание камней в протекторе и повышают самоочищение. В плечевой зоне, блоки имеют другую форму, за счет этого достигается повышенная устойчивость при любых маневрах. Отличная курсовая устойчивость и быстрая обратная связь обеспечивается центральной частью протектора, где пересекаются блоки.<br/>\n<br>Dakar - протектор с усиленным каркасом для экстремального вождения или гонок.<br/>\n<br>Вес шины: 7,7 кг<br/>\n<br>Индекс нагрузки: 70<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '140-80-18-m-c-70t-e-07-dakar-tl', NULL, NULL, 1, 0, 'e5518e75-325b-11e8-8192-ed790c9fa917'),
(287, 2, '2|1', 1, 0, '80/100-12 50M SX30 TT', NULL, '', '915635', 0, '<br>Mitas SX30 разработана для преимущественного использования по гравию, камням.<br/>\n<br>Данная моторезина предназначена для установки на любую ось.<br/>\n<br>Вес шины: 2,2 кг<br/>\n<br>Индекс нагрузки: 50<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '80-100-12-50m-sx30-tt', NULL, NULL, 1, 0, 'e5518eb8-325b-11e8-8192-ed790c9fa917'),
(288, 2, '2|1', 1, 0, '90/100-16 51M C-20 TT', NULL, '', '881108', 0, '<br>Mitas C20 представляет собой уникальную разработку именитого шинного концерна. Покрышка отличается универсальностью. Протектор обладает улучшенным узором, который без проблем справляется даже с нестабильными дорожными полотнами.<br/> \n<br>Благодаря суперкрепкому компаунду в разы повышается срок эксплуатации такого изделия. Шина обладает высоким европейским качеством. Она надежно защищена от механических повреждений и абразивного воздействия магистралей.<br/> \n<br>Вес шины: 3,1 кг<br/>\n<br>Индекс нагрузки: 49<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '90-100-16-51m-c-20-tt', NULL, NULL, 1, 0, 'befe4d46-325b-11e8-8192-ed790c9fa917'),
(289, 4, '4|1', 1, 0, '130/80-17 65S TL MC24 INVADER', NULL, '', '938430', 0, '<br>Mitas MC24  - диагональные покрышки двойного назначения с более выраженным рисунком протектора, чем у моделей MC30, E-08<br/>\n<br>INVADER MC24 - мотошины для мотоциклов двойного назначения и туристических эндуро, ориентированные на езду по асфальту и дорогам с твердым покрытием. Обеспечивают отличную управляемость на мокрой дороге и легком бездорожье в любую погоду.<br/>\n<br>Вес шины: 6,1 кг<br/>\n<br>Индекс нагрузки: 65<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '130-80-17-65s-tl-mc24-invader', NULL, NULL, 1, 0, 'ff45d459-325b-11e8-8192-ed790c9fa917'),
(290, 0, '', 0, 0, '120/70-11 56L TL MC20 MONSUM REINF', NULL, '', '915582', 0, '<br>Шины Sava MC20 - всепогодные шины для скутеров. Отличная управляемость и долгий срок службы.<br/>\n<br>Эксклюзивная по составу резиновая смесь стойко справляется с абразивным воздействием асфальтного полотна.<br/>\n<br>Reinforced - увеличенный индекс грузоподъемности(нагрузки) шины по E.T.R.T.O.<br/>\n<br>Вес шины: 2,6 кг<br/>\n<br>Индекс нагрузки: 56<br/>\n<br>Страна производства: Словения<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-70-11-56l-tl-mc20-monsum-reinf', NULL, NULL, 1, 0, 'df3e9b59-325b-11e8-8192-ed790c9fa917'),
(291, 2, '2|1', 1, 0, '110/90-18 61N C-04 LEISURE TT', NULL, '', '881116', 0, '<br>Модель Mitas C-04 разработана для преимущественного использования по грязи и песку, гравию. Мотошины этой модели рекомендуется использовать на средне-мягких грунтах.<br/>\n<br>Super Light - протектор из особой смеси и легким каркасом для Enduro Extreme.<br/>\n<br>Вес шины: 4,8 кг<br/>\n<br>Индекс нагрузки: 61<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-90-18-61n-c-04-leisure-tt', NULL, NULL, 1, 0, 'befe4dad-325b-11e8-8192-ed790c9fa917'),
(292, 4, '4|1', 1, 0, '110/80-19 M/C 59R E-09 DAKAR TL', NULL, '', '925750', 0, '<br>Mitas E09 - подходит для пустынных и раллийных соревнований.<br/>\n<br>Протектор наделен эксклюзивным сочетанием элементов для совершенного сцепления на любой скорости. Благодаря прочной конструкции шины очень надежны, устойчивы к проколам.<br/>\n<br>Dakar - протектор с усиленным каркасом дляэкстремального вождения или гонок.<br/>\n<br>Вес шины: 5 кг<br/>\n<br>Индекс нагрузки: 59<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-80-19-m-c-59r-e-09-dakar-tl', NULL, NULL, 1, 0, 'f27ec21a-325b-11e8-8192-ed790c9fa917'),
(293, 0, '', 0, 0, '25X10.00-12 B71 4PR TL', NULL, '', '915690', 0, '<br>Sava B71 это модель шин ATV, предназначенная для \"утилитарно-лесного\" использования.<br/>\n<br>Рисунок покрышек Sava B 71 - направленная \"елочка\" с дополнительными внутренними гранями - обеспечивает хорошую самоочищаемость и грязеотвод.<br/>\n<br>Кроме того, колеса Sava B71 имеют дополнительные боковые грунтозацепы по краям протектора, для более эффективной работы в колее.<br/>\n<br>Шины ATV Sava B71 вполне органично могут быть применены на квадроциклах, используемых для поездок по полям и лесам.<br/>\n<br>Вес шины: 9,1 кг<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '25x10-00-12-b71-4pr-tl', NULL, NULL, 1, 0, 'e5518fc3-325b-11e8-8192-ed790c9fa917'),
(294, 0, '', 0, 0, '120/70-12 58P TL MC20 REINF. B', NULL, '', '915537', 0, '<br>Шины Sava MC20 - всепогодные шины для скутеров. Отличная управляемость и долгий срок службы.<br/>\n<br>Эксклюзивная по составу резиновая смесь стойко справляется с абразивным воздействием асфальтного полотна.<br/>\n<br>Reinforced - увеличенный индекс грузоподъемности(нагрузки) шины по E.T.R.T.O.<br/>\n<br>Вес шины: 2,8 кг<br/>\n<br>Индекс нагрузки: 58<br/>\n<br>Страна производства: Словения<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-70-12-58p-tl-mc20-reinf--b', NULL, NULL, 1, 0, 'df3e9afe-325b-11e8-8192-ed790c9fa917'),
(295, 4, '4|1', 1, 0, '100/90-19 M/C 57T E-07 TL', NULL, '', '910272', 0, '<br>Mitas E-07 специально создана для мотоциклов, которые эксплуатируются на любой дорожной поверхности. Отличительной особенностью этой модели является необычный протекторный рисунок, который обеспечивает повышенную устойчивость и уверенное управление на любой дорожной поверхности.<br/>\n<br>Вся поверхность шины покрыта необычными блоками, которые обеспечивают отличную устойчивость и управляемость. Оптимально подобранные расстояния между блоками предотвращают застревание камней в протекторе и повышают самоочищение. В плечевой зоне, блоки имеют другую форму, за счет этого достигается повышенная устойчивость при любых маневрах. Отличная курсовая устойчивость и быстрая обратная связь обеспечивается центральной частью протектора, где пересекаются блоки.<br/>\n<br>Вес шины: 4,5 кг<br/>\n<br>Индекс нагрузки: 57<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '100-90-19-m-c-57t-e-07-tl', NULL, NULL, 1, 0, 'd941f960-325b-11e8-8192-ed790c9fa917'),
(296, 4, '4|1', 1, 0, '90/90-21 54H TL MC30 INVADER', NULL, '', '915500', 0, '<br>Mitas MC30  - предназначены для всех типов дорог и минимального бездорожья.<br/>\n<br>Invader MC30 - мотошины для мотоциклов двойного назначения и туристических эндуро, ориентированные на езду по асфальту и дорогам с твердым покрытием. Обеспечивают отличную управляемость на мокрой дороге и легком бездорожье в любую погоду.<br/>\n<br>Вес шины: 4,6 кг<br/>\n<br>Индекс нагрузки: 54<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '90-90-21-54h-tl-mc30-invader', NULL, NULL, 1, 0, 'df3e9a7f-325b-11e8-8192-ed790c9fa917');
INSERT INTO `parf_goods` (`id`, `default_category_id`, `category_ids`, `parent_category`, `brand_id`, `name_1`, `name_2`, `name_in_cyrillic`, `vendor_code`, `vendor_code_id`, `description`, `price`, `existence`, `new`, `sex`, `flavors_group`, `top_note`, `heart_note`, `base_note`, `perfumer`, `collection`, `series`, `country`, `release`, `rating`, `number_of_votes`, `meta_title`, `meta_description`, `meta_keywords`, `rewrite`, `related`, `recommended`, `active`, `count_show`, `id_import`) VALUES
(297, 0, '', 0, 0, '120/90-10 66M S-11 WINTER FRICTION TL', NULL, '', '915366', 0, '<br>Mitas S-11 – шины для скутера, использующегося на бездорожье или зимой.<br/>\n<br>Модель разработана для преимущественной эксплуатации на бездорожье, но предполагает и использование на асфальте. Покрышки Mitas S-11 пригодны для использования в зимних условиях и шипования.<br/>\n<br>Winter Friction - специальный вариант для использования в зимних условиях, подходит также для шипов.<br/>\n<br>Вес шины: <br/>\n<br>Индекс нагрузки: 66<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-90-10-66m-s-11-winter-friction-tl', NULL, NULL, 1, 0, 'd941f9cb-325b-11e8-8192-ed790c9fa917'),
(298, 4, '4|1', 1, 0, '100/90-19 M/C 57R E-09 DAKAR TL', NULL, '', '925731', 0, '<br>Mitas E09 - подходит для пустынных и раллийных соревнований.<br/>\n<br>Протектор наделен эксклюзивным сочетанием элементов для совершенного сцепления на любой скорости. Благодаря прочной конструкции шины очень надежны, устойчивы к проколам.<br/>\n<br>Dakar - протектор с усиленным каркасом дляэкстремального вождения или гонок.<br/>\n<br>Вес шины: 4,9<br/>\n<br>Индекс нагрузки: 57<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '100-90-19-m-c-57r-e-09-dakar-tl', NULL, NULL, 1, 0, 'f27ec1d9-325b-11e8-8192-ed790c9fa917'),
(299, 2, '2|1', 1, 0, '110/90-19M/C 62M C-16 TT', NULL, '', '881144', 0, '<br>Mitas C16 – модернизированная мотоциклетная покрышка от небезызвестного шинного гиганта из Европы. Она предназначается для маневренной езды по твердому дорожному полотну. Также вашему байку покорятся каменистые спуски и подъемы. Протектор имеет особенный узор. Он представляет собой совокупность массивных блоков, размещенных с определенными интервалами. Они были скрупулезно просчитаны в уникальной компьютерной программе для виртуального моделирования.<br/>\n<br>Резиновая смесь имеет особую прочность. Она дополнена новейшими полимерами, стойкими к абразивному и механическому стороннему воздействию.<br/>\n<br>Вес шины: 5,4 кг<br/>\n<br>Индекс нагрузки: 62<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-90-19m-c-62m-c-16-tt', NULL, NULL, 1, 0, 'c523b9d0-325b-11e8-8192-ed790c9fa917'),
(300, 4, '4|1', 1, 0, '120/90-17M/C 64R E-09 DAKAR TL', NULL, '', '925781', 0, '<br>Mitas E09 - подходит для пустынных и раллийных соревнований.<br/>\n<br>Протектор наделен эксклюзивным сочетанием элементов для совершенного сцепления на любой скорости. Благодаря прочной конструкции шины очень надежны, устойчивы к проколам.<br/>\n<br>Dakar - протектор с усиленным каркасом дляэкстремального вождения или гонок.<br/>\n<br>Вес шины: 6,2<br/>\n<br>Индекс нагрузки: 64<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-90-17m-c-64r-e-09-dakar-tl', NULL, NULL, 1, 0, 'f27ec2ad-325b-11e8-8192-ed790c9fa917'),
(301, 2, '2|1', 1, 0, '80/100-21 51M C-25 TT', NULL, '', '920513', 0, '<br>Модель Mitas C-25 разработана для преимущественного использования по грязи и песку.<br/>\n<br>Передние шины с рисунком протектора для очень мягкой и вязкой местности. Отличные ходовые свойства на песке и на грязи. Хорошие самоочищающиеся свойства.<br/>\n<br>Вес шины: 3,7 кг<br/>\n<br>Индекс нагрузки: 51<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '80-100-21-51m-c-25-tt', NULL, NULL, 1, 0, 'ec3eeccb-325b-11e8-8192-ed790c9fa917'),
(302, 0, '', 0, 0, '3.50-8 46J TT B13', NULL, '', '915445', 0, '<br>Мотошины Sava B13 обеспечивают отличную скоростную езду, водоотведение, маневренность.<br/>\n<br>Оригинальный рисунок протектора гарантирует высокие сцепные, тяговые и тормозные характеристики.<br/>\n<br>Вес шины: 1,6 кг<br/>\n<br>Индекс нагрузки: 46<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '3-50-8-46j-tt-b13', NULL, NULL, 1, 0, 'd941fa40-325b-11e8-8192-ed790c9fa917'),
(303, 2, '2|1', 1, 0, '140/80-18 70R EF-07 SUPER LIGHT TT', NULL, '', '889995', 0, '<br>Mitas EF-07 разработана для преимущественного использования по гравию, камням, горной местности.<br/>\n<br>Обновленная резиновая смесь улучшила ходовые параметры шины. Большое содержание кремния повысило износостойкие качества протектора, в результате увеличился срок использования. Новая силика обеспечила повышенную эластичность, за счет этого улучшилось сцепление Mitas EF-07 на влажном дорожном покрытии. Сочетание обновленной резиновой смеси и оптимального подобранных протекторных блоков позволило увеличить пятно контакта с дорожной поверхностью.<br/>\n<br>Super Light - протектор из особой смеси и легким каркасом для Enduro Extreme.<br/>\n<br>Reinforced - увеличенный индекс грузоподъемности(нагрузки) шины по E.T.R.T.O.<br/>\n<br>Вес шины: 5,4 кг<br/>\n<br>Индекс нагрузки: 70<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '140-80-18-70r-ef-07-super-light-tt', NULL, NULL, 1, 0, 'd2e068e2-325b-11e8-8192-ed790c9fa917'),
(304, 3, '3|1', 1, 0, '3.00-18M/C 52P REINF H-03 TT', NULL, '', '881008', 0, '<br>Mitas H03 – высокотехнологичная европейская покрышка с бескомпромиссным качеством. Она станет лучшим вариантом для установки на обе оси мотоциклетного транспортного средства. Таким образом, вам будет обеспечена исключительная «цепкость» в любом скоростном режиме. Изумительный компаунд медленно изнашивается. Он почти не подвержен негативному механическому воздействию. С этими шинами вы стабильно проедете солидное количество километров! Мотошина отличается эталонной проходимостью.<br/>\n<br>Reinforced - увеличенный индекс грузоподъемности(нагрузки) шины по E.T.R.T.O.<br/>\n<br>Вес шины: 3,8 кг<br/>\n<br>Индекс нагрузки: 52<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '3-00-18m-c-52p-reinf-h-03-tt', NULL, NULL, 1, 0, 'b1201c52-325b-11e8-8192-ed790c9fa917'),
(305, 4, '4|1', 1, 0, '90/90-21M/C 54T E-08 TL', NULL, '', '881067', 0, '<br>Mitas E-08 подходит для грунтовых дорог и сухой пересеченной местности.<br/>\n<br>Протектор наделен специфическим рисунком, разработанным командой инженеров по трехмерной технологии. Благодаря этому вся совокупность элементов размещена со скрупулезно просчитанными интервалами. Таким образом, центральная часть шины обладает феноменальным сцепление. Оно будет продемонстрировано на дорожном полотне любого качества.<br/>\n<br>Вес шины: 3,3 кг<br/>\n<br>Индекс нагрузки: 54<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '90-90-21m-c-54t-e-08-tl', NULL, NULL, 1, 0, 'b831b5ee-325b-11e8-8192-ed790c9fa917'),
(306, 2, '2|1', 1, 0, '120/90-19M/C 66N C-16 WIN FRIC TT', NULL, '', '881151', 0, '<br>Mitas C16 – модернизированная мотоциклетная покрышка от небезызвестного шинного гиганта из Европы. Она предназначается для маневренной езды по твердому дорожному полотну. Также вашему байку покорятся каменистые спуски и подъемы. Протектор имеет особенный узор. Он представляет собой совокупность массивных блоков, размещенных с определенными интервалами. Они были скрупулезно просчитаны в уникальной компьютерной программе для виртуального моделирования.<br/>\n<br>Резиновая смесь имеет особую прочность. Она дополнена новейшими полимерами, стойкими к абразивному и механическому стороннему воздействию.<br/>\n<br>Winter Friction - специальный вариант для использования в зимних условиях, подходит также для шипов.<br/>\n<br>Вес шины: 6 кг<br/>\n<br>Индекс нагрузки: 66<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-90-19m-c-66n-c-16-win-fric-tt', NULL, NULL, 1, 0, 'c523ba37-325b-11e8-8192-ed790c9fa917'),
(307, 2, '2|1', 1, 0, '100/90-19 M/C 57M C-18 SUPER LIGHT TT', NULL, '', '885574', 0, '<br>Mitas C18 – идеальная разработка для задней оси мототранспорта. Это вариант С17 для задней оси. Протектор имеет универсальный узор, позволяющий покрышке демонстрировать изумительные «цепные» показатели в любых дорожных условиях! Покоряйте своему мотору даже сыпучие грунты!<br/>\n<br>Моторезина отличается адаптированной под повышенные нагрузки конструкцией. Внутри шины давление распределяется за доли секунды. Благодаря этому происходит медленное и равномерное изнашивание. В такой «обуви» вы сможете отлично ездить в дождливую погоду, поскольку протектор обладает феноменальными дренажными показателями.<br/>\n<br>Super Light - протектор из особой смеси и легким каркасом для Enduro Extreme.<br/>\n<br>Вес шины: 4,5 кг<br/>\n<br>Индекс нагрузки: 57<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '100-90-19-m-c-57m-c-18-super-light-tt', NULL, NULL, 1, 0, 'd2e0684b-325b-11e8-8192-ed790c9fa917'),
(308, 4, '4|1', 1, 0, '150/70B18 M/C 70T E-10 TL', NULL, '', '881083', 0, '<br>Mitas E10 - предназначены для всех типов дорог и умеренного бездорожья.<br/>\n<br>При разработке резиновой смеси использовалось огромное число новых компонентов, которые увеличили эксплуатационные качества шины Mitas E-10. Повысить износостойкие параметры помог кремний, за счет этого срок службы шину увеличился. Новая силика обеспечила резине повышенную эластичность, что положительно сказалось на сцеплении с влажным дорожным покрытием. Новая резиновая смесь позволила уменьшить сопротивление качению, что повысило устойчивость при движении на высоких скоростях.<br/>\n<br>Вес шины: 7,6 кг<br/>\n<br>Индекс нагрузки: 70<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '150-70b18-m-c-70t-e-10-tl', NULL, NULL, 1, 0, 'b831b678-325b-11e8-8192-ed790c9fa917'),
(309, 2, '2|1', 1, 0, '100/90-19 57M C-30 TERRACROSS TT', NULL, '', '926994', 0, '<br>Mitas C30 представляет собой уникальную разработку именитого шинного концерна. Покрышка отличается универсальностью. Протектор обладает улучшенным узором, который без проблем справляется даже с нестабильными дорожными полотнами.<br/>\n<br>Дизайн протектора обеспечивает оптимальную производительность во всех режимах вождения.<br/>\n<br>Вес шины: 5,3 кг<br/>\n<br>Индекс нагрузки: 57<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '100-90-19-57m-c-30-terracross-tt', NULL, NULL, 1, 0, 'f8fee40e-325b-11e8-8192-ed790c9fa917'),
(310, 2, '2|1', 1, 0, '60/100-14 30M C-19 WINTER FRICTION TT', NULL, '', '926119', 0, '<br>Mitas C-19 разработана для преимущественного использования по гравию, камням, горной местности.<br/>\n<br>Кроссовые шины Mitas C-19 одобрены для эксплуатации в соответствии с DOT EN, 80% по бездорожью, 20% на дорогах.<br/>\n<br>Winter Friction - специальный вариант для использования в зимних условиях, подходит также для шипов.<br/>\n<br>Вес шины:1,5 кг<br/>\n<br>Индекс нагрузки: 30<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '60-100-14-30m-c-19-winter-friction-tt', NULL, NULL, 1, 0, 'f8fee386-325b-11e8-8192-ed790c9fa917'),
(311, 0, '', 0, 0, '90/90-14 46P TL MC38 MAX SCOOT', NULL, '', '944952', 0, '<br>Шины Mitas MC38 - Всесезонные покрышки для максискутера, подходящие как для сухой, так и влажной поверхности.<br/>\n<br>Современный рисунок протектора Mitas MC38 обеспечивает стабильность и комфорт на высоких скоростях и прекрасно отводит воду. Новый состав резины обеспечивает превосходное сцепление и длительный срок службы.<br/>\n<br>Вес шины: 2,6 кг<br/>\n<br>Индекс нагрузки: 46<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '90-90-14-46p-tl-mc38-max-scoot', NULL, NULL, 1, 0, '05e03d62-325c-11e8-8192-ed790c9fa917'),
(312, 2, '2|1', 1, 0, '120/90-19M/C 66N C-16 TT', NULL, '', '881152', 0, '<br>Mitas C16 – модернизированная мотоциклетная покрышка от небезызвестного шинного гиганта из Европы. Она предназначается для маневренной езды по твердому дорожному полотну. Также вашему байку покорятся каменистые спуски и подъемы. Протектор имеет особенный узор. Он представляет собой совокупность массивных блоков, размещенных с определенными интервалами. Они были скрупулезно просчитаны в уникальной компьютерной программе для виртуального моделирования.<br/>\n<br>Резиновая смесь имеет особую прочность. Она дополнена новейшими полимерами, стойкими к абразивному и механическому стороннему воздействию.<br/>\n<br>Вес шины: 5,6 кг<br/>\n<br>Индекс нагрузки: 66<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-90-19m-c-66n-c-16-tt', NULL, NULL, 1, 0, 'c523ba44-325b-11e8-8192-ed790c9fa917'),
(313, 4, '4|1', 1, 0, '4.00-19 M/C 71P E-05 TT', NULL, '', '915654', 0, '<br>Mitas E-05 предназначен для легкого бездорожья.<br/>\n<br>На любой оси покрышка продемонстрирует феноменальные рабочие параметры. На магистралях хорошего и даже плохого качества вы будете почувствовать себя уверенно.<br/>\n<br>Вес шины: 5,9 кг<br/>\n<br>Индекс нагрузки: 71<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '4-00-19-m-c-71p-e-05-tt', NULL, NULL, 1, 0, 'e5518f21-325b-11e8-8192-ed790c9fa917'),
(314, 4, '4|1', 1, 0, '150/70-18 M/C 70T E-07 TL', NULL, '', '906764', 0, '<br>Mitas E-07 специально создана для мотоциклов, которые эксплуатируются на любой дорожной поверхности. Отличительной особенностью этой модели является необычный протекторный рисунок, который обеспечивает повышенную устойчивость и уверенное управление на любой дорожной поверхности.<br/>\n<br>Вся поверхность шины покрыта необычными блоками, которые обеспечивают отличную устойчивость и управляемость. Оптимально подобранные расстояния между блоками предотвращают застревание камней в протекторе и повышают самоочищение. В плечевой зоне, блоки имеют другую форму, за счет этого достигается повышенная устойчивость при любых маневрах. Отличная курсовая устойчивость и быстрая обратная связь обеспечивается центральной частью протектора, где пересекаются блоки.<br/>\n<br>Вес шины: 7,7 кг<br/>\n<br>Индекс нагрузки: 70<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '150-70-18-m-c-70t-e-07-tl', NULL, NULL, 1, 0, 'd941f91f-325b-11e8-8192-ed790c9fa917'),
(315, 2, '2|1', 1, 0, '120/90-18M/C 71N REINF C-02 TT', NULL, '', '881123', 0, '<br>Mitas C02 – прекрасные покрышки европейского производства с широким набором характеристик. Предназначается для задней оси мотоциклетных транспортных средств. Модель Mitas C-02 разработана для преимущественного использования по гравию, камням.<br/>\n<br>Резиновая смесь дополнена стойкими к абразивному износу полимерами.<br/>\n<br>Reinforced - увеличенный индекс грузоподъемности(нагрузки) шины по E.T.R.T.O.<br/>\n<br>Вес шины: 5,7 кг<br/>\n<br>Индекс нагрузки: 71<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-90-18m-c-71n-reinf-c-02-tt', NULL, NULL, 1, 0, 'befe4e15-325b-11e8-8192-ed790c9fa917'),
(316, 3, '3|1', 1, 0, '190/50ZR17 73W TL SPORTFORCE+', NULL, '', '920518', 0, '<br>Мотоциклетная шина Mitas SportForce+ является одним из флагманов модельного ряда известного чешского производителя. Об этом можно судить по технологиям, использованным в ее конструкции. Многие из них ранее применялись исключительно в мотоспорте, что лишний раз подтверждает высокую производительность данной модели, предназначенной для спортбайков. Мотоциклетная шина Mitas SportForce+ является одним из флагманов модельного ряда известного чешского производителя. Об этом можно судить по технологиям, использованным в ее конструкции. Многие из них ранее применялись исключительно в мотоспорте, что лишний раз подтверждает высокую производительность данной модели, предназначенной для спортбайков.<br/>\n<br>Особенности:<br/>\n<br>Оптимизированный дизайн дренажных канавок.<br/>\n<br>Протекторный рисунок Mitas SportForce+ содержит большое количество дренажных канавок. Эти элементы отличаются формой и расположением, специально подобранными не только с целью обеспечить максимальную устойчивость к аквапланированию. Они имеют значительную протяженность, будучи расположенными под острым углом относительно направления. В сочетании со сложной многоугольной формой их боковых стенок это позволяет шине чрезвычайно эффективно сопротивляться перегреву, отводя значительную часть тепла в окружающее пространство. Те же конструктивные особенности позволяют дренажным канавкам превосходно справляться с отводом воды от пятна контакта, обеспечивая шине хорошую устойчивость в дождливую погоду.<br/>\n<br>Жесткий каркас.<br/>\n<br>Еще одним нововведением данной модели является технология SCT. За этой аббревиатурой (Strong Carcass Technology) скрывается конструкция каркаса, корд которого намотан таким образом, что в нем отсутствуют какие-либо стыки и швы. В результате шина прекрасно сохраняет свою первоначальную форму даже при самом сильном воздействии разнонаправленных сил ускорения, обеспечивая быстрые и точные реакции на действия байкера. Еще одним преимуществом данной технологии является улучшившаяся устойчивость к неравномерному износу.<br/>\n<br>Основные особенности мотошины Mitas SportForce+<br/>\n<br>— оптимизированное расположение и форма дренажных канавок обеспечивает не только высокую устойчивость к аквапланированию, но и снижает уровень нагрева при движении на высокой скорости;<br/>\n<br>— жесткий каркас улучшает управляемость и устойчивость при прохождении поворотов, придает реакциям шины быстроту и точность;<br/>\n<br>— стабильные сцепные свойства в любых условиях благодаря использованию при разработке технологий компьютерного моделирования.<br/>\n<br>Конструкция: Радиальная<br/>\n<br>Индекс нагрузки: 73<br/>\n<br>Вес шины: 6,6 кг<br/>\n<br>Страна производства: Словения<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '190-50zr17-73w-tl-sportforce-', NULL, NULL, 1, 0, 'ec3eed0e-325b-11e8-8192-ed790c9fa917'),
(317, 0, '', 0, 0, '130/70-12 62P MC20 REINF. TL', NULL, '', '950539', 0, '<br>Шины Mitas MC20 - всепогодные шины для скутеров. Отличная управляемость и долгий срок службы.<br/>\n<br>Эксклюзивная по составу резиновая смесь стойко справляется с абразивным воздействием асфальтного полотна.<br/>\n<br>Reinforced - увеличенный индекс грузоподъемности(нагрузки) шины по E.T.R.T.O.<br/>\n<br>Вес шины: 3 кг<br/>\n<br>Индекс нагрузки: 62<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '130-70-12-62p-mc20-reinf--tl', NULL, NULL, 1, 0, '137b8076-325c-11e8-8192-ed790c9fa917'),
(318, 4, '4|1', 1, 0, '150/70-17 M/C 69R E-09 TL', NULL, '', '922908', 0, '<br>Mitas E09 - подходит для пустынных и раллийных соревнований.<br/>\n<br>Протектор наделен эксклюзивным сочетанием элементов для совершенного сцепления на любой скорости. Благодаря прочной конструкции шины очень надежны, устойчивы к проколам.<br/>\n<br>Вес шины: 7,5 кг<br/>\n<br>Индекс нагрузки: 69<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '150-70-17-m-c-69r-e-09-tl', NULL, NULL, 1, 0, 'ec3eed74-325b-11e8-8192-ed790c9fa917'),
(319, 2, '2|1', 1, 0, '130/90-18M/C 69R EF-07 SUPER LIGHT TT', NULL, '', '915321', 0, '<br>Mitas EF-07 разработана для преимущественного использования по гравию, камням, горной местности.<br/>\n<br>Обновленная резиновая смесь улучшила ходовые параметры шины. Большое содержание кремния повысило износостойкие качества протектора, в результате увеличился срок использования. Новая силика обеспечила повышенную эластичность, за счет этого улучшилось сцепление Mitas EF-07 на влажном дорожном покрытии. Сочетание обновленной резиновой смеси и оптимального подобранных протекторных блоков позволило увеличить пятно контакта с дорожной поверхностью.<br/>\n<br>Super Light - протектор из особой смеси и легким каркасом для Enduro Extreme.<br/>\n<br>Reinforced - увеличенный индекс грузоподъемности(нагрузки) шины по E.T.R.T.O.<br/>\n<br>Вес шины: 5,4 кг<br/>\n<br>Индекс нагрузки: 69<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '130-90-18m-c-69r-ef-07-super-light-tt', NULL, NULL, 1, 0, 'd941f9be-325b-11e8-8192-ed790c9fa917'),
(320, 2, '2|1', 1, 0, '70/100-19 42M C-19 TT', NULL, '', '881134', 0, '<br>Mitas C-19 разработана для преимущественного использования по гравию, камням, горной местности.<br/>\n<br>Кроссовые шины Mitas C-19 одобрены для эксплуатации в соответствии с DOT EN, 80% по бездорожью, 20% на дорогах.<br/>\n<br>Вес шины: 2,5 кг<br/>\n<br>Индекс нагрузки: 42<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '70-100-19-42m-c-19-tt', NULL, NULL, 1, 0, 'c523b95c-325b-11e8-8192-ed790c9fa917'),
(321, 0, '', 0, 0, '120/70-12 58P TL MC20 REINF. V7', NULL, '', '928518', 0, '<br>Шины Sava MC20 - всепогодные шины для скутеров. Отличная управляемость и долгий срок службы.<br/>\n<br>Эксклюзивная по составу резиновая смесь стойко справляется с абразивным воздействием асфальтного полотна.<br/>\n<br>Reinforced - увеличенный индекс грузоподъемности(нагрузки) шины по E.T.R.T.O.<br/>\n<br>Вес шины: 2,8 кг<br/>\n<br>Индекс нагрузки: 58<br/>\n<br>Страна производства: Словения<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-70-12-58p-tl-mc20-reinf--v7', NULL, NULL, 1, 0, 'ff45d399-325b-11e8-8192-ed790c9fa917'),
(322, 2, '2|1', 1, 0, '90/90-21M/C 54R C-15 TT', NULL, '', '947223', 0, '<br>Mitas C-15 разработана для преимущественного использования по гравию.<br/>\n<br>Данная моторезина предназначена для установки на переднюю ось.<br/>\n<br>Soft Terrain - технология, позволяющая использовать ваш мотоцикл на мягких грунтах.<br/>\n<br>Вес шины: 3,3 кг<br/>\n<br>Индекс нагрузки: 54<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '90-90-21m-c-54r-c-15-tt', NULL, NULL, 1, 0, '0ce5e2b4-325c-11e8-8192-ed790c9fa917'),
(323, 2, '2|1', 1, 0, '2.75-23 48P SW-02 ICE TT', NULL, '', '915653', 0, '<br>Mitas SW-02 рекомендована для классических и длинных кольцевых гонок с отличным сцеплением в поворотах.<br/>\n<br>Данная моторезина предназначена для установки на переднюю ось.<br/>\n<br>Ice - для соревнований на льду. <br/>\n\n<br>Вес шины: 2,3 кг<br/>\n<br>Индекс нагрузки: 48<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '2-75-23-48p-sw-02-ice-tt', NULL, NULL, 1, 0, 'e5518f15-325b-11e8-8192-ed790c9fa917'),
(324, 3, '3|1', 1, 0, '130/80-17M/C 65H H-17 TL', NULL, '', '881035', 0, '<br>Mitas H17 – своеобразная мотопокрышка для дорожника с экспрессивным характером. Ходовые параметры подбирались инженерами европейского концерна для удовлетворения потребностей высокоскоростных моторов. Геометрия каркаса у такой модели является безупречной. Это позволит блистательно маневрировать на любой скорости. Резиновая смесь представляет собой сочетание суперкрепких синтетических компонентов. Благодаря этому она является невероятно устойчивой к различным абразивным воздействиям, которые неизбежно появляются при езде даже по качественному дорожному полотну.<br/>\n<br>Конструкция: Диагональная<br/>\n<br>Индекс нагрузки: 65<br/>\n<br>Вес шины: 6,1 кг<br/>\n<br>Страна производства: Словения<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '130-80-17m-c-65h-h-17-tl', NULL, NULL, 1, 0, 'b1201ce2-325b-11e8-8192-ed790c9fa917'),
(325, 2, '2|1', 1, 0, '80/100-21 51M C-27 ТТ', NULL, '', '924331', 0, '<br>Модель Mitas C-27 разработана для преимущественного использования по камням, горной местности. Мотошины этой модели , маркированные красной полосой рекомендуется использовать на твердых, сверхтвердых грунтах.<br/>\n<br>Вес шины: 3,6 кг<br/>\n<br>Индекс нагрузки: 51<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '80-100-21-51m-c-27-tt', NULL, NULL, 1, 0, 'ec3eeda3-325b-11e8-8192-ed790c9fa917'),
(326, 0, '', 0, 0, '140/90-15 70R TL/TT MC7', NULL, '', '925835', 0, '<br>Mitas MC7 - это высокоскоростные шины диагональной конструкции. Шины Mitas MC7 используются в профессиональных мотогонках, отличаются хорошим сцеплением с дорогой и длительным сроком службы. Данная моторезина рекомендуется для спорта, супермото, мотоциклов с низким и средним объемом двигателя. Конструкция шин Mitas MC7 позволяет использовать их не только на гоночных трассах, но и в повседневной жизни. Mitas MC7 - многофункциональная шина с отличной производительностью на сухом дорожном покрытии и в то же время с отличной управляемостью на мокром. Жесткость боковой стенки обеспечивает стабильность шины на гоночных трассах.<br/>\n<br>Вес шины: 6,1 кг<br/>\n<br>Индекс нагрузки: 70<br/>\n<br>Страна производства: Словения<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '140-90-15-70r-tl-tt-mc7', NULL, NULL, 1, 0, 'f8fee330-325b-11e8-8192-ed790c9fa917'),
(327, 0, '', 0, 0, '2 3/4-17 47J TL/TT B7 B Сава (белая боковина)', NULL, '', '915448', 0, '<br>Sava B7 - шины для мопедов.<br/>\n<br>Reinforced - увеличенный индекс грузоподъемности(нагрузки) шины по E.T.R.T.O..<br/>\n<br>Вес шины: 1,3 кг<br/>\n<br>Индекс нагрузки: 47<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '2-3-4-17-47j-tl-tt-b7-b-sava--belaya-bokovina-', NULL, NULL, 1, 0, 'df3e9a36-325b-11e8-8192-ed790c9fa917'),
(328, 0, '', 0, 0, '130/60-13 60P TL MC32 WIN SCOOT', NULL, '', '915504', 0, '<br>Шины Mitas MC32 WIN SCOOT - идеальный выбор для тех, кто использует свой мотоцикл или скутер зимой и в межсезонье.<br/>\n<br>Эти шины обладают высокими эксплутационными характеристиками при низких температурах, на снегу, льду и мокрой дороге.<br/>\n<br>Вес шины: 4 кг<br/>\n<br>Индекс нагрузки: 60<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '130-60-13-60p-tl-mc32-win-scoot', NULL, NULL, 1, 0, 'df3e9a99-325b-11e8-8192-ed790c9fa917'),
(329, 2, '2|1', 1, 0, '100/100-18 59R C-20 TT', NULL, '', '881115', 0, '<br>Mitas C20 представляет собой уникальную разработку именитого шинного концерна. Покрышка отличается универсальностью. Протектор обладает улучшенным узором, который без проблем справляется даже с нестабильными дорожными полотнами.<br/> \n<br>Благодаря суперкрепкому компаунду в разы повышается срок эксплуатации такого изделия. Шина обладает высоким европейским качеством. Она надежно защищена от механических повреждений и абразивного воздействия магистралей.<br/> \n<br>Вес шины: 5,2 кг<br/>\n<br>Индекс нагрузки: 59<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '100-100-18-59r-c-20-tt', NULL, NULL, 1, 0, 'befe4d9e-325b-11e8-8192-ed790c9fa917'),
(330, 2, '2|1', 1, 0, '120/80-19M/C 63R EF-05 SUPER TT', NULL, '', '881089', 0, '<br>Mitas EF-05 разработана для преимущественного использования по грязи и песку, гравию.<br/>\n<br>Компаунд наделен исключительными показателями эластичности. Благодаря этому шиной полностью «поглощаются» различные неровности городских и загородных магистральных «джунглей». Моторезина имеет современный каркас, что делает ее идеальным вариантом для любителей FIM-чемпионатов. <br/>\n<br>Super-протектор из особой смеси для гонок Enduro.<br/>\n<br>Вес шины: 5,3 кг<br/>\n<br>Индекс нагрузки: 63<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-80-19m-c-63r-ef-05-super-tt', NULL, NULL, 1, 0, 'b831b6c6-325b-11e8-8192-ed790c9fa917'),
(331, 3, '3|1', 1, 0, '2.75-19M/C 43P H-01 TT', NULL, '', '885557', 0, '<br>Дорожная моторезина Mitas H-01 обладает ленточным рисунком протектора, который подходит для задних и передних колес мотоцикла.Данная моторезина предназначена для эксплуатации по качественной дороге.<br/>\n<br>Вес шины: 3,2 кг<br/>\n<br>Индекс нагрузки: 43<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '2-75-19m-c-43p-h-01-tt', NULL, NULL, 1, 0, 'd2e067fc-325b-11e8-8192-ed790c9fa917'),
(332, 2, '2|1', 1, 0, '90/90-14 40M C-21 TT', NULL, '', '889993', 0, '<br>Mitas C21 создавались признанным шинником на основе высоких технологий, которые только начинают использоваться в отрасли. В результате шина может похвастаться эксклюзивным сочетанием ходовых параметров.<br/>\n<br>Компаунд был специально усовершенствован для этой модели. В него включены особые компоненты для непревзойденной прочности.<br/>\n<br>Вес шины: 2,7 кг<br/>\n<br>Индекс нагрузки: 40<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '90-90-14-40m-c-21-tt', NULL, NULL, 1, 0, 'd2e068d3-325b-11e8-8192-ed790c9fa917'),
(333, 0, '', 0, 0, '150/70-14 66S MC28 DIAMOND S TL', NULL, '', '950522', 0, '<br>Шины Mitas - MC28 - всесезонные шины, сделаны специально для максискутеров.<br/>\n<br>Mitas MC28 обладают отличной продольной и угловой стабильностью. <br/>\n<br>Долговечная резиновая смесь выдерживает скоростные и весовые нагрузки и отлично держит дорогу в любую погоду.<br/>\n<br>Вес шины: 5,2 кг<br/>\n<br>Индекс нагрузки: 66<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '150-70-14-66s-mc28-diamond-s-tl', NULL, NULL, 1, 0, '0ce5e2df-325c-11e8-8192-ed790c9fa917'),
(334, 0, '', 0, 0, '11X6.00-5 SRH', NULL, '', '915680', 0, '<br>Покрышки для картинга SRH — очень жесткие прокатные покрышки.<br/>\n<br>Подходят для езды как под открытым небом, так и в закрытых помещениях, долгий срок службы при высоких температурах, подходят также для езды на прокатных картах.<br/>\n<br>Вес шины: 1,5 кг<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '11x6-00-5-srh', NULL, NULL, 1, 0, 'e5518f87-325b-11e8-8192-ed790c9fa917'),
(335, 3, '3|1', 1, 0, '100/90-19 57H TL MC50', NULL, '', '925730', 0, '<br>\"Mitas MC50 - это высокоскоростные шины диагональной конструкции. Шины Mitas MC50 используются в профессиональных мотогонках, отличаются хорошим сцеплением с дорогой и длительным сроком службы. Данная моторезина рекомендуется для спорта, супермото, мотоциклов с низким и средним объемом двигателя. Конструкция шин Mitas MC50 позволяет использовать их не только на гоночных трассах, но и в повседневной жизни. Mitas MC50 - многофункциональная шина с отличной производительностью на сухом дорожном покрытии и в то же время с отличной управляемостью на мокром. Жесткость боковой стенки обеспечивает стабильность шины на гоночных трассах.<br/>\n<br>Конструкция: Диагональная<br/>\n<br>Индекс нагрузки: 57<br/>\n<br>Вес шины: 3,7 кг<br/>\n<br>Страна производства: Словения<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '100-90-19-57h-tl-mc50', NULL, NULL, 1, 0, 'f27ec1cc-325b-11e8-8192-ed790c9fa917'),
(336, 0, '', 0, 0, '2.75/3.00/3.25-18 TR6 BOX T', NULL, '', '942302', 0, '<br>Камеры изготовлены из бутилкаучука и имеют следующие маркировки:<br/> \n<br><br/>\n<br>Mitas и SAVA<br/>\n<br><br/>\n<br>UHD - камера толщиной 4 мм для очень больших нагрузок<br/>\n<br>HD - камера толщиной 1,9-2,0 мм для больших нагрузок<br/>\n<br>Normal - камера толщиной 1,2-1,4 мм для не больших нагрузок, как правило устонавливаются на скутеры или малокубатурные мотоциклы<br/>\n<br>BOX - камера упакована в отдельную коробку<br/>\n<br>JS87, TR87, 90/90 - камера имеет изогнутый вентель<br/>\n<br>34G, TR6 - камера имеет прямой вентель<br/>\n<br><br/>\n<br>КАБАТ<br/>\n<br><br/>\n<br>HD - усиленные камеры для больших нагрузок<br/>\n<br>GP4(TR-4)(V1.09.1) - камера имеет прямой вентель<br/>\n<br>Все камеры марки КАБАТ не имеют упаковки<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '2-75-3-00-3-25-18-tr6-box-t', NULL, NULL, 1, 0, '05e03c4f-325c-11e8-8192-ed790c9fa917'),
