(338, 4, '4|1', 1, 0, '120/90-17 64S MC24 INVADER TL', NULL, '', '935190', 0, '<br>Mitas MC24  - диагональные покрышки двойного назначения с более выраженным рисунком протектора, чем у моделей MC30, E-08<br/>\n<br>INVADER MC24 - мотошины для мотоциклов двойного назначения и туристических эндуро, ориентированные на езду по асфальту и дорогам с твердым покрытием. Обеспечивают отличную управляемость на мокрой дороге и легком бездорожье в любую погоду.<br/>\n<br>Вес шины: 5,8 кг<br/>\n<br>Индекс нагрузки: 64<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-90-17-64s-mc24-invader-tl', NULL, NULL, 1, 0, 'ff45d3d7-325b-11e8-8192-ed790c9fa917'),
(339, 0, '', 0, 0, '10X4.50-5 SRH', NULL, '', '915671', 0, '<br>Покрышки для картинга SRH — очень жесткие прокатные покрышки.<br/>\n<br>Подходят для езды как под открытым небом, так и в закрытых помещениях, долгий срок службы при высоких температурах, подходят также для езды на прокатных картах.<br/>\n<br>Вес шины: 1,5 кг<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '10x4-50-5-srh', NULL, NULL, 1, 0, 'e5518f7c-325b-11e8-8192-ed790c9fa917'),
(340, 2, '2|1', 1, 0, '3.00-21 57P REIN SW-08 ICE SPEEDWAY TT', NULL, '', '881172', 0, '<br>Mitas SW-08 Ice Speedway - гладкий рисунок протектора для задних колес, разработанный специально для использования с шипами для соревнований на льду.<br/>\n<br>Данная моторезина предназначена для установки на заднюю ось.<br/>\n<br>Reinforced - увеличенный индекс грузоподъемности(нагрузки) шины по E.T.R.T.O.\n<br>Вес шины: 3,6 кг<br/>\n<br>Индекс нагрузки: 57<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '3-00-21-57p-rein-sw-08-ice-speedway-tt', NULL, NULL, 1, 0, 'c523bb10-325b-11e8-8192-ed790c9fa917'),
(341, 0, '', 0, 0, '120/80-14 58S TL MC28 DIAMOND S', NULL, '', '927058', 0, '<br>Шины Mitas - MC28 - всесезонные шины, сделаны специально для максискутеров.<br/>\n<br>Mitas MC28 обладают отличной продольной и угловой стабильностью. <br/>\n<br>Долговечная резиновая смесь выдерживает скоростные и весовые нагрузки и отлично держит дорогу в любую погоду.<br/>\n<br>Вес шины: 3,9 кг<br/>\n<br>Индекс нагрузки: 58<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-80-14-58s-tl-mc28-diamond-s', NULL, NULL, 1, 0, 'ff45d377-325b-11e8-8192-ed790c9fa917'),
(342, 2, '2|1', 1, 0, '3.50-16 58P REINF C-01 TT', NULL, '', '881106', 0, '<br>Mitas C01 – прекрасные покрышки европейского производства с широким набором характеристик. Разработана для преимущественного использования по гравию, камням. Данная моторезина предназначена для установки на любую ось.<br/>\n<br>Reinforced - увеличенный индекс грузоподъемности(нагрузки) шины по E.T.R.T.O.<br/>\n<br>Вес шины: 3,6 кг<br/>\n<br>Индекс нагрузки: 68<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '3-50-16-58p-reinf-c-01-tt', NULL, NULL, 1, 0, 'befe4d38-325b-11e8-8192-ed790c9fa917'),
(343, 2, '2|1', 1, 0, '3.75-19 61P SW-07 TT', NULL, '', '881170', 0, '<br>Mitas SW-07 - Рисунок протектора для кольцевых гонок в соответствии с новыми правилами FIM.<br/>\n<br>Ламельный рисунок с усиленной боковиной имеет отличные ездовые качества при старте и на поворотах. Данная моторезина предназначена для установки на заднюю ось.<br/>\n<br>Вес шины: 4,2 кг<br/>\n<br>Индекс нагрузки: 61<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '3-75-19-61p-sw-07-tt', NULL, NULL, 1, 0, 'c523bb04-325b-11e8-8192-ed790c9fa917'),
(344, 0, '', 0, 0, '3.00-21 HD-K GP-4 (V1.09.1) (TR-4)', NULL, '', '884992', 0, '<br>Камеры изготовлены из бутилкаучука и имеют следующие маркировки:<br/> \n<br><br/>\n<br>Mitas и SAVA<br/>\n<br><br/>\n<br>UHD - камера толщиной 4 мм для очень больших нагрузок<br/>\n<br>HD - камера толщиной 1,9-2,0 мм для больших нагрузок<br/>\n<br>Normal - камера толщиной 1,2-1,4 мм для не больших нагрузок, как правило устонавливаются на скутеры или малокубатурные мотоциклы<br/>\n<br>BOX - камера упакована в отдельную коробку<br/>\n<br>JS87, TR87, 90/90 - камера имеет изогнутый вентель<br/>\n<br>34G, TR6 - камера имеет прямой вентель<br/>\n<br><br/>\n<br>КАБАТ<br/>\n<br><br/>\n<br>HD - усиленные камеры для больших нагрузок<br/>\n<br>GP4(TR-4)(V1.09.1) - камера имеет прямой вентель<br/>\n<br>Все камеры марки КАБАТ не имеют упаковки<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '3-00-21-hd-k-gp-4--v1-09-1---tr-4-', NULL, NULL, 1, 0, 'd2e067f4-325b-11e8-8192-ed790c9fa917'),
(345, 0, '', 0, 0, '130/70-16 61P TL MC28', NULL, '', '915503', 0, '<br>Шины Sava MC28 - всесезонные шины, сделаны специально для максискутеров.\nSava MC28 обладают отличной продольной и угловой стабильностью. \nДолговечная резиновая смесь выдерживает скоростные и весовые нагрузки и отлично держит дорогу в любую погоду.\n<br>Вес шины: 4,8 кг<br/>\n<br>Индекс нагрузки: 61<br/>\n<br>Страна производства: Словения<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '130-70-16-61p-tl-mc28', NULL, NULL, 1, 0, 'df3e9a8c-325b-11e8-8192-ed790c9fa917'),
(346, 0, '', 0, 0, '2.75/3.00/3.25/3.60//90/90//100/80..-21 TR6 SD21 HD BOX', NULL, '', '940638', 0, '<br>Камеры изготовлены из бутилкаучука и имеют следующие маркировки:<br/> \n<br><br/>\n<br>Mitas и SAVA<br/>\n<br><br/>\n<br>UHD - камера толщиной 4 мм для очень больших нагрузок<br/>\n<br>HD - камера толщиной 1,9-2,0 мм для больших нагрузок<br/>\n<br>Normal - камера толщиной 1,2-1,4 мм для не больших нагрузок, как правило устонавливаются на скутеры или малокубатурные мотоциклы<br/>\n<br>BOX - камера упакована в отдельную коробку<br/>\n<br>JS87, TR87, 90/90 - камера имеет изогнутый вентель<br/>\n<br>34G, TR6 - камера имеет прямой вентель<br/>\n<br><br/>\n<br>КАБАТ<br/>\n<br><br/>\n<br>HD - усиленные камеры для больших нагрузок<br/>\n<br>GP4(TR-4)(V1.09.1) - камера имеет прямой вентель<br/>\n<br>Все камеры марки КАБАТ не имеют упаковки<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '2-75-3-00-3-25-3-60--90-90--100-80---21-tr6-sd21-hd-box', NULL, NULL, 1, 0, 'ff45d4f9-325b-11e8-8192-ed790c9fa917'),
(347, 4, '4|1', 1, 0, '140/80-18 M/C 70T E-12 RALLY STAR TT', NULL, '', '945372', 0, '<br>Рисунок протектора шины Mitas E-12 предназначен для экстремальных ралли-рейдов, таких, как \"Дакар\". На данный момент мотошина доступна в единственном размере 140/80-18. Покрышка была успешно испытана в экстремально жестких условиях пустынь в Северной Африке.<br/>\n<br>Вес шины: 7,1 кг<br/>\n<br>Индекс нагрузки: 70<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '140-80-18-m-c-70t-e-12-rally-star-tt', NULL, NULL, 1, 0, '0ce5e25f-325c-11e8-8192-ed790c9fa917'),
(348, 2, '2|1', 1, 0, '60/100-14 30M SX30 TT', NULL, '', '915634', 0, '<br>Mitas SX30 разработана для преимущественного использования по гравию, камням.<br/>\n<br>Данная моторезина предназначена для установки на любую ось.<br/>\n<br>Вес шины: 1,8 кг<br/>\n<br>Индекс нагрузки: 30<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '60-100-14-30m-sx30-tt', NULL, NULL, 1, 0, 'e5518ea9-325b-11e8-8192-ed790c9fa917'),
(349, 0, '', 0, 0, '120/80-16 60P TL MC38 MAX SCOOT', NULL, '', '915546', 0, '<br>Шины Sava MC38 - Всесезонные покрышки для максискутера, подходящие как для сухой, так и влажной поверхности.<br/>\n<br>Современный рисунок протектора Sava MC38 обеспечивает стабильность и комфорт на высоких скоростях и прекрасно отводит воду. Новый состав резины обеспечивает превосходное сцепление и длительный срок службы.<br/>\n<br>Вес шины: 4,7 кг<br/>\n<br>Индекс нагрузки: 60<br/>\n<br>Страна производства: Словения<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-80-16-60p-tl-mc38-max-scoot', NULL, NULL, 1, 0, 'df3e9b0b-325b-11e8-8192-ed790c9fa917'),
(350, 2, '2|1', 1, 0, '110/100-18 64M XT-454 SUPER SOFT TT', NULL, '', '938428', 0, '<br>Mitas XT454 – европейская резина бескомпромиссного качества. Она демонстрирует великолепное сцепление с дорожным полотном любого качества. Это обеспечивается массивной короной протектора. Совокупность элементов центральной части покрышки разрабатывалась в компьютерной программе трехмерного компьютерного моделирования. Благодаря этому интервалы просчитаны до миллиметра. Боковые фигуры изготовлены из прочной резиновой смеси. Однако при этом они сохраняют отличную эластичность.<br/>\n<br>Super Soft - шина с более мягким каркасом и очень мягкой смесью для применения в экстремально тяжелых соревнованиях.<br/>\n<br>Вес шины: 5,3 кг<br/>\n<br>Индекс нагрузки: 64<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-100-18-64m-xt-454-super-soft-tt', NULL, NULL, 1, 0, 'ff45d44a-325b-11e8-8192-ed790c9fa917'),
(351, 0, '', 0, 0, '120/70-12 58P TL MC32 WIN.SCOOT', NULL, '', '925767', 0, '<br>Шины Mitas MC32 WIN SCOOT - идеальный выбор для тех, кто использует свой мотоцикл или скутер зимой и в межсезонье.<br/>\n<br>Эти шины обладают высокими эксплутационными характеристиками при низких температурах, на снегу, льду и мокрой дороге.<br/>\n<br>Вес шины: 3,5 кг<br/>\n<br>Индекс нагрузки: 58<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-70-12-58p-tl-mc32-win-scoot', NULL, NULL, 1, 0, 'f27ec24e-325b-11e8-8192-ed790c9fa917'),
(352, 2, '2|1', 1, 0, '110/90-19 M/C 62M XT-754 TT', NULL, '', '881185', 0, '<br>Mitas XT754 – безукоризненный вариант для вашего эндуро. Известный шинный гигант из Европы скрупулезно подбирал набор рабочих параметров для такого изделия. В результате миру была представлена совершенная разработка. Она наделена маневренностью и устойчивостью. Вы будете превосходно чувствовать свой байк даже на экстремальном вираже.<br/>\n<br>Шина имеет бескомпромиссное качество. Резиновая смесь усовершенствована. Ее состав дополнен суперпрочными синтетическими компонентами.<br/>\n<br>Вес шины: 5,1 кг<br/>\n<br>Индекс нагрузки: 62<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-90-19-m-c-62m-xt-754-tt', NULL, NULL, 1, 0, 'cbbe1dd3-325b-11e8-8192-ed790c9fa917'),
(353, 3, '3|1', 1, 0, '2.50-16M/C 41L REINF. H-04 TT', NULL, '', '880995', 0, '<br>Mitas H04 – эталонная разработка для прогулочного мотоциклетного транспортного средства. Использовать изделие от маститого европейского бренда можно для любой оси вашего мотора. Протектор обладает великолепным ходовым узором. Он был сконструирован в программе виртуального трехмерного моделирования. Это позволило наделить центральную часть шины эффективной желобковой системой, которая демонстрирует отличную «цепкость» в любых ландшафтных условиях.<br/>\n<br>Reinforced - увеличенный индекс грузоподъемности(нагрузки) шины по E.T.R.T.O.<br/>\n<br>Вес шины: 1,9 кг<br/>\n<br>Индекс нагрузки: 41<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '2-50-16m-c-41l-reinf--h-04-tt', NULL, NULL, 1, 0, 'b1201bfd-325b-11e8-8192-ed790c9fa917'),
(354, 0, '', 0, 0, '110/70-12 47P TL MC16', NULL, '', '915533', 0, '<br>Шины Sava MC16 - шины оригинального дизайна для скутеров.<br/>\n<br>Sava MC16 обеспечивают прекрасные эксплуатационные и потребительские характеристики. Они отлично показывают себя практически на всех видах дорожного покрытия, даже на проселочных дорогах и по бездорожью. Курсовая устойчивость и высокая безопасность гарантируется рисунком протектора и резиновой смесью.<br/>\n<br>Вес шины: 2,6 кг<br/>\n<br>Индекс нагрузки: 47<br/>\n<br>Страна производства: Словения<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-70-12-47p-tl-mc16', NULL, NULL, 1, 0, 'df3e9af1-325b-11e8-8192-ed790c9fa917'),
(355, 0, '', 0, 0, '3.50-10 51P TL MC20 MONSUM', NULL, '', '922907', 0, '<br>Шины Mitas MC20 - всепогодные шины для скутеров. Отличная управляемость и долгий срок службы.<br/>\n<br>Эксклюзивная по составу резиновая смесь стойко справляется с абразивным воздействием асфальтного полотна.<br/>\n<br>Reinforced - увеличенный индекс грузоподъемности(нагрузки) шины по E.T.R.T.O.<br/>\n<br>Вес шины: 2,4 кг<br/>\n<br>Индекс нагрузки: 51<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '3-50-10-51p-tl-mc20-monsum', NULL, NULL, 1, 0, 'ec3eed68-325b-11e8-8192-ed790c9fa917'),
(356, 4, '4|1', 1, 0, '140/80-18 M/C 70R E-12 RALLY STAR TT', NULL, '', '947221', 0, '<br>Рисунок протектора шины Mitas E-12 предназначен для экстремальных ралли-рейдов, таких, как \"Дакар\". На данный момент мотошина доступна в единственном размере 140/80-18. Покрышка была успешно испытана в экстремально жестких условиях пустынь в Северной Африке.<br/>\n<br>Вес шины: 7,1 кг<br/>\n<br>Индекс нагрузки: 70<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '140-80-18-m-c-70r-e-12-rally-star-tt', NULL, NULL, 1, 0, '0ce5e2a7-325c-11e8-8192-ed790c9fa917'),
(357, 4, '4|1', 1, 0, '140/80 B17 M/C 69T E-10 DAKAR TL', NULL, '', '915620', 0, '<br>Mitas E10 - предназначены для всех типов дорог и умеренного бездорожья.<br/>\n<br>При разработке резиновой смеси использовалось огромное число новых компонентов, которые увеличили эксплуатационные качества шины Mitas E-10. Повысить износостойкие параметры помог кремний, за счет этого срок службы шину увеличился. Новая силика обеспечила резине повышенную эластичность, что положительно сказалось на сцеплении с влажным дорожным покрытием. Новая резиновая смесь позволила уменьшить сопротивление качению, что повысило устойчивость при движении на высоких скоростях.<br/>\n<br>Dakar - протектор с усиленным каркасом дляэкстремального вождения или гонок.<br/>\n<br>Вес шины: 8,1 кг<br/>\n<br>Индекс нагрузки: 69<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '140-80-b17-m-c-69t-e-10-dakar-tl', NULL, NULL, 1, 0, 'e5518e68-325b-11e8-8192-ed790c9fa917');
INSERT INTO `parf_goods` (`id`, `default_category_id`, `category_ids`, `parent_category`, `brand_id`, `name_1`, `name_2`, `name_in_cyrillic`, `vendor_code`, `vendor_code_id`, `description`, `price`, `existence`, `new`, `sex`, `flavors_group`, `top_note`, `heart_note`, `base_note`, `perfumer`, `collection`, `series`, `country`, `release`, `rating`, `number_of_votes`, `meta_title`, `meta_description`, `meta_keywords`, `rewrite`, `related`, `recommended`, `active`, `count_show`, `id_import`) VALUES
(358, 3, '3|1', 1, 0, '180/55ZR17 73W TL SPORTFORCE+', NULL, '', '920517', 0, '<br>Мотоциклетная шина Mitas SportForce+ является одним из флагманов модельного ряда известного чешского производителя. Об этом можно судить по технологиям, использованным в ее конструкции. Многие из них ранее применялись исключительно в мотоспорте, что лишний раз подтверждает высокую производительность данной модели, предназначенной для спортбайков. Мотоциклетная шина Mitas SportForce+ является одним из флагманов модельного ряда известного чешского производителя. Об этом можно судить по технологиям, использованным в ее конструкции. Многие из них ранее применялись исключительно в мотоспорте, что лишний раз подтверждает высокую производительность данной модели, предназначенной для спортбайков.<br/>\n<br>Особенности:<br/>\n<br>Оптимизированный дизайн дренажных канавок.<br/>\n<br>Протекторный рисунок Mitas SportForce+ содержит большое количество дренажных канавок. Эти элементы отличаются формой и расположением, специально подобранными не только с целью обеспечить максимальную устойчивость к аквапланированию. Они имеют значительную протяженность, будучи расположенными под острым углом относительно направления. В сочетании со сложной многоугольной формой их боковых стенок это позволяет шине чрезвычайно эффективно сопротивляться перегреву, отводя значительную часть тепла в окружающее пространство. Те же конструктивные особенности позволяют дренажным канавкам превосходно справляться с отводом воды от пятна контакта, обеспечивая шине хорошую устойчивость в дождливую погоду.<br/>\n<br>Жесткий каркас.<br/>\n<br>Еще одним нововведением данной модели является технология SCT. За этой аббревиатурой (Strong Carcass Technology) скрывается конструкция каркаса, корд которого намотан таким образом, что в нем отсутствуют какие-либо стыки и швы. В результате шина прекрасно сохраняет свою первоначальную форму даже при самом сильном воздействии разнонаправленных сил ускорения, обеспечивая быстрые и точные реакции на действия байкера. Еще одним преимуществом данной технологии является улучшившаяся устойчивость к неравномерному износу.<br/>\n<br>Основные особенности мотошины Mitas SportForce+<br/>\n<br>— оптимизированное расположение и форма дренажных канавок обеспечивает не только высокую устойчивость к аквапланированию, но и снижает уровень нагрева при движении на высокой скорости;<br/>\n<br>— жесткий каркас улучшает управляемость и устойчивость при прохождении поворотов, придает реакциям шины быстроту и точность;<br/>\n<br>— стабильные сцепные свойства в любых условиях благодаря использованию при разработке технологий компьютерного моделирования.<br/>\n<br>Конструкция: Радиальная<br/>\n<br>Индекс нагрузки: 69<br/>\n<br>Вес шины: 6,1 кг<br/>\n<br>Страна производства: Словения<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '180-55zr17-73w-tl-sportforce-', NULL, NULL, 1, 0, 'ec3eed01-325b-11e8-8192-ed790c9fa917'),
(359, 2, '2|1', 1, 0, '80/100-21 51N C-23 ICE TT', NULL, '', '915658', 0, '<br>Mitas C-23 разработана для преимущественного использования по гравию, камням.<br/>\n<br>Чётко выраженный протектор позволяет уверенно себя чувствовать при движении по песчаной или грунтовой дороге. Но и на дорогах с твердым покрытием покрышка надежно держит сцепление, препятствует вилянию и скольжению.<br/>\n<br>Вес шины: 6,2 кг<br/>\n<br>Индекс нагрузки: 51<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '80-100-21-51n-c-23-ice-tt', NULL, NULL, 1, 0, 'e5518f47-325b-11e8-8192-ed790c9fa917'),
(360, 2, '2|1', 1, 0, '120/90-19 66N C-12 TT', NULL, '', '881150', 0, '<br>Mitas C12 – мотоциклетная шина от признанного производителя из Европы. Протектор конструировался в программе виртуального трехмерного моделирования. Поэтому совокупность всех его элементов имеет идеальное расположения. Канавки наделены нетрадиционной глубиной и наклоном. Все это сделано для безукоризненного сцепления на любых дорожных полотнах.<br/>\n<br>Компаунд получил от команды специалистов маститого бренда оригинальный состав. Благодаря этому обеспечивается эго беспрецедентная износостойкость.<br/>\n<br>Вес шины: 5,6 кг<br/>\n<br>Индекс нагрузки: 66<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-90-19-66n-c-12-tt', NULL, NULL, 1, 0, 'c523ba28-325b-11e8-8192-ed790c9fa917'),
(361, 3, '3|1', 1, 0, '100/90-18 56H MC50 TL', NULL, '', '940650', 0, '<br>Mitas MC50 - это высокоскоростные шины диагональной конструкции. Шины Mitas MC50 используются в профессиональных мотогонках, отличаются хорошим сцеплением с дорогой и длительным сроком службы. Данная моторезина рекомендуется для спорта, супермото, мотоциклов с низким и средним объемом двигателя. Конструкция шин Mitas MC50 позволяет использовать их не только на гоночных трассах, но и в повседневной жизни. Mitas MC50 - многофункциональная шина с отличной производительностью на сухом дорожном покрытии и в то же время с отличной управляемостью на мокром. Жесткость боковой стенки обеспечивает стабильность шины на гоночных трассах.<br/>\n<br>Конструкция: Диагональная<br/>\n<br>Индекс нагрузки: 56<br/>\n<br>Вес шины:  4,5 кг<br/>\n<br>Страна производства: Словения<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '100-90-18-56h-mc50-tl', NULL, NULL, 1, 0, '1a0532bc-325c-11e8-8192-ed790c9fa917'),
(362, 2, '2|1', 1, 0, '110/90-19M/C 62M C-16 WIN FRIC TT', NULL, '', '881143', 0, '<br>Mitas C16 – модернизированная мотоциклетная покрышка от небезызвестного шинного гиганта из Европы. Она предназначается для маневренной езды по твердому дорожному полотну. Также вашему байку покорятся каменистые спуски и подъемы. Протектор имеет особенный узор. Он представляет собой совокупность массивных блоков, размещенных с определенными интервалами. Они были скрупулезно просчитаны в уникальной компьютерной программе для виртуального моделирования.<br/>\n<br>Резиновая смесь имеет особую прочность. Она дополнена новейшими полимерами, стойкими к абразивному и механическому стороннему воздействию.<br/>\n<br>Winter Friction - специальный вариант для использования в зимних условиях, подходит также для шипов.<br/>\n<br>Вес шины: 5,5 кг<br/>\n<br>Индекс нагрузки: 68<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-90-19m-c-62m-c-16-win-fric-tt', NULL, NULL, 1, 0, 'c523b9c3-325b-11e8-8192-ed790c9fa917'),
(363, 3, '3|1', 1, 0, '120/60ZR17 55W TL SPORTFORCE+', NULL, '', '939433', 0, '<br>Мотоциклетная шина Mitas SportForce+ является одним из флагманов модельного ряда известного чешского производителя. Об этом можно судить по технологиям, использованным в ее конструкции. Многие из них ранее применялись исключительно в мотоспорте, что лишний раз подтверждает высокую производительность данной модели, предназначенной для спортбайков. Мотоциклетная шина Mitas SportForce+ является одним из флагманов модельного ряда известного чешского производителя. Об этом можно судить по технологиям, использованным в ее конструкции. Многие из них ранее применялись исключительно в мотоспорте, что лишний раз подтверждает высокую производительность данной модели, предназначенной для спортбайков.<br/>\n<br>Особенности:<br/>\n<br>Оптимизированный дизайн дренажных канавок.<br/>\n<br>Протекторный рисунок Mitas SportForce+ содержит большое количество дренажных канавок. Эти элементы отличаются формой и расположением, специально подобранными не только с целью обеспечить максимальную устойчивость к аквапланированию. Они имеют значительную протяженность, будучи расположенными под острым углом относительно направления. В сочетании со сложной многоугольной формой их боковых стенок это позволяет шине чрезвычайно эффективно сопротивляться перегреву, отводя значительную часть тепла в окружающее пространство. Те же конструктивные особенности позволяют дренажным канавкам превосходно справляться с отводом воды от пятна контакта, обеспечивая шине хорошую устойчивость в дождливую погоду.<br/>\n<br>Жесткий каркас.<br/>\n<br>Еще одним нововведением данной модели является технология SCT. За этой аббревиатурой (Strong Carcass Technology) скрывается конструкция каркаса, корд которого намотан таким образом, что в нем отсутствуют какие-либо стыки и швы. В результате шина прекрасно сохраняет свою первоначальную форму даже при самом сильном воздействии разнонаправленных сил ускорения, обеспечивая быстрые и точные реакции на действия байкера. Еще одним преимуществом данной технологии является улучшившаяся устойчивость к неравномерному износу.<br/>\n<br>Основные особенности мотошины Mitas SportForce+<br/>\n<br>— оптимизированное расположение и форма дренажных канавок обеспечивает не только высокую устойчивость к аквапланированию, но и снижает уровень нагрева при движении на высокой скорости;<br/>\n<br>— жесткий каркас улучшает управляемость и устойчивость при прохождении поворотов, придает реакциям шины быстроту и точность;<br/>\n<br>— стабильные сцепные свойства в любых условиях благодаря использованию при разработке технологий компьютерного моделирования.<br/>\n<br>Конструкция: Радиальная<br/>\n<br>Индекс нагрузки: 55<br/>\n<br>Вес шины: 4,3 кг<br/>\n<br>Страна производства: Словения<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-60zr17-55w-tl-sportforce-', NULL, NULL, 1, 0, 'ff45d4b2-325b-11e8-8192-ed790c9fa917'),
(364, 2, '2|1', 1, 0, '90/100-12 46M C-20 TT', NULL, '', '885573', 0, '<br>Mitas C20 представляет собой уникальную разработку именитого шинного концерна. Покрышка отличается универсальностью. Протектор обладает улучшенным узором, который без проблем справляется даже с нестабильными дорожными полотнами.<br/> \n<br>Благодаря суперкрепкому компаунду в разы повышается срок эксплуатации такого изделия. Шина обладает высоким европейским качеством. Она надежно защищена от механических повреждений и абразивного воздействия магистралей.<br/> \n<br>Вес шины: 3,3 кг<br/>\n<br>Индекс нагрузки: 51<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '90-100-12-46m-c-20-tt', NULL, NULL, 1, 0, 'd2e0683c-325b-11e8-8192-ed790c9fa917'),
(365, 0, '', 0, 0, '120/70-13 53L TL MC16', NULL, '', '945204', 0, '<br>Шины Mitas MC16 - шины оригинального дизайна для скутеров.<br/>\n<br>Mitas MC16 обеспечивают прекрасные эксплуатационные и потребительские характеристики. Они отлично показывают себя практически на всех видах дорожного покрытия, даже на проселочных дорогах и по бездорожью. Курсовая устойчивость и высокая безопасность гарантируется рисунком протектора и резиновой смесью.<br/>\n<br>Вес шины: 3,2 кг<br/>\n<br>Индекс нагрузки: 53<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-70-13-53l-tl-mc16', NULL, NULL, 1, 0, '0ce5e212-325c-11e8-8192-ed790c9fa917'),
(366, 0, '', 0, 0, '130/70-13 63P TL MC28 REINF.', NULL, '', '950529', 0, '<br>Шины Mitas - MC28 - всесезонные шины, сделаны специально для максискутеров.<br/>\n<br>Mitas MC28 обладают отличной продольной и угловой стабильностью. <br/>\n<br>Долговечная резиновая смесь выдерживает скоростные и весовые нагрузки и отлично держит дорогу в любую погоду.<br/>\n<br>Вес шины: 4,3 кг<br/>\n<br>Индекс нагрузки: 63<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '130-70-13-63p-tl-mc28-reinf-', NULL, NULL, 1, 0, '0ce5e33a-325c-11e8-8192-ed790c9fa917'),
(367, 4, '4|1', 1, 0, '100/90-19M/C 57H E-08 TL', NULL, '', '881082', 0, '<br>Mitas E-08 подходит для грунтовых дорог и сухой пересеченной местности.<br/>\n<br>Протектор наделен специфическим рисунком, разработанным командой инженеров по трехмерной технологии. Благодаря этому вся совокупность элементов размещена со скрупулезно просчитанными интервалами. Таким образом, центральная часть шины обладает феноменальным сцепление. Оно будет продемонстрировано на дорожном полотне любого качества.<br/>\n<br>Вес шины: 4,7 кг<br/>\n<br>Индекс нагрузки: 57<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '100-90-19m-c-57h-e-08-tl', NULL, NULL, 1, 0, 'b831b66b-325b-11e8-8192-ed790c9fa917'),
(368, 3, '3|1', 1, 0, '140/70-17 66H MC50 TL', NULL, '', '940651', 0, '<br>\"Mitas MC50 - это высокоскоростные шины диагональной конструкции. Шины Mitas MC50 используются в профессиональных мотогонках, отличаются хорошим сцеплением с дорогой и длительным сроком службы. Данная моторезина рекомендуется для спорта, супермото, мотоциклов с низким и средним объемом двигателя. Конструкция шин Mitas MC50 позволяет использовать их не только на гоночных трассах, но и в повседневной жизни. Mitas MC50 - многофункциональная шина с отличной производительностью на сухом дорожном покрытии и в то же время с отличной управляемостью на мокром. Жесткость боковой стенки обеспечивает стабильность шины на гоночных трассах.<br/>\n<br>Конструкция: Диагональная<br/>\n<br>Индекс нагрузки: 66<br/>\n<br>Вес шины: 5,9 кг<br/>\n<br>Страна производства: Словения<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '140-70-17-66h-mc50-tl', NULL, NULL, 1, 0, '05e03c1a-325c-11e8-8192-ed790c9fa917'),
(369, 0, '', 0, 0, '110/80-14 59M TL/TT MC26 REINF', NULL, '', '928517', 0, '<br>Летние мотоциклетные шины Mitas MC26 обеспечивают прекрасные сцепно-тормозные качества, что является важным показателем при скоростной езде на мотоциклах и скутерах.<br/>\n<br>Протекторный рисунок и усовершенствованная резиновая композиция обеспечивает курсовую устойчивость и отличные показатели при вхождении в повороты.<br/>\n<br>Еще одним достоинством данной модели является долговечность.<br/>\n<br>Reinforced - увеличенный индекс грузоподъемности(нагрузки) шины по E.T.R.T.O.<br/>\n<br>Вес шины: 3,3 кг<br/>\n<br>Индекс нагрузки: 59<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-80-14-59m-tl-tt-mc26-reinf', NULL, NULL, 1, 0, 'ff45d38c-325b-11e8-8192-ed790c9fa917'),
(370, 2, '2|1', 1, 0, '110/100-18 64R C-20 TT', NULL, '', '881122', 0, '<br>Mitas C20 представляет собой уникальную разработку именитого шинного концерна. Покрышка отличается универсальностью. Протектор обладает улучшенным узором, который без проблем справляется даже с нестабильными дорожными полотнами.<br/> \n<br>Благодаря суперкрепкому компаунду в разы повышается срок эксплуатации такого изделия. Шина обладает высоким европейским качеством. Она надежно защищена от механических повреждений и абразивного воздействия магистралей.<br/> \n<br>Вес шины: 5,7 кг<br/>\n<br>Индекс нагрузки: 64<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-100-18-64r-c-20-tt', NULL, NULL, 1, 0, 'befe4e06-325b-11e8-8192-ed790c9fa917'),
(371, 4, '4|1', 1, 0, '110/80-18 58P MC23 TT', NULL, '', '942315', 0, '<br>Асфальт: 40%<br/>\n<br>Бездорожье: 60%<br/>\n<br>Данная моторезина предназначена для установки на любую ось.<br/>\n<br>Вес шины: 4,8 кг<br/>\n<br>Индекс нагрузки: 58<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-80-18-58p-mc23-tt', NULL, NULL, 1, 0, '05e03c89-325c-11e8-8192-ed790c9fa917'),
(372, 0, '', 0, 0, '2.75-21 HD-K GP-4 (V1.09.1) (TR-4)', NULL, '', '884782', 0, '<br>Камеры изготовлены из бутилкаучука и имеют следующие маркировки:<br/> \n<br><br/>\n<br>Mitas и SAVA<br/>\n<br><br/>\n<br>UHD - камера толщиной 4 мм для очень больших нагрузок<br/>\n<br>HD - камера толщиной 1,9-2,0 мм для больших нагрузок<br/>\n<br>Normal - камера толщиной 1,2-1,4 мм для не больших нагрузок, как правило устонавливаются на скутеры или малокубатурные мотоциклы<br/>\n<br>BOX - камера упакована в отдельную коробку<br/>\n<br>JS87, TR87, 90/90 - камера имеет изогнутый вентель<br/>\n<br>34G, TR6 - камера имеет прямой вентель<br/>\n<br><br/>\n<br>КАБАТ<br/>\n<br><br/>\n<br>HD - усиленные камеры для больших нагрузок<br/>\n<br>GP4(TR-4)(V1.09.1) - камера имеет прямой вентель<br/>\n<br>Все камеры марки КАБАТ не имеют упаковки<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '2-75-21-hd-k-gp-4--v1-09-1---tr-4-', NULL, NULL, 1, 0, 'cbbe1ee4-325b-11e8-8192-ed790c9fa917'),
(373, 4, '4|1', 1, 0, '90/90-21M/C 54T E-07 TT', NULL, '', '881066', 0, '<br>Mitas E-07 специально создана для мотоциклов, которые эксплуатируются на любой дорожной поверхности. Отличительной особенностью этой модели является необычный протекторный рисунок, который обеспечивает повышенную устойчивость и уверенное управление на любой дорожной поверхности.<br/>\n<br>Вся поверхность шины покрыта необычными блоками, которые обеспечивают отличную устойчивость и управляемость. Оптимально подобранные расстояния между блоками предотвращают застревание камней в протекторе и повышают самоочищение. В плечевой зоне, блоки имеют другую форму, за счет этого достигается повышенная устойчивость при любых маневрах. Отличная курсовая устойчивость и быстрая обратная связь обеспечивается центральной частью протектора, где пересекаются блоки.<br/>\n<br>Вес шины: 3,7 кг<br/>\n<br>Индекс нагрузки: 54<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '90-90-21m-c-54t-e-07-tt', NULL, NULL, 1, 0, 'b831b5e1-325b-11e8-8192-ed790c9fa917'),
(374, 2, '2|1', 1, 0, '120/90-19 66N C-12 ICE SOFT TT', NULL, '', '881149', 0, '<br>Mitas C12 – мотоциклетная шина от признанного производителя из Европы. Протектор конструировался в программе виртуального трехмерного моделирования. Поэтому совокупность всех его элементов имеет идеальное расположения. Канавки наделены нетрадиционной глубиной и наклоном. Все это сделано для безукоризненного сцепления на любых дорожных полотнах.<br/>\n<br>Компаунд получил от команды специалистов маститого бренда оригинальный состав. Благодаря этому обеспечивается эго беспрецедентная износостойкость.<br/>\n<br>Ice Soft - специальный вариант для Motoskijoring. Шина не теряет свою гибкость даже при низких температурах.<br/>\n<br>Вес шины: 5,4 кг<br/>\n<br>Индекс нагрузки: 66<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-90-19-66n-c-12-ice-soft-tt', NULL, NULL, 1, 0, 'c523ba1b-325b-11e8-8192-ed790c9fa917'),
(375, 4, '4|1', 1, 0, '90/90-21 54S TT MC24', NULL, '', '942313', 0, '<br>Mitas MC24  - диагональные покрышки двойного назначения с более выраженным рисунком протектора, чем у моделей MC30, E-08<br/>\n<br>INVADER MC24 - мотошины для мотоциклов двойного назначения и туристических эндуро, ориентированные на езду по асфальту и дорогам с твердым покрытием. Обеспечивают отличную управляемость на мокрой дороге и легком бездорожье в любую погоду.<br/>\n<br>Вес шины: 3,5 кг<br/>\n<br>Индекс нагрузки: 54<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '90-90-21-54s-tt-mc24', NULL, NULL, 1, 0, '05e03c7c-325c-11e8-8192-ed790c9fa917'),
(376, 2, '2|1', 1, 0, '80/100-21 51R C-19 TT', NULL, '', '890004', 0, '<br>Mitas C-19 разработана для преимущественного использования по гравию, камням, горной местности.<br/>\n<br>Кроссовые шины Mitas C-19 одобрены для эксплуатации в соответствии с DOT EN, 80% по бездорожью, 20% на дорогах.<br/>\n<br>Вес шины: 3,5 кг<br/>\n<br>Индекс нагрузки: 51<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '80-100-21-51r-c-19-tt', NULL, NULL, 1, 0, 'd941f910-325b-11e8-8192-ed790c9fa917'),
(377, 2, '2|1', 1, 0, '2.50-12 37J C-11 WINTER FRICTION TT', NULL, '', '915652', 0, '<br>Mitas C11 – надежная мотоциклетная резина для любителей мотокросса. Изготовлена она европейским выдающимся брендом по трехмерной технологии. Благодаря этому все параметры идеально сбалансированы. Такая модель предназначается для установки на переднюю ось мототранспорта. Она сочетается с моделью C-10 для задней оси.<br/>\n<br>Для центральной части шины подобрана особая резиновая смесь. Она адаптирована для суровых мотокроссовых условий. Компаунд отличается эластичностью благодаря уникальным полимерам в составе. Шины демонстрирует феноменальную маневренность при пониженных температурах.<br/>\n<br>Winter Friction - специальный вариант для использования в зимних условиях, подходит также для шипов.<br/>\n<br>Вес шины: 1,5 кг<br/>\n<br>Индекс нагрузки: 66<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '2-50-12-37j-c-11-winter-friction-tt', NULL, NULL, 1, 0, 'e5518f09-325b-11e8-8192-ed790c9fa917'),
(378, 3, '3|1', 1, 0, '4.00-19M/C 71P REINF H-02 TT', NULL, '', '881027', 0, '<br>Дорожная моторезина Mitas H-02 обладает универсальным рисунком протектора, который подходит для задних и передних колес мотоцикла. При установке сразу двух шин вам гарантированы феноменальные сцепные показатели на любых ландшафтах. Исключительные пропорции каркаса делают покрышку невероятно управляемой. Такая модель станет безукоризненным вариантом для тех, кто желает подобрать лучшую «обувь» для своего байка.<br/>\n<br>Данная моторезина наиболее подходит для классических и ретро-мотоциклов.<br/>\n<br>Вес шины: 4,4 кг<br/>\n<br>Индекс нагрузки: 64<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '4-00-19m-c-71p-reinf-h-02-tt', NULL, NULL, 1, 0, 'b1201cd6-325b-11e8-8192-ed790c9fa917'),
(379, 3, '3|1', 1, 0, '120/90-16 63P TL MC7', NULL, '', '925780', 0, '<br>Mitas MC7 - это высокоскоростные шины диагональной конструкции. Шины Mitas MC7 используются в профессиональных мотогонках, отличаются хорошим сцеплением с дорогой и длительным сроком службы. Данная моторезина рекомендуется для спорта, супермото, мотоциклов с низким и средним объемом двигателя. Конструкция шин Mitas MC7 позволяет использовать их не только на гоночных трассах, но и в повседневной жизни. Mitas MC7 - многофункциональная шина с отличной производительностью на сухом дорожном покрытии и в то же время с отличной управляемостью на мокром. Жесткость боковой стенки обеспечивает стабильность шины на гоночных трассах.<br/>\n<br>Конструкция: Диагональная<br/>\n<br>Вес шины: 4,4 кг<br/>\n<br>Индекс нагрузки: 63<br/>\n<br>Страна производства: Словения<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-90-16-63p-tl-mc7', NULL, NULL, 1, 0, 'f27ec2a0-325b-11e8-8192-ed790c9fa917'),
(380, 4, '4|1', 1, 0, '110/80B19 M/C 59T E-10 TL', NULL, '', '881081', 0, '<br>Mitas E10 - предназначены для всех типов дорог и умеренного бездорожья.<br/>\n<br>При разработке резиновой смеси использовалось огромное число новых компонентов, которые увеличили эксплуатационные качества шины Mitas E-10. Повысить износостойкие параметры помог кремний, за счет этого срок службы шину увеличился. Новая силика обеспечила резине повышенную эластичность, что положительно сказалось на сцеплении с влажным дорожным покрытием. Новая резиновая смесь позволила уменьшить сопротивление качению, что повысило устойчивость при движении на высоких скоростях.<br/>\n<br>Вес шины: 5,3 кг<br/>\n<br>Индекс нагрузки: 59<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-80b19-m-c-59t-e-10-tl', NULL, NULL, 1, 0, 'b831b65e-325b-11e8-8192-ed790c9fa917'),
(381, 0, '', 0, 0, '4.50-17 HD-D GP-4 (V1.09.1) (TR-4)', NULL, '', '923808', 0, '<br>Камеры изготовлены из бутилкаучука и имеют следующие маркировки:<br/> \n<br><br/>\n<br>Mitas и SAVA<br/>\n<br><br/>\n<br>UHD - камера толщиной 4 мм для очень больших нагрузок<br/>\n<br>HD - камера толщиной 1,9-2,0 мм для больших нагрузок<br/>\n<br>Normal - камера толщиной 1,2-1,4 мм для не больших нагрузок, как правило устонавливаются на скутеры или малокубатурные мотоциклы<br/>\n<br>BOX - камера упакована в отдельную коробку<br/>\n<br>JS87, TR87, 90/90 - камера имеет изогнутый вентель<br/>\n<br>34G, TR6 - камера имеет прямой вентель<br/>\n<br><br/>\n<br>КАБАТ<br/>\n<br><br/>\n<br>HD - усиленные камеры для больших нагрузок<br/>\n<br>GP4(TR-4)(V1.09.1) - камера имеет прямой вентель<br/>\n<br>Все камеры марки КАБАТ не имеют упаковки<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '4-50-17-hd-d-gp-4--v1-09-1---tr-4-', NULL, NULL, 1, 0, 'ec3eed9b-325b-11e8-8192-ed790c9fa917'),
(382, 0, '', 0, 0, '100/80-10 56J TL/TT MC6', NULL, '', '915443', 0, '<br>Sava MC6 обеспечивают прекрасные сцепно-тормозные качества, что является важным показателем при скоростной езде на скутерах.<br/>\n<br>Протекторный рисунок и усовершенствованная резиновая композиция обеспечивает курсовую устойчивость и отличные показатели при вхождении в повороты.<br/>\n<br>Еще одним достоинством данной модели является долговечность.<br/>\n<br>Вес шины: 1,9 кг<br/>\n<br>Индекс нагрузки: 56<br/>\n<br>Страна производства: Словения<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '100-80-10-56j-tl-tt-mc6', NULL, NULL, 1, 0, 'd941fa33-325b-11e8-8192-ed790c9fa917'),
(383, 2, '2|1', 1, 0, '120/90-18 65M C-10 ICE SOFT TT', NULL, '', '915305', 0, '<br>Mitas C-10 разработана для преимущественного использования по грязи и песку, гравию.<br/>\n<br>Ice Soft - специальный вариант для Motoskijoring. Шина не теряет свою гибкость даже при низких температурах,<br/>\n<br>Вес шины: 5,2 кг<br/>\n<br>Индекс нагрузки: 65<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-90-18-65m-c-10-ice-soft-tt', NULL, NULL, 1, 0, 'd941f9b1-325b-11e8-8192-ed790c9fa917'),
(384, 2, '2|1', 1, 0, '120/100-18 68M XT-946 ICE SOFT TT', NULL, '', '881209', 0, '<br>Модель Mitas XT-946 разработана для преимущественного использования по камням, горной местности. Мотошины этой модели рекомендуется использовать на средне-мягких, средних грунтах и в холодную зимнюю погоду.<br/>\n<br>Ice Soft - специальный вариант для Motoskijoring. Шина не теряет свою гибкость даже при низких температурах.<br/>\n<br>Вес шины: 5,2 кг<br/>\n<br>Индекс нагрузки: 68<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-100-18-68m-xt-946-ice-soft-tt', NULL, NULL, 1, 0, 'cbbe1e7e-325b-11e8-8192-ed790c9fa917'),
(385, 0, '', 0, 0, '25X8.00-12 B71 4PR TL', NULL, '', '915688', 0, '<br>Sava B71 это модель шин ATV, предназначенная для \"утилитарно-лесного\" использования.<br/>\n<br>Рисунок покрышек Sava B 71 - направленная \"елочка\" с дополнительными внутренними гранями - обеспечивает хорошую самоочищаемость и грязеотвод.<br/>\n<br>Кроме того, колеса Sava B71 имеют дополнительные боковые грунтозацепы по краям протектора, для более эффективной работы в колее.<br/>\n<br>Шины ATV Sava B71 вполне органично могут быть применены на квадроциклах, используемых для поездок по полям и лесам.<br/>\n<br>Вес шины: 8,1 кг<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '25x8-00-12-b71-4pr-tl', NULL, NULL, 1, 0, 'e5518fb7-325b-11e8-8192-ed790c9fa917'),
(386, 0, '', 0, 0, '3.50-12 64J S-05', NULL, '', '925952', 0, '<br>Шины Mitas S-05 обеспечивают прекрасные сцепно-тормозные качества, что является важным показателем при скоростной езде на скутерах.<br/>\n<br>Mitas S-05 обладают дорожным и ленточным рисунком протектора для преимущественной езды по дорогам с качественным покрытием.<br/>\n<br>Вес шины: 2,5 кг<br/>\n<br>Индекс нагрузки: 64<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '3-50-12-64j-s-05', NULL, NULL, 1, 0, 'f8fee37a-325b-11e8-8192-ed790c9fa917'),
(387, 2, '2|1', 1, 0, '80/100-21M/C 51M XT-434 WIN FRIC TT', NULL, '', '881199', 0, '<br>Mitas XT434 – отличается повышенной проходимостью и минимальным процентом повреждений. Использование современного оборудования и лучших материалов позволило добиться прекрасных эксплуатационных характеристик.<br/>\n<br>Одной из отличительных особенностей данной модели является протекторный рисунок. Он состоит из нескольких функциональных зон, обеспечивающих ей максимальную производительность в любых условиях. При этом их строение сильно разнится в силу тех задач, которым им приходится решать в процессе эксплуатации.<br/>\n<br>Winter Friction - специальный вариант для использования в зимних условиях, подходит также для шипов.<br/>\n<br>Вес шины: 3,2 кг<br/>\n<br>Индекс нагрузки: 51<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '80-100-21m-c-51m-xt-434-win-fric-tt', NULL, NULL, 1, 0, 'cbbe1e32-325b-11e8-8192-ed790c9fa917'),
(388, 2, '2|1', 1, 0, '130/90-18 69M C-04 LEISURE TT', NULL, '', '881132', 0, '<br>Модель Mitas C-04 разработана для преимущественного использования по грязи и песку, гравию. Мотошины этой модели рекомендуется использовать на средне-мягких грунтах.<br/>\n<br>Super Light - протектор из особой смеси и легким каркасом для Enduro Extreme.<br/>\n<br>Вес шины: 5,9 кг<br/>\n<br>Индекс нагрузки: 69<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '130-90-18-69m-c-04-leisure-tt', NULL, NULL, 1, 0, 'befe4e7c-325b-11e8-8192-ed790c9fa917'),
(389, 0, '', 0, 0, '4.00/4.25/..-18 TR6 SF18 BOX HD', NULL, '', '940637', 0, '<br>Камеры изготовлены из бутилкаучука и имеют следующие маркировки:<br/> \n<br><br/>\n<br>Mitas и SAVA<br/>\n<br><br/>\n<br>UHD - камера толщиной 4 мм для очень больших нагрузок<br/>\n<br>HD - камера толщиной 1,9-2,0 мм для больших нагрузок<br/>\n<br>Normal - камера толщиной 1,2-1,4 мм для не больших нагрузок, как правило устонавливаются на скутеры или малокубатурные мотоциклы<br/>\n<br>BOX - камера упакована в отдельную коробку<br/>\n<br>JS87, TR87, 90/90 - камера имеет изогнутый вентель<br/>\n<br>34G, TR6 - камера имеет прямой вентель<br/>\n<br><br/>\n<br>КАБАТ<br/>\n<br><br/>\n<br>HD - усиленные камеры для больших нагрузок<br/>\n<br>GP4(TR-4)(V1.09.1) - камера имеет прямой вентель<br/>\n<br>Все камеры марки КАБАТ не имеют упаковки<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '4-00-4-25----18-tr6-sf18-box-hd', NULL, NULL, 1, 0, 'ff45d4f1-325b-11e8-8192-ed790c9fa917'),
(390, 2, '2|1', 1, 0, '110/90-19 62M C-26 TT', NULL, '', '920512', 0, '<br>Mitas C26 разработана для преимущественного использования по камням, горной местности.<br/>м\n<br>Хорошая износостойкость и прекрасное поведение на пересеченной местности. Устойчивость к порезам шины на острых камнях.<br/>\n<br>Вес шины: 5,6 кг<br/>\n<br>Индекс нагрузки: 62<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-90-19-62m-c-26-tt', NULL, NULL, 1, 0, 'ec3eecbc-325b-11e8-8192-ed790c9fa917'),
(391, 0, '', 0, 0, '130/70-10 59P TL MC25 REINF.', NULL, '', '943302', 0, '<br>Вес шины: 2,9 кг<br/>\n<br>Индекс нагрузки: 62<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '130-70-10-59p-tl-mc25-reinf-', NULL, NULL, 1, 0, '05e03d21-325c-11e8-8192-ed790c9fa917'),
(392, 4, '4|1', 1, 0, '90/90-21 54R TT MC23 ROCKRIDER', NULL, '', '926998', 0, '<br>Асфальт: 40%<br/>\n<br>Бездорожье: 60%<br/>\n<br>Данная моторезина предназначена для установки на любую ось.<br/>\n<br>Вес шины: 3,9 кг<br/>\n<br>Индекс нагрузки: 54<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '90-90-21-54r-tt-mc23-rockrider', NULL, NULL, 1, 0, 'ff45d36a-325b-11e8-8192-ed790c9fa917'),
(393, 2, '2|1', 1, 0, '80/100-21 51M C-29 TERRACROSS TT', NULL, '', '926991', 0, '<br>Mitas C29 представляет собой уникальную разработку именитого шинного концерна. Покрышка отличается универсальностью. Протектор обладает улучшенным узором, который без проблем справляется даже с нестабильными дорожными полотнами.<br/>\n<br>Дизайн протектора обеспечивает оптимальную производительность во всех режимах вождения.<br/>\n<br>Вес шины: 3,8 кг<br/>\n<br>Индекс нагрузки: 51<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '80-100-21-51m-c-29-terracross-tt', NULL, NULL, 1, 0, 'f8fee3e1-325b-11e8-8192-ed790c9fa917'),
(394, 4, '4|1', 1, 0, '110/80-19M/C 59H E-08 TL', NULL, '', '889991', 0, '<br>Mitas E-08 подходит для грунтовых дорог и сухой пересеченной местности.<br/>\n<br>Протектор наделен специфическим рисунком, разработанным командой инженеров по трехмерной технологии. Благодаря этому вся совокупность элементов размещена со скрупулезно просчитанными интервалами. Таким образом, центральная часть шины обладает феноменальным сцепление. Оно будет продемонстрировано на дорожном полотне любого качества.<br/>\n<br>Вес шины: 4,7 кг<br/>\n<br>Индекс нагрузки: 59<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-80-19m-c-59h-e-08-tl', NULL, NULL, 1, 0, 'd2e068c6-325b-11e8-8192-ed790c9fa917'),
(395, 2, '2|1', 1, 0, '90/90-21 54R C-17 DAKAR TT', NULL, '', '881162', 0, '<br>Модель Mitas C-17 разработана для преимущественного использования по камням, горной местности. Данная моторезина предназначена для установки на переднюю ось.<br/>\n<br>Кроссовая моторезина Mitas C-17 одобрена для эксплуатации в соответствии с DOT EN, 80% по бездорожью, 20% на дорогах.<br/>\n<br>Dakar - протектор с усиленным каркасом для экстремального вождения или гонок.<br/>\n<br>Вес шины: 3,7 кг<br/>\n<br>Индекс нагрузки: 54<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '90-90-21-54r-c-17-dakar-tt', NULL, NULL, 1, 0, 'c523ba9e-325b-11e8-8192-ed790c9fa917'),
(396, 2, '2|1', 1, 0, '110/100-18 64L C-22 ICE TT', NULL, '', '915649', 0, '<br>Mitas C-22 предназначены для установки на мопеды, скутеры и лёгкие мотоциклы.<br/>\n<br>Чётко выраженный протектор позволяет уверенно себя чувствовать при движении по песчаной или грунтовой дороге. Но и на дорогах с твердым покрытием покрышка надежно держит сцепление, препятствует вилянию и скольжению.<br/>\n<br>Вес шины: 10 кг<br/>\n<br>Индекс нагрузки: 64<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-100-18-64l-c-22-ice-tt', NULL, NULL, 1, 0, 'e5518ee0-325b-11e8-8192-ed790c9fa917'),
(397, 0, '', 0, 0, '130/60-13 60P TL MC32 WIN SCOOT', NULL, '', '945210', 0, '<br>Шины Mitas MC32 WIN SCOOT - идеальный выбор для тех, кто использует свой мотоцикл или скутер зимой и в межсезонье.<br/>\n<br>Эти шины обладают высокими эксплутационными характеристиками при низких температурах, на снегу, льду и мокрой дороге.<br/>\n<br>Вес шины: 4 кг<br/>\n<br>Индекс нагрузки: 60<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '130-60-13-60p-tl-mc32-win-scoot', NULL, NULL, 1, 0, '0ce5e252-325c-11e8-8192-ed790c9fa917'),
(398, 4, '4|1', 1, 0, '150/70 B17 M/C 69T E-10 TL', NULL, '', '881080', 0, '<br>Mitas E10 - предназначены для всех типов дорог и умеренного бездорожья.<br/>\n<br>При разработке резиновой смеси использовалось огромное число новых компонентов, которые увеличили эксплуатационные качества шины Mitas E-10. Повысить износостойкие параметры помог кремний, за счет этого срок службы шину увеличился. Новая силика обеспечила резине повышенную эластичность, что положительно сказалось на сцеплении с влажным дорожным покрытием. Новая резиновая смесь позволила уменьшить сопротивление качению, что повысило устойчивость при движении на высоких скоростях.<br/>\n<br>Вес шины: 7,1 кг<br/>\n<br>Индекс нагрузки: 69<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '150-70-b17-m-c-69t-e-10-tl', NULL, NULL, 1, 0, 'b831b651-325b-11e8-8192-ed790c9fa917'),
(399, 0, '', 0, 0, '4.75-18 V1.09.1', NULL, '', '884988', 0, '<br>Камеры изготовлены из бутилкаучука и имеют следующие маркировки:<br/> \n<br><br/>\n<br>Mitas и SAVA<br/>\n<br><br/>\n<br>UHD - камера толщиной 4 мм для очень больших нагрузок<br/>\n<br>HD - камера толщиной 1,9-2,0 мм для больших нагрузок<br/>\n<br>Normal - камера толщиной 1,2-1,4 мм для не больших нагрузок, как правило устонавливаются на скутеры или малокубатурные мотоциклы<br/>\n<br>BOX - камера упакована в отдельную коробку<br/>\n<br>JS87, TR87, 90/90 - камера имеет изогнутый вентель<br/>\n<br>34G, TR6 - камера имеет прямой вентель<br/>\n<br><br/>\n<br>КАБАТ<br/>\n<br><br/>\n<br>HD - усиленные камеры для больших нагрузок<br/>\n<br>GP4(TR-4)(V1.09.1) - камера имеет прямой вентель<br/>\n<br>Все камеры марки КАБАТ не имеют упаковки<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '4-75-18-v1-09-1', NULL, NULL, 1, 0, 'd2e067dc-325b-11e8-8192-ed790c9fa917'),
(400, 0, '', 0, 0, '100/80-10 53P TL/TT MC32 WIN SCOOT', NULL, '', '950547', 0, '<br>Шины Mitas MC32 WIN SCOOT - идеальный выбор для тех, кто использует свой мотоцикл или скутер зимой и в межсезонье.<br/>\n<br>Эти шины обладают высокими эксплутационными характеристиками при низких температурах, на снегу, льду и мокрой дороге.<br/>\n<br>Вес шины: 2,8 кг<br/>\n<br>Индекс нагрузки: 53<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '100-80-10-53p-tl-tt-mc32-win-scoot', NULL, NULL, 1, 0, '137b8083-325c-11e8-8192-ed790c9fa917'),
(401, 0, '', 0, 0, '150/80-10 65L TL MC17', NULL, '', '915483', 0, '<br>Mitas MC17 - скутерная шина для захватывающей езды по внедорожью.<br/>\n<br>MКонструкция шин гарантирует отличное сцепление, сопротивление пробою и острой поверхности.<br/>\n<br>Вес шины: 3,5 кг<br/>\n<br>Индекс нагрузки: 65<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '150-80-10-65l-tl-mc17', NULL, NULL, 1, 0, 'df3e9a74-325b-11e8-8192-ed790c9fa917'),
(402, 4, '4|1', 1, 0, '120/90-17 64H MC30 INVADER TL', NULL, '', '940648', 0, '<br>Mitas MC30  - предназначены для всех типов дорог и минимального бездорожья.<br/>\n<br>Invader MC30 - мотошины для мотоциклов двойного назначения и туристических эндуро, ориентированные на езду по асфальту и дорогам с твердым покрытием. Обеспечивают отличную управляемость на мокрой дороге и легком бездорожье в любую погоду.<br/>\n<br>Вес шины: 5,7 кг<br/>\n<br>Индекс нагрузки: 64<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-90-17-64h-mc30-invader-tl', NULL, NULL, 1, 0, '05e03c0d-325c-11e8-8192-ed790c9fa917'),
(403, 3, '3|1', 1, 0, '2.75-18M/C 48P REINF H-06 TT', NULL, '', '881006', 0, '<br>Mitas H06 – великолепная всесезонная модель от европейского шинного гиганта. В абсолютно любую погоду вы сможете комфортно себя чувствовать за рулем своего транспортного средства. Такая универсальность делает шину данной модели превосходным вариантом для любителей долговременных путешествий. Покрышка рассчитана для установки на любую ось. Протектор имеет оригинальный узор, состоящий из прямых и криволинейных элементов. Reinforced - увеличенный индекс грузоподъемности(нагрузки) шины по E.T.R.T.O.<br/>\n<br>Вес шины: 2,9 кг<br/>\n<br>Индекс нагрузки: 48<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '2-75-18m-c-48p-reinf-h-06-tt', NULL, NULL, 1, 0, 'b1201c46-325b-11e8-8192-ed790c9fa917'),
(404, 0, '', 0, 0, '120/90-10 56J TL MC17 V2', NULL, '', '925776', 0, '<br>Mitas MC17 - скутерная шина для захватывающей езды по внедорожью.<br/>\n<br>MКонструкция шин гарантирует отличное сцепление, сопротивление пробою и острой поверхности.<br/>\n<br>Вес шины: 3,5 кг<br/>\n<br>Индекс нагрузки: 56<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-90-10-56j-tl-mc17-v2', NULL, NULL, 1, 0, 'f27ec293-325b-11e8-8192-ed790c9fa917'),
(405, 2, '2|1', 1, 0, '100/100-18 59R C-18 TT', NULL, '', '881114', 0, '<br>Mitas C18 – идеальная разработка для задней оси мототранспорта. Это вариант С17 для задней оси. Протектор имеет универсальный узор, позволяющий покрышке демонстрировать изумительные «цепные» показатели в любых дорожных условиях! Покоряйте своему мотору даже сыпучие грунты!<br/>\n<br>Моторезина отличается адаптированной под повышенные нагрузки конструкцией. Внутри шины давление распределяется за доли секунды. Благодаря этому происходит медленное и равномерное изнашивание. В такой «обуви» вы сможете отлично ездить в дождливую погоду, поскольку протектор обладает феноменальными дренажными показателями.<br/> \n<br>Вес шины: 5,2 кг<br/>\n<br>Индекс нагрузки: 57<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '100-100-18-59r-c-18-tt', NULL, NULL, 1, 0, 'befe4d8f-325b-11e8-8192-ed790c9fa917'),
(406, 3, '3|1', 1, 0, '130/90-16 67T H-11 TT', NULL, '', '925819', 0, '<br>Mitas H11 – изумительная разработка небезызвестного шинного гиганта. Отличается стабильным поведением в любой дорожной ситуации. Вы никогда не столкнетесь с неконтролируемым поведением шины при резком торможении! При этом вашему мотору покорится даже выход из самого крутого поворота.<br/>\n<br>Отличительной особенностью такой мотопокрышки, которая позволила ей получить лояльность солидного количества байкеров, является прогнозируемость. Ваш мотоцикл стремительно преодолеет немалое расстояние без ощутимого износа компаунда. Он усовершенствован для городских дорог любого качества.<br/>\n<br>Конструкция: Диагональная<br/>\n<br>Индекс нагрузки: 67<br/>\n<br>Вес шины: 5,8 кг<br/>\n<br>Страна производства: Словения<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '130-90-16-67t-h-11-tt', NULL, NULL, 1, 0, 'f8fee2fc-325b-11e8-8192-ed790c9fa917'),
(407, 2, '2|1', 1, 0, '100/100-19 M/C 62M XT-754 TT', NULL, '', '881184', 0, '<br>Mitas XT754 – безукоризненный вариант для вашего эндуро. Известный шинный гигант из Европы скрупулезно подбирал набор рабочих параметров для такого изделия. В результате миру была представлена совершенная разработка. Она наделена маневренностью и устойчивостью. Вы будете превосходно чувствовать свой байк даже на экстремальном вираже.<br/>\n<br>Шина имеет бескомпромиссное качество. Резиновая смесь усовершенствована. Ее состав дополнен суперпрочными синтетическими компонентами.<br/>\n<br>Вес шины: 4,9 кг<br/>\n<br>Индекс нагрузки: 62<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '100-100-19-m-c-62m-xt-754-tt', NULL, NULL, 1, 0, 'cbbe1dc4-325b-11e8-8192-ed790c9fa917'),
(408, 0, '', 0, 0, '100/80-17 52R TL MC32 WIN SCOOT', NULL, '', '925719', 0, '<br>Шины Mitas MC32 WIN SCOOT - идеальный выбор для тех, кто использует свой мотоцикл или скутер зимой и в межсезонье.<br/>\n<br>Эти шины обладают высокими эксплутационными характеристиками при низких температурах, на снегу, льду и мокрой дороге.<br/>\n<br>Вес шины: 4,1 кг<br/>\n<br>Индекс нагрузки: 52<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '100-80-17-52r-tl-mc32-win-scoot', NULL, NULL, 1, 0, 'f27ec1bf-325b-11e8-8192-ed790c9fa917'),
(409, 3, '3|1', 1, 0, '110/70ZR17 54W TL SPORTFORCE+', NULL, '', '938424', 0, '<br>Мотоциклетная шина Mitas SportForce+ является одним из флагманов модельного ряда известного чешского производителя. Об этом можно судить по технологиям, использованным в ее конструкции. Многие из них ранее применялись исключительно в мотоспорте, что лишний раз подтверждает высокую производительность данной модели, предназначенной для спортбайков. Мотоциклетная шина Mitas SportForce+ является одним из флагманов модельного ряда известного чешского производителя. Об этом можно судить по технологиям, использованным в ее конструкции. Многие из них ранее применялись исключительно в мотоспорте, что лишний раз подтверждает высокую производительность данной модели, предназначенной для спортбайков.<br/>\n<br>Особенности:<br/>\n<br>Оптимизированный дизайн дренажных канавок.<br/>\n<br>Протекторный рисунок Mitas SportForce+ содержит большое количество дренажных канавок. Эти элементы отличаются формой и расположением, специально подобранными не только с целью обеспечить максимальную устойчивость к аквапланированию. Они имеют значительную протяженность, будучи расположенными под острым углом относительно направления. В сочетании со сложной многоугольной формой их боковых стенок это позволяет шине чрезвычайно эффективно сопротивляться перегреву, отводя значительную часть тепла в окружающее пространство. Те же конструктивные особенности позволяют дренажным канавкам превосходно справляться с отводом воды от пятна контакта, обеспечивая шине хорошую устойчивость в дождливую погоду.<br/>\n<br>Жесткий каркас.<br/>\n<br>Еще одним нововведением данной модели является технология SCT. За этой аббревиатурой (Strong Carcass Technology) скрывается конструкция каркаса, корд которого намотан таким образом, что в нем отсутствуют какие-либо стыки и швы. В результате шина прекрасно сохраняет свою первоначальную форму даже при самом сильном воздействии разнонаправленных сил ускорения, обеспечивая быстрые и точные реакции на действия байкера. Еще одним преимуществом данной технологии является улучшившаяся устойчивость к неравномерному износу.<br/>\n<br>Основные особенности мотошины Mitas SportForce+<br/>\n<br>— оптимизированное расположение и форма дренажных канавок обеспечивает не только высокую устойчивость к аквапланированию, но и снижает уровень нагрева при движении на высокой скорости;<br/>\n<br>— жесткий каркас улучшает управляемость и устойчивость при прохождении поворотов, придает реакциям шины быстроту и точность;<br/>\n<br>— стабильные сцепные свойства в любых условиях благодаря использованию при разработке технологий компьютерного моделирования.<br/>\n<br>Конструкция: Радиальная<br/>\n<br>Индекс нагрузки: 54<br/>\n<br>Вес шины: 4,2 кг<br/>\n<br>Страна производства: Словения<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-70zr17-54w-tl-sportforce-', NULL, NULL, 1, 0, 'ff45d43d-325b-11e8-8192-ed790c9fa917'),
(410, 4, '4|1', 1, 0, '100/90-19 M/C 57T E-09 TL', NULL, '', '885572', 0, '<br>Mitas E09 - подходит для пустынных и раллийных соревнований.<br/>\n<br>Протектор наделен эксклюзивным сочетанием элементов для совершенного сцепления на любой скорости. Благодаря прочной конструкции шины очень надежны, устойчивы к проколам.<br/>\n<br>Вес шины: 4,4 кг<br/>\n<br>Индекс нагрузки: 57<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '100-90-19-m-c-57t-e-09-tl', NULL, NULL, 1, 0, 'd2e0682f-325b-11e8-8192-ed790c9fa917'),
(411, 4, '4|1', 1, 0, '150/70 B17 M/C 69T E-10 DAKAR TL', NULL, '', '889990', 0, '<br>Mitas E10 - предназначены для всех типов дорог и умеренного бездорожья.<br/>\n<br>При разработке резиновой смеси использовалось огромное число новых компонентов, которые увеличили эксплуатационные качества шины Mitas E-10. Повысить износостойкие параметры помог кремний, за счет этого срок службы шину увеличился. Новая силика обеспечила резине повышенную эластичность, что положительно сказалось на сцеплении с влажным дорожным покрытием. Новая резиновая смесь позволила уменьшить сопротивление качению, что повысило устойчивость при движении на высоких скоростях.<br/>\n<br>Dakar - протектор с усиленным каркасом дляэкстремального вождения или гонок.<br/>\n<br>Вес шины: 7,6 кг<br/>\n<br>Индекс нагрузки: 69<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '150-70-b17-m-c-69t-e-10-dakar-tl', NULL, NULL, 1, 0, 'd2e068b9-325b-11e8-8192-ed790c9fa917'),
(412, 0, '', 0, 0, '110/80-12 61L TL MC16', NULL, '', '915527', 0, '<br>Шины Sava MC16 - шины оригинального дизайна для скутеров.<br/>\n<br>Sava MC16 обеспечивают прекрасные эксплуатационные и потребительские характеристики. Они отлично показывают себя практически на всех видах дорожного покрытия, даже на проселочных дорогах и по бездорожью. Курсовая устойчивость и высокая безопасность гарантируется рисунком протектора и резиновой смесью.<br/>\n<br>Вес шины: 2,8 кг<br/>\n<br>Индекс нагрузки: 61<br/>\n<br>Страна производства: Словения<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-80-12-61l-tl-mc16', NULL, NULL, 1, 0, 'df3e9ae4-325b-11e8-8192-ed790c9fa917');
