(413, 4, '4|1', 1, 0, '110/80-18M/C 58P E-09 TT', NULL, '', '881051', 0, '<br>Mitas E09 - подходит для пустынных и раллийных соревнований.<br/>\n<br>Протектор наделен эксклюзивным сочетанием элементов для совершенного сцепления на любой скорости. Благодаря прочной конструкции шины очень надежны, устойчивы к проколам.<br/>\n<br>Вес шины: 4,2 кг<br/>\n<br>Индекс нагрузки: 58<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-80-18m-c-58p-e-09-tt', NULL, NULL, 1, 0, 'b1201d23-325b-11e8-8192-ed790c9fa917'),
(414, 2, '2|1', 1, 0, '90/100-14 49M C-20 TT', NULL, '', '881105', 0, '<br>Mitas C20 представляет собой уникальную разработку именитого шинного концерна. Покрышка отличается универсальностью. Протектор обладает улучшенным узором, который без проблем справляется даже с нестабильными дорожными полотнами.<br/> \n<br>Благодаря суперкрепкому компаунду в разы повышается срок эксплуатации такого изделия. Шина обладает высоким европейским качеством. Она надежно защищена от механических повреждений и абразивного воздействия магистралей.<br/> \n<br>Вес шины: 2,8 кг<br/>\n<br>Индекс нагрузки: 46<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '90-100-14-49m-c-20-tt', NULL, NULL, 1, 0, 'befe4d29-325b-11e8-8192-ed790c9fa917'),
(415, 0, '', 0, 0, '130/60-13 60P MC20 REINF. TL', NULL, '', '950538', 0, '<br>Шины Mitas MC20 - всепогодные шины для скутеров. Отличная управляемость и долгий срок службы.<br/>\n<br>Эксклюзивная по составу резиновая смесь стойко справляется с абразивным воздействием асфальтного полотна.<br/>\n<br>Reinforced - увеличенный индекс грузоподъемности(нагрузки) шины по E.T.R.T.O.<br/>\n<br>Вес шины: 3,1 кг<br/>\n<br>Индекс нагрузки: 60<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '130-60-13-60p-mc20-reinf--tl', NULL, NULL, 1, 0, '137b8069-325c-11e8-8192-ed790c9fa917'),
(416, 4, '4|1', 1, 0, '110/80-19 MC60 GETA WAY NORM', NULL, '', '906768', 0, '<br>Sava MC60 - диагональные покрышки для дорожных мотоциклов эндуро.<br/>\n<br>Моторезина Sava MC60 GetAway обладает мощным протекторным рисунком, который обеспечивает отличительные характеристики при езде на высоких скоростях. Благодаря рисунку протектора также обеспечивается прекрасная езда по бездорожью, так как рисунок протектора самоочищается и надежно защищает от эффекта аквапланирования, обеспечивая высокий уровень безопасности.<br/>\n<br>Вес шины: 4,5 кг<br/>\n<br>Индекс нагрузки: 60<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-80-19-mc60-geta-way-norm', NULL, NULL, 1, 0, 'd941f953-325b-11e8-8192-ed790c9fa917'),
(417, 2, '2|1', 1, 0, '130/90-18M/C 69R EF-07 SUPER TT', NULL, '', '881088', 0, '<br>Mitas EF-07 разработана для преимущественного использования по гравию, камням, горной местности.<br/>\n<br>Обновленная резиновая смесь улучшила ходовые параметры шины. Большое содержание кремния повысило износостойкие качества протектора, в результате увеличился срок использования. Новая силика обеспечила повышенную эластичность, за счет этого улучшилось сцепление Mitas EF-07 на влажном дорожном покрытии. Сочетание обновленной резиновой смеси и оптимального подобранных протекторных блоков позволило увеличить пятно контакта с дорожной поверхностью.<br/>\n<br>Super-протектор из особой смеси для гонок Enduro.<br/>\n<br>Вес шины: 5,4 кг<br/>\n<br>Индекс нагрузки: 69<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '130-90-18m-c-69r-ef-07-super-tt', NULL, NULL, 1, 0, 'b831b6b9-325b-11e8-8192-ed790c9fa917'),
(418, 0, '', 0, 0, '10x4.50-5 SRH', NULL, '', '942141', 0, '<br>Покрышки для картинга SRH — очень жесткие прокатные покрышки.<br/>\n<br>Подходят для езды как под открытым небом, так и в закрытых помещениях, долгий срок службы при высоких температурах, подходят также для езды на прокатных картах.<br/>\n<br>Вес шины: 1,5 кг<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '10x4-50-5-srh', NULL, NULL, 1, 0, '05e03c45-325c-11e8-8192-ed790c9fa917'),
(419, 4, '4|1', 1, 0, '130/80-18M/C 72T REINF E-07 TL', NULL, '', '944951', 0, '<br>Mitas E-07 специально создана для мотоциклов, которые эксплуатируются на любой дорожной поверхности. Отличительной особенностью этой модели является необычный протекторный рисунок, который обеспечивает повышенную устойчивость и уверенное управление на любой дорожной поверхности.<br/>\n<br>Вся поверхность шины покрыта необычными блоками, которые обеспечивают отличную устойчивость и управляемость. Оптимально подобранные расстояния между блоками предотвращают застревание камней в протекторе и повышают самоочищение. В плечевой зоне, блоки имеют другую форму, за счет этого достигается повышенная устойчивость при любых маневрах. Отличная курсовая устойчивость и быстрая обратная связь обеспечивается центральной частью протектора, где пересекаются блоки.<br/>\n<br>Вес шины: 8 кг<br/>\n<br>Индекс нагрузки: 72<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '130-80-18m-c-72t-reinf-e-07-tl', NULL, NULL, 1, 0, '05e03d55-325c-11e8-8192-ed790c9fa917'),
(420, 2, '2|1', 1, 0, '120/90-19M/C 66N C-02 TT', NULL, '', '881148', 0, '<br>Mitas C02 – прекрасные покрышки европейского производства с широким набором характеристик. Предназначается для задней оси мотоциклетных транспортных средств. Модель Mitas C-02 разработана для преимущественного использования по гравию, камням.<br/>\n<br>Резиновая смесь дополнена стойкими к абразивному износу полимерами.<br/>\n<br>Reinforced - увеличенный индекс грузоподъемности(нагрузки) шины по E.T.R.T.O.<br/>\n<br>Вес шины: 6,2 кг<br/>\n<br>Индекс нагрузки: 66<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-90-19m-c-66n-c-02-tt', NULL, NULL, 1, 0, 'c523ba0c-325b-11e8-8192-ed790c9fa917'),
(421, 3, '3|1', 1, 0, '140/80-17 69H TL MC50', NULL, '', '925832', 0, '<br>\"Mitas MC50 - это высокоскоростные шины диагональной конструкции. Шины Mitas MC50 используются в профессиональных мотогонках, отличаются хорошим сцеплением с дорогой и длительным сроком службы. Данная моторезина рекомендуется для спорта, супермото, мотоциклов с низким и средним объемом двигателя. Конструкция шин Mitas MC50 позволяет использовать их не только на гоночных трассах, но и в повседневной жизни. Mitas MC50 - многофункциональная шина с отличной производительностью на сухом дорожном покрытии и в то же время с отличной управляемостью на мокром. Жесткость боковой стенки обеспечивает стабильность шины на гоночных трассах.<br/>\n<br>Конструкция: Диагональная<br/>\n<br>Индекс нагрузки: 69<br/>\n<br>Вес шины: 5,9 кг<br/>\n<br>Страна производства: Словения<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '140-80-17-69h-tl-mc50', NULL, NULL, 1, 0, 'f8fee323-325b-11e8-8192-ed790c9fa917'),
(422, 0, '', 0, 0, '120/90-//130/80-18.....TR6 BOX HD', NULL, '', '915230', 0, '<br>Камеры изготовлены из бутилкаучука и имеют следующие маркировки:<br/> \n<br><br/>\n<br>Mitas и SAVA<br/>\n<br><br/>\n<br>UHD - камера толщиной 4 мм для очень больших нагрузок<br/>\n<br>HD - камера толщиной 1,9-2,0 мм для больших нагрузок<br/>\n<br>Normal - камера толщиной 1,2-1,4 мм для не больших нагрузок, как правило устонавливаются на скутеры или малокубатурные мотоциклы<br/>\n<br>BOX - камера упакована в отдельную коробку<br/>\n<br>JS87, TR87, 90/90 - камера имеет изогнутый вентель<br/>\n<br>34G, TR6 - камера имеет прямой вентель<br/>\n<br><br/>\n<br>КАБАТ<br/>\n<br><br/>\n<br>HD - усиленные камеры для больших нагрузок<br/>\n<br>GP4(TR-4)(V1.09.1) - камера имеет прямой вентель<br/>\n<br>Все камеры марки КАБАТ не имеют упаковки<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-90---130-80-18-----tr6-box-hd', NULL, NULL, 1, 0, 'd941f9a9-325b-11e8-8192-ed790c9fa917'),
(423, 0, '', 0, 0, '3.50//90/90-...-18 TR6 BOX T', NULL, '', '947037', 0, '<br>Камеры изготовлены из бутилкаучука и имеют следующие маркировки:<br/> \n<br><br/>\n<br>Mitas и SAVA<br/>\n<br><br/>\n<br>UHD - камера толщиной 4 мм для очень больших нагрузок<br/>\n<br>HD - камера толщиной 1,9-2,0 мм для больших нагрузок<br/>\n<br>Normal - камера толщиной 1,2-1,4 мм для не больших нагрузок, как правило устонавливаются на скутеры или малокубатурные мотоциклы<br/>\n<br>BOX - камера упакована в отдельную коробку<br/>\n<br>JS87, TR87, 90/90 - камера имеет изогнутый вентель<br/>\n<br>34G, TR6 - камера имеет прямой вентель<br/>\n<br><br/>\n<br>КАБАТ<br/>\n<br><br/>\n<br>HD - усиленные камеры для больших нагрузок<br/>\n<br>GP4(TR-4)(V1.09.1) - камера имеет прямой вентель<br/>\n<br>Все камеры марки КАБАТ не имеют упаковки<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '3-50--90-90-----18-tr6-box-t', NULL, NULL, 1, 0, '0ce5e29f-325c-11e8-8192-ed790c9fa917'),
