(425, 2, '2|1', 1, 0, '120/90-18 65M C-10 SPEEDY-CROC TT', NULL, '', '881131', 0, '<br>Mitas C02 – прекрасные покрышки европейского производства с широким набором характеристик. Предназначается для задней оси мотоциклетных транспортных средств. Модель Mitas C-02 разработана для преимущественного использования по гравию, камням.<br/>\n<br>Резиновая смесь дополнена стойкими к абразивному износу полимерами.<br/>\n<br>Reinforced - увеличенный индекс грузоподъемности(нагрузки) шины по E.T.R.T.O.<br/>\n<br>Вес шины: 5,1 кг<br/>\n<br>Индекс нагрузки: 65<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-90-18-65m-c-10-speedy-croc-tt', NULL, NULL, 1, 0, 'befe4e6d-325b-11e8-8192-ed790c9fa917'),
(426, 2, '2|1', 1, 0, '110/80-18 58M EF-07 SUPER TT', NULL, '', '915626', 0, '<br>Mitas EF-07 разработана для преимущественного использования по гравию, камням, горной местности.<br/>\n<br>Обновленная резиновая смесь улучшила ходовые параметры шины. Большое содержание кремния повысило износостойкие качества протектора, в результате увеличился срок использования. Новая силика обеспечила повышенную эластичность, за счет этого улучшилось сцепление Mitas EF-07 на влажном дорожном покрытии. Сочетание обновленной резиновой смеси и оптимального подобранных протекторных блоков позволило увеличить пятно контакта с дорожной поверхностью.<br/>\n<br>Super-протектор из особой смеси для гонок Enduro.<br/>\n<br>Вес шины: 4,6 кг<br/>\n<br>Индекс нагрузки: 58<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-80-18-58m-ef-07-super-tt', NULL, NULL, 1, 0, 'e5518e9c-325b-11e8-8192-ed790c9fa917'),
(427, 2, '2|1', 1, 0, '110/90-19 62M C-12 TT', NULL, '', '881142', 0, '<br>Mitas C12 – мотоциклетная шина от признанного производителя из Европы. Протектор конструировался в программе виртуального трехмерного моделирования. Поэтому совокупность всех его элементов имеет идеальное расположения. Канавки наделены нетрадиционной глубиной и наклоном. Все это сделано для безукоризненного сцепления на любых дорожных полотнах.<br/>\n<br>Компаунд получил от команды специалистов маститого бренда оригинальный состав. Благодаря этому обеспечивается эго беспрецедентная износостойкость.<br/>\n<br>Вес шины: 5,2 кг<br/>\n<br>Индекс нагрузки: 62 <br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-90-19-62m-c-12-tt', NULL, NULL, 1, 0, 'c523b9b4-325b-11e8-8192-ed790c9fa917'),
(428, 0, '', 0, 0, '120/90-19 (5.00-19) TR6 BOX', NULL, '', '915221', 0, '<br>Камеры изготовлены из бутилкаучука и имеют следующие маркировки:<br/> \n<br><br/>\n<br>Mitas и SAVA<br/>\n<br><br/>\n<br>UHD - камера толщиной 4 мм для очень больших нагрузок<br/>\n<br>HD - камера толщиной 1,9-2,0 мм для больших нагрузок<br/>\n<br>Normal - камера толщиной 1,2-1,4 мм для не больших нагрузок, как правило устонавливаются на скутеры или малокубатурные мотоциклы<br/>\n<br>BOX - камера упакована в отдельную коробку<br/>\n<br>JS87, TR87, 90/90 - камера имеет изогнутый вентель<br/>\n<br>34G, TR6 - камера имеет прямой вентель<br/>\n<br><br/>\n<br>КАБАТ<br/>\n<br><br/>\n<br>HD - усиленные камеры для больших нагрузок<br/>\n<br>GP4(TR-4)(V1.09.1) - камера имеет прямой вентель<br/>\n<br>Все камеры марки КАБАТ не имеют упаковки<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-90-19--5-00-19--tr6-box', NULL, NULL, 1, 0, 'd941f999-325b-11e8-8192-ed790c9fa917'),
(429, 2, '2|1', 1, 0, '3.00-17 50P SW-10 TT', NULL, '', '881168', 0, '<br>Mitas SW-10 рекомендована для кольцевых гонок и суперсложных гран-при.<br/>\n<br>Данная моторезина предназначена для установки исключительно на заднюю ось.<br/>\n<br>Вес шины: 2,6 кг<br/>\n<br>Индекс нагрузки: 50<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '3-00-17-50p-sw-10-tt', NULL, NULL, 1, 0, 'c523baf8-325b-11e8-8192-ed790c9fa917'),
(430, 2, '2|1', 1, 0, '4.00-18 64M ET-01 X FORCE (TRIAL X-PRO) TL', NULL, '', '935189', 0, '<br>Mitas ET-01 разработана для преимущественного использования по гравию, камням, горной местности.<br/>\n<br>Универсальность изделия выражается в возможности установки на любую ось мотоцикла. Протектор получил нетрадиционный узор, который повысил «цепные» качества до максимального уровня.<br/>Универсальность изделия выражается в возможности установки на любую ось мотоцикла. Протектор получил нетрадиционный узор, который повысил «цепные» качества до максимального уровня.\n<br>Trial X-Pro - можно использовать для профессионального триала.<br/>\n<br>Вес шины: 5,5 кг<br/>\n<br>Индекс нагрузки: 64<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '4-00-18-64m-et-01-x-force--trial-x-pro--tl', NULL, NULL, 1, 0, 'ff45d3cb-325b-11e8-8192-ed790c9fa917'),
(431, 0, '', 0, 0, '4.00-18 HD V1.09.1', NULL, '', '927651', 0, '<br>Камеры изготовлены из бутилкаучука и имеют следующие маркировки:<br/> \n<br><br/>\n<br>Mitas и SAVA<br/>\n<br><br/>\n<br>UHD - камера толщиной 4 мм для очень больших нагрузок<br/>\n<br>HD - камера толщиной 1,9-2,0 мм для больших нагрузок<br/>\n<br>Normal - камера толщиной 1,2-1,4 мм для не больших нагрузок, как правило устонавливаются на скутеры или малокубатурные мотоциклы<br/>\n<br>BOX - камера упакована в отдельную коробку<br/>\n<br>JS87, TR87, 90/90 - камера имеет изогнутый вентель<br/>\n<br>34G, TR6 - камера имеет прямой вентель<br/>\n<br><br/>\n<br>КАБАТ<br/>\n<br><br/>\n<br>HD - усиленные камеры для больших нагрузок<br/>\n<br>GP4(TR-4)(V1.09.1) - камера имеет прямой вентель<br/>\n<br>Все камеры марки КАБАТ не имеют упаковки<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '4-00-18-hd-v1-09-1', NULL, NULL, 1, 0, 'ff45d384-325b-11e8-8192-ed790c9fa917'),
(432, 3, '3|1', 1, 0, '90/65-6.5 MRC', NULL, '', '947034', 0, '<br>MRC<br/>\n<br>Мягкие гоносные шины подходят для вождения в теплую погоду и по умеренно гладкой поверхности<br/>\n<br>Вес шины: 1,2 кг<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '90-65-6-5-mrc', NULL, NULL, 1, 0, '0ce5e293-325c-11e8-8192-ed790c9fa917'),
(433, 0, '', 0, 0, '3.50-10 59J REINF S-06 TT', NULL, '', '880970', 0, '<br>Мотоциклетные шины Mitas S-06 обеспечивают прекрасные сцепно-тормозные качества, что является важным показателем при скоростной езде на скутерах.<br/>\n<br>Рисунок протектора покрышек Mitas S-06 оптимален для преимущественной езды по дорогам с покрытием низкого качества.<br/>\n<br>Reinforced - увеличенный индекс грузоподъемности(нагрузки) шины по E.T.R.T.O.<br/>\n<br>Вес шины: 2,5 кг<br/>\n<br>Индекс нагрузки: 59<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '3-50-10-59j-reinf-s-06-tt', NULL, NULL, 1, 0, 'b1201bf0-325b-11e8-8192-ed790c9fa917'),
(434, 4, '4|1', 1, 0, '130/80-17M/C 65R E-09 TL', NULL, '', '922910', 0, '<br>Mitas E09 - подходит для пустынных и раллийных соревнований.<br/>\n<br>Протектор наделен эксклюзивным сочетанием элементов для совершенного сцепления на любой скорости. Благодаря прочной конструкции шины очень надежны, устойчивы к проколам.<br/>\n<br>Вес шины: 5,9 кг<br/>\n<br>Индекс нагрузки: 65<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '130-80-17m-c-65r-e-09-tl', NULL, NULL, 1, 0, 'ec3eed8e-325b-11e8-8192-ed790c9fa917'),
(435, 0, '', 0, 0, '130/70-17 62R MC32 W.SCOOT M+S TL', NULL, '', '940646', 0, '<br>Шины Mitas MC32 WIN SCOOT - идеальный выбор для тех, кто использует свой мотоцикл или скутер зимой и в межсезонье.<br/>\n<br>Эти шины обладают высокими эксплутационными характеристиками при низких температурах, на снегу, льду и мокрой дороге.<br/>\n<br>M + S - шины для грязи и снега, используются также круглогодично. Устанавливая шину на мотоцикл, достигающий большую скорость, необходимо учитывать допустимую максимальную скорость шины.<br/>\n<br>Вес шины: 4,9 кг<br/>\n<br>Индекс нагрузки: 62<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '130-70-17-62r-mc32-w-scoot-m-s-tl', NULL, NULL, 1, 0, '05e03c00-325c-11e8-8192-ed790c9fa917'),
(436, 0, '', 0, 0, '120/70-16 57P MC28 DIAMONDS TL', NULL, '', '950528', 0, '<br>Шины Mitas - MC28 - всесезонные шины, сделаны специально для максискутеров.<br/>\n<br>Mitas MC28 обладают отличной продольной и угловой стабильностью. <br/>\n<br>Долговечная резиновая смесь выдерживает скоростные и весовые нагрузки и отлично держит дорогу в любую погоду.<br/>\n<br>Вес шины: 4,1 кг<br/>\n<br>Индекс нагрузки: 57<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '120-70-16-57p-mc28-diamonds-tl', NULL, NULL, 1, 0, '0ce5e32d-325c-11e8-8192-ed790c9fa917'),
(437, 4, '4|1', 1, 0, '80/90-21M/C 48P E-09 TT', NULL, '', '881065', 0, '<br>Mitas E09 - подходит для пустынных и раллийных соревнований.<br/>\n<br>Протектор наделен эксклюзивным сочетанием элементов для совершенного сцепления на любой скорости. Благодаря прочной конструкции шины очень надежны, устойчивы к проколам.<br/>\n<br>Вес шины: 2,7 кг<br/>\n<br>Индекс нагрузки: 48<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '80-90-21m-c-48p-e-09-tt', NULL, NULL, 1, 0, 'b831b5d4-325b-11e8-8192-ed790c9fa917'),
(438, 0, '', 0, 0, '140/80-18 TR6 HD BOX', NULL, '', '915229', 0, '<br>Камеры изготовлены из бутилкаучука и имеют следующие маркировки:<br/> \n<br><br/>\n<br>Mitas и SAVA<br/>\n<br><br/>\n<br>UHD - камера толщиной 4 мм для очень больших нагрузок<br/>\n<br>HD - камера толщиной 1,9-2,0 мм для больших нагрузок<br/>\n<br>Normal - камера толщиной 1,2-1,4 мм для не больших нагрузок, как правило устонавливаются на скутеры или малокубатурные мотоциклы<br/>\n<br>BOX - камера упакована в отдельную коробку<br/>\n<br>JS87, TR87, 90/90 - камера имеет изогнутый вентель<br/>\n<br>34G, TR6 - камера имеет прямой вентель<br/>\n<br><br/>\n<br>КАБАТ<br/>\n<br><br/>\n<br>HD - усиленные камеры для больших нагрузок<br/>\n<br>GP4(TR-4)(V1.09.1) - камера имеет прямой вентель<br/>\n<br>Все камеры марки КАБАТ не имеют упаковки<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '140-80-18-tr6-hd-box', NULL, NULL, 1, 0, 'd941f9a1-325b-11e8-8192-ed790c9fa917'),
(439, 3, '3|1', 1, 0, '110/80-17 57P TL MC18', NULL, '', '922906', 0, '<br>Mitas MC18 - это высокоскоростные шины диагональной конструкции. Шины Mitas MC18 используются в профессиональных мотогонках, отличаются хорошим сцеплением с дорогой и длительным сроком службы. Данная моторезина рекомендуется для спорта, супермото, мотоциклов с низким и средним объемом двигателя. Конструкция шин Mitas MC18 позволяет использовать их не только на гоночных трассах, но и в повседневной жизни. Mitas MC18 - многофункциональная шина с отличной производительностью на сухом дорожном покрытии и в то же время с отличной управляемостью на мокром. Жесткость боковой стенки обеспечивает стабильность шины на гоночных трассах.<br/>\n<br>Конструкция: Диагональная<br/>\n<br>Индекс нагрузки: 57<br/>\n<br>Вес шины: 4,4 кг<br/>\n<br>Страна производства: Словения<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-80-17-57p-tl-mc18', NULL, NULL, 1, 0, 'ec3eed5b-325b-11e8-8192-ed790c9fa917'),
(440, 4, '4|1', 1, 0, '140/80-17M/C 69R E-09 DAKAR TL', NULL, '', '924488', 0, '<br>Mitas E09 - подходит для пустынных и раллийных соревнований.<br/>\n<br>Протектор наделен эксклюзивным сочетанием элементов для совершенного сцепления на любой скорости. Благодаря прочной конструкции шины очень надежны, устойчивы к проколам.<br/>\n<br>Dakar - протектор с усиленным каркасом дляэкстремального вождения или гонок.<br/>\n<br>Вес шины: 7,7 кг<br/>\n<br>Индекс нагрузки: 69<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '140-80-17m-c-69r-e-09-dakar-tl', NULL, NULL, 1, 0, 'ec3eede4-325b-11e8-8192-ed790c9fa917'),
(441, 2, '2|1', 1, 0, '110/90-19 62M C-30 TERRACROSS TT', NULL, '', '926997', 0, '<br>Mitas C30 представляет собой уникальную разработку именитого шинного концерна. Покрышка отличается универсальностью. Протектор обладает улучшенным узором, который без проблем справляется даже с нестабильными дорожными полотнами.<br/>\n<br>Дизайн протектора обеспечивает оптимальную производительность во всех режимах вождения.<br/>\n<br>Вес шины: 6,1 кг<br/>\n<br>Индекс нагрузки: 62 <br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-90-19-62m-c-30-terracross-tt', NULL, NULL, 1, 0, 'ff45d35b-325b-11e8-8192-ed790c9fa917'),
(442, 0, '', 0, 0, '110/70-11 45P TL/TT  MC32', NULL, '', '915576', 0, '<br>Шины Sava MC32 - всесезонные покрышки для скутера, подходящие для сухих, влажных и заснеженных дорог.<br/>\n<br>Рисунок протектора Sava MC32 имеет глубокие канавки для отвода воды и слякоти, ламели для хорошего сцепления на снегу.<br/>\n<br>Специальный состав шин Sava MC 32 сохраняет свою эластичность при очень низких температурах.<br/>\n<br>Вес шины: 2,9 кг<br/>\n<br>Индекс нагрузки: 45<br/>\n<br>Страна производства: Словения<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-70-11-45p-tl-tt--mc32', NULL, NULL, 1, 0, 'df3e9b4c-325b-11e8-8192-ed790c9fa917'),
(443, 0, '', 0, 0, '3.50-18 V1.09.1', NULL, '', '884987', 0, '<br>Камеры изготовлены из бутилкаучука и имеют следующие маркировки:<br/> \n<br><br/>\n<br>Mitas и SAVA<br/>\n<br><br/>\n<br>UHD - камера толщиной 4 мм для очень больших нагрузок<br/>\n<br>HD - камера толщиной 1,9-2,0 мм для больших нагрузок<br/>\n<br>Normal - камера толщиной 1,2-1,4 мм для не больших нагрузок, как правило устонавливаются на скутеры или малокубатурные мотоциклы<br/>\n<br>BOX - камера упакована в отдельную коробку<br/>\n<br>JS87, TR87, 90/90 - камера имеет изогнутый вентель<br/>\n<br>34G, TR6 - камера имеет прямой вентель<br/>\n<br><br/>\n<br>КАБАТ<br/>\n<br><br/>\n<br>HD - усиленные камеры для больших нагрузок<br/>\n<br>GP4(TR-4)(V1.09.1) - камера имеет прямой вентель<br/>\n<br>Все камеры марки КАБАТ не имеют упаковки<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '3-50-18-v1-09-1', NULL, NULL, 1, 0, 'd2e067d4-325b-11e8-8192-ed790c9fa917'),
(444, 0, '', 0, 0, '3.50-10 51P TL MC18  BK/WH', NULL, '', '950521', 0, '<br>Вес шины: 2,4 кг<br/>\n<br>Индекс нагрузки: 51<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '3-50-10-51p-tl-mc18--bk-wh', NULL, NULL, 1, 0, '0ce5e2d3-325c-11e8-8192-ed790c9fa917'),
(445, 0, '', 0, 0, '130/80-15 63P TL MC28 DIAMOND S', NULL, '', '925813', 0, '<br>Шины Mitas - MC28 - всесезонные шины, сделаны специально для максискутеров.<br/>\n<br>Mitas MC28 обладают отличной продольной и угловой стабильностью. <br/>\n<br>Долговечная резиновая смесь выдерживает скоростные и весовые нагрузки и отлично держит дорогу в любую погоду.<br/>\n<br>Вес шины: 4,8 кг<br/>\n<br>Индекс нагрузки: 63<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '130-80-15-63p-tl-mc28-diamond-s', NULL, NULL, 1, 0, 'f8fee2c8-325b-11e8-8192-ed790c9fa917'),
(446, 2, '2|1', 1, 0, '110/90-19 M/C 62M XT-454 WIN FRIC TT', NULL, '', '881198', 0, '<br>Mitas XT454 – европейская резина бескомпромиссного качества. Она демонстрирует великолепное сцепление с дорожным полотном любого качества. Это обеспечивается массивной короной протектора. Совокупность элементов центральной части покрышки разрабатывалась в компьютерной программе трехмерного компьютерного моделирования. Благодаря этому интервалы просчитаны до миллиметра.<br/>\n<br>Боковые фигуры изготовлены из прочной резиновой смеси. Однако при этом они сохраняют отличную эластичность.<br/>\n<br>Winter Friction - специальный вариант для использования в зимних условиях, подходит также для шипов.<br/>\n<br>Вес шины: 6,2 кг<br/>\n<br>Индекс нагрузки: 62<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-90-19-m-c-62m-xt-454-win-fric-tt', NULL, NULL, 1, 0, 'cbbe1e25-325b-11e8-8192-ed790c9fa917'),
(447, 3, '3|1', 1, 0, '3.50-19M/C 63P H-02 TT', NULL, '', '881024', 0, '<br>Дорожная моторезина Mitas H-02 обладает универсальным рисунком протектора, который подходит для задних и передних колес мотоцикла. При установке сразу двух шин вам гарантированы феноменальные сцепные показатели на любых ландшафтах. Исключительные пропорции каркаса делают покрышку невероятно управляемой. Такая модель станет безукоризненным вариантом для тех, кто желает подобрать лучшую «обувь» для своего байка.<br/>\n<br>Данная моторезина наиболее подходит для классических и ретро-мотоциклов.<br/>\n<br>Вес шины: 3,7 кг<br/>\n<br>Индекс нагрузки: 63<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '3-50-19m-c-63p-h-02-tt', NULL, NULL, 1, 0, 'b1201cca-325b-11e8-8192-ed790c9fa917'),
(448, 0, '', 0, 0, '4.50-10C 76N  (6PR) TL B61', NULL, '', '915670', 0, '<br>Мотошины Sava B61 обеспечивают отличную скоростную езду и маневренность.<br/>\n<br>Благодаря мото резине Sava B61 каждый мотоцикл сможет сочетать быструю скорость с приятной и безопасной поездкой.<br/>\n<br>Вес шины: 4 кг<br/>\n<br>Индекс нагрузки: 76<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '4-50-10c-76n---6pr--tl-b61', NULL, NULL, 1, 0, 'e5518f6e-325b-11e8-8192-ed790c9fa917'),
(449, 2, '2|1', 1, 0, '80/100-21M/C 51R XT-994 W.F.SPIKE TT', NULL, '', '881208', 0, '<br>Основной сферой применения мотоциклетной шины Mitas XT-994 являются тяжелые и каменистые грунты, где она демонстрирует все свои сильные стороны, будучи установленной на переднее колесо мотоцикла категории мотокросс либо эндуро.<br/>\n<br>Данную модель выгодно отличает открытый дизайн протекторного рисунка, отличная курсовая устойчивость, очень продолжительный срок службы и великолепная надежность.<br/>\n<br>Также нельзя не отметить возможность эксплуатации на дорогах общего пользования. Об этом свидетельствует наличие сертификатов, удостоверяющих соответствие данной модели требованиям DOT и E75.<br/>\n<br>Winter Friction - специальный вариант для использования в зимних условиях, подходит также для шипов.<br/>\n<br>Spike - протектор с шипами Winterfriction.<br/>\n<br>Вес шины: 4,5 кг<br/>\n<br>Индекс нагрузки: 51<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '80-100-21m-c-51r-xt-994-w-f-spike-tt', NULL, NULL, 1, 0, 'cbbe1e71-325b-11e8-8192-ed790c9fa917'),
(450, 0, '', 0, 0, '145/70-8 52F K02 TT', NULL, '', '881211', 0, '<br>На создание такой модели команду инженеров знаменитого бренда вдохновила детская коляска «Buggy».<br/>\n<br>Мотопокрышка получила «забористый» узор в виде скопления массивных зубьев. Этим обеспечивается феноменальное сцепление. Ходовые параметры шины вас обязательно порадуют.<br/>\n<br>Вес шины: 3,5 кг<br/>\n<br>Индекс нагрузки: 52<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '145-70-8-52f-k02-tt', NULL, NULL, 1, 0, 'cbbe1e9a-325b-11e8-8192-ed790c9fa917'),
(451, 0, '', 0, 0, '110/80-14 59P TL/TT MC32 REINF.W.F', NULL, '', '925748', 0, '<br>Mitas S-11 – шины для скутера, использующегося на бездорожье или зимой.<br/>\n<br>Модель разработана для преимущественной эксплуатации на бездорожье, но предполагает и использование на асфальте. Покрышки Mitas S-11 пригодны для использования в зимних условиях и шипования.<br/>\n<br>Winter Friction - специальный вариант для использования в зимних условиях, подходит также для шипов.<br/>\n<br>Вес шины: 4,2 кг<br/>\n<br>Индекс нагрузки: 59<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '110-80-14-59p-tl-tt-mc32-reinf-w-f', NULL, NULL, 1, 0, 'f27ec20d-325b-11e8-8192-ed790c9fa917'),
(452, 2, '2|1', 1, 0, '90/90-21M/C 54R C-15 CROSS FRONT TT', NULL, '', '881159', 0, '<br>Mitas C-15 разработана для преимущественного использования по гравию.<br/>\n<br>Данная моторезина предназначена для установки на переднюю ось.<br/>\n<br>Soft Terrain - технология, позволяющая использовать ваш мотоцикл на мягких грунтах.<br/>\n<br>Вес шины: 3,3 кг<br/>\n<br>Индекс нагрузки: 54<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '90-90-21m-c-54r-c-15-cross-front-tt', NULL, NULL, 1, 0, 'c523ba8f-325b-11e8-8192-ed790c9fa917'),
(453, 4, '4|1', 1, 0, '90/90B21 M/C 54T E-10 TL', NULL, '', '881077', 0, '<br>Mitas E10 - предназначены для всех типов дорог и умеренного бездорожья.<br/>\n<br>При разработке резиновой смеси использовалось огромное число новых компонентов, которые увеличили эксплуатационные качества шины Mitas E-10. Повысить износостойкие параметры помог кремний, за счет этого срок службы шину увеличился. Новая силика обеспечила резине повышенную эластичность, что положительно сказалось на сцеплении с влажным дорожным покрытием. Новая резиновая смесь позволила уменьшить сопротивление качению, что повысило устойчивость при движении на высоких скоростях.<br/>\n<br>Вес шины: 4,5 кг<br/>\n<br>Индекс нагрузки: 54<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '90-90b21-m-c-54t-e-10-tl', NULL, NULL, 1, 0, 'b831b644-325b-11e8-8192-ed790c9fa917'),
(454, 4, '4|1', 1, 0, '150/70-17 M/C 69T E-07 DAKAR TL', NULL, '', '889989', 0, '<br>Mitas E-07 специально создана для мотоциклов, которые эксплуатируются на любой дорожной поверхности. Отличительной особенностью этой модели является необычный протекторный рисунок, который обеспечивает повышенную устойчивость и уверенное управление на любой дорожной поверхности.<br/>\n<br>Вся поверхность шины покрыта необычными блоками, которые обеспечивают отличную устойчивость и управляемость. Оптимально подобранные расстояния между блоками предотвращают застревание камней в протекторе и повышают самоочищение. В плечевой зоне, блоки имеют другую форму, за счет этого достигается повышенная устойчивость при любых маневрах. Отличная курсовая устойчивость и быстрая обратная связь обеспечивается центральной частью протектора, где пересекаются блоки.<br/>\n<br>Dakar - протектор с усиленным каркасом для экстремального вождения или гонок.<br/>\n<br>Вес шины: 7,9 кг<br/>\n<br>Индекс нагрузки: 69<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '150-70-17-m-c-69t-e-07-dakar-tl', NULL, NULL, 1, 0, 'd2e068ac-325b-11e8-8192-ed790c9fa917'),
(455, 0, '', 0, 0, '140/60-13 57L TL MC28', NULL, '', '915480', 0, '<br>Шины Sava MC28 - всесезонные шины, сделаны специально для максискутеров.\nSava MC28 обладают отличной продольной и угловой стабильностью. \nДолговечная резиновая смесь выдерживает скоростные и весовые нагрузки и отлично держит дорогу в любую погоду.\n<br>Вес шины: 3,6 кг<br/>\n<br>Индекс нагрузки: 57<br/>\n<br>Страна производства: Словения<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '140-60-13-57l-tl-mc28', NULL, NULL, 1, 0, 'df3e9a67-325b-11e8-8192-ed790c9fa917'),
(456, 0, '', 0, 0, '4.00/4.25./...-17 TR6 SG17 BOX', NULL, '', '940636', 0, '<br>Камеры изготовлены из бутилкаучука и имеют следующие маркировки:<br/> \n<br><br/>\n<br>Mitas и SAVA<br/>\n<br><br/>\n<br>UHD - камера толщиной 4 мм для очень больших нагрузок<br/>\n<br>HD - камера толщиной 1,9-2,0 мм для больших нагрузок<br/>\n<br>Normal - камера толщиной 1,2-1,4 мм для не больших нагрузок, как правило устонавливаются на скутеры или малокубатурные мотоциклы<br/>\n<br>BOX - камера упакована в отдельную коробку<br/>\n<br>JS87, TR87, 90/90 - камера имеет изогнутый вентель<br/>\n<br>34G, TR6 - камера имеет прямой вентель<br/>\n<br><br/>\n<br>КАБАТ<br/>\n<br><br/>\n<br>HD - усиленные камеры для больших нагрузок<br/>\n<br>GP4(TR-4)(V1.09.1) - камера имеет прямой вентель<br/>\n<br>Все камеры марки КАБАТ не имеют упаковки<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '4-00-4-25------17-tr6-sg17-box', NULL, NULL, 1, 0, 'ff45d4e9-325b-11e8-8192-ed790c9fa917'),
(457, 4, '4|1', 1, 0, '3.50-18M/C 62R REINF E-03 TT', NULL, '', '881050', 0, '<br>Универсальный фигурный рисунок протектора моторезины Mitas E-03 для передних и задних колес подходит для езды в режиме дорога/бездорожье.<br/>\n<br>Reinforced - увеличенный индекс грузоподъемности(нагрузки) шины по E.T.R.T.O.<br/>\n<br>Вес шины: 4,1 кг<br/>\n<br>Индекс нагрузки: 62<br/>\n<br>Страна производства: Чехия<br/>', 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 2000, 0, 0, NULL, NULL, NULL, '3-50-18m-c-62r-reinf-e-03-tt', NULL, NULL, 1, 0, 'b1201d16-325b-11e8-8192-ed790c9fa917');
