INSERT INTO `parf_pages` (`id`, `url`, `title`, `text`, `type`, `active`, `img`) VALUES
(1, 'oplata', 'Оплата', '<h3 style=\"text-align: center;\" id=\"mcetoc_1c404tque0\"><span><strong>Оплата наличными<br /><br /><br /><br /></strong></span><span><strong></strong></span><span><strong></strong></span></h3>\n<div>\n<p><span><strong>1. В пункте&nbsp;выдачи заказа&nbsp;г. Краснодар&nbsp;&nbsp;</strong>(комиссия 0%)&nbsp;</span></p>\n<p><span><img alt=\"наличные\" src=\"https://parfumart.ru/userfiles/images/nal.png\" style=\"float: right;\" caption=\"false\" width=\"120\" /></span></p>\n<p><span>Оплата производится при получении&nbsp;товара&nbsp;в пункте выдачи заказов по адресу:<br />г. Краснодар,</span>&nbsp;ул. Уральская 75/1, корпус 1. Деловой центр AVM-ORSETTO, 2 этаж,&nbsp;офис 201.</p>\n<p><span>Режим работы пункта выдачи заказов:</span></p>\n<p>Понедельник-Воскресенье: с 10:00 до 19:00</p>\n<p>Без перерыва и выходных.</p>\n<p><span><strong>2.&nbsp;В пунктах&nbsp;выдачи заказов других регионах&nbsp;РФ, АР Крым&nbsp;и Республики&nbsp;Казахстан</strong>&nbsp;(комиссия 0%)&nbsp;</span></p>\n<p><span>Оплата производится при получении&nbsp;товара&nbsp;в пункте выдачи заказов.</span></p>\n<p><span><strong>3. Оплата наличными&nbsp;курьеру в г. Краснодар и&nbsp;других регионах&nbsp;РФ, АР Крым&nbsp;и Республики&nbsp;Казахстан</strong>&nbsp;(комиссия 0%)</span></p>\n<p><span>Оплата производится при получении товара наличными курьеру, который доставит заказ и выдаст товарный чек об оплате. Цены, представленные на сайте, окончательные. Все налоги включены. При получении заказа внимательно осматривайте покупку в присутствии курьера: если Вас&nbsp;не устраивает&nbsp;внешний вид товара, или товар не соответствует параметрам заказа, Вы можете вернуть товар курьеру, мы обязательно его заменим. Вы можете отказаться от заказа полностью в присутствии курьера, оплатив только доставку (на основании п.3 ст. 497 ГК РФ о Правилах дистанционной торговли). Претензии по внешнему виду принимаются курьером только в момент доставки!</span></p>\n<h3 style=\"text-align: center;\" id=\"mcetoc_1c404tquf1\"><span><strong><br /><br /><br />Оплата заказа банковской картой Visa,&nbsp;MasterCard, МИР<br /><br /><br /><br /></strong></span></h3>\n<p><strong>1. Оплата в пункте выдачи заказов&nbsp;</strong>(комиссия 0%)</p>\n</div>\n<p><img src=\"http://parfumart.ru/userfiles/images/%D0%9E%D0%BF%D0%BB%D0%B0%D1%82%D0%B0_%D0%B2%D0%B5%D1%80%D1%82.png\" width=\"75\" caption=\"false\" style=\"float: right;\" /></p>\n<p><span>Оплата производится посредством POS-терминала, при получении товара, в пункте самовывоза.</span></p>\n<p><span><strong>2. Оплата онлайн</strong>&nbsp;(комиссия 0%)</span></p>\n<p><span>Для оплаты (ввода реквизитов Вашей карты) Вы будете перенаправлены на платежный шлюз ПАО СБЕРБАНК. Соединение с платежным шлюзом и передача информации осуществляется в защищенном режиме с использованием протокола шифрования SSL. В случае если Ваш банк поддерживает технологию безопасного проведения интернет-платежей Verified By Visa или MasterCard SecureCode для проведения платежа также может потребоваться ввод специального пароля. &nbsp;Настоящий сайт поддерживает 256-битное шифрование. Конфиденциальность сообщаемой персональной информации обеспечивается ПАО СБЕРБАНК. Введенная информация не будет предоставлена третьим лицам за исключением случаев, предусмотренных законодательством РФ. Проведение платежей по банковским картам осуществляется в строгом соответствии с требованиями платежных систем МИР, Visa Int. и MasterCard Europe Sprl.&nbsp;<br />Обращаем Ваше внимание, что наш сайт не хранит введенную вами информацию по платежу кредитной картой. Эту информацию вы вводите на сайте 3ds.mmbank.ru., который официально одобрен Visa и Master Card (имеет соответствующие логотипы Verified by VISA и MasterCard SecureCode). \"Безопасность платежей с помощью банковских карт обеспечивается технологиями защищенного соединения HTTPS и двухфакторной аутентификации пользователя 3D Secure.&nbsp;<br />В соответствии с ФЗ &laquo;О защите прав потребителей&raquo; в случае, если вам была не оказана услуга или реализован товар ненадлежащего качества, платеж может быть возвращен на банковскую карту, с которой производилась оплата. Порядок возврата средств уточняйте у администрации интернет-магазина.\"</span></p>\n<h3 style=\"text-align: center;\" id=\"mcetoc_1c404tquf2\"><span><strong><br /><br /><br />Оплата через \"Сбербанк-онлайн\"&nbsp;и \"Сбербанк\".<br /><br /><br /><br /></strong></span></h3>\n<p><span><a href=\"http://parfumart.ru/userfiles/images/sberbank_1.png\"><img alt=\"сбербанк\" class=\"right\" src=\"http://parfumart.ru/userfiles/images/sberbank_1.png\" style=\"float: right;\" width=\"120\" caption=\"false\" /></a></span></p>\n<p><span><strong>А) Оплата через систему \"Сбербанк-онлайн\"&nbsp;</strong>(комиссия : Краснодарский край - 0, другие регионы РФ - 1%&nbsp;)</span></p>\n<ol>\n<li>Войти в Ваш личный кабинет.&nbsp;</li>\n<li><span>Выбрать раздел \"Платежи и переводы\", а затем перейти в пункт \"Перевод клиенту Сбе​р​б​а​нка\".&nbsp;</span></li>\n<li><span>Ввести номер карты: 4276 3000 3043 0436.&nbsp;</span></li>\n<li><span>Ввести сумму перевода.&nbsp;</span></li>\n<li><span>Отправить шаблон платежа на оплату.&nbsp;</span></li>\n<li><span>Проверить инфо о получателе (ФИО владельца карты: Раюшкин Дмитрий Александрович) и сумму перевода.&nbsp;</span></li>\n<li><span>Подтвердить перевод.&nbsp;</span></li>\n</ol>\n<p><span><strong>Б) С карты Сбербанк, через банкомат на счёт карты\"Сбербанк\"&nbsp;&nbsp;</strong>(комиссия 1%&nbsp;)</span></p>\n<ol>\n<li>В меню банкомата выбрать перевод средств; перевести на карту .&nbsp;</li>\n<li><span>Ввести номер карты: 4276 3000 3043 0436.&nbsp;</span></li>\n<li><span>Ввести сумму перевода.&nbsp;</span></li>\n<li><span>Проверить инфо о получателе (ФИО владельца карты: Раюшкин Дмитрий Александрович) и сумму перевода.&nbsp;</span></li>\n<li><span>Вставить деньги в купюроприемник и совершить перевод.&nbsp;</span></li>\n<li><span>Сохранить чек.&nbsp;</span></li>\n</ol>\n<p><span><strong>В) Наличными через операциониста в любом отделении \"Сбербанк\"&nbsp;</strong>(комиссия 0%, деньги поступают в течении 3-5 рабочих дней&nbsp;)</span></p>\n<ol>\n<li>Явиться в ближайшее отделение \"Сбербанк\" и предъявить паспорт.&nbsp;</li>\n<li><span>Сообщить операционисту, что хотите пополнить счёт карты \"Сбербанк\".&nbsp;</span></li>\n<li><span>Назвать ФИО владельца карты: Раюшкин Дмитрий Александрович&nbsp;</span></li>\n<li><span>Назвать номер карты: 4276 3000 3043 0436&nbsp;</span></li>\n<li><span>Произвести оплату.&nbsp;</span></li>\n<li><span>Сохранить чек.&nbsp;</span></li>\n</ol>\n<h3 style=\"text-align: center;\" id=\"mcetoc_1c404tque0\"><span><strong><br /><br />Оплата через \"Тинькофф Банк\".<br /><br /><br /><br /></strong></span><span><strong></strong></span></h3>\n<p><strong>А) Оплата через сайт&nbsp;www.tinkoff.ru&nbsp;</strong>(комиссия 0%)<span><img alt=\"тинькофф\" class=\"right\" src=\"http://parfumart.ru/userfiles/images/TinkoffBank_general_logo_6.png\" width=\"120\" caption=\"false\" style=\"float: right;\" /></span></p>\n<ol>\n<li>Войти в Ваш личный кабинет.&nbsp;</li>\n<li><span>Выбрать пункт меню \"Оплатить\" - \"Переводы\".&nbsp;</span></li>\n<li><span>Ввести номер карты: 5213 2438 4663 8094.&nbsp;</span></li>\n<li><span>Ввести сумму перевода.&nbsp;</span></li>\n<li><span>Отправить шаблон платежа на оплату.&nbsp;</span></li>\n<li><span>Подтвердить перевод.&nbsp;</span></li>\n</ol>\n<p><span><strong>Б) Оплата через мобильное приложение \"Тинькофф\"&nbsp;</strong>(комиссия 0%)</span></p>\n<ol>\n<li>Войти в Ваш личный кабинет.&nbsp;</li>\n<li><span>Выбрать вкладку меню \"Оплатить\" - \"Перевод с карты на карту\".&nbsp;</span></li>\n<li><span>Ввести номер карты: 5213 2438 4663 8094.&nbsp;</span></li>\n<li><span>Ввести сумму перевода.&nbsp;</span></li>\n<li><span>Отправить шаблон платежа на оплату.&nbsp;</span></li>\n<li><span>Подтвердить перевод.&nbsp;</span></li>\n</ol>\n<p><span><strong>В) Наличными через терминал&nbsp;</strong>(комиссия 0%, деньги поступают в течение 1-3 дней, в зависимости от выбранного терминала)</span></p>\n<ol>\n<li>Выбрать в терминале услугу по операциям с картами Тинькофф.&nbsp;</li>\n<li><span>Затем выбрать необходимое поле для пополнения счета по номеру карты.&nbsp;</span></li>\n<li><span>Ввести номер карты 5213 2438 4663 8094 и сумму перевода.&nbsp;</span></li>\n<li><span>Подтвердить перевод.&nbsp;</span></li>\n</ol>\n<h3 style=\"text-align: center;\" id=\"mcetoc_1c404tque0\"><span><strong><br /><br /><br />Оплата через \"ВТБ24\".<br /><br /><br /><br /></strong></span><span><strong></strong></span></h3>\n<p><span><img alt=\"втб\" src=\"http://parfumart.ru/userfiles/images/389839bc2bd862d5e2004a61eff6b6dd.jpg\" width=\"150\" caption=\"false\" style=\"float: right;\" /></span></p>\n<p><span><strong>А) Оплата через сайт&nbsp;www.vtb24.ru&nbsp;</strong>(комиссия 0%)<strong>&nbsp;</strong></span></p>\n<ol>\n<li>Войти в Ваш личный кабинет.&nbsp;</li>\n<li><span>Выбрать пункт меню \"Переводы\" - \"С карты на карту\"</span></li>\n<li><span>Ввести номер карты: 4272 2900 4253 3356.&nbsp;</span></li>\n<li><span>Ввести сумму перевода.&nbsp;</span></li>\n<li><span>тправить шаблон платежа на оплату, нажав кнопку \"Продолжить\".&nbsp;</span></li>\n<li><span>Подтвердить перевод.&nbsp;</span></li>\n</ol>\n<p><span><strong>Б) Оплата через мобильное приложение \"ВТБ24\"&nbsp;</strong>(комиссия 0%)</span></p>\n<ol>\n<li>Войти в Ваш личный кабинет.&nbsp;</li>\n<li><span>Выбрать вкладку меню \"Платежи\" - \"С карты на карту\".&nbsp;</span></li>\n<li><span>Ввести номер карты: 4272 2900 4253 3356.&nbsp;</span></li>\n<li><span>Ввести сумму перевода.&nbsp;</span></li>\n<li><span>Отправить шаблон платежа на оплату, нажав кнопку \"Продолжить\".</span></li>\n<li><span>Подтвердить перевод.&nbsp;</span></li>\n</ol>\n<h3 style=\"text-align: center;\" id=\"mcetoc_1c404tquf3\"><span><strong><br /><br /><br />Оплата через QIWI-кошелек.<br /><br /><br /><br /></strong></span><span><strong></strong></span></h3>\n<p><img alt=\"qiwi\" class=\"right\" src=\"http://parfumart.ru/userfiles/images/qiwi.png\" style=\"float: right;\" caption=\"false\" width=\"140\" height=\"60\" /><strong></strong></p>\n<p><span><strong>А) Оплата наличными в терминале QIWI&nbsp;</strong>(комиссия 0%)</span></p>\n<ol>\n<li>На номер мобильного телефона, который Вы указали у нас на сайте при оформлении заказа, мы выставим счёт в платёжную систему qiwi.</li>\n<li><span>В терминале на главном экране выбираете раздел &laquo;QIWI-КОШЕЛЕК&raquo;. Далее, на появившемся экране, введите номер мобильного телефона, который Вы указали у нас на сайте при оформлении заказа и нажимаете кнопку \"Вперед\".</span></li>\n<li><span>Если Вы&nbsp; зарегистрированы, то нужно ввести Ваш ПИН код (высылается &laquo;QIWI-КОШЕЛЕК&raquo; при регистрации).&nbsp;</span></li>\n<li><span>Далее&nbsp; Вам нужно выбрать &laquo;СЧЕТА К ОПЛАТЕ&raquo;.</span></li>\n<li><span>В разделе &laquo;СЧЕТА К ОПЛАТЕ&raquo; откроется страница со списком всех выставленных пользователю счетов. Выбираете счет, который Вам нужно оплатить, нажимаете кнопку &laquo;ОПЛАТИТЬ&raquo;. После этого останется только выбрать способ оплаты и оплатить счет.</span></li>\n</ol>\n<p><span><strong>Б) Оплата выставленного счета через сайт QIWI-Кошелька&nbsp;</strong>(комиссия 0%)</span></p>\n<ol>\n<li>Войдите в QIWI-Кошелек, используя в качестве логина номер вашего мобильного телефона, который Вы указали при закзе. Если Вы&nbsp; зарегистрированы в QIWI-Кошельке под другим номером, то сначала необходимо сообщить нам номер Вашего кошелька.</li>\n<li><span>В главном меню перейдите в раздел &laquo;Счета&raquo;, нажмите &laquo;Оплатить&raquo; напротив выставленного нами счёта и выберите способ оплаты из QIWI-Кошелька.</span></li>\n</ol>\n<p>&nbsp;</p>', 0, 1, ''),
(2, 'dostavka', 'Доставка', '<p style=\"text-align: center;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><strong><big>Пункт выдачи заказов в г. Краснодар</big></strong></span></p>\n<p style=\"text-align: left;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><span style=\"font-size: 14px;\"><img alt=\"\" src=\"http://parfumart.ru/userfiles/images/AVM.jpg\" style=\"float: right; height: 170px; margin-left: 20px; margin-right: 20px; width: 131px;\" />Самовывоз - бесплатно.</span></span></p>\n<p><span style=\"font-family: arial,helvetica,sans-serif;\"><span style=\"font-size: 14px;\">Адрес пункта выдачи заказов:</span></span></p>\n<div><span style=\"font-family: arial,helvetica,sans-serif;\"><span style=\"font-size: 14px;\">г. Краснодар, ул. Уральская, 75/1, корпус 1, Деловой центр AVM-ORSETTO, 2 этаж,&nbsp;офис 201.</span></span></div>\n<div>\n<p><span style=\"font-size: 14px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">Телефоны:</span></span></p>\n<p>8 (861) 944-21-10<br />8 (918) 977-21-10</p>\n</div>\n<p><span style=\"font-family: arial,helvetica,sans-serif;\"><span style=\"font-size: 14px;\">Режим работы пункта выдачи заказов:</span></span></p>\n<p><span style=\"font-family: arial,helvetica,sans-serif;\"><span style=\"font-size: 14px;\">Понедельник-Воскресенье:&nbsp;с 10:00 до 19:00</span></span></p>\n<p>Без перерыва и выходных</p>\n<p>&nbsp;</p>\n<p style=\"text-align: center;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><strong><big>Доставка по г. Краснодару</big></strong></span></p>\n<p><span style=\"font-family: arial,helvetica,sans-serif;\"><img alt=\"\" class=\"right\" src=\"http://parfumart.ru/userfiles/images/cars.JPG\" style=\"border: none; float: right; height: 65px; margin: 5px 0px 0px 15px; text-align: center; width: 150px;\" /></span></p>\n<p><span style=\"font-family: arial,helvetica,sans-serif;\"><span style=\"font-size: 14px;\">Срок доставки -&nbsp;1-2 дня<strong>&nbsp;</strong>после подтверждения заказа.</span></span></p>\n<p><strong><span style=\"font-family: arial,helvetica,sans-serif;\"><span style=\"font-size: 14px;\">Стоимость услуги -&nbsp;100 руб.</span></span></strong></p>\n<p><span style=\"font-family: arial,helvetica,sans-serif;\"><span style=\"font-size: 14px;\">Доставка осуществляется курьером службы доставки интернет-магазина Parfumart.ru.</span></span></p>\n<p><span style=\"font-family: arial,helvetica,sans-serif;\"><span style=\"font-size: 14px;\">Режим работы&nbsp;службы доставки:</span></span></p>\n<p><span style=\"font-family: arial,helvetica,sans-serif;\"><span style=\"font-size: 14px;\">Понедельник-Суббота: &nbsp;с 12:00 до 19:00</span></span></p>\n<p><span style=\"font-family: arial,helvetica,sans-serif;\"><span style=\"font-size: 14px;\">Воскресенье - выходной.</span></span></p>\n<p>&nbsp;</p>\n<p style=\"text-align: center;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><strong><big>Экспресс-доставка по Краснодарскому краю&nbsp; \"EMS\"</big></strong></span></p>\n<p style=\"text-align: left;\"><br /> <span style=\"font-family: arial,helvetica,sans-serif;\"><img alt=\"\" class=\"right\" src=\"http://parfumart.ru/userfiles/images/ems2.jpg\" style=\"border: none; float: right; font-family: arial; height: 81px; margin: 5px 0px 0px 15px; width: 150px;\" /><span style=\"font-size: 14px;\">Интернет-магазин Parfumart.ru предлагает своим клиентам экспресс-доставку по Краснодарскому краю. Услуга распространяется на весь представленный ассортимент.<br /> Доставка осуществляется курьером по указанному клиентом адресу.<br /> Срок экспресс-доставки по Краснодарскому краю - 3-5 дней.<br /> Стоимость услуги -&nbsp;380 руб.</span></span></p>\n<p style=\"text-align: center;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><span style=\"font-size: small;\"><strong>&nbsp;Оплата заказа</strong></span></span></p>\n<p style=\"text-align: left;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><a name=\"ems\"></a><strong>&nbsp;</strong><strong>Услуга \"Наложенный платеж\"&nbsp;</strong><br /> <span style=\"font-size: 14px;\">Вы можете оплатить товар непосредственно при его получении. Доставка осуществляется курьерской компанией \"EMS\". На услугу \"Наложенный платеж\" существует ограничение - максимальная стоимость товара или суммы товаров на одно отправление - 50 тыс. рублей. Обращаем Ваше внимание, что заказ товара с использованием услуги \"Наложенный платеж\", предусматривает дополнительные расходы в виде пошлины, взимаемой компанией \"EMS\" за перевод наличных средств поставщику товара, в данном случае - нам. Ниже представлена тарификация:</span></span></p>\n<table border=\"1\" cellpadding=\"10\" cellspacing=\"0\" class=\"MsoNormalTable\" style=\"border-collapse: collapse; margin-left: 2.75pt; width: 70%;\">\n<tbody>\n<tr>\n<td style=\"text-align: center;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><strong>Размер пересылаемой суммы</strong></span></td>\n<td style=\"text-align: center;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><strong>Тариф</strong></span></td>\n</tr>\n<tr>\n<td><span style=\"font-family: arial,helvetica,sans-serif;\"><span style=\"font-size: 14px;\">до 1 000 руб. включительно</span></span></td>\n<td><span style=\"font-family: arial,helvetica,sans-serif;\"><span style=\"font-size: 14px;\">40&nbsp;руб. + 5% от суммы</span></span></td>\n</tr>\n<tr>\n<td><span style=\"font-family: arial,helvetica,sans-serif;\"><span style=\"font-size: 14px;\">свыше 1 000 до 5 000 руб. включительно</span></span></td>\n<td><span style=\"font-family: arial,helvetica,sans-serif;\"><span style=\"font-size: 14px;\">50&nbsp;руб. + 4% от суммы</span></span></td>\n</tr>\n<tr>\n<td><span style=\"font-family: arial,helvetica,sans-serif;\"><span style=\"font-size: 14px;\">свыше 5 000 руб. до 20 000 руб. включительно</span></span></td>\n<td><span style=\"font-family: arial,helvetica,sans-serif;\"><span style=\"font-size: 14px;\">150 руб. + 2% от суммы</span></span></td>\n</tr>\n<tr>\n<td><span style=\"font-family: arial,helvetica,sans-serif;\"><span style=\"font-size: 14px;\">свыше 20 000 руб. до 50 000 руб. включительно</span></span></td>\n<td><span style=\"font-family: arial,helvetica,sans-serif;\"><span style=\"font-size: 14px;\">250 руб. + 1,5% от суммы</span></span></td>\n</tr>\n</tbody>\n</table>\n<p style=\"text-align: left;\"><br /> <br /> <span style=\"font-family: arial,helvetica,sans-serif;\"><span style=\"font-size: 14px;\">Избежать дополнительных расходов Вы можете путем предоплаты заказа любым из предложенных способов дистанционного платежа. Информацию о возможных способах оплаты смотрите&nbsp;<a href=\"http://parfumart.ru/info/oplata/#visa\" onclick=\"window.open(this.href, \'\', \'resizable=no,status=no,location=no,toolbar=no,menubar=no,fullscreen=no,scrollbars=no,dependent=yes\'); return false;\" style=\"border: none; color: #9e2479;\">здесь.</a></span><strong><big><a id=\"delivery\" name=\"delivery\"></a></big></strong></span></p>\n<p>&nbsp;</p>\n<p><span style=\"font-family: arial,helvetica,sans-serif;\"><span style=\"font-size: 14px;\"><strong></strong></span></span></p>\n<p style=\"text-align: center;\">&nbsp;</p>\n<p style=\"text-align: center;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><strong><big>Доставка в другие регионы Российской Федерации и АР Крым</big></strong></span></p>\n<p>&nbsp;</p>\n<p style=\"text-align: left;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><span style=\"font-size: 14px;\">Доставка осуществляется транспортной компанией СДЕК&nbsp;</span></span></p>\n<p style=\"text-align: left;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><span style=\"font-size: 14px;\">Срок доставки - от 3 до 14 дней, с момента подтверждения заказа, в зависимости от региона доставки.&nbsp;</span></span></p>\n<p style=\"text-align: left;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><span style=\"font-size: 14px;\"><strong>Оплата и проверка при получении, без дополнительных комиссий!</strong></span></span></p>', 0, 1, ''),
(3, 'contacts', 'Контакты', '<p><strong><span style=\"font-size: 14px;\">Фактический адрес:</span></strong><span style=\"font-family: arial; font-size: medium;\"><img alt=\"\" src=\"http://parfumart.ru/userfiles/images/AVM.jpg\" style=\"float: right; height: 326px; margin: 5px 10px; width: 250px;\" /></span></p>\n<p>&nbsp;</p>\n<p><span style=\"font-size: 14px;\">г. Краснодар, ул. Уральская 75/1, корпус 1.</span></p>\n<p><span style=\"font-size: 14px;\">Деловой центр AVM-ORSETTO, 2 этаж,&nbsp;офис 201.</span></p>\n<p>&nbsp;</p>\n<p><span style=\"font-size: 14px;\">Телефоны:</span></p>\n<p><span style=\"font-size: 14px;\"><strong>8 (861) 944-21-10<br /> 8 (918) 977-21-10</strong></span></p>\n<p>&nbsp;</p>\n<p><span style=\"font-size: 14px;\">Электронная почта:</span></p>\n<p>Служба поддержки клиентов&nbsp;&nbsp;<a href=\"mailto:client@parfumart.ru\">client@parfumart.ru</a></p>\n<p>Отдел закупок&nbsp;<a href=\"mailto:sup@parfumart.ru\">sup@parfumart.ru</a></p>\n<p>Написать письмо руководству интернет-магазина &nbsp;<a href=\"mailto:ceo@parfumart.ru\">ceo@parfumart.ru</a></p>\n<p style=\"text-align: center;\">&nbsp;</p>\n<p><strong><span style=\"font-size: 14px;\">Наши реквизиты:</span></strong></p>\n<p><span style=\"font-size: 14px;\">ИНН : 231294849270</span></p>\n<p><span style=\"font-size: 14px;\">ОГРНИП: 312231208000021</span></p>\n<p><span style=\"font-size: 14px;\">ОКВЭД: 52.61.2</span></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p style=\"text-align: center;\"><span style=\"font-size: 14px;\"><strong>Как добраться</strong></span></p>\n<div style=\"font-family: Arial;\">\n<p><img alt=\"\" src=\"http://parfumart.ru/userfiles/images/%D0%A2%D1%80%D0%B0%D0%BD%D1%81%D0%BF%D0%BE%D1%80%D1%82.png\" style=\"float: left; height: 206px; width: 250px;\" /><img alt=\"\" src=\"http://parfumart.ru/userfiles/images/yandex_maps.jpg\" style=\"height: 401px; margin: 5px 10px; width: 650px; float: right;\" /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n</div>', 0, 1, ''),
(4, 'rezhim-raboti', 'Режим работы', '<p>Уважаемые покупатели!</p>\n<p>Интернет-магазин парфюмерии Parfumart.ru работает для Вас в следующем режиме:</p>\n<p>&nbsp;</p>\n<p><strong>Заказ на сайте</strong>&nbsp;</p>\n<p>Сделать заказ на сайте можно 24 часа в сутки 7 дней в неделю.&nbsp;Наш менеджер обязательно свяжется с Вами в рабочее время для подтверждения заказа.</p>\n<p>&nbsp;</p>\n<p><strong>Клиентский отдел</strong>&nbsp;(прием заказов по телефону, консультация и подтверждение заказов)</p>\n<table border=\"1\" width=\"800\" cellspacing=\"0\" cellpadding=\"10\" align=\"left\">\n<tbody>\n<tr>\n<th>День недели</th>\n<th>Время работы</th>\n</tr>\n<tr>\n<td>Понедельник</td>\n<td>с 10:00 до 19:00</td>\n</tr>\n<tr>\n<td>Вторник</td>\n<td>с 10:00 до 19:00</td>\n</tr>\n<tr>\n<td>Среда</td>\n<td>с 10:00 до 19:00</td>\n</tr>\n<tr>\n<td>Четверг</td>\n<td>с 10:00 до 19:00</td>\n</tr>\n<tr>\n<td>Пятница</td>\n<td>с 10:00 до 19:00</td>\n</tr>\n<tr>\n<td>Суббота</td>\n<td>с 10:00 до 19:00</td>\n</tr>\n<tr>\n<td>Воскресенье</td>\n<td>с 10:00 до 19:00</td>\n</tr>\n</tbody>\n</table>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p><strong>Пункт выдачи заказов в г. Краснодар&nbsp;</strong>(г. Краснодар, ул. Уральская 75/1, корпус 1.&nbsp;Деловой центр AVM-ORSETTO, 2 этаж,&nbsp;офис 201.)</p>\n<table border=\"1\" width=\"800\" cellspacing=\"0\" cellpadding=\"10\" align=\"left\">\n<tbody>\n<tr>\n<th>День недели</th>\n<th>Время работы</th>\n</tr>\n<tr>\n<td>Понедельник</td>\n<td>с 10:00 до 19:00</td>\n</tr>\n<tr>\n<td>Вторник</td>\n<td>с 10:00 до 19:00</td>\n</tr>\n<tr>\n<td>Среда</td>\n<td>с 10:00 до 19:00</td>\n</tr>\n<tr>\n<td>Четверг</td>\n<td>с 10:00 до 19:00</td>\n</tr>\n<tr>\n<td>Пятница</td>\n<td>с 10:00 до 19:00</td>\n</tr>\n<tr>\n<td>Суббота</td>\n<td>с 10:00 до 19:00</td>\n</tr>\n<tr>\n<td>Воскресенье</td>\n<td>с 10:00 до 19:00</td>\n</tr>\n</tbody>\n</table>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p><strong>Доставка заказов курьером по г. Краснодар</strong></p>\n<table border=\"1\" width=\"800\" cellspacing=\"0\" cellpadding=\"10\" align=\"left\">\n<tbody>\n<tr>\n<th>День недели</th>\n<th>Время работы</th>\n</tr>\n<tr>\n<td>Понедельник</td>\n<td>с 12:00 до 19:00</td>\n</tr>\n<tr>\n<td>Вторник</td>\n<td>с 10:00 до 19:00</td>\n</tr>\n<tr>\n<td>Среда</td>\n<td>с 10:00 до 19:00</td>\n</tr>\n<tr>\n<td>Четверг</td>\n<td>с 10:00 до 19:00</td>\n</tr>\n<tr>\n<td>Пятница</td>\n<td>с 10:00 до 19:00</td>\n</tr>\n<tr>\n<td>Суббота</td>\n<td>Выходной</td>\n</tr>\n<tr>\n<td>Воскресенье</td>\n<td>Выходной</td>\n</tr>\n</tbody>\n</table>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>Ждём Вас!</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<h3 id=\"mcetoc_1bvi9pf8e0\"><br data-cke-eol=\"1\" /><br /></h3>', 0, 1, ''),
