(7, 'vozvrat', 'Возврат и обмен', '<p>Интернет-магазин Parfumart.ru даёт&nbsp;100% гарантию подлинности и&nbsp;качества на представленные товарный ассортимент, поэтому предлагаем возможность возврата или обмена любого товара, вне зависимости от причин. Вернуть товар можно курьеру, сразу после его получения, или в течение 14 дней с момента получения заказа, но только в том случае, если товар не был в употреблении, сохранены его потребительские свойства, товарный вид, оригинальная фабричная упаковка,&nbsp;а также предъявлены документы, подтверждающие факт покупки на сайте<span>&nbsp;</span><a href=\"http://www.parfumart.ru/\">www.p</a><a href=\"https://vk.com/away.php?to=http%3A%2F%2FParfumart.ru\" target=\"_blank\" rel=\"noopener\">arfumart.ru</a><a href=\"http://www.parfumart.ru/\">&nbsp;</a><br /><br />Если Вы хотите вернуть заказ полностью или частично, Вам необходимо написать нам письмо в свободной форме&nbsp;и прислать его&nbsp;нам для ознакомления на электронную почту&nbsp;<a href=\"https://vk.com/write?email=client@parfumart.ru\" target=\"_blank\" rel=\"noopener\">client@parfumart.ru</a>&nbsp;с темой письма - \"Возврат\".&nbsp;Претензия будет рассмотрена в течение 3 рабочих дней. Возврат денежных средств осуществляется наличным расчетом или на банковский счет клиента, если оплата заказа была совершена путем безналичного расчета, только после получения нами возвратного товара и проверки его состояния в течение 10 рабочих дней и в сумме, равной стоимости товаров, за исключением транспортных расходов на доставку и возврат товара.&nbsp;<br /><br />Если Вы нарушили упаковку товара и/или использовали купленный товар, и/или нарушили воздушную пробку, то возврат/обмен производится только в случае заводского брака (не работает распылитель, негерметичность упаковки, товарная ёмкость &laquo;течет&raquo; и др.). В таком случае написать нам письмо в свободной форме и прислать ее нам на&nbsp;<a href=\"https://vk.com/write?email=client@parfumart.ru\" target=\"_blank\" rel=\"noopener\">client@parfumart.ru</a>&nbsp;с темой письма - \"Брак\", желательно&nbsp;вместе с фотографией бракованного товара. Претензия будет рассмотрена в течение 3 рабочих дней.</p>\n<p>&nbsp;</p>\n<p><strong>Постановление&nbsp;Правительства РФ от 19 января 1998 г. №55</strong></p>\n<p>Перечень непродовольственных<span>&nbsp;</span><strong>товаров надлежащего качества</strong>,<span>&nbsp;</span><strong>не подлежащих возврату или обмену<span>&nbsp;</span></strong>на аналогичный товар других размера, формы, габарита, фасона, расцветки или комплектации (утв. постановлением Правительства РФ от 19 января 1998 г. №55)&nbsp; (с изменениями от 20 октября 1998 г., 6 февраля 2002 г.)</p>\n<p>1. Товары для профилактики и лечения заболеваний в домашних условиях (предметы санитарии и гигиены из металла, резины, текстиля и других материалов, инструменты, приборы и аппаратура медицинские, средства гигиены полости рта, линзы очковые, предметы по уходу за детьми, лекарственные препараты)</p>\n<p>2. Предметы личной гигиены (зубные щётки, расчёски, заколки, бигуди для волос, парики, шиньоны и другие аналогичные товары)</p>\n<p>3.<span>&nbsp;</span><strong>Парфюмерно-косметические товары</strong></p>\n<p>4. Текстильные товары (хлопчатобумажные, льняные, шёлковые, шерстяные и синтетические ткани, товары из нетканых материалов типа тканей &mdash; ленты, тесьма, кружево и другие); кабельная продукция (провода, шнуры, кабели); строительные и отделочные материалы (линолеум, плёнка, ковровые покрытия и другие) и другие товары, отпускаемые на метраж</p>\n<p>5. Швейные и трикотажные изделия (изделия швейные и трикотажные бельевые, изделия чулочно-носочные)</p>\n<p>6. Изделия и материалы, контактирующие с пищевыми продуктами, из полимерных материалов, в том числе для разового использования (посуда и принадлежности столовые и кухонные, ёмкости и упаковочные материалы для хранения и транспортирования пищевых продуктов)</p>\n<p>7. Товары бытовой химии, пестициды и агрохимикаты</p>\n<p>8. Мебель бытовая (мебельные гарнитуры и комплекты)</p>\n<p>9. Изделия из драгоценных металлов, с драгоценными камнями, из драгоценных металлов со вставками из полудрагоценных и синтетических камней, огранённые драгоценные камни</p>\n<p>10. Автомобили и мотовелотовары, прицепы и номерные агрегаты к ним; мобильные средства малой механизации сельскохозяйственных работ; прогулочные суда и иные плавсредства бытового назначения</p>\n<p>11. Технически сложные товары бытового назначения, на которые установлены гарантийные сроки (станки металлорежущие и деревообрабатывающие бытовые; электробытовые машины и приборы; бытовая радиоэлектронная аппаратура; бытовая вычислительная и множительная техника; фото- и киноаппаратура; телефонные аппараты и факсимильная аппаратура; электромузыкальные инструменты; игрушки электронные; бытовое газовое оборудование и устройства)</p>\n<p>12. Гражданское оружие, основные части гражданского и служебного огнестрельного оружия, патроны к нему</p>\n<p>13. Животные и растения</p>\n<p>14. Непериодические издания (книги, брошюры, альбомы, картографические и нотные издания, листовые изоиздания, календари, буклеты, издания, воспроизведённые на технических носителях информации)</p>', 0, 1, ''),
(8, 'system-skidok', 'Система скидок', '<p>Накопительная система скидок.</p>\n<p>Для постоянных зарегистрированных клиентов интернет-магазина parfumart.ru, мы предлагаем накопительную систему скидок. Чтобы стать участником программы, Вам необходимо при заказе на нашем сайте зарегистрироваться, оставить контактные данные, чтобы система сайта автоматически считала информацию о сделанных Вами покупках. Размер скидки зависит от потраченной Вами суммы в нашем интернет-магазине:</p>\n<p>Свыше 15 000 рублей - 5%</p>', 0, 1, ''),
