(10, 'otzivi-pr', 'Отзывыв и предложения', '<p>Отзывыв и предложения</p>', 0, 0, ''),
(11, 'about', 'О нас', '<p><span>Парфюмерия и косметика являются неотъемлемой частью жизни&nbsp;большинства людей. Хороший парфюм, равно как и качественный макияж, способен многое рассказать о Вас, о Вашем настроении, возможно, о Ваших желаниях...Оба элемента в совокупности отображают Ваш имидж и стиль жизни, способны изменить жизнь в один миг, оставив неизгладимое впечатление в сердце любимого человека!</span><br /><br /><span>Интернет-магазин парфюмерии и косметики parfumart.ru предлагает широкий ассортимент оригинальной продукции от производителей с мировым именем. В магазине представлено более 25 000 наименований товаров парфюмерно-косметической индустрии, при этом ассортимент постоянно расширяется.</span><br /><br /><span>Интернет-магазин parfumart.ru предлагает оригинальную и качественную продукцию по ценам, существенно отличающимся от стоимости тех же товаров, представленных в парфюмерных бутиках. Связано это с тем, что мы не платим дорогостоящую аренду за торговый зал и не имеем раздутого штата сотрудников, что позволяет нам сэкономить Ваши деньги.</span><br /><br /><span>Мы заботимся о вашем времени, поэтому постоянно работаем над совершенствованием предоставляемого сервиса. Заказать парфюмерию и косметику в нашем интернет-магазине можно максимально быстро и просто: Вам нужно лишь выбрать необходимый товар, оставить минимальный объем контактных дынных и оформить заказ. Наш оператор свяжется с Вами в кратчайшие сроки.</span><br /><br /><span>Доставка осуществляется курьером по городу Краснодару и Краснодарскому краю, с учетом Ваших пожеланий касательно даты и времени получения товара. Подробнее об условиях и стоимости доставки Вы можете узнать в подразделе&nbsp;</span><a href=\"https://parfumart.ru/info/dostavka/\">\"Доставка\"</a><span>&nbsp;\"Информационного раздела\".</span><br /><br /><span>Мы заботимся о безопасности Ваших платежей. Для оплаты (ввода реквизитов Вашей карты) Вы будете перенаправлены на платежный шлюз ПАО СБЕРБАНК. Соединение с платежным шлюзом и передача информации осуществляется в защищенном режиме с использованием протокола шифрования SSL. Подробнее об условиях оплаты Вы можете узнать в подразделе&nbsp;</span><a href=\"https://parfumart.ru/info/dostavka/\">\"Оплата\"</a><span>&nbsp;\"Информационного раздела\".</span><br /><br /><span>Интернет-магазин parfumart.ru осуществляет удаленную торговлю в соответствии с законодательством РФ. В связи с этим мы предлагаем публичную оферту для наших клиентов. Ознакомиться подробнее с условиями публичной оферты Вы можете, пройдя по&nbsp;</span><a href=\"https://parfumart.ru/info/oferta/\">ссылке</a><br /><br /><span>Интернет-магазин parfumart.ru - мы заботимся о Вас!</span></p>', 0, 1, ''),
